I.u[1030] = {'n': 'Queues de Chatons', 'nn': 'QUEUES DE CHATONS', 't': 5, 'd': 'Cette paire de dagues est en fait un jouet magique. Créé pour amuser les jeunes Ecaflips, sa production fut interdite après qu\'un enfant adepte de Sram prit part au jeu.', 'ep': 14, 'g': 20, 'l': 25, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [15, 3, 1, 1, 30, 50, false, false], 'c': 'CA>40&CS>20&CV>20', 'p': 1800};
I.u[1031] = {'n': 'Dagues Cruelles d\'Elorie Entuwan', 'nn': 'DAGUES CRUELLES D\'ELORIE ENTUWAN', 't': 5, 'd': 'Ces magnifiques dagues auraient appartenu à la Sramette la plus cruelle qu\'Amakna ait connu. Enfin, l\'une des plus cruelles... En fait, juste un peu plus que les autres, enfin au moins autant que les autres, ce qui est déjà pas mal !', 'ep': 1, 'g': 7, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'an': 13, 'e': [12, 3, 1, 1, 30, 50, false, false], 'c': 'CA>40', 'p': 4000};
