I.u[1393] = {'n': 'Le Matronome', 'nn': 'LE MATRONOME', 't': 7, 'd': 'Ce marteau a été fabriqué à partir d\'une horloge, la fameuse horloge avalée par le Crocodaille qui avait dévoré la main du Captain\' Brochet. Si on a pu récupérer l\'horloge, on ne sait en revanche pas ce qu\'il est advenu de la main...', 'ep': 5, 'g': 21, 'l': 54, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [8, 6, 1, 1, 40, 40, false, true], 'c': 'CI>62&CW>22', 'p': 9700};
