I.u[1620] = {'n': 'Abrarc', 'nn': 'ABRARC', 't': 2, 'd': 'Cet arc semble encore vivant et peut presque tirer des flèches tout seul, comme un grand. Il aurait pu être l\'arc idéal des personnes dotées de deux mains gauches, mais malheureusement, il faut toujours encocher la flèche dans le bon sens.', 'ep': 9, 'g': 24, 'l': 39, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [5, 4, 2, 5, 50, 30, false, true], 'p': 4200};
I.u[1621] = {'n': 'Bottes de Maîtrise', 'nn': 'BOTTES DE MAITRISE', 't': 11, 'd': 'Les bottes de Maîtrise augmentent l\'agilité et l\'intelligence de leur lanceur au détriment de la force et de la chance. Contrairement à ce que l\'on pourrait croire, elle ne vous permettent pas de maitriser votre adversaire.', 'ep': 4, 'g': 14, 'l': 22, 'wd': true, 'fm': true, 'w': 5, 'p': 1500};
I.u[1622] = {'n': 'Bottes de Puissance', 'nn': 'BOTTES DE PUISSANCE', 't': 11, 'd': 'Les bottes de puissance augmentent la force et la chance de leur lanceur au détriment de l\'intelligence et de l\'agilité. Contrairement à ce que l\'on pourrait croire, elle ne confèrent pas à leur porteur, une puissance démente.', 'ep': 4, 'g': 14, 'l': 22, 'wd': true, 'fm': true, 'w': 5, 'p': 1500};
I.u[1623] = {'n': 'Bottes d\'Anticipation', 'nn': 'BOTTES D\'ANTICIPATION', 't': 11, 'd': 'Les bottes d\'Anticipation augmentent la force et l\'agilité de leur lanceur au détriment de l\'intelligence et de la chance. Contrairement à ce que l\'on pourrait croire, elles ne vous permettent pas d\'anticiper les actions de vos adversaires.', 'ep': 4, 'g': 15, 'l': 22, 'wd': true, 'fm': true, 'w': 5, 'p': 1500};
