I.u[2688] = {'n': 'Ceinture Kolante', 'nn': 'CEINTURE KOLANTE', 't': 10, 'd': 'Le moins que l\'on puisse dire, c\'est qu\'une fois enfilée, vous ne risquez plus de perdre cette ceinture. Elle fera le bonheur des étourdis et des victimes récurrentes de vols.', 'ep': 12, 'g': 46, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 'p': 6600};
I.u[2689] = {'n': 'Ceinture Banisation', 'nn': 'CEINTURE BANISATION', 't': 10, 'd': 'Le cordonnier qui a créé cette ceinture avec les restes d\'un Dragodinde devait vraiment manquer d\'imagination, pour lui donner un nom aussi stupide.', 'ep': 2, 'g': 47, 'l': 29, 'wd': true, 'fm': true, 'w': 10, 'p': 2400};
I.u[2710] = {'n': 'Ceinture Banisation Sauvage', 'nn': 'CEINTURE BANISATION SAUVAGE', 't': 10, 'd': 'Comportant des renforts en fer, c\'est une version améliorée de la classique Ceinture Banisation, elle a été spécialement conçue pour chasser les Dragodindes Sauvages dans les contrées sauvages.', 'ep': 2, 'g': 48, 'l': 32, 'wd': true, 'fm': true, 'w': 10, 'p': 3000};
