I.u[2803] = {'n': 'Ceinture du Kwabe', 'nn': 'CEINTURE DU KWABE', 't': 10, 'd': 'Cette étrange ceinture est entièrement constituée de fragments de pince, et de carapace de crabe. Même en employant une magie très puissante, elle sentira toujours aussi mauvais, il faut vous rendre à l\'évidence.', 'ep': 1, 'g': 49, 'l': 8, 'wd': true, 'fm': true, 'w': 2, 'p': 400};
I.u[2804] = {'n': 'Ceinture Mulante', 'nn': 'CEINTURE MULANTE', 't': 10, 'd': 'Le célèbre Mulou a fait don de ses plus précieux organes pour aider à la confection de cette ceinture incroyable qui respire la puissance malgrès son apparence assez étrange qui comblerait le plus pervers des Chafers.', 'ep': 2, 'g': 50, 'l': 81, 'wd': true, 'fm': true, 'w': 10, 'p': 16800};
I.u[2805] = {'n': 'Testicules Magiques du Mulou', 'nn': 'TESTICULES MAGIQUES DU MULOU', 't': 15, 'd': 'Personne ne sait exactement quand et comment cela s\'est produit, mais un jour, ces testicules se sont vues dotées de pouvoirs magiques assez obscurs, il faut bien le reconnaître.', 'ep': 1, 'g': 650, 'l': 80, 'wd': true, 'fm': true, 'w': 20, 'p': 1000};
I.u[2806] = {'n': 'Testicules Magiques du Meulou', 'nn': 'TESTICULES MAGIQUES DU MEULOU', 't': 15, 'd': 'Aussi étrange que cela puisse paraître, ces testicules sont dotés de pouvoirs magiques. On ne sait pas trop à quoi cela pouvait servir au Meulou, mais mieux vaut ne pas savoir.', 'ep': 2, 'g': 651, 'l': 198, 'wd': true, 'fm': true, 'w': 10, 'p': 2000};
I.u[2807] = {'n': 'Ceinture Meulante', 'nn': 'CEINTURE MEULANTE', 't': 10, 'd': 'C\'est Bowisse le Cordonnier en personne, qui a conçu cette ceinture. Il l\'a offerte à Brouce Boulgoure lorsque celui-ci a réussi à déraciner à mains nues le Chêne Mou, il y a de ça très longtemps.', 'ep': 2, 'g': 51, 'l': 129, 'wd': true, 'fm': true, 'w': 20, 'p': 50000};
I.u[2808] = {'n': 'Ceinture Dracochoune', 'nn': 'CEINTURE DRACOCHOUNE', 't': 10, 'd': 'Cette ceinture fera de vous une personne irrésistible. Bowisse recommande cependant de ne pas s\'approcher du Dragon Cochon avec cette ceinture, cela pourrait réveiller certaines de ses pulsions les plus tourmentées.', 'ep': 2, 'g': 52, 'l': 77, 'wd': true, 'fm': true, 'w': 20, 's': 58, 'p': 16000};
I.u[2809] = {'n': 'Ceinture Chafeuse', 'nn': 'CEINTURE CHAFEUSE', 't': 10, 'd': 'Derrière ce nom assez grotesque, se cache une belle création de Bowisse le Cordonnier qui lors d\'une promenade dans le Donjon des Squelettes a eu l\'idée de récupérer les restes de ses ennemis.', 'ep': 3, 'g': 53, 'l': 49, 'wd': true, 'fm': true, 'w': 10, 'p': 6500};
