I.u[3203] = {'n': 'Anneau Tribal', 'nn': 'ANNEAU TRIBAL', 't': 9, 'd': 'L\'origine de cet anneau est pour le moins douteuse, on pense qu\'il a appartenu à une tribu de Sadidas Kannibouls végétariens mangeurs de fougères de la pire espèce qui soit. Sûrement une histoire pour faire peur aux jeunes Sadidas.', 'ep': 11, 'g': 49, 'l': 51, 'wd': true, 'fm': true, 'w': 5, 'p': 7000};
I.u[3204] = {'n': 'Ceinture Bontarienne', 'nn': 'CEINTURE BONTARIENNE', 't': 10, 'd': 'C\'est la ceinture la plus à la mode dans les rues de Bonta. Elle est ornée au niveau de la boucle, de l\'insigne d\'une célèbre confrérie de cordonniers.', 'ep': 3, 'g': 37, 'l': 53, 'wd': true, 'fm': true, 'w': 10, 'c': 'Ps=1', 'p': 7400};
I.u[3205] = {'n': 'Ceinture Brâkmarienne', 'nn': 'CEINTURE BRAKMARIENNE', 't': 10, 'd': 'C\'est la ceinture la plus en vogue dans les égouts de Brâkmar. Pour donner l\'impression d\'être un dur à cuir, elle est parfaite. Pour faire de vous un dur à cuir, vous pouvez trouver mieux.', 'ep': 13, 'g': 38, 'l': 53, 'wd': true, 'fm': true, 'w': 10, 'c': 'Ps=2', 'p': 7500};
I.u[3206] = {'n': 'La Xerbo', 'nn': 'LA XERBO', 't': 10, 'd': 'Créée spécialement pour récompenser les guerriers les plus habiles de leurs mains, elle se porte sans sous-vêtements et uniquement en hiver.', 'ep': 13, 'g': 39, 'l': 67, 'wd': true, 'fm': true, 'w': 7, 'p': 13000};
I.u[3207] = {'n': 'Bottes de Satisfaction', 'nn': 'BOTTES DE SATISFACTION', 't': 11, 'd': 'Ces bottes sont si confortables, si légères, que l\'on ne peut qu\'en être satisfait. Seul un adversaire pourrait ne pas être satisfait si vous lui faites voir vos semelles d\'un peu trop près. Et encore ce n\'est pas dit.', 'ep': 1, 'g': 38, 'l': 17, 'wd': true, 'fm': true, 'w': 10, 'p': 950};
I.u[3208] = {'n': 'Slip de Bwork Archer', 'nn': 'SLIP DE BWORK ARCHER', 't': 56, 'd': 'Le Bwork Archer avait la fâcheuse habitude de se servir de son slip en cuir pour ranger ses flèches. C\'est peut-être finalement ce qui explique pourquoi les flèches du Bwork Archer sont réputées empoisonnées.', 'ep': 1, 'g': 649, 'l': 23, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[3209] = {'n': 'Scalp de Bwork Mage', 'nn': 'SCALP DE BWORK MAGE', 't': 15, 'd': 'Très tôt, les jeunes Enutrofs cherchent à s\'approprier un Scalp de Bwork Mage pour dissimuler leur calvitie naissante. Affublés d\'une telle cochonnerie, ils paraissent encore plus ridicules qu\'en temps normal, mais l\'odeur de Bwork qui s\'en dégage permet de couvrir facilement leur haleine régulièrement imprégnée d\'alcool.', 'ep': 4, 'g': 653, 'l': 23, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
