I.u[3647] = {'n': 'La Thor-Boyaux', 'nn': 'LA THOR-BOYAUX', 't': 5, 'd': 'Cette dague en forme de faucille, servait à éviscérer les voyageurs égarés. Elle tire son nom, de toutes les beuveries à la taverne que son propriétaire se payait après avoir dépouillé ses pauvres victimes.', 'ep': 13, 'g': 31, 'l': 83, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>80&CS>100', 'p': 17800};
