I.u[3649] = {'n': 'Dague Rafeuse', 'nn': 'DAGUE RAFEUSE', 't': 5, 'd': 'C\'est le célèbre artisan Daguiero qui eut l\'idée de créer une telle dague. Plutôt versé dans les jeux d\'argents et activités peu recommandables, ce fut sa dernière création réellement digne d\'intérêt. On peut imaginer pire comme fin de carrière.', 'ep': 9, 'g': 33, 'l': 95, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>80&CS>100', 'p': 23000};
I.u[3650] = {'n': 'Dague Régah', 'nn': 'DAGUE REGAH', 't': 5, 'd': 'Ces puissantes dagues sont le fruit d\'une coopération entre les seuls artisans capables de se mettre d\'accord sur l\'avenir de leur profession. Ils ne furent que deux. Ils moururent tous les deux en se disputant à propos du nom de ces dagues.', 'ep': 3, 'g': 34, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>250&CS>100', 'p': 37000};
I.u[3651] = {'n': 'Dague Lutination', 'nn': 'DAGUE LUTINATION', 't': 5, 'd': 'Un ridicule petit artisan du nom de Slaillehine, a eu la brillante idée de bricoler ces superbes dagues. Du jour au lendemain, tout le monde faisait la queue devant sa forge, c\'est comme cela qu\'il a trouvé un nom pour cette dague.', 'ep': 9, 'g': 35, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CV>30&CA>100&CS>70', 'p': 22000};
