I.u[6438] = {'n': 'Baguette Molle', 'nn': 'BAGUETTE MOLLE', 't': 3, 'd': 'Cette baguette est constituée d\'éléments plutôt mous, ce qui en fait une baguette difficile à manier. Mais au coeur du combat, cette baguette révèle son véritable pouvoir.', 'ep': 5, 'g': 33, 'l': 85, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [10, 4, 2, 4, 30, 70, false, true], 'c': 'CI>85', 'p': 8500};
I.u[6439] = {'n': 'Baguette Irréelle', 'nn': 'BAGUETTE IRREELLE', 't': 3, 'd': 'Des mélanges magiques d\'éléments surnaturels ont permis la création de cette baguette qui vogue aux frontières du réel. Tantôt terrifiante, tantôt délirante, cette baguette est l\'exemple typique de l\'instabilité.', 'ep': 4, 'g': 32, 'l': 90, 'wd': true, 'fm': true, 'w': 12, 'an': 11, 'e': [10, 4, 2, 3, 20, 20, false, false], 'c': 'CI>90&CW>30', 'p': 9000};
I.u[6440] = {'n': 'Baguette Velue', 'nn': 'BAGUETTE VELUE', 't': 3, 'd': 'Cette baguette n\'est pas qu\'un vulgaire amas de poils. Le coeur même de la baguette absorbe l\'essence magique des diverses touffes et les fusionne entre elles. Aussi aberrant que cela puisse paraître, ça marche !', 'ep': 14, 'g': 31, 'l': 95, 'wd': true, 'fm': true, 'w': 12, 'an': 11, 'e': [5, 3, 2, 5, 40, 40, false, true], 'c': 'CW>40&CI>40', 'p': 9500};
I.u[6441] = {'n': 'Poils de Moon', 'nn': 'POILS DE MOON', 't': 54, 'd': 'Ces poils sont incroyablement doux et chauds au toucher. On a l\'impression qu\'ils sont encore vivants.', 'ep': 12, 'g': 656, 'l': 200, 'wd': true, 'fm': true, 'w': 2, 'p': 10000};
I.u[6442] = {'n': 'Bâton d\'Aga Dou', 'nn': 'BATON D\'AGA DOU', 't': 4, 'd': 'Toujours en quête d\'un moyen de surprendre ses ennemis, le Sadida Aga Dou, a pris soin d\'accrocher une petite poupée au bout de son bâton. Les jeunes Iopettes se jettent dessus pour attraper la poupée et meurent empalées.', 'ep': 14, 'g': 31, 'l': 81, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 4, 1, 1, 40, 40, false, false], 'c': 'CS>80&CV>50', 'p': 17000};
I.u[6443] = {'n': 'Amulette du Renouveau', 'nn': 'AMULETTE DU RENOUVEAU', 't': 1, 'd': 'C\'est le célèbre et non moins burlesque artisan Yamato, injustement méprisé pour son arc ridicule, qui le premier, eu l\'audace de tenter d\'enchanter une amulette avec autant d\'effets, chose réputée infaisable depuis des lustres.', 'ep': 9, 'g': 57, 'l': 126, 'wd': true, 'fm': true, 'w': 20, 'p': 40000};
I.u[6444] = {'n': 'Amulette Turquoise', 'nn': 'AMULETTE TURQUOISE', 't': 1, 'd': 'De la couleur du célèbre Dofus Turquoise, cette amulette n\'a en fait aucun rapport avec ce dernier, ce qui ne l\'empêche pas d\'être très puissante pour autant. Comme quoi, les apparences ne sont pas toujours trompeuses.', 'ep': 9, 'g': 58, 'l': 63, 'wd': true, 'fm': true, 'w': 10, 'p': 10300};
I.u[6445] = {'n': 'Arc Boutant', 'nn': 'ARC BOUTANT', 't': 2, 'd': 'Cet arc a une forme très étudiée, sa courbure est vraiment parfaite. On raconte à ce sujet que le sculpteur d\'arc s\'est servi d\'un fessier de femelle Bouftou comme patron.', 'ep': 14, 'g': 13, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 8, 30, 50, false, true], 'c': 'CA>70&CC>50', 'p': 16500};
I.u[6446] = {'n': 'Arc Chiduc', 'nn': 'ARC CHIDUC', 't': 2, 'd': 'Chiduc était un sculpteur d\'arcs, réputé pour avoir des problèmes de prononciation. Il était en effet incapable de prononcé le son ' + '"' + 'ar' + '"' + ' sans rajouter un ' + '"' + 'keu' + '"' + ' derrière. C\'était tout de même un grand arctiste.', 'ep': 12, 'g': 14, 'l': 87, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 6, 30, 30, false, true], 'c': 'CW>50&CA>80', 'p': 19000};
I.u[6447] = {'n': 'Potion d\'oubli de Chaferfu', 'nn': 'POTION D\'OUBLI DE CHAFERFU', 't': 43, 'd': 'Cette potion permet d\'oublier un niveau du sort d\'invocation Chaferfu', 'ep': 5, 'g': 36, 'l': 50, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
I.u[6448] = {'n': 'Potion d\'oubli d\'Invocation d\'Arakne', 'nn': 'POTION D\'OUBLI D\'INVOCATION D\'ARAKNE', 't': 43, 'd': 'Cette potion permet d\'oublier un niveau du sort d\'invocation d\'Arakne.', 'ep': 5, 'g': 36, 'l': 50, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
I.u[6449] = {'n': 'Corbacape', 'nn': 'CORBACAPE', 't': 17, 'd': 'De quoi ressembler à une ombre, ou se déguiser en Maître Corbac pour impressionner les filles à la sortie de la Boulangerie avant la tombée de la nuit.', 'ep': 1, 'g': 54, 'l': 45, 'wd': true, 'fm': true, 'w': 26, 's': 8, 'p': 1000};
I.u[6450] = {'n': 'Ceinture de l\'Amant d\'Ha', 'nn': 'CEINTURE DE L\'AMANT D\'HA', 't': 10, 'd': 'La célèbre Cordonnière Ha, avait un amant connu pour lui faire faux bond au dernier moment. Mais l\'amour l\'aveuglant, elle lui offrit tout de même cette magnifique ceinture comme témoin de leur union secrète.', 'ep': 14, 'g': 57, 'l': 121, 'wd': true, 'fm': true, 'w': 20, 'p': 37255};
I.u[6451] = {'n': 'Arc Ange', 'nn': 'ARC ANGE', 't': 2, 'd': 'A propos de cet arc, on est en droit de se demander pourquoi son nom est aussi stupide. Il en est de même pour vous.', 'ep': 14, 'g': 31, 'l': 82, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 8, 30, 50, false, true], 'c': 'CA>80&CS>50', 'p': 17000};
I.u[6452] = {'n': 'Arc Chitecte', 'nn': 'ARC CHITECTE', 't': 2, 'd': 'Cet arc à l\'apparence complexe est un véritable objet d\'art. Le sculpteur d\'arc qui l\'a créé est également célèbre pour avoir exposé ses modèles les plus controversés dans la fameuse grotte de Loopine, interdite au public non averti depuis des lustres.', 'ep': 9, 'g': 30, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 8, 30, 50, false, true], 'c': 'CA>200&CS>100&CI>30', 'p': 37000};
I.u[6453] = {'n': 'Arc du Pêcheur', 'nn': 'ARC DU PECHEUR', 't': 2, 'd': 'Issu d\'un constat frappant (l\'arc est très utile pour pêcher les poissons volants), cet arc est muni d\'une canne à pêche intégrée qui permet de pêcher d\'autres choses que des poissons volants.', 'ep': 14, 'g': 32, 'l': 70, 'wd': true, 'fm': true, 'w': 1, 'an': 10, 'tw': true, 'e': [10, 4, 2, 8, 30, 50, false, true], 'c': 'CS>70&CA>70', 'p': 13000};
I.u[6454] = {'n': 'Abraton Sombre', 'nn': 'ABRATON SOMBRE', 't': 4, 'd': 'Cette branche d\'Abraknyde Sombre est en fait l\'un de ses bras. Excellente pour s\'entraîner au bras de fer, c\'est surtout une excellente arme pour terroriser vos ennemis d\'enfance ou torturer les Tronknydes.', 'ep': 13, 'g': 23, 'l': 87, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [5, 4, 1, 1, 40, 50, false, false], 'c': 'CV>150&CW>50', 'p': 20000};
I.u[6457] = {'n': 'Kriptonite', 'nn': 'KRIPTONITE', 't': 40, 'd': 'Voici un alliage remarquable, dont l\'origine semble vraiment lointaine. A défaut d\'être utile, il pourra toujours servir à décorer sa cheminée ou à taper sur le crâne des Iops, ne serait-ce que pour s\'assurer qu\'ils sont bel et bien vides.', 'ep': 1, 'g': 706, 'l': 80, 'wd': true, 'fm': true, 'w': 80, 'p': 0};
I.u[6458] = {'n': 'Kobalite', 'nn': 'KOBALITE', 't': 40, 'd': 'De tous les alliages découverts à ce jour, la Kobalite est un des plus surprenants. Les anciens mineurs pensaient avoir trouvé l\'alliage idéal, jusqu\'au jour où l\'on s\'aperçut qu\'il se transformait en poussière au contact de la Bave de Bouftou.', 'ep': 1, 'g': 704, 'l': 100, 'wd': true, 'fm': true, 'w': 100, 'p': 0};
I.u[6459] = {'n': 'Amulette du Mineur Sombre', 'nn': 'AMULETTE DU MINEUR SOMBRE', 't': 1, 'd': 'La seule chance de survivre dans une mine infestée de Mineurs Sombres, c\'est d\'y voir clair. A défaut de leur voler leur bougie, portez cette amulette, elle vous portera chance.', 'ep': 14, 'g': 61, 'l': 39, 'wd': true, 'fm': true, 'w': 1, 'c': 'CC>30', 'p': 4200};
I.u[6460] = {'n': 'La Feuille d\'Hiver', 'nn': 'LA FEUILLE D\'HIVER', 't': 1, 'd': 'Cette magnifique broche est un hommage à la célèbre résistance des mineurs de la mine d\'argent de Grimoth, qui passèrent un hiver entier, à combattre un Rockailleux de la pire espèce, pour finalement mourir achevés par un vieux Tofu égaré.', 'ep': 1, 'g': 65, 'l': 98, 'wd': true, 'fm': true, 'w': 10, 'p': 25000};
I.u[6461] = {'n': 'La Feuille de Printemps', 'nn': 'LA FEUILLE DE PRINTEMPS', 't': 1, 'd': 'Cette Amulette spécialement conçue pour les vieux Enutrofs, a permis il y a bien longtemps à Setag, de nettoyer la mine de Grimoth, de tous ses rivaux mineurs. Une méthode certes peu raisonnable, mais terriblement efficace.', 'ep': 7, 'g': 62, 'l': 123, 'wd': true, 'fm': true, 'w': 10, 'p': 40000};
I.u[6462] = {'n': 'La Feuille d\'Eté', 'nn': 'LA FEUILLE D\'ETE', 't': 1, 'd': 'Cette petite broche a vraiment du charme, destinée à la base pour les malchanceux fermement décidés à participer aux jeux de la fête foraine, on a vite remarqué, qu\'elle était également bien adaptée pour les chasses épiques.', 'ep': 13, 'g': 63, 'l': 45, 'wd': true, 'fm': true, 'w': 4, 'p': 5400};
I.u[6463] = {'n': 'Anneau Forain', 'nn': 'ANNEAU FORAIN', 't': 9, 'd': 'Cet anneau a été créé par un célèbre forain, dont personne ne se rappelle le nom. Il est mort lors du concours de tir à l\'arc, en mettant comme cible sur sa tête, une Graine de Tournesol Sauvage à la place de la traditionnelle Citrouille.', 'ep': 1, 'g': 50, 'l': 44, 'wd': true, 'fm': true, 'w': 5, 'p': 5300};
I.u[6464] = {'n': 'Anneau de l\'Invocateur Satisfait', 'nn': 'ANNEAU DE L\'INVOCATEUR SATISFAIT', 't': 9, 'd': 'Cet anneau est une version améliorée du célèbre Anneau de Satisfaction. Idéal pour laisser à vos petites bestioles le soin de faire le combat à votre place, ou tout simplement pour faire le malin en invoquant une armée de Tofus.', 'ep': 1, 'g': 51, 'l': 40, 'wd': true, 'fm': true, 'w': 5, 'p': 4000};
I.u[6465] = {'n': 'Anneau de Loopine', 'nn': 'ANNEAU DE LOOPINE', 't': 9, 'd': 'Loopine a jadis demandé comment créer un tel anneau au monstre qui hante sa grotte en échange de quelques services à rendre, qui l\'ont changé à jamais. Les gens avertis vous diront qu\'il a perdu au change...', 'ep': 5, 'g': 52, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 'p': 16000};
I.u[6466] = {'n': 'Amulette de Shika', 'nn': 'AMULETTE DE SHIKA', 't': 1, 'd': 'Cette amulette a permis à de nombreuses reprises à Shika Ingalsse, de survivre aux rebellions des troupeaux de Bouftous bien décidés à lui mener la vie dure.', 'ep': 14, 'g': 60, 'l': 29, 'wd': true, 'fm': true, 'w': 10, 'p': 2300};
I.u[6467] = {'n': 'Anneau Nime', 'nn': 'ANNEAU NIME', 't': 9, 'd': 'Personne ne connaît le propriétaire de cet anneau, qui a tenu a garder l\'anonymat suite à un combat humiliant face à une Arackne invoquée. Cependant, il faut avouer que cette dernière venait d\'être compulsée par un Iop.', 'ep': 1, 'g': 53, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'p': 13000};
I.u[6468] = {'n': 'Anneau du Jeune Vald', 'nn': 'ANNEAU DU JEUNE VALD', 't': 9, 'd': 'A l\'époque où tous les Iops de son âge recevaient pour leur communion, une monture Tabi, ou une Goultard en bois, Vald lui a reçu cet anneau. C\'est un peu moins marrant pour jouer avec ses petits camarades, mais c\'est plus utile en plein combat.', 'ep': 1, 'g': 54, 'l': 59, 'wd': true, 'fm': true, 'w': 10, 'p': 9275};
I.u[6469] = {'n': 'Alliance de Farle', 'nn': 'ALLIANCE DE FARLE', 't': 9, 'd': 'Cette alliance a été usée par le frottement des épis d\'escourgeon pendant des centaines de moissons. Elle est également le témoin, de l\'union entre Farle et Shika, lorsqu\'ils se sont mariés au milieu d\'un champs d\'orge de printemps.', 'ep': 9, 'g': 55, 'l': 87, 'wd': true, 'fm': true, 'w': 5, 'p': 20000};
I.u[6470] = {'n': 'Bottes de l\'Eleveur de Bouftous', 'nn': 'BOTTES DE L\'ELEVEUR DE BOUFTOUS', 't': 11, 'd': 'Ces magnifiques bottes, sont parfaites pour botter le derrière des Bouftous lorsqu\'il faut les forcer à changer de pâtures et à traverser le village. Elles fonctionnent également pour forcer les enfants Iops à faire leurs devoirs et à aller à l\'école.', 'ep': 13, 'g': 40, 'l': 68, 'wd': true, 'fm': true, 'w': 10, 'p': 12000};
I.u[6471] = {'n': 'Souliers Vernis de Porkass', 'nn': 'SOULIERS VERNIS DE PORKASS', 't': 11, 'd': 'Ces petits souliers ont été renforcés, remis en état, mais surtout désodorisés. Ils sont surtout utilisés pour attirer les Champ-Champ, tant le substrat laissé par le Porkass leur semble appétissant.', 'ep': 13, 'g': 41, 'l': 30, 'wd': true, 'fm': true, 'w': 10, 'p': 2700};
I.u[6472] = {'n': 'Dragocoiffe Dorée', 'nn': 'DRAGOCOIFFE DOREE', 't': 16, 'd': 'Cette coquille de Dragoeuf Doré rembourrée, vous rend presque insensible aux coups de foudre magiques du Bwork Mage. En revanche, il ne vous protège en rien contre les vrais coups de foudre...', 'ep': 11, 'g': 55, 'l': 57, 'wd': true, 'fm': true, 'w': 10, 'p': 8500};
I.u[6473] = {'n': 'Dragocoiffe de Saphire', 'nn': 'DRAGOCOIFFE DE SAPHIRE', 't': 16, 'd': 'Cette coquille de Dragoeuf de Saphire vous ira à merveille si vous savez la porter. Arborer une telle coiffe n\'est pas à la portée de tout le monde, la preuve, les Iops ont tendance à la porter à l\'envers.', 'ep': 11, 'g': 57, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'p': 13000};
I.u[6474] = {'n': 'Dragocoiffe noire', 'nn': 'DRAGOCOIFFE NOIRE', 't': 16, 'd': 'Cette coquille de Dragoeuf Noir est idéale pour rester discret la nuit, ou se protéger des chutes de pierres, courantes en montagne, ou lorsque l\'on défie un Craqueleur au lancer de rochers.', 'ep': 11, 'g': 56, 'l': 93, 'wd': true, 'fm': true, 'w': 20, 'p': 22300};
I.u[6475] = {'n': 'Casque Cassé du Chafer', 'nn': 'CASQUE CASSE DU CHAFER', 't': 15, 'd': 'Ce casque est inutilisable dans cet état, il vous ferait bien trop mal à la tête. Un bon Tailleur devrait pouvoir le réparer, mettre un bon rembourrage à l\'intérieur et au passage se faire beaucoup de kamas sur votre dos.', 'ep': 3, 'g': 709, 'l': 40, 'wd': true, 'fm': true, 'w': 20, 'p': 1000};
I.u[6476] = {'n': 'Bougie Magique du Mineur Sombre', 'nn': 'BOUGIE MAGIQUE DU MINEUR SOMBRE', 't': 15, 'd': 'Cette bougie brille même lorsqu\'elle est éteinte, et ne dégage pas de chaleur. On peut juste si l\'on tend l\'oreille, entendre un léger crépitement, un peu comme le bruit de certaines céréales dans un bol de lait.', 'ep': 1, 'g': 701, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 10000};
I.u[6477] = {'n': 'Chapeau du Mineur Sombre', 'nn': 'CHAPEAU DU MINEUR SOMBRE', 't': 16, 'd': 'Ce somptueux chapeau vous permet d\'y voir plus clair même lorsqu\'il fait déjà assez clair. Il est également très utile pour éblouir les bêtes qui hantent les mines mal famées, ou tout simplement, pour faire croire aux Iops que vous êtes une lumière.', 'ep': 16, 'g': 90, 'l': 103, 'wd': true, 'fm': true, 'w': 20, 'p': 27000};
I.u[6478] = {'n': 'Makroute Déchiqueté', 'nn': 'MAKROUTE DECHIQUETE', 't': 15, 'd': 'Ce Makroute magique est vraiment dans un très mauvais état, il n\'a pas supporté la violence de vos attaques et son poil est devenu sombre. Une nouvelle vie pourrait peut-être s\'offrir à lui si vous étiez capable de le soigner.', 'ep': 14, 'g': 702, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'p': 1000};
I.u[6479] = {'n': 'Ours Déchiqueté', 'nn': 'OURS DECHIQUETE', 't': 15, 'd': 'Cette petite tête d\'Ours est vraiment dans un très mauvais état. Un peu de fil, de tissu et d\'inventivité auront raison de cette horreur et pourront la transformer en un remarquable couvre-chef.', 'ep': 1, 'g': 703, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'p': 1000};
I.u[6480] = {'n': 'Osier Sombre', 'nn': 'OSIER SOMBRE', 't': 15, 'd': 'Ce morceau d\'osier est sombre comme le plus sombre des fantômes, magique, comme le plus magique des fantômes, résistant comme le plus résistant des fantômes. Rappelez-vous que les fantômes n\'existent pas.', 'ep': 14, 'g': 123, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'p': 1000};
I.u[6481] = {'n': 'Dora Bora', 'nn': 'DORA BORA', 't': 16, 'd': 'Ce splendide chapeau a été imaginé sur l\'île de Dora Bora un peu au sud de l\'île de Moon. Parfaitement adapté au combat, il est également très apprécié comme corbeille à fruits, pour entreposer les noix de Kokokos Traumatisées par exemple.', 'ep': 12, 'g': 61, 'l': 120, 'wd': true, 'fm': true, 'w': 20, 'p': 40000};
I.u[6482] = {'n': 'Korko Kousto', 'nn': 'KORKO KOUSTO', 't': 16, 'd': 'Version retravaillée du Jouik Krampe, ce chapeau utilise les meilleurs ressources de l\'île de Moon, ce qui lui donne un cachet très terroir reconnaissons-le. A défaut de ressembler à un Kanniboul, vous pourrez sortir de très bons coups de boule.', 'ep': 12, 'g': 59, 'l': 73, 'wd': true, 'fm': true, 'w': 10, 'c': 'PG=10', 'p': 14000};
I.u[6483] = {'n': 'Casque du Bwork de Bronze', 'nn': 'CASQUE DU BWORK DE BRONZE', 't': 16, 'd': 'Ce surprenant casque transforme son propriétaire en Bwork de Bronze selon la légende. A essayer d\'urgence sur les gros lourds, vous pourrez les refondre ensuite et en tirer un bon prix.', 'ep': 20, 'g': 91, 'l': 144, 'wd': true, 'fm': true, 'w': 10, 'p': 46625};
I.u[6484] = {'n': 'Arc du Sram Archer', 'nn': 'ARC DU SRAM ARCHER', 't': 2, 'd': 'Quand les dagues ne suffisent plus, que les dieux se moquent de vous, à vous de rechercher votre propre style de combat. Certains Srams l\'ont bien compris, d\'autres espèrent que les dieux leur viennent en aide.', 'ep': 9, 'g': 40, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 7, 30, 50, false, true], 'c': 'CS>90&CA>90&CW>50', 'p': 16000};
I.u[6485] = {'n': 'Arc du Chafer Archer', 'nn': 'ARC DU CHAFER ARCHER', 't': 2, 'd': 'Le Chafer Archer, n\'aura jamais été assez astucieux et habile à cause de ses os tremblants, pour manier un tel arc. Excepté pour le problème des os tremblants, il est probable que vous soyez dans le même cas que ce ridicule Chafer.', 'ep': 9, 'g': 39, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 7, 30, 50, false, true], 'c': 'CA>150&CC>100&CS>100', 'p': 36600};
I.u[6486] = {'n': 'Ecorce du Chêne Mou', 'nn': 'ECORCE DU CHENE MOU', 't': 96, 'd': 'Cette écorce est plus résistante que n\'importe quelle autre écorce, elle respire la puissance. En revanche, rien n\'indique que ce n\'est pas une fausse écorce d\'Abraknyde repeinte. Il serait peut-être temps d\'arnaquer à votre tour un ami.', 'ep': 9, 'g': 666, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[6487] = {'n': 'Bourgeon du Chêne Mou', 'nn': 'BOURGEON DU CHENE MOU', 't': 108, 'd': 'Cet énorme bourgeon gorgé de sève chaude et sirupeuse, devrait vous rappeler vos biberons d\'enfance si vous vous risquez à aspirer son contenu. Dans un deuxième temps, vous vous transformerez peut-être en feuille morte.', 'ep': 9, 'g': 665, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[6488] = {'n': 'Racine du Chêne Mou', 'nn': 'RACINE DU CHENE MOU', 't': 98, 'd': 'Certains tenteront de faire de la bière avec cette racine. C\'est fortement déconseillé, le Chêne Mou ne tenant pas du tout l\'alcool, ces racines risquent de devenir très instables au contact de la moindre goutte d\'alcool. Un peu comme un Sadida.', 'ep': 9, 'g': 667, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[6489] = {'n': 'Bois de Chêne Mou', 'nn': 'BOIS DE CHENE MOU', 't': 38, 'd': 'Ce bois-là a vu la Hache de Brouce Boulgoure, et de très près. Il a également connu d\'autres choses mystérieuses et intrigantes, que même le livre du Bwork Mage se refuse de révéler. On est en droit de s\'imaginer le pire.', 'ep': 1, 'g': 668, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[6490] = {'n': 'Ambre du Chêne Mou', 'nn': 'AMBRE DU CHENE MOU', 't': 50, 'd': 'Cette Ambre contient une misérable bestiole prise dans la résine. Ce bijou du Chêne Mou est une pièce de collection, au même titre que les chaussettes rouges et jaunes à petits pois du Chouque.', 'ep': 9, 'g': 669, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[6491] = {'n': 'Le Tronknydum', 'nn': 'LE TRONKNYDUM', 't': 2, 'd': 'Cet arc est issu du croisement raté d\'un Tronknyde et d\'un Abraknyde. Pour un Bûcheron, il s\'agit de toute évidence d\'un échec mais pour un Sculpteur d\'Arcs, c\'est une vraie réussite. Vos parents auraient aimé pouvoir en dire autant de vous.', 'ep': 9, 'g': 41, 'l': 57, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 7, 30, 50, false, true], 'p': 8500};
I.u[6492] = {'n': 'Bâton du Wobot', 'nn': 'BATON DU WOBOT', 't': 4, 'd': 'L\'écart entre les deux pointes de ce bâton correspond à celui des yeux de Lenalds... Mais jusqu\'où iront ces howibles Wabbits ?', 'ep': 2, 'g': 37, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CS>60&CV>60', 's': 11, 'p': 9400};
I.u[6493] = {'n': 'Tongues Wabbits', 'nn': 'TONGUES WABBITS', 't': 11, 'd': 'Adoptez la ' + '"' + 'Cawotte attitude' + '"' + ' avec ces tongues wabbits issues de la dernière collection. Elles sont recommandées par tous les experts en claquettes, en danses rituelles, et en Tango rapide du Captain Chafer.', 'ep': 8, 'g': 39, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 's': 11, 'p': 9300};
I.u[6494] = {'n': 'Baguette d\'Elya Wood', 'nn': 'BAGUETTE D\'ELYA WOOD', 't': 3, 'd': 'Utilisée par les plus célèbres Eniripsas d\'Amakna, cette baguette constitue l\'arme idéale pour envoyer un sortilège sur ses adversaires ou tenter de rendre plus intelligents ses propres amis. Ainsi, vous pouvez transformer un Iop en citrouille.', 'ep': 9, 'g': 39, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [10, 4, 2, 4, 50, 50, false, true], 'c': 'CI>300&CW>100', 's': 39, 'p': 36800};
I.u[6495] = {'n': 'Baguette du Chêne Mou', 'nn': 'BAGUETTE DU CHENE MOU', 't': 3, 'd': 'Fabriquée à partir de restes du Chêne Mou ayant repris vie, cette baguette est tout simplement surpuissante. Il suffit de l\'agiter à droite puis à gauche avec le bon rythme, pour déclencher des pluies de crapauds ou passer pour un idiot notoire.', 'ep': 22, 'g': 42, 'l': 172, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'tw': true, 'e': [7, 3, 3, 4, 45, 70, false, true], 'c': 'CI>400&CC>250&CW>150', 'p': 45000};
I.u[6496] = {'n': 'Baguette en Racine d\'Abraknyde Sombre', 'nn': 'BAGUETTE EN RACINE D\'ABRAKNYDE SOMBRE', 't': 3, 'd': 'Cette baguette a parfois tendance à reprendre vie et se révolter contre son maître. Dans ce cas-là, la meilleure chose à faire reste de la donner à votre ennemi, ou à un Iop qui pensera que vous lui faîtes un cadeau.', 'ep': 9, 'g': 40, 'l': 67, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>70&CW>70', 'p': 12000};
I.u[6497] = {'n': 'Balgourde des Clairettes', 'nn': 'BALGOURDE DES CLAIRETTES', 't': 3, 'd': 'La femme de Brouce Boulgoure, une Eniripsa, ne cessait de lui voler sa célèbre hache. Pour mettre un terme à ces bêtises, il lui coupa une aile et un bras et pour s\'excuser, il lui offrît cette Baguette. Voilà un homme qui savait y faire avec les femmes.', 'ep': 9, 'g': 43, 'l': 63, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [10, 4, 2, 4, 30, 50, false, true], 'c': 'CI>63&CW>30', 'p': 10325};
I.u[6498] = {'n': 'Slip Kangouwou du Wabbit GM', 'nn': 'SLIP KANGOUWOU DU WABBIT GM', 't': 10, 'd': 'De taille plus que respectable, ce magnifique slip comporte encore les traces du passage de son ancien propriétaire et quelques poils bien étranges. Sur les fesses ou sur la tête, ce slip fera de vous une personnalité respectée de tout Amakna.', 'ep': 8, 'g': 58, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 's': 11, 'p': 9400};
I.u[6499] = {'n': 'Amulette ' + '"' + 'Dents de Wabbits' + '"' + '', 'nn': 'AMULETTE ' + '"' + 'DENTS DE WABBITS' + '"' + '', 't': 1, 'd': 'Les dents de cette amulette ont rongé plus de Cawottes que Brouce Boulgoure n\'a déraciné d\'arbres, ne vous étonnez donc pas si vous sentez la Cawotte, et si les Tiwabbits cherchent à vous faire des bisous dans le cou.', 'ep': 8, 'g': 59, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 's': 11, 'p': 9400};
I.u[6500] = {'n': 'Oreilles de Wabbits', 'nn': 'OREILLES DE WABBITS', 't': 16, 'd': 'Ces oreilles ne vous permettront pas de mieux entendre, mais permettront à vos amis de mieux vous retrouver dans la foule, et à vos ennemis, de mourir de rire. Une paire d\'oreilles qui s\'avère avec le temps vraiment indispensable.', 'ep': 8, 'g': 52, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 's': 11, 'p': 9500};
I.u[6501] = {'n': 'Sac-Cawotte', 'nn': 'SAC-CAWOTTE', 't': 81, 'd': 'Avec ce sac sur les épaules, vous pouvez partir à l\'aventure sans vous soucier des problèmes alimentaires. En effet, même si la Cawotte est vide comme un crâne de Iop, les feuilles du dessus repoussent toutes seules, de quoi se faire de bonnes tisanes.', 'ep': 8, 'g': 57, 'l': 60, 'wd': true, 'fm': true, 'w': 10, 's': 11, 'p': 9400};
I.u[6503] = {'n': 'Marteau Polpoulette', 'nn': 'MARTEAU POLPOULETTE', 't': 7, 'd': 'La Polpoulette est le résultat d\'un croisement entre un Kwak de Feu agressif et un Tofu maladif. Depuis la nuit des temps, la chasse à la Polpoulette est considérée comme un rituel immuable, chasser cette horrible créature est un vrai plaisir.', 'ep': 13, 'g': 35, 'l': 57, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [6, 5, 1, 1, 40, 50, false, false], 'c': 'CI>60&CS>20', 'p': 8000};
I.u[6504] = {'n': 'Marteau Fantal', 'nn': 'MARTEAU FANTAL', 't': 7, 'd': 'On ne connaît que le diminutif de son créateur, un certain Fantal, mais on sait qu\'il avait très mauvais goût. En effet, il appréciait s\'enduire de Gelée Royale pour ensuite se recouvrir de plumes de Tofu Royal. Et oui en plus, il avait des goûts de luxe.', 'ep': 9, 'g': 36, 'l': 81, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [10, 5, 1, 1, 50, 50, false, false], 'c': 'CS>80&CV>70', 'p': 17000};
I.u[6505] = {'n': 'Marteau Réhadaure', 'nn': 'MARTEAU REHADAURE', 't': 7, 'd': 'Pour lutter contre les bêtes à cornes, ce marteau est idéal. En revanche, pour planter des clous, ou des choux, même à la mode de chez nous, c\'est une autre histoire.', 'ep': 9, 'g': 37, 'l': 100, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [10, 5, 1, 1, 50, 50, false, false], 'c': 'CC>100&CW>40&CS>50', 'p': 26000};
I.u[6506] = {'n': 'Anneau du Mineur Gogorifiant', 'nn': 'ANNEAU DU MINEUR GOGORIFIANT', 't': 9, 'd': 'Chez les Enutrofs, on dit qu\'un mineur est gogorifié lorsqu\'il ne supporte plus la lumière du jour, à force de travailler dans sa mine. Ne tentez jamais d\'approcher une bougie d\'un tel mineur, il vous transformerait en bronze.', 'ep': 1, 'g': 40, 'l': 84, 'wd': true, 'fm': true, 'w': 10, 'c': 'PG=3', 'p': 18500};
I.u[6507] = {'n': 'Marteau de la Terps', 'nn': 'MARTEAU DE LA TERPS', 't': 7, 'd': 'La Terps était une très vilaine créature aussi dangereuse et mal aimée que sa grande rivale, la vieille Liche. Déterminée à la surpasser, elle forgea ce marteau pour lui écraser les orteils, mais elle lui cassa surtout les pieds. Une grande histoire d\'amour naquit.', 'ep': 9, 'g': 38, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'e': [10, 4, 1, 1, 35, 80, false, false], 'c': 'CS>60&CI>60', 'p': 19000};
I.u[6508] = {'n': 'Marteau Pinambour', 'nn': 'MARTEAU PINAMBOUR', 't': 7, 'd': 'Un marteau exceptionnel, destiné à soigner son petit Prespic adoré, ou ses ennemis si vous êtes un disciple du Chafer Fu.', 'ep': 9, 'g': 39, 'l': 50, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [6, 4, 1, 1, 40, 40, false, false], 'p': 6000};
I.u[6509] = {'n': 'Marteau R\'Ticolis', 'nn': 'MARTEAU R\'TICOLIS', 't': 7, 'd': 'Ce somptueux marteau a fait tourner la tête de plus d\'un Osamodas. En effet, il est si puissant, que tout le monde se retourne quand on croise son propriétaire. Ce marteau est depuis ce temps-là, à l\'origine d\'une bien étrange pathologie.', 'ep': 9, 'g': 40, 'l': 120, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [10, 5, 1, 1, 40, 50, false, false], 'c': 'CS>100&CI>150', 'p': 36000};
I.u[6510] = {'n': 'Marteau Kahr', 'nn': 'MARTEAU KAHR', 't': 7, 'd': 'Kahr était vraiment à la masse lorsqu\'il s\'agissait de combattre avec un marteau. Heureusement pour lui, il reçut en héritage cette véritable merveille, qui fit de lui une personne respectée et jalousée. Le succès ne tient parfois à rien.', 'ep': 12, 'g': 41, 'l': 120, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>150&CI>150', 'p': 36000};
I.u[6511] = {'n': 'Marteau Ridhe', 'nn': 'MARTEAU RIDHE', 't': 7, 'd': 'C\'est le marteau parfait des moments chauds, vous aurez un succès énorme parmi votre entourage si vous savez vous y prendre correctement. De toute évidence, à ne pas mettre entre toutes les mains...', 'ep': 9, 'g': 42, 'l': 120, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 40, 40, false, false], 'c': 'CI>150&CS>100', 'p': 36000};
I.u[6512] = {'n': 'Marteau Nitruhant', 'nn': 'MARTEAU NITRUHANT', 't': 7, 'd': 'C\'est l\'arme rêvée des Xélors un tantinet rebelles et en manque de sensations fortes. Ca leur permet surtout de compenser une vieille histoire de complexe à propos de leur taille franchement ridicule.', 'ep': 14, 'g': 43, 'l': 82, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [10, 5, 1, 1, 40, 50, false, false], 'c': 'CI>50&CC>50', 'p': 17000};
I.u[6513] = {'n': 'Marteau Réfacteur', 'nn': 'MARTEAU REFACTEUR', 't': 7, 'd': 'Ce marteau tire sa puissance d\'un subtile enchantement. Ca ne se voit pas au premier coup d\'oeil, ni au second. C\'est pour cela que l\'on prend la peine de le préciser, histoire d\'augmenter la valeur de cet objet aux yeux des acheteurs un peu naïfs.', 'ep': 1, 'g': 44, 'l': 55, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [6, 4, 1, 1, 50, 50, false, false], 'p': 9000};
I.u[6516] = {'n': 'Dagues R\'Hoh', 'nn': 'DAGUES R\'HOH', 't': 5, 'd': 'Aucun Sram ne peut résister à l\'envie d\'agresser un ami avec ces sublimes dagues. Leur principal intérêt est donc de faire baisser de manière considérable l\'insécurité en Amakna, en supprimant un à un les derniers Srams restants.', 'ep': 9, 'g': 41, 'l': 121, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>150&CS>100&CV>100', 'p': 38000};
I.u[6517] = {'n': 'Dagues Hischantes', 'nn': 'DAGUES HISCHANTES', 't': 5, 'd': 'Ces dagues feraient craquer n\'importe quelle petite Sramette en quête d\'expériences nouvelles. En effet, ses pouvoirs étranges lui permettent d\'accomplir les pires fourberies, aux amis comme aux ennemis. Le Captain Chafer aurait adoré.', 'ep': 7, 'g': 42, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>100&CS>80', 'p': 8000};
I.u[6518] = {'n': 'Amrothiline', 'nn': 'AMROTHILINE', 't': 3, 'd': 'Conçue par un célèbre Sculpteur, cette baguette a gagné 13 fois le grand concours de la Baguette N\'hi, en réussissant à surpasser les anciens modèles de Boulgourdes aujourd\'hui retirés du marché car trop dangereuses pour les petites Eniripsas.', 'ep': 9, 'g': 44, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [6, 4, 2, 4, 50, 50, false, true], 'c': 'CI>300&CV>100', 'p': 36000};
I.u[6519] = {'n': 'Baguette de Kouartz', 'nn': 'BAGUETTE DE KOUARTZ', 't': 3, 'd': 'C\'est un sculpteur réputé, connu également pour la ressemblance de son nom avec un des alliages les plus précieux d\'Amakna, qui eut le premier, l\'idée d\'introduire des métaux dans ses créations. La folie mène parfois au succès.', 'ep': 14, 'g': 41, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>120&CW>40', 'p': 17000};
I.u[6520] = {'n': 'La Migraine', 'nn': 'LA MIGRAINE', 't': 3, 'd': 'Le sculpteur de cette baguette, a maintes fois demandé à changer de nom. Trop habitués à passer leurs journées à la Taverne, les responsables du registre d\'Amakna, ont fini par avoir mal à la tête avec toutes ces histoires. Cette baguette leur est dédiée.', 'ep': 13, 'g': 45, 'l': 85, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>150&CV>100', 'p': 19000};
I.u[6521] = {'n': 'Kelinobranche', 'nn': 'KELINOBRANCHE', 't': 4, 'd': 'On raconte que ce bâton permet de faire rougir une femelle Abraknyde, ou de chatouiller les parties intimes du Chêne Mou pour mieux le séduire. Dans tous les cas, on vous déconseille d\'essayer, le Chêne Mou est vraiment très possessif...', 'ep': 9, 'g': 38, 'l': 129, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [5, 4, 1, 1, 40, 40, false, false], 'c': 'CS>250&CV>200', 'p': 43000};
I.u[6522] = {'n': 'La Racine Cinati', 'nn': 'LA RACINE CINATI', 't': 4, 'd': 'La légende raconte que cette racine est herbivore : elle aurait tendance à se faufiler très vite sous les feuilles mortes et avaler les jeunes pousses. Très impressionnant. Bon, à part si vous combattez des Pissenlits, ça ne sert à rien.', 'ep': 9, 'g': 39, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 4, 1, 1, 40, 40, false, false], 'c': 'CI>200&CS>200&CV>150', 'p': 37000};
I.u[6523] = {'n': 'La Racine Hagogue', 'nn': 'LA RACINE HAGOGUE', 't': 4, 'd': 'Création élégante et raffinée, cette racine sculptée fera de vous un invocateur confirmé. Pas de quoi frimer en soirée, mais pour rendre folles de vous les Sadidettes d\'Amakna, il n\'y a pas mieux.', 'ep': 9, 'g': 40, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 4, 1, 1, 40, 40, false, false], 'c': 'CS>200&CV>150', 'p': 36000};
I.u[6524] = {'n': 'Racine Sauvageonne', 'nn': 'RACINE SAUVAGEONNE', 't': 4, 'd': 'Un Sadida, éperdument amoureux d\'une Sadidette Sauvage a tenté de l\'attirer sous un charme avec cette racine, il a attendu une centaine d\'années. Elle lui a posé une sorte de Wabbit. Depuis ce jour, les Sadidas parlent de poser une Racine.', 'ep': 14, 'g': 41, 'l': 54, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 3, 1, 1, 40, 50, false, false], 'c': 'PG=10', 'p': 9000};
I.u[6525] = {'n': 'Bâton du Féca', 'nn': 'BATON DU FECA', 't': 4, 'd': 'Les habitants d\'Amakna en avaient assez d\'entendre les disciples Fécas se plaindre à longueur de journée de leurs armures. Ils ont donc conçu ce bâton pour espérer les voir parler d\'autre chose à la taverne.', 'ep': 14, 'g': 42, 'l': 94, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [7, 5, 1, 1, 40, 80, false, false], 'c': 'PG=1', 'p': 25600};
I.u[6526] = {'n': 'Pelle Hébuse', 'nn': 'PELLE HEBUSE', 't': 8, 'd': 'Le forgeur de cette pelle a voulu rester anonyme pour faire le modeste, mais il a pris soin de laisser un indice dans le nom de cette pelle. Certains artisans sont vraiment irrécupérables...', 'ep': 1, 'g': 4, 'l': 94, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>200&CV>70&CW>50', 'p': 23000};
I.u[6527] = {'n': 'Pelle Musicale', 'nn': 'PELLE MUSICALE', 't': 8, 'd': '' + '"' + 'Pelle pelle pelle comme euh le jour, pelle pelle pelle comme euh l\'amour' + '"' + ' fredonnait Noh Yèle l\'illustre forgeur d\'épées. Il chantait si faux, que sa femme en est restée marquée à vie lorsqu\'elle lui fabriqua cette pelle.', 'ep': 1, 'g': 38, 'l': 52, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [10, 5, 1, 1, 20, 20, false, false], 'c': 'CC>80&CI>50', 'p': 7100};
I.u[6528] = {'n': 'Pelle Rinage', 'nn': 'PELLE RINAGE', 't': 8, 'd': 'Cette pelle a traversé les continents, elle a vu le soleil se coucher sur la crête du Mont Crakelour, le soleil se lever là où la Mer d\'Asse et l\'horizon ne font plus qu\'un. Et dire que vous vous n\'êtes jamais allé plus loin que l\'île de Moon, pitoyable.', 'ep': 12, 'g': 4, 'l': 88, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CI>80&CC>150&CW>40', 'p': 20000};
I.u[6535] = {'n': 'Pelle Hikule', 'nn': 'PELLE HIKULE', 't': 8, 'd': 'Cette étrange pelle multi-usages, servait à tuer les poux des jeunes Iops, à leur enlever les pellicules, et à leur faire rentrer dans le crâne les bases de l\'arithmétique.', 'ep': 9, 'g': 36, 'l': 121, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>300&CS>50&CV>100&CW>50', 'p': 37000};
I.u[6536] = {'n': 'Pelle du Mineur Sombre', 'nn': 'PELLE DU MINEUR SOMBRE', 't': 8, 'd': 'Le Mineur Sombre se sert de cette pelle de la taille d\'une main de Craqueleur,  essentiellement pour écraser plusieurs Eniripsas d\'un seul coup. On vous encourage à faire de même, histoire de ne pas mourir idiot.', 'ep': 9, 'g': 34, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [10, 5, 1, 1, 60, 60, false, false], 'c': 'CC>250&CV>100&CS>75', 'p': 34000};
I.u[6537] = {'n': 'Pelle Mairhe', 'nn': 'PELLE MAIRHE', 't': 8, 'd': 'Cette pelle est vraiment antipathique. Personne ne sait réellement pourquoi, mais les Pelles Mairhes sont toujours insupportables. Heureusement, qu\'elles ont tout de même des bons côtés, même si on les cherche encore à l\'heure actuelle.', 'ep': 12, 'g': 37, 'l': 88, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>200&CV>100&CA>70', 'p': 20000};
I.u[6538] = {'n': 'Pelle Vaidaire', 'nn': 'PELLE VAIDAIRE', 't': 8, 'd': 'Cette pelle permet aux Enutrofs de voir plus loin. Elle est faîte pour qu\'ils puissent la planter et monter dessus pour scruter l\'horizon et se donner des airs intéressants. Idéal pour retrouver son hospice lorsque l\'on est perdu entre deux fougères.', 'ep': 12, 'g': 39, 'l': 84, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>200&CV>70', 'p': 18200};
I.u[6539] = {'n': 'Pelle Gicque', 'nn': 'PELLE GICQUE', 't': 8, 'd': 'Cette pelle est vraiment différente des autres. Si vous l\'utilisez pour combattre, on risque de beaucoup rire et de faire des blagues sur vous. En effet, les blagues sur la Pelle Gicque sont très populaires du côté de la Taverne.', 'ep': 9, 'g': 35, 'l': 71, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'tw': true, 'e': [10, 4, 1, 1, 25, 60, false, false], 'c': 'CS>30&CC>150', 'p': 13000};
I.u[6540] = {'n': 'La Pelle Hélabète', 'nn': 'LA PELLE HELABETE', 't': 8, 'd': 'On raconte que celui qui a forgé cette pelle ressemblait à une véritable bête. Une sorte de croisement entre un Sadida et un Mulou. Sa pelle serait tombée amoureuse de lui. Vraiment une histoire débile.', 'ep': 14, 'g': 33, 'l': 87, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'tw': true, 'e': [15, 5, 1, 1, 30, 100, false, false], 'c': 'CC>150&CV>80', 'p': 20000};
