I.u[6894] = {'n': 'Surpuissant Chacha de Combat (MJ)', 'nn': 'SURPUISSANT CHACHA DE COMBAT (MJ)', 't': 18, 'd': 'Ce surpuissant Chacha de combat incarne à merveille la surpuissance. Très impressionnant. Mais attention, il est réservé aux Maîtres de jeu qui le valent bien.', 'ep': 1, 'g': 1, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'c': 'PX=3|PX=5', 'p': 1};
I.u[6895] = {'n': 'Petit Chacha de Combat (MJ)', 'nn': 'PETIT CHACHA DE COMBAT (MJ)', 't': 18, 'd': 'Moins surpuissant que le surpuissant Chacha de Combat, mais néanmoins très puissant, ce familier reste une valeur sûre pour tout Maître de jeu qui se respecte. En revanche, il faut avouer qu\'il est nettement plus salissant. N\'oubliez pas de le laver vigoureusement à l\'eau bouillante de temps à autre pour qu\'il garde toute sa splendeur.', 'ep': 1, 'g': 9, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'p': 1};
