I.u[6904] = {'n': 'Protection usagée du Bworker', 'nn': 'PROTECTION USAGEE DU BWORKER', 't': 15, 'd': 'L\'amour fait parfois plus de ravages et de dégâts qu\'une guerre. Ce n\'est pas au Bworker que vous apprendrez cela.', 'ep': 1, 'g': 714, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 1000};
