I.u[6940] = {'n': 'Scaracape Verte', 'nn': 'SCARACAPE VERTE', 't': 17, 'd': 'Qui n\'a jamais rêvé de revêtir une cape en coquille de Scarafeuilles ? Une fois équipée, vous devriez réussir à vous prendre pour un véritable Scarafeuille, et peut-être arriverez-vous à vous déplacer en glissant et en dérapant. De quoi décontenancer une horde de Trools.', 'ep': 3, 'g': 74, 'l': 45, 'wd': true, 'fm': true, 'w': 2, 's': 27, 'p': 5500};
