I.u[6944] = {'n': 'Scaranneau Vert', 'nn': 'SCARANNEAU VERT', 't': 9, 'd': 'Porter cet anneau autour du doigt vous permettra d\'avoir une pensée émue pour tous les Scarafeuilles que vous avez exterminés. Alors peut-être, vous vous demanderez si tout cela en valait réellement la peine.', 'ep': 3, 'g': 69, 'l': 43, 'wd': true, 'fm': true, 'w': 2, 's': 27, 'p': 5000};
