I.u[7097] = {'n': 'Bouclier d\'entraînement', 'nn': 'BOUCLIER D\'ENTRAINEMENT', 't': 82, 'd': 'Ce bouclier est donné aux disciples qui ne savent pas encore correctement utiliser un bouclier.', 'ep': 14, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[7098] = {'n': 'Marteau du Forgeur de Boucliers', 'nn': 'MARTEAU DU FORGEUR DE BOUCLIERS', 't': 7, 'd': 'Ce marteau est indispensable à la confection de boucliers.', 'ep': 18, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'e': [5, 6, 1, 1, 50, 50, false, false], 'p': 500};
I.u[7102] = {'n': 'Epée du Chevalier de Glace', 'nn': 'EPEE DU CHEVALIER DE GLACE', 't': 6, 'd': 'Le Chevalier de Glace était connu pour être un des plus grands forgeurs d\'épées de tout Amakna. Seule l\'horrible et impitoyable Liche refusait de reconnaître son immense talent. Vexé qu\'une telle créature puisse ne pas s\'émerveiller devant ses créations, il lui posa un ultimatum : il refusa d\'exercer sa profession tant qu\'elle ne fît pas l\'effort de reconnaître publiquement le talent du forgeur d\'épées. Mais c\'était mal connaître la terrible Liche, qui ne céda point. Le forgeur dû se résoudre à forger à nouveau plusieurs centaines d\'années plus tard. Entre temps, il avait complètement oublié son métier, et cette épée ridicule fut sa dernière création utilisable.', 'ep': 1, 'g': 51, 'l': 12, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'e': [5, 6, 1, 1, 40, 60, false, false], 'p': 575};
I.u[7103] = {'n': 'La Xyothine', 'nn': 'LA XYOTHINE', 't': 3, 'd': 'Cette baguette servait à décapiter tous les ploucs d\'Amakna. Autant dire qu\'elle a beaucoup servi. Il est intéressant de constater qu\'elle ressemble à s\'y méprendre à un bâton, et même peut-être à une canne... Peut-être était-elle utilisée pour assouvir les vieux fantasmes de son propriétaire, qui a fini par lui donner son nom. Personne ne saura jamais le fin mot de cette histoire sordide.', 'ep': 19, 'g': 53, 'l': 145, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'tw': true, 'e': [7, 4, 3, 5, 30, 50, false, true], 'c': 'CI>450&CV>200', 'p': 10000};
I.u[7104] = {'n': 'Tongues Baques', 'nn': 'TONGUES BAQUES', 't': 11, 'd': 'Ces tongues servaient à pratiquer différents arts martiaux. D\'un aspect peu innovant et artistiquement ratées, elles sont très vite tombées dans l\'oubli, un peu comme vous, mais moins vite tout de même.', 'ep': 18, 'g': 58, 'l': 67, 'wd': true, 'fm': true, 'w': 5, 'p': 11700};
I.u[7105] = {'n': 'Amulette de Pandala', 'nn': 'AMULETTE DE PANDALA', 't': 24, 'd': 'Cette amulette d\'apparence trés simple renferme un mystère que seul un Pandawa sur le point de mourir est capable de comprendre ...', 'ep': 18, 'g': 48, 'l': 0, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[7106] = {'n': 'Larvamulette', 'nn': 'LARVAMULETTE', 't': 1, 'd': 'Avec cette tête de larve autour du cou, vous ressemblez à Ulrik Holgan célèbre dompteur de larves des temps modernes.', 'ep': 5, 'g': 88, 'l': 26, 'wd': true, 'fm': true, 'w': 5, 's': 33, 'p': 1950};
I.u[7107] = {'n': 'Larvabottes', 'nn': 'LARVABOTTES', 't': 11, 'd': 'Qui n\'a jamais rêvé d\'enfoncer son pied directement dans les entrailles d\'une larve ? En tout cas sûrement pas vous, alors profitez-en et lâchez-vous.', 'ep': 1, 'g': 53, 'l': 33, 'wd': true, 'fm': true, 'w': 10, 's': 33, 'p': 3150};
I.u[7108] = {'n': 'Larvasac', 'nn': 'LARVASAC', 't': 81, 'd': 'Ce sac  original mais sans fioritures était très en vogue il y a bien longtemps. Un exemple typique du mauvais goût de vos ancêtres.', 'ep': 5, 'g': 60, 'l': 27, 'wd': true, 'fm': true, 'w': 10, 's': 33, 'p': 2150};
I.u[7109] = {'n': 'Larvacoiffe', 'nn': 'LARVACOIFFE', 't': 16, 'd': 'Enfin, l\'opportunité de ressembler à une vraie larve s\'offre à vous. Vous pourrez enfin afficher ouvertement votre mode de vie larvesque.', 'ep': 5, 'g': 103, 'l': 34, 'wd': true, 'fm': true, 'w': 10, 's': 33, 'p': 3225};
I.u[7110] = {'n': 'Baguette Larvesque', 'nn': 'BAGUETTE LARVESQUE', 't': 3, 'd': 'Cette terrifiante baguette est en fait un boyau de larve desséché puis enchanté, et enfin réhydraté. Il ne ressemble plus à rien désormais, un peu comme vous en fait, sauf que vous n\'êtes même pas enchanté.', 'ep': 5, 'g': 19, 'l': 40, 'wd': true, 'fm': true, 'w': 5, 'an': 11, 'e': [5, 3, 2, 4, 40, 50, false, true], 's': 33, 'p': 4000};
I.u[7112] = {'n': 'Dofus Tâcheté', 'nn': 'DOFUS TACHETE', 't': 23, 'd': 'Seul l\'accouplement d\'un dragon noir et d\'un dragon blanc a pu permettre la création d\'un tel œuf. Ou alors il s\'agit d\'une supercherie.', 'ep': 1, 'g': 8, 'l': 6, 'wd': true, 'fm': true, 'w': 1, 'p': 50000};
I.u[7113] = {'n': 'Dofawa', 'nn': 'DOFAWA', 't': 23, 'd': 'Ce Dofus ressemble étrangement à un œuf de Dragodinde sauvage... Pour une fois, les apparences ne sont peut-être pas trompeuses.', 'ep': 1, 'g': 9, 'l': 6, 'wd': false, 'fm': true, 'w': 1, 'p': 10};
I.u[7114] = {'n': 'Dofus Ebène', 'nn': 'DOFUS EBENE', 't': 23, 'd': 'Sombre comme les ténèbres, dur comme le roc, Grougalorasalar le Dragon Noir a créé le Dofus Ebène pour lui tenir compagnie. Il avait simplement oublié qu\'un Œuf, aussi magique fut-il, ne parle pas.', 'ep': 1, 'g': 7, 'l': 6, 'wd': true, 'fm': true, 'w': 10, 'p': 50000};
I.u[7115] = {'n': 'Dofus Ivoire', 'nn': 'DOFUS IVOIRE', 't': 23, 'd': 'Si sa blancheur n\'a pas d\'égal, c\'est que Dardondakal le Dragon blanc, blanchit le Dofus Ivoire à grands coups d\'haleine chaque matin (un vieux truc que lui a refilé sa grand-mère Dragon).', 'ep': 1, 'g': 11, 'l': 6, 'wd': true, 'fm': true, 'w': 10, 'p': 50000};
I.u[7116] = {'n': 'Anneau Merta', 'nn': 'ANNEAU MERTA', 't': 9, 'd': 'Cet anneau dispose d\'un bien étrange enchantement. En effet, une fois porté autour du doigt, vous ne pourrez plus parler qu\'au Bijoutier qui vous l\'a confectionné.', 'ep': 18, 'g': 91, 'l': 59, 'wd': true, 'fm': true, 'w': 5, 'p': 9155};
I.u[7117] = {'n': 'Alliance Ethnique', 'nn': 'ALLIANCE ETHNIQUE', 't': 9, 'd': 'Un groupe de Ménestrels cosmopolites, mais particulièrement mauvais, avaient décidé d\'utiliser cette alliance pour se reconnaître dans la foule qui venait assister à leurs représentations. Finalement, cette alliance ne leur fut d\'aucune utilité car ils n\'eurent aucun succès. Selon certaines mauvaises langues ou bonnes oreilles, c\'était bien mérité.', 'ep': 18, 'g': 92, 'l': 53, 'wd': true, 'fm': true, 'w': 5, 'p': 7150};
I.u[7118] = {'n': 'Anneau K\'Tuelle', 'nn': 'ANNEAU K\'TUELLE', 't': 9, 'd': 'Cet anneau en forme de gros papillon de nuit ne mettra pas vos mains en valeur, mais ce n\'est peut-être pas plus mal...', 'ep': 18, 'g': 94, 'l': 90, 'wd': true, 'fm': true, 'w': 5, 'p': 20775};
I.u[7119] = {'n': 'Anneau Ha', 'nn': 'ANNEAU HA', 't': 9, 'd': 'Le bijoutier à l\'origine de cette oeuvre n\'a contrairement aux apparences aucun lien de parenté avec un célèbre forgeur d\'épées. D\'après son créateur, cet anneau est censé vous rappeler l\'ambiance de la brousse, sans pour autant sentir les secousses. Personne n\'a encore compris de quoi il parlait.', 'ep': 18, 'g': 85, 'l': 58, 'wd': true, 'fm': true, 'w': 5, 'p': 8750};
I.u[7120] = {'n': 'Anneau Hé', 'nn': 'ANNEAU HE', 't': 9, 'd': 'Cet anneau appartenait à un vieillard, qui selon certaines rumeurs, aurait sauvé toutes les créatures de l\'île de Moon d\'un terrible déluge, en les amenant sur son radeau. Une autre version des faits raconte qu\'il aurait troqué son radeau contre un petit singe, au lieu de sauver les créatures de l\'île.', 'ep': 18, 'g': 86, 'l': 44, 'wd': true, 'fm': true, 'w': 2, 'p': 5350};
I.u[7121] = {'n': 'Anneau Zocomial', 'nn': 'ANNEAU ZOCOMIAL', 't': 9, 'd': 'Cet anneau vivant dispose d\'un terrible envoûtement, capable de rendre malades les aventuriers les plus résistants. On raconte qu\'il était à l\'origine censé soigner celui qui le porte autour de l\'index et qu\'il est devenu dangereux et agressif à force de se retrouver contre sa volonté dans des endroits peu recommandables.', 'ep': 18, 'g': 87, 'l': 50, 'wd': true, 'fm': true, 'w': 5, 'p': 6655};
I.u[7122] = {'n': 'Anneau Vice', 'nn': 'ANNEAU VICE', 't': 9, 'd': 'Anneau des débutants par excellence, c\'est également l\'anneau symbolisant le mieux un bon nombre de moeurs inavouables. Il semblerait qu\'il vous corresponde dans tous les cas, très bien.', 'ep': 16, 'g': 88, 'l': 18, 'wd': true, 'fm': true, 'w': 2, 'p': 1100};
I.u[7123] = {'n': 'Anneau Bsène', 'nn': 'ANNEAU BSENE', 't': 9, 'd': 'Réservé aux aventuriers avertis, cet anneau risque de choquer votre entourage s\'il est composé de jeunes créatures innocentes.', 'ep': 18, 'g': 95, 'l': 70, 'wd': true, 'fm': true, 'w': 2, 'p': 12900};
I.u[7124] = {'n': 'Dofus au lait', 'nn': 'DOFUS AU LAIT', 't': 42, 'd': 'Cet œuf de Dofus possède un pouvoir hors-pair, celui de vous faire saliver de bonheur.', 'ep': 1, 'g': 27, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[7125] = {'n': 'Dofus au chocolat blanc', 'nn': 'DOFUS AU CHOCOLAT BLANC', 't': 42, 'd': 'Cet oeuf de Dofus possède un pouvoir hors-pair, celui de vous faire saliver de bonheur.', 'ep': 1, 'g': 28, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[7128] = {'n': 'Anneau Karina', 'nn': 'ANNEAU KARINA', 't': 9, 'd': 'Contrairement à ce que certains pensent, cet anneau n\'a aucun rapport avec la sulfureuse Karina, qui s\'est à maintes reprises, mise en scène d\'une façon assez exotique dans le bar des pirates de Sufokia. En réalité, c\'est un musicien éleveur de Tofus, qui a donné ce nom à cet anneau, capable une fois porté autour du pouce, d\'émettre un son proche de celui que l\'on peut entendre lorsque l\'on tord le cou d\'un Tofu.', 'ep': 18, 'g': 89, 'l': 54, 'wd': true, 'fm': true, 'w': 5, 'p': 7700};
I.u[7129] = {'n': 'Panda au chocolat', 'nn': 'PANDA AU CHOCOLAT', 't': 42, 'd': 'Ne vous méprenez pas, il n\'y a pas que le chocolat qui donne du goût, la forme de la friandise apporte aussi son lot de saveur. Goûtez une Ouassingue au chocolat et vous comprendrez peut-être mieux.', 'ep': 0, 'g': 31, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[7130] = {'n': 'Recette du Dofus en chocolat', 'nn': 'RECETTE DU DOFUS EN CHOCOLAT', 't': 24, 'd': 'La recette du Dofus en chocolat, un must pour épater vos amis.', 'ep': 1, 'g': 250, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 100};
I.u[7131] = {'n': 'Anneau Piaume', 'nn': 'ANNEAU PIAUME', 't': 9, 'd': 'Ce bijou a fait rêver plus d\'un aventurier avant vous. En effet, on lui prête énormément de vertus, comme celle de transformer les plus belliqueux en doux rêveurs. La notice indique clairement qu\'il est déconseillé de le mettre au feu, mais elle ne précise pas pourquoi.', 'ep': 16, 'g': 90, 'l': 57, 'wd': true, 'fm': true, 'w': 5, 'p': 8475};
I.u[7132] = {'n': 'Anneau Rigami', 'nn': 'ANNEAU RIGAMI', 't': 9, 'd': 'Cet anneau doit son nom aux dernières paroles de son créateur : ' + '"' + 'Oh, Rigami mon ami !' + '"' + ' lança-t-il dans un râle de douleur terriblement amusant. Il est important de constater que la confection de cet anneau en Bambou est antérieure à l\'apparition des Bambous. Une énigme de plus qui ne risque pas d\'être résolue avant plusieurs décennies.', 'ep': 16, 'g': 96, 'l': 49, 'wd': true, 'fm': true, 'w': 5, 'p': 6300};
I.u[7133] = {'n': 'Mixomawose', 'nn': 'MIXOMAWOSE', 't': 30, 'd': 'N\'importe quel Wabbit vous le dira, si vous ne voulez pas voir la vie en rouge, évitez comme la peste la Mixomawose.', 'ep': 1, 'g': 9, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[7134] = {'n': 'Rage', 'nn': 'RAGE', 't': 30, 'd': 'On raconte que la rage transforme complètement les êtres atteints. Les personnes belliqueuses deviennent dociles, et les personnes calmes deviennent agressives. En revanche, celles qui bavaient déjà avant continueront de baver.', 'ep': 1, 'g': 10, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[7135] = {'n': 'Maloria', 'nn': 'MALORIA', 't': 30, 'd': 'Maladie transmise par les Moskitos qui habitent les régions au climat tropical, la Maloria, est aussi appelée Molaria par certains indigènes, car la maladie semble se transmettre également par les crachats de Moskitos.', 'ep': 1, 'g': 11, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[7136] = {'n': 'Médaille Kido', 'nn': 'MEDAILLE KIDO', 't': 1, 'd': 'Cette médaille appartenait à un célèbre Pandawa, maître d\'une vieille école d\'arts martiaux qui enseignait à ses disciples la défense en utilisant la force de ses adversaires. Son école a fini par disparaître car ses adversaires n\'étaient plus assez forts.', 'ep': 19, 'g': 89, 'l': 125, 'wd': true, 'fm': true, 'w': 10, 'p': 40425};
I.u[7137] = {'n': 'Cape Huccino', 'nn': 'CAPE HUCCINO', 't': 17, 'd': 'Cette cape a été cousue dans un seul et unique but, créer une cape capable de maintenir éveillé son porteur pendant plusieurs jours d\'affilée. Le résultat est bel et bien présent, elle est si rigide, qu\'elle vous gardera debout dans toutes les circonstances. Attention cependant, vous ne serez plus capables de nouer vos lacets.', 'ep': 16, 'g': 15, 'l': 44, 'wd': true, 'fm': true, 'w': 15, 'p': 5300};
I.u[7138] = {'n': 'Ortiz', 'nn': 'ORTIZ', 't': 17, 'd': 'Portée par les plus grands de ce monde, cette cape est surtout réputée pour sa douceur légendaire, qui lui permet d\'être portée sans aucun sous-vêtement lors des saisons chaudes. Une forme raffinée d\'exhibitionnisme qui en a séduit plus d\'un.', 'ep': 19, 'g': 91, 'l': 125, 'wd': true, 'fm': true, 'w': 15, 'p': 40175};
I.u[7139] = {'n': 'Ceinture Sula', 'nn': 'CEINTURE SULA', 't': 10, 'd': 'Sula la cordonnière aimait perdre son temps à flâner dans les champs, en quête d\'un amour improbable. A défaut de trouver l\'être tant convoité, elle trouva la mort en tombant dans une grande fosse remplie d\'immondices, près de la zone Cochonne. Son corps ne fût retrouvé que 7 décennies plus tard, au moment de vider la fameuse fosse. Son frère se serait alors écrié : ' + '"' + 'je me doutais bien qu\'elle était quelque part' + '"' + ', juste avant de tomber lui aussi dans la fosse.', 'ep': 19, 'g': 82, 'l': 125, 'wd': true, 'fm': true, 'w': 15, 'p': 39975};
I.u[7140] = {'n': 'Xénature', 'nn': 'XENATURE', 't': 10, 'd': 'Contrairement aux apparences, Xéna, n\'était pas une guerrière, mais une cordonnière. Ses formes généreuses et sa passion sans limite pour les tâches ménagères la prédestinaient à une brillante carrière dans les brasseries d\'Amakna. Le destin en a décidé autrement.', 'ep': 19, 'g': 83, 'l': 125, 'wd': true, 'fm': true, 'w': 15, 'p': 40125};
I.u[7141] = {'n': 'Holoune', 'nn': 'HOLOUNE', 't': 16, 'd': 'Ce chapeau étrange vous protègera des rayons du soleil, même la nuit. Attention, il reprend vie une fois toutes les trois décennies, et se retourne contre son maître en tentant de l\'étouffer pendant son sommeil.', 'ep': 19, 'g': 111, 'l': 122, 'wd': true, 'fm': true, 'w': 10, 'p': 37925};
I.u[7142] = {'n': 'Piruk', 'nn': 'PIRUK', 't': 16, 'd': 'Ce chapeau était utilisé par certains Xélors, pour cacher leur calvitie naissante. Certains Enutrofs s\'en servaient même pour cacher leur femme. Une façon habile de cacher deux problèmes majeurs de la vie de tous les jours.', 'ep': 19, 'g': 112, 'l': 145, 'wd': true, 'fm': true, 'w': 15, 'p': 46980};
I.u[7143] = {'n': 'Solomonk', 'nn': 'SOLOMONK', 't': 16, 'd': 'Le Solomonk était le chapeau d\'un vieux chef d\'une Tribu de Pandawas, experts en potions laxatives. Les Pandawas en question étant souvent obligés de tester eux-mêmes les effets de leurs potions, ils utilisaient ce type de chapeau, qui à défaut de les mettre en valeur, faisait un excellent pot de chambre.', 'ep': 19, 'g': 123, 'l': 120, 'wd': true, 'fm': true, 'w': 50, 'p': 36880};
I.u[7144] = {'n': 'Blémiche', 'nn': 'BLEMICHE', 't': 16, 'd': 'Cette coiffe de mariée est passée de mode depuis bien longtemps, peut-être à cause de sa dentelle qui date d\'une autre ère. Recyclée en culotte, et portée sur une tête bien garnie en cheveux, elle pourrait cependant mettre en transe, le plus blasé des Chafers.', 'ep': 19, 'g': 116, 'l': 108, 'wd': true, 'fm': true, 'w': 15, 'p': 29775};
I.u[7145] = {'n': 'Coiffe du Gaddie', 'nn': 'COIFFE DU GADDIE', 't': 16, 'd': 'Créature étrange sortie d\'un monde imaginaire, le Gaddie se démarquait avant tout par son extraordinaire ruse, son aversion totale pour le règne végétal, et sa faculté à jeûner pendant plusieurs jours en temps de guerre. Une créature aussi complexe à comprendre était de toute évidence impossible à maîtriser, on la laissa donc vivre en paix dans les mines sans fond de Kruup, où elle fit connaissance avec une vieille Liche dévoreuse de Bouftons.', 'ep': 19, 'g': 115, 'l': 106, 'wd': true, 'fm': true, 'w': 15, 'p': 26375};
I.u[7146] = {'n': 'La Bertheuze', 'nn': 'LA BERTHEUZE', 't': 16, 'd': 'Cette coiffe surpuissante tient plus de la perruque qu\'autre chose, mais qu\'importe, elle est surpuissante. En effet, son propriétaire aimait se travestir et se faire passer pour les autres, afin de mieux profiter des personnes naïves. Ses jeux lugubres et glauques finirent par être découverts, tout comme son crâne, une fois sa coiffe retirée. Son immense talent d\'artiste lui sauva la vie, puisqu\'il se proposa quelques jours avant sa mise à mort, pour sculpter une statue géante à l\'effigie des parties intimes du Meulou. Il fût tout de même brûlé vif une fois la statue finie.', 'ep': 18, 'g': 114, 'l': 81, 'wd': true, 'fm': true, 'w': 10, 'p': 16925};
I.u[7149] = {'n': 'Carré de chocolat noir', 'nn': 'CARRE DE CHOCOLAT NOIR', 't': 42, 'd': 'Extrait du cacao brut, ce carré de chocolat en sublime la saveur. Attention à ne pas en abuser sous peine de problème de digestion.', 'ep': 1, 'g': 34, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 200};
I.u[7150] = {'n': 'La Bekille', 'nn': 'LA BEKILLE', 't': 16, 'd': 'Ce chapeau au nom surprenant, appartenait à un pauvre Ecaflip, qui avait perdu l\'usage de la parole suite à un terrible traumatisme. Artiste dans l\'âme, et dans le sang, il fût contraint de suivre une formation de Brasseur. Il se noya dans un fût de bière et de larmes, vers son quatorzième anniversaire. Heureusement, la bière ne fut pas perdue pour autant, puisque le prêtre responsable des obsèques, tomba dans un coma éthylique pendant plusieurs années avant de reprendre son office là où il s\'était arrêté.', 'ep': 19, 'g': 109, 'l': 111, 'wd': true, 'fm': true, 'w': 20, 'p': 31725};
I.u[7151] = {'n': 'Koloss', 'nn': 'KOLOSS', 't': 16, 'd': 'Le slogan publicitaire de ce casque était : ' + '"' + 'Cet imposant casque en argile fera de vous un colosse à la tête d\'argile' + '"' + '. Une étude approfondie de l\'objet vous permettra de vous apercevoir que le casque en question n\'est pas en argile, mais en plomb. De quoi prendre un peu de plomb dans le crâne à moindre frais.', 'ep': 19, 'g': 108, 'l': 120, 'wd': true, 'fm': true, 'w': 15, 'p': 36925};
I.u[7152] = {'n': 'Kanistère', 'nn': 'KANISTERE', 't': 16, 'd': 'Ce chapeau en forme de cuve servait aux pompiers d\'Amakna lors des incendies de champs de céréales. De nos jours, il sert avant tout aux Brasseurs et aux serveuses de taverne, qui servent de fûts sur pattes.', 'ep': 19, 'g': 110, 'l': 120, 'wd': true, 'fm': true, 'w': 20, 'p': 36675};
I.u[7153] = {'n': 'Marteau Hubohu', 'nn': 'MARTEAU HUBOHU', 't': 7, 'd': 'Cet énorme marteau fait un bruit incroyable lorsqu\'il tape sur un crâne de Iop, car il a tendance à amplifier les résonances. Surprenant, mais terriblement efficace.', 'ep': 19, 'g': 51, 'l': 126, 'wd': true, 'fm': true, 'w': 15, 'an': 15, 'tw': true, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CC>200', 'p': 40200};
I.u[7154] = {'n': 'Marteau M\'Pouce', 'nn': 'MARTEAU M\'POUCE', 't': 7, 'd': 'Ce léger marteau, était destiné à la base aux petits êtres : les Xélors utilisaient le manche, et les Araknes recevaient la masse sur la tête. Il a vite été détourné de son usage et constitue maintenant un petit jouet pour les jeunes Iops bricoleurs.', 'ep': 18, 'g': 46, 'l': 107, 'wd': true, 'fm': true, 'w': 15, 'an': 15, 'e': [5, 4, 1, 1, 40, 50, false, false], 'c': 'CI>350&CV>200&CW>100', 'p': 29475};
I.u[7155] = {'n': 'Marteau Nairedeubrest', 'nn': 'MARTEAU NAIREDEUBREST', 't': 7, 'd': 'Le célèbre Capitaine Kradoc a utilisé pendant des dizaines d\'années ce terrible marteau afin d\'occire tous ceux qui se mettaient en travers de son chemin, y compris femmes et enfants. Son mauvais caractère légendaire et son goût prononcé pour l\'alcool, en ont tout de même fait une personne très respectée des différents corps d\'armées, ennemis, comme alliés.', 'ep': 18, 'g': 48, 'l': 113, 'wd': true, 'fm': true, 'w': 15, 'an': 15, 'e': [10, 4, 1, 1, 40, 60, false, false], 'c': 'CI>150&CW>100&PG=5', 'p': 32650};
I.u[7156] = {'n': 'Marteau Ronto', 'nn': 'MARTEAU RONTO', 't': 7, 'd': 'Ce marteau rouillé est parfait pour éclater les érables, ou les Moskitos.', 'ep': 18, 'g': 50, 'l': 107, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [10, 3, 1, 1, 30, 100, false, false], 'c': 'CI>150&CV>150&(PG=2|PG=5)', 'p': 100000};
I.u[7157] = {'n': 'Marteau Ksain', 'nn': 'MARTEAU KSAIN', 't': 7, 'd': 'Ce marteau était autrefois utilisé pour faire sonner la cloche de l\'église d\'Amakna. De nos jours, il sert toujours à faire de la musique, en broyant les os des imprudents par exemple.', 'ep': 19, 'g': 49, 'l': 124, 'wd': true, 'fm': true, 'w': 15, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CI>250', 'p': 29400};
I.u[7158] = {'n': 'Marteau Lahre', 'nn': 'MARTEAU LAHRE', 't': 7, 'd': 'Conçu par un alchimiste de renom pendant un séjour dans les prisons de Brâkmar, ce marteau devait à l\'origine servir à casser le matériel d\'alchimie de ses concurrents.', 'ep': 19, 'g': 47, 'l': 143, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CA>250&PG=5', 'p': 46550};
I.u[7159] = {'n': 'Marteau Pinière', 'nn': 'MARTEAU PINIERE', 't': 7, 'd': 'Ce marteau de mineur est utilisable comme une pelle ou pioche selon vos besoins. Son utilisation en jardinage est cependant proscrite, car il a tendance à détruire de manière définitive les pelouses.', 'ep': 19, 'g': 52, 'l': 135, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CC>200&CV>300', 'p': 41200};
I.u[7160] = {'n': 'Arc Hanne', 'nn': 'ARC HANNE', 't': 2, 'd': 'Cet arc a été enchanté il y a bien longtemps par une magie des plus obscures. De quoi inquiéter autant son propriétaire que ses ennemis.', 'ep': 19, 'g': 44, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 7, 30, 50, false, true], 'c': 'CA>150&CI>400&PG=9', 'p': 36900};
I.u[7161] = {'n': 'Arc Assin', 'nn': 'ARC ASSIN', 't': 2, 'd': 'Cet arc était avant tout utilisé pour chasser les Sangliers des Plaines. En effet, il est si puissant, qu\'il permet à l\'aide d\'une seule flèche, de tuer plusieurs petits marcassins, à condition qu\'ils soient correctement alignés.', 'ep': 18, 'g': 45, 'l': 107, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 8, 30, 50, false, true], 'c': 'CI>250&CA>150', 'p': 29325};
I.u[7162] = {'n': 'Arc Lavoine', 'nn': 'ARC LAVOINE', 't': 2, 'd': 'Cet arc appartenait à un ménestrel indépendant, surtout célèbre, pour détruire les oreilles de ses ennemis avec ses chants de guerre. Il fut exilé pendant plusieurs années sur Pandala, à cause de ses chants qui étaient capables de rendre sourds les Corbacs de Brâkmar. Après avoir rendu fous plusieurs générations de Pandawas, il fut tout simplement livré vivant au grand Sorlok, pour être digéré lentement pendant plus de 752 années. Il y découvrit une nouvelle forme de plaisir intense.', 'ep': 19, 'g': 46, 'l': 130, 'wd': true, 'fm': true, 'w': 15, 'an': 10, 'tw': true, 'e': [10, 5, 3, 6, 30, 50, false, true], 'c': 'CA>200&CC>70&PG=9', 'p': 30000};
I.u[7163] = {'n': 'Arc Huledela', 'nn': 'ARC HULEDELA', 't': 2, 'd': 'Cet arc était avant tout utilisé comme une arme de dissuasion. Son propriétaire expliquait à qui voulait l\'entendre que ses flèches étaient empoisonnées, ce qui ne manquait pas d\'effrayer la population locale. Ainsi, il arrivait à faire reculer tous les pleutres qui se mettaient en travers de son chemin.', 'ep': 19, 'g': 47, 'l': 124, 'wd': true, 'fm': true, 'w': 15, 'an': 10, 'tw': true, 'e': [10, 5, 2, 6, 30, 50, false, true], 'c': 'PG=9&CA>250', 'p': 39050};
I.u[7164] = {'n': 'Arc Hisedaisange', 'nn': 'ARC HISEDAISANGE', 't': 2, 'd': 'Cet arc léger et fragile a séduit bon nombre d\'aventuriers, plus attachés aux apparences qu\'à l\'efficacité.', 'ep': 19, 'g': 48, 'l': 143, 'wd': true, 'fm': true, 'w': 15, 'an': 10, 'e': [5, 5, 2, 6, 30, 50, false, true], 'c': 'CA>120&CI>120&CC>120&CV>300', 'p': 46025};
I.u[7165] = {'n': 'Baguette Nah', 'nn': 'BAGUETTE NAH', 't': 3, 'd': 'Cette baguette explosive a été trempée dans la lave d\'un volcan en éruption avant d\'être sculptée, puis enchantée. Il va sans dire qu\'elle semble très puissante, malgré son apparence ridicule.', 'ep': 18, 'g': 54, 'l': 105, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'e': [5, 4, 3, 6, 50, 50, false, true], 'c': 'CI>300', 'p': 28625};
I.u[7167] = {'n': 'Baguette Cetera', 'nn': 'BAGUETTE CETERA', 't': 3, 'd': 'L\'artisan à l\'origine de cette baguette avait de nombreux apprentis qu\'il faisait travailler à longueur de journées. Il était censé leur apprendre les ficelles du métier, mais était en fait très mauvais pédagogue, il commençait toujours ses explications, mais ne les finissait jamais.', 'ep': 18, 'g': 50, 'l': 43, 'wd': true, 'fm': true, 'w': 5, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>60', 'p': 5000};
I.u[7168] = {'n': 'Baguette Hylique', 'nn': 'BAGUETTE HYLIQUE', 't': 3, 'd': 'Une fois sculptée, cette baguette a été trempée dans la bière pendant plusieurs années. Elle a déjà commencé à pourrir, mais elle garde cependant encore quelques propriétés magiques, suffisantes pour divertir ou exterminer vos alliés.', 'ep': 18, 'g': 51, 'l': 63, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>150', 'p': 4800};
I.u[7169] = {'n': 'Baguette Hincelle', 'nn': 'BAGUETTE HINCELLE', 't': 3, 'd': 'Idéale pour allumer le feu, ou animer les mariages ennuyeux, cette baguette vous permettra peut-être une fois dans votre vie, de faire des étincelles. Une occasion à saisir.', 'ep': 18, 'g': 52, 'l': 81, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CI>200', 'p': 17000};
I.u[7170] = {'n': 'Baguette Houffe-Craitien', 'nn': 'BAGUETTE HOUFFE-CRAITIEN', 't': 3, 'd': 'Houffe le pâtissier était fou au point de se marier avec la bûcheronne Craitien, et de l\'étouffer le lendemain avec ses pâtisseries trop grasses. On parle donc depuis cet événement, ' + '"' + 'd\'histoire de Houffe' + '"' + ', pour relater les événements les plus fous.', 'ep': 18, 'g': 46, 'l': 112, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'tw': true, 'e': [5, 2, 3, 4, 30, 50, false, true], 'c': 'CI>350&CV>200', 'p': 32330};
I.u[7171] = {'n': 'Baguette Ourderie', 'nn': 'BAGUETTE OURDERIE', 't': 3, 'd': 'Le sculpteur de cette baguette avait la fâcheuse habitude d\'oublier ses enfants à l\'école. Sa femme, une mère indigne comme tant d\'autres, s\'en réjouissait. Conscient d\'être trop étourdi, il sculpta cette baguette qui tous les jours, prenait vie et lui rappelait d\'aller chercher ses enfants. Il a par la suite tenté de faire des baguettes similaires pour rappeler à sa femme d\'aller faire le ménage, mais la baguette ne fut jamais assez puissante pour relever ce défi.', 'ep': 19, 'g': 47, 'l': 127, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'tw': true, 'e': [10, 4, 4, 6, 40, 60, false, true], 'c': 'CI>300&CV>300', 'p': 43125};
I.u[7172] = {'n': 'Baguette Rhon', 'nn': 'BAGUETTE RHON', 't': 3, 'd': 'Cette baguette magique est encore de nos jours utilisée pour vider les fosses sceptiques, curer les fossés, et accessoirement pour se curer le nez. Les sculpteurs les plus avertis, vous expliqueront qu\'elle tire toute sa magie, des immondices qu\'elle a pu côtoyer, surtout celles présentes dans votre nez.', 'ep': 18, 'g': 49, 'l': 105, 'wd': true, 'fm': true, 'w': 20, 'an': 11, 'tw': true, 'e': [10, 4, 2, 4, 30, 60, false, true], 'c': 'CI>200&CW>50', 'p': 28375};
I.u[7173] = {'n': 'Baguette Rangleuse', 'nn': 'BAGUETTE RANGLEUSE', 't': 3, 'd': 'Cette terrifiante baguette est capable de s\'enrouler autour du cou de vos adversaires pour les étrangler lentement mais sûrement. Une façon originale et distinguée de donner la mort aux adversaires que vous respectez un peu.', 'ep': 18, 'g': 48, 'l': 27, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 3, 2, 4, 50, 50, false, true], 'c': 'CI>50', 'p': 2100};
I.u[7174] = {'n': 'Cape Pandawushu', 'nn': 'CAPE PANDAWUSHU', 't': 17, 'd': 'Cette cape est indispensable à l\'entraînement au Pandawushu...', 'ep': 1, 'g': 89, 'l': 10, 'wd': true, 'fm': true, 'w': 5, 'p': 10};
I.u[7175] = {'n': 'Certificat shamanique', 'nn': 'CERTIFICAT SHAMANIQUE', 't': 24, 'd': 'Certificat médical indispensable pour la pratique du Pandawushuka.', 'ep': 18, 'g': 55, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[7176] = {'n': 'Racine Cithi', 'nn': 'RACINE CITHI', 't': 4, 'd': 'C\'est un certain Frank, sculpteur de bâtons de son état, qui serait à l\'origine de cette petite merveille, capable d\'assombrir le ciel et de faire couler le sang des ennemis qui n\'en n\'ont pas. On raconte qu\'il aurait mis plus de mille heures pour la sculpter. Même vos ennemis ne pourront y rester indifférents.', 'ep': 19, 'g': 53, 'l': 143, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'e': [10, 4, 1, 1, 45, 70, false, false], 'c': 'CS>150&CV>400&CI>50&CA>50', 'p': 46600};
I.u[7177] = {'n': 'Bandeau Pandawushu', 'nn': 'BANDEAU PANDAWUSHU', 't': 16, 'd': 'Avec ce bandeau Pandawushu noué autour du crâne, vous pourrez sans problème effrayer les jeunes Lenalds, en vous faisant passer pour un Maître en arts martiaux. N\'oubliez pas de pousser quelques cris de guerre pour paraître encore plus crédible.', 'ep': 1, 'g': 102, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 10};
I.u[7178] = {'n': 'Racine Horodon', 'nn': 'RACINE HORODON', 't': 4, 'd': 'Depuis des générations, les Sadidas utilisent des racines magiques comme bâtons. Cependant, il semblerait que certains d\'entre eux, se refusent encore à utiliser celle-ci, qui serait paraît-il, plus proche du fruit que de la racine. Fruit ou racine, qu\'importe, elle fait très mal là où elle se glisse et c\'est l\'essentiel.', 'ep': 18, 'g': 58, 'l': 86, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 3, 1, 1, 50, 50, false, false], 'c': 'CI>150', 'p': 19100};
I.u[7179] = {'n': 'Route et Chemin : Forêt Maudite', 'nn': 'ROUTE ET CHEMIN : FORET MAUDITE', 't': 25, 'd': 'Ce livre regroupe les meilleurs itinéraires touristiques à faire dans le labyrinthe de la forêt maudite...un Must ! Du moins c\'est ce que la jaquette annonce.', 'ep': 2, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 50};
I.u[7181] = {'n': 'Racine Sémilla', 'nn': 'RACINE SEMILLA', 't': 4, 'd': 'Sémilla était une jeune Sadidette, très intéressée par le jardinage et accessoirement, une piètre chanteuse. Elle prenait d\'ailleurs régulièrement un malin plaisir à recevoir des râteaux, mais bizarrement, beaucoup moins de pelles.', 'ep': 18, 'g': 54, 'l': 106, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'tw': true, 'e': [10, 4, 1, 1, 50, 50, false, false], 'c': 'CV>250&CW>60', 'p': 28575};
I.u[7182] = {'n': 'Racine Hécouanone', 'nn': 'RACINE HECOUANONE', 't': 4, 'd': 'Hécouanone n\'avait pas de chance, son mari était un gros fainéant, incapable d\'assumer son statut (pourtant mérité par sa condition) de chef de famille. Elle était en permanence obligée de lui fixer des conditions : ' + '"' + 'Tu auras ta Gelée Fraise, si tu vas faucher les céréales' + '"' + ' ou encore ' + '"' + 'Tu pourras fumer des Champs quand tu auras tondu les Bouftous' + '"' + ', pour ne citer que ses phrases les plus connues. Évidemment, cette histoire n\'a aucun rapport avec cette racine très puissante, à moins qu\'elle aussi, à force de côtoyer sa maîtresse, ne vous impose trop de conditions...', 'ep': 18, 'g': 60, 'l': 103, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'tw': true, 'e': [15, 4, 1, 1, 25, 50, false, false], 'c': 'CV>200', 'p': 27280};
I.u[7183] = {'n': 'Racine Huzohide', 'nn': 'RACINE HUZOHIDE', 't': 4, 'd': 'Cette racine a des formes pures, que certains artisans n\'hésiteront pas à qualifier de parfaites. C\'est peut-être pour cela que certains aventuriers y attachent plus d\'importance qu\'à leur dulcinée.', 'ep': 18, 'g': 55, 'l': 88, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CV>70', 'p': 20000};
I.u[7184] = {'n': 'Racine Histre', 'nn': 'RACINE HISTRE', 't': 4, 'd': 'Cette terrible racine, est avant tout connue pour déclencher des catastrophes climatiques aux endroits précis où elle est utilisée. Evitez donc de vous en servir pour botter les fesses de vos adversaires, on ne sait pas ce qu\'il pourrait arriver...', 'ep': 18, 'g': 56, 'l': 86, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CV>100', 'p': 18945};
I.u[7185] = {'n': 'Racine Hécure', 'nn': 'RACINE HECURE', 't': 4, 'd': 'Utiliser cette racine en combat est censé être assez simple. Parfois, elle reprend vie et décide de n\'en faire qu\'à sa tête. C\'est dans ces moments-là qu\'il est possible d\'entendre son propriétaire crier : ' + '"' + 'Mais ce n\'est pas une Racine Hécure' + '"' + '. Et pourtant si, c\'en est bien une.', 'ep': 18, 'g': 57, 'l': 103, 'wd': true, 'fm': true, 'w': 20, 'an': 12, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CV>200&CW>150', 'p': 27425};
I.u[7186] = {'n': 'Passage de grade', 'nn': 'PASSAGE DE GRADE', 't': 24, 'd': 'Sur cette feuille est inscrit la dernière date de votre passage de grade Pandawashuka.', 'ep': 18, 'g': 58, 'l': 0, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[7187] = {'n': 'Jakchir Arc', 'nn': 'JAKCHIR ARC', 't': 2, 'd': 'Cet arc est réputé pour voler l\'argent du peuple à distance, et en toute discrétion. Le plus surprenant c\'est qu\'il reste tout de même très populaire au fil des années. Heureusement pour le peuple, il commence déjà à s\'user.', 'ep': 19, 'g': 50, 'l': 124, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 4, 6, 30, 2, false, true], 'c': 'CA>100&CC>100&PG=9', 'p': 40000};
I.u[7188] = {'n': 'Dagues Rhumes', 'nn': 'DAGUES RHUMES', 't': 5, 'd': 'Ces dagues sont parfaites pour couper les fruits, ou pour couper l\'herbe sous les pieds de vos adversaires. Une  façon originale de les surprendre.', 'ep': 18, 'g': 48, 'l': 113, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [8, 3, 1, 1, 35, 50, false, false], 'c': 'CA>100&CI>100', 'p': 32575};
I.u[7189] = {'n': 'Rod Gerse', 'nn': 'ROD GERSE', 't': 4, 'd': 'Ce bâton étrange, est une version améliorée du célèbre God Rod. En effet, ce bâton a été imaginé et confectionné après les nombreux tests du God Rod effectués par les Prêtresses de l\'Amour. Ce modèle a même été utilisé et usé par Kuri en personne, ce qui en fait en quelque sorte une pièce unique.', 'ep': 19, 'g': 59, 'l': 176, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'tw': true, 'e': [7, 4, 1, 1, 30, 100, false, false], 'c': 'CI>450', 'p': 57000};
I.u[7190] = {'n': 'Dagues Maydhyn China', 'nn': 'DAGUES MAYDHYN CHINA', 't': 5, 'd': 'Ces dagues sublimes ont été confectionnées sur mesure, pour une Sramette en manque de sensations fortes. En effet, déçue de ne pas trouver de dagues à sa convenance, elle lança un défi à tous les forgeurs de dagues d\'Amakna : celui qui réussirait à lui forger des dagues capables de tuer sur le coup, n\'importe quel Tofu, pourrait passer 3 nuits en sa compagnie. Contrairement à ce qu\'elle pensait, cette annonce n\'eut pas l\'effet escompté, puisque personne ne participa au défi. Elle dut attendre une centaine d\'années, pour qu\'un forgeur de dagues Enutrof à la retraite, soit intéressé par la récompense qui avait bien changé avec le temps...', 'ep': 18, 'g': 45, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [15, 3, 1, 1, 35, 50, false, false], 'c': 'CS>150&CA>150', 'p': 21800};
I.u[7191] = {'n': 'Sertisseur de Ramougre', 'nn': 'SERTISSEUR DE RAMOUGRE', 't': 5, 'd': 'Ramougre était un vieux Sram, devenu maître dans la confection de bijoux. Il se servait à la fois de ce sertisseur pour ses créations, mais aussi pour assassiner ses propres clients, lorsqu\'il s\'ennuyait trop dans sa bijouterie. Il était connu pour son très mauvais caractère, qui le poussait parfois à détruire avec son sertisseur, ses plus belles créations. Aujourd\'hui, les utilisateurs de ces dagues savent lui rendre hommage, puisqu\'il les utilisent essentiellement pour trancher les bijoux de famille.', 'ep': 19, 'g': 49, 'l': 127, 'wd': true, 'fm': true, 'w': 15, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 30, false, false], 'c': 'CA>200&CS>200', 'p': 40825};
I.u[7192] = {'n': 'Griffe de Grizmine', 'nn': 'GRIFFE DE GRIZMINE', 't': 6, 'd': 'Grizmine n\'a jamais réussi à utiliser correctement cette griffe. A force de jouer aux cartes et aux jeux d\'argent tout en buvant de la bière, ses muscles ont vite fini par s\'atrophier. Chez certaines personnes, il semblerait que ce type de loisirs puisse même atrophier d\'autres organes.', 'ep': 18, 'g': 59, 'l': 111, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'e': [5, 5, 1, 1, 50, 50, false, false], 'c': 'CS>300&CA>120', 'p': 31625};
I.u[7193] = {'n': 'Epée du Dark Vlad', 'nn': 'EPEE DU DARK VLAD', 't': 6, 'd': 'Seul le Dark Vlad en personne est à même de faire ressurgir toute la magie de cette épée, pour la rendre réellement étincelante. En la portant, vous pourrez fièrement montrer que vous n\'avez pas fini comme ces ridicules aventuriers qui ont péri sous sa lame.', 'ep': 19, 'g': 61, 'l': 126, 'wd': true, 'fm': true, 'w': 20, 'an': 14, 'e': [12, 5, 1, 1, 50, 100, false, false], 'c': 'CV>250&CI>300&PG=8', 'p': 40625};
I.u[7194] = {'n': 'Arc Anum', 'nn': 'ARC ANUM', 't': 2, 'd': 'Cet arc est la preuve que l\'association de la technologie et de la magie, peut donner d\'excellents résultats. Pourtant, cet arc est tout de même tombé rapidement dans l\'oubli pour des raisons encore méconnues. L\'artisan à l\'origine de cette arc a d\'ailleurs été contraint de fermer sa boutique, ce qui n\'a pas manqué d\'attrister bon nombre de ses anciens clients.', 'ep': 18, 'g': 49, 'l': 96, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 2, 6, 30, 50, false, true], 'c': 'CI>200&CA>60&PG=9', 'p': 23500};
I.u[7195] = {'n': 'Karnak', 'nn': 'KARNAK', 't': 6, 'd': 'Cette épée légendaire a été forgée au petit matin, par une armée d\'Enutrofs saouls, dans le fond des mines de Grimoth. Elle dégage une aura de puissance surprenante, mais aussi une odeur de bière éventée.', 'ep': 19, 'g': 60, 'l': 158, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'tw': true, 'e': [10, 5, 1, 1, 50, 80, false, false], 'c': 'CV>300&CA>300&PG=8', 'p': 51100};
I.u[7197] = {'n': 'Marteau Bleuronne', 'nn': 'MARTEAU BLEURONNE', 't': 7, 'd': 'Ce marteau servait à l\'origine à casser les tablettes de chocolat, pour en faire de la poudre. Il a donc acquis au fil des années, une odeur et un goût délicieux. Une raison de plus, pour aller le faire goûter à vos ennemis.', 'ep': 19, 'g': 53, 'l': 150, 'wd': true, 'fm': true, 'w': 100, 'an': 15, 'tw': true, 'e': [10, 5, 1, 1, 50, 50, false, false], 'c': 'CI>150&CV>200&(PG=5|PG=2)', 'p': 100000};
I.u[7198] = {'n': 'Razoir du Soir', 'nn': 'RAZOIR DU SOIR', 't': 6, 'd': 'Tous les vieux Enutrofs vous le diront, une belle barbe est une barbe entretenue. Sa lame est si finement aiguisée, qu\'elle conviendra même aux dames un peu trop poilues.', 'ep': 18, 'g': 62, 'l': 106, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'e': [10, 4, 1, 1, 50, 50, false, false], 'c': 'CS>200&CA>100', 'p': 28925};
I.u[7199] = {'n': 'Glaive Icération', 'nn': 'GLAIVE ICERATION', 't': 6, 'd': 'Ce glaive appartenait à Metzger le boucher, qui s\'en servait pour récupérer rapidement les entrailles de ses ennemis pour en faire de la chair à saucisse qu\'il revendait à bon prix sur les marchés de Bonta.', 'ep': 19, 'g': 63, 'l': 135, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CS>200&CA>120&CV>300', 'p': 44225};
I.u[7200] = {'n': 'Sabre Shodanwa', 'nn': 'SABRE SHODANWA', 't': 6, 'd': 'Ce magnifique sabre est utilisé par les disciples Pandawushuka lorsqu\'ils réussissent à atteindre le grade Shodanwa sans être morts entre temps.', 'ep': 18, 'g': 55, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CS>60', 'p': 4300};
