I.u[7204] = {'n': 'Bâton du Shodanwa', 'nn': 'BATON DU SHODANWA', 't': 4, 'd': 'Ce bâton est en règle générale utilisé par les disciples Pandawushuka qui ont réussi à atteindre le grade de Shodanwa sans perdre l\'usage de leurs bras entre temps.', 'ep': 18, 'g': 49, 'l': 46, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'e': [5, 4, 1, 1, 40, 50, false, false], 'c': 'CV>30&CW>10', 'p': 5775};
