I.u[7208] = {'n': 'Hache du Shodanwa', 'nn': 'HACHE DU SHODANWA', 't': 19, 'd': 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Shodanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 'ep': 18, 'g': 37, 'l': 36, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 6, 1, 1, 50, 50, false, false], 'p': 3550};
I.u[7209] = {'n': 'Hache du Nidanwa', 'nn': 'HACHE DU NIDANWA', 't': 19, 'd': 'Cette hache est utilisée par les disciples Pandawushuka, lorsqu\'ils obtiennent le grade de Nidanwa. Elle est également très pratique pour ravager les forêts de Bambous et tous ceux qui s\'y cachent.', 'ep': 18, 'g': 36, 'l': 59, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 6, 1, 1, 50, 50, false, false], 'c': 'CS>100&CV>50', 'p': 9000};
