I.u[7367] = {'n': 'Anges & Démons', 'nn': 'ANGES & DEMONS', 't': 25, 'd': 'Plébiscité par une foultitude de lecteurs, Acidrik Fenlapanse revient avec quelques autres considérations métaphysiques.', 'ep': 18, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 50};
I.u[7368] = {'n': 'Baguette Houalle', 'nn': 'BAGUETTE HOUALLE', 't': 3, 'd': 'Le sculpteur de cette baguette voulait qu\'elle puisse détruire les étoiles filantes qui l\'empêchaient de dormir la nuit. La légende raconte qu\'un soir en sortant de la taverne, complètement ivre, il a voulu essayer sa baguette, mais a confondu la lune avec une étoile filante. La baguette étant réellement très puissante, il aurait cassé la lune en deux, et une des deux parties serait tombée en pleine Mer d\'Asse, donnant ainsi naissance à l\'île de Moon telle qu\'on la connaît actuellement. Encore une histoire débile de plus, à raconter entre amis, les soirs de beuverie.', 'ep': 19, 'g': 55, 'l': 126, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'e': [5, 4, 2, 4, 50, 50, false, true], 'c': 'CS>100&CV>150&CI>300', 'p': 39355};
I.u[7369] = {'n': 'Ambre de Bambouto', 'nn': 'AMBRE DE BAMBOUTO', 't': 50, 'd': 'Cette ambre est généralement accrochée à la cime du Bambouto, elle lui sert de bijoux, mais aussi pour se donner plus d\'inertie lorsque le Bambouto décide de s\'abattre sur vous afin de vous faire plus mal. Quelle ingénieuse créature.', 'ep': 18, 'g': 2, 'l': 40, 'wd': true, 'fm': true, 'w': 2, 'p': 100};
I.u[7370] = {'n': 'Ambre de Bambouto Sacré', 'nn': 'AMBRE DE BAMBOUTO SACRE', 't': 50, 'd': 'Cette ambre constitue la seule richesse du Bambouto Sacré, c\'est peut-être pour cela qu\'il est si aigri, et méchant, avec les touristes qui s\'aventurent sur l\'île de Pandala.', 'ep': 18, 'g': 1, 'l': 120, 'wd': true, 'fm': true, 'w': 2, 'p': 100};
