I.u[7379] = {'n': 'Etoffe de Fantôme Pandikaze', 'nn': 'ETOFFE DE FANTOME PANDIKAZE', 't': 55, 'd': 'Cet amas de poils est presque intact malgré la punition que vous avez dû infliger au pauvre Fantôme Pandikaze, pour la lui arracher.', 'ep': 19, 'g': 4, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7380] = {'n': 'Etoffe de Fantôme Maho Firefoux', 'nn': 'ETOFFE DE FANTOME MAHO FIREFOUX', 't': 55, 'd': 'Cette étoffe magique de couleur rousse est imprégnée d\'une magie surpuissante. On ne peut pas en dire autant de vous.', 'ep': 19, 'g': 1, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7381] = {'n': 'Etoffe de Fantôme Soryo Firefoux', 'nn': 'ETOFFE DE FANTOME SORYO FIREFOUX', 't': 55, 'd': 'Cette étoffe de taille modeste est parfaite pour boucher les trous sous les vieilles portes, lorsque l\'hiver approche.', 'ep': 19, 'g': 2, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7382] = {'n': 'Etoffe de Fantôme Léopardo', 'nn': 'ETOFFE DE FANTOME LEOPARDO', 't': 55, 'd': 'Cette étoffe n\'est pas aussi douce que la musique du Léopardo, et pourtant, elle devrait pouvoir vous servir. Mais à quoi ? Là est la question.', 'ep': 19, 'g': 7, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7383] = {'n': 'Etoffe de Fantôme Yokai Firefoux', 'nn': 'ETOFFE DE FANTOME YOKAI FIREFOUX', 't': 55, 'd': 'Cette étoffe provient des parties les plus sensibles du Fantôme Yokai Firefoux, qui sont également les plus malodorantes. Beaucoup d\'aventuriers pensent qu\'il s\'agit de ses moustaches, mais ils se trompent.', 'ep': 19, 'g': 3, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7384] = {'n': 'Etoffe de Fantôme Pandule', 'nn': 'ETOFFE DE FANTOME PANDULE', 't': 55, 'd': 'Contrairement aux idées reçues, cette étoffe n\'est pas mangeable. Les derniers qui ont essayé de la cuisiner se sont transformés en Tanukouï San. Une aubaine pour certains d\'entre eux.', 'ep': 19, 'g': 5, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7385] = {'n': 'Etoffe de Fantôme Tanukouï San', 'nn': 'ETOFFE DE FANTOME TANUKOUI SAN', 't': 55, 'd': 'Cette étoffe provient directement des aisselles du Fantôme Tanukouï San, réputées pour leur douceur, mais aussi pour leur odeur, proche dans le meilleur des cas, de celle que dégage la viande de Corbac en putréfaction.', 'ep': 19, 'g': 6, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7386] = {'n': 'Testicules du Tanukouï San', 'nn': 'TESTICULES DU TANUKOUI SAN', 't': 15, 'd': 'Ces énormes testicules sont recouverts d\'un très doux duvet qui prévient à merveille les attaques magiques, mais aussi des coups d\'échasses que le Tanukouï San se donne lorsqu\'il ne fait pas attention, ou lorsqu\'il entre en transe lors de l\'invocation d\'une femelle Tanuki Chan. Dans tous les cas, vous n\'avez pas n\'importe quoi entre les mains.', 'ep': 1, 'g': 2, 'l': 120, 'wd': true, 'fm': true, 'w': 200, 'p': 10};
I.u[7387] = {'n': 'Le clan des Mercenaires', 'nn': 'LE CLAN DES MERCENAIRES', 't': 25, 'd': 'Tout, tout, tout vous saurez tout sur les Mercenaires ! Un ouvrage écrit par le fondateur et Grand-Maître du Clan.', 'ep': 1, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[7388] = {'n': 'Potion d\'oubli de Maîtrise : Haches', 'nn': 'POTION D\'OUBLI DE MAITRISE : HACHES', 't': 45, 'd': 'Cette potion vous permettra d\'oublier un peu votre maîtrise des Haches.', 'ep': 3, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
