I.u[7393] = {'n': 'Etoffe de Fantôme Pandore', 'nn': 'ETOFFE DE FANTOME PANDORE', 't': 55, 'd': 'Cette étoffe est encore imprégnée de la sueur du Pandore, ce qui lui confère une valeur ajoutée non négligeable.', 'ep': 19, 'g': 8, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7394] = {'n': 'Potion d\'oubli : \'Félintion\'', 'nn': 'POTION D\'OUBLI : \'FELINTION\'', 't': 43, 'd': 'Cette potion permet d\'oublier un niveau du sort spécial \'Félintion\'', 'ep': 2, 'g': 36, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
