I.u[7396] = {'n': 'Prospérité', 'nn': 'PROSPERITE', 't': 29, 'd': 'Cette bénédiction permet de gagner de la résistance à l\'Eau pour les prochains combats.', 'ep': 18, 'g': 10, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'm': true, 'p': 1};
