I.u[7495] = {'n': 'Coupe Cuir du Cordomage', 'nn': 'COUPE CUIR DU CORDOMAGE', 't': 5, 'd': 'Ce Coupe Cuir magique permet de mieux découper le cuir et gratter les peaux. C\'est l\'outil idéal pour améliorer les vieilles bottes et ceintures.', 'ep': 2, 'g': 53, 'l': 1, 'wd': true, 'fm': true, 'w': 15, 'an': 13, 'e': [5, 6, 1, 1, 40, 40, false, false], 'c': 'PJ=62', 'p': 1000};
I.u[7496] = {'n': 'Potion de résurrection de masse', 'nn': 'POTION DE RESURRECTION DE MASSE', 't': 14, 'd': 'Cette potion permet de ressusciter tous les alliés présents autour de vous.', 'ep': 0, 'g': 60, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'Pg>23,4', 'u': true, 'p': 10};
I.u[7497] = {'n': 'Potion de libération de masse', 'nn': 'POTION DE LIBERATION DE MASSE', 't': 14, 'd': 'Cette potion permet de libérer les âmes de vos ennemis pour les renvoyer directement dans leur cimetière, sans leur permettre de pouvoir se faire ressusciter.', 'ep': 0, 'g': 59, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'Pg>23,4', 'u': true, 'p': 10};
