I.u[7502] = {'n': 'Potion de Ralliement', 'nn': 'POTION DE RALLIEMENT', 't': 12, 'd': 'Cette potion permet de créer un point de ralliement, pour permettre aux aventuriers alignés de vous rejoindre, pour organiser une attaque ou une défense de village par exemple. Cette potion magique permet également de sauvegarder la position des personnes qui vous rejoignent, pour leur permettre de repartir rapidement jusqu\'à leur point de départ initial.', 'ep': 0, 'g': 21, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
