I.u[7508] = {'n': 'Rune de Signature', 'nn': 'RUNE DE SIGNATURE', 't': 50, 'd': 'Cette rune permet aux artisans les plus doués, de signer leurs créations. \n(à utiliser lors de la fabrication de l\'objet en plus des ingrédients)', 'ep': 18, 'g': 37, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[7509] = {'n': 'Première partie de la clef du labyrinthe du Dragon Cochon', 'nn': 'PREMIERE PARTIE DE LA CLEF DU LABYRINTHE DU DRAGON COCHON', 't': 84, 'd': 'Si ce groin ne vous dit rien, alors ne cherchez pas à en faire quelque chose, sous peine de recevoir une claque mortelle, surtout si vous êtes un peu étourdi.', 'ep': 13, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7510] = {'n': 'Deuxième partie de la clef du labyrinthe du Dragon Cochon', 'nn': 'DEUXIEME PARTIE DE LA CLEF DU LABYRINTHE DU DRAGON COCHON', 't': 84, 'd': 'Ce morceau est peut-être une partie de la clef qui ouvre le coffre au trésor dont vous avez toujours rêvé. A moins que ce ne soit la clef de votre tombeau.', 'ep': 13, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7511] = {'n': 'Clef du labyrinthe du Dragon Cochon', 'nn': 'CLEF DU LABYRINTHE DU DRAGON COCHON', 't': 84, 'd': 'Si vous espérez rencontrer beaucoup de grosses cochonnes avec cette clef vous vous fourrez le doigt dans l\'oeil. Elle ne vous permettra que d\'ouvrir le labyrinthe du Dragon Cochon. Attention, elle sera détruite après utilisation.', 'ep': 13, 'g': 3, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7513] = {'n': 'Sandales Titude', 'nn': 'SANDALES TITUDE', 't': 11, 'd': 'Titude était un modeste Enutrof cordonnier, plus petit encore qu\'un Xélor. On raconte qu\'il aurait confectionné ces sandales pour enfin réussir à embrasser sa dulcinée, une Eniripsa cul-de-jatte, mais que cela ne suffit point, et qu\'il dut se résoudre à ne pas l\'embrasser debout.', 'ep': 20, 'g': 67, 'l': 122, 'wd': true, 'fm': true, 'w': 10, 'p': 37800};
I.u[7514] = {'n': 'Bottes Harry', 'nn': 'BOTTES HARRY', 't': 11, 'd': 'Harry était un vieux sage, qui passait ses journées à pêcher sur les quais de Sufokia. Sa grande moustache lui donnait un air de Danous Kouaide, célèbre acteur d\'une troupe de théatre qui se produisait régulièrement à la taverne d\'Amakna en guise de prélude à d\'incroyables orgies à base de bière et de Bougnette.', 'ep': 20, 'g': 70, 'l': 123, 'wd': true, 'fm': true, 'w': 10, 'p': 37850};
I.u[7515] = {'n': 'Cape Itaineflam', 'nn': 'CAPE ITAINEFLAM', 't': 17, 'd': 'Cette cape ne vient pas de votre galaxie et pourtant,  elle semble assortie à la couleur de vos bas résille en laine de Boufton.', 'ep': 20, 'g': 92, 'l': 148, 'wd': true, 'fm': true, 'w': 10, 'p': 47925};
I.u[7516] = {'n': 'Coiffe du Bimd\'Oule', 'nn': 'COIFFE DU BIMD\'OULE', 't': 16, 'd': 'C\'est un vieil Enutrof, connu sous le nom de Dhy-Ah-Mhanhd, aigri et rongé par des siècles de malchance qui fit le premier, la découverte de cette terrible coiffe, cachée au fond d\'une alcôve dans les grottes de Bimd\'Oule. Plus tard, l\'Enutrof s\'exila loin des terres d\'Amakna pour tenter d\'échapper à l\'ennui et découvrir de nouveaux horizons. La légende raconte qu\'il revient sur ses terres natales une fois par siècle, pour se moquer de ses anciens amis, mais surtout par nostalgie.', 'ep': 20, 'g': 121, 'l': 110, 'wd': true, 'fm': true, 'w': 10, 'p': 31675};
I.u[7517] = {'n': 'Bière du Ripate', 'nn': 'BIERE DU RIPATE', 't': 37, 'd': 'Cette bière est si acide, que la chope dans laquelle elle est servie a une espérance de vie digne d\'un Moskito.', 'ep': 7, 'g': 4, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 5};
I.u[7518] = {'n': 'Fotome', 'nn': 'FOTOME', 't': 18, 'd': 'Cette surprenante créature vient de l\'au-delà et n\'est pas prête d\'y retourner, sauf si malencontreusement, vous deviez l\'y accompagner...', 'ep': 3, 'g': 13, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7519] = {'n': 'Dragoune Rose', 'nn': 'DRAGOUNE ROSE', 't': 18, 'd': 'Ce petit dragon a la peau aussi rose que les fesses d\'une femelle Bwork. Un bon moyen de vous faire fantasmer à moindre frais et sans risques, ou tout simplement de vous rappeler de bons souvenirs. Heureusement pour lui, ce dragon n\'est pas uniquement l\'objet de vos fantasmes, mais avant tout une créature très puissante et sage. Attention tout de même, sa voracité n\'a d\'égal que la perversité d\'un Chafer les soirs de pleine lune, et il ne se nourrit que d\'autres familiers.', 'ep': 3, 'g': 14, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7520] = {'n': 'Croum', 'nn': 'CROUM', 't': 18, 'd': 'Ancien soldat de plomb retraité, cette créature en métal est devenue vivante. Elle vous suivra partout et fera tout pour vous défendre au péril de sa vie, si vous prenez la peine de lui donner à manger régulièrement. Mais n\'espérez pas qu\'elle prenne pour autant les coups à votre place, elle ne remplacera donc pas les aventuriers débutants d\'Astrub.', 'ep': 3, 'g': 15, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7521] = {'n': 'Cadeau Fotome', 'nn': 'CADEAU FOTOME', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'PZ=1', 'u': true, 'p': 1};
I.u[7522] = {'n': 'Minimino', 'nn': 'MINIMINO', 't': 18, 'd': 'Ce bébé Minotoror apprivoisé et nettoyé peut être approché et caressé, sans risquer de perdre une main. Cependant, restez prudents, la nature reprend parfois ses droits et il se pourrait que l\'instinct destructeur de cette créature refasse surface à un moment où vous comptiez sur lui. Pour éviter les mauvaises surprises, élevez-le comme vos propres enfants, avec des coups de bâtons.', 'ep': 3, 'g': 21, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7523] = {'n': 'Chachate Rousse', 'nn': 'CHACHATE ROUSSE', 't': 18, 'd': 'Cette adorable créature rousse est capable de faire craquer tous les matous, même les plus blasés. \n(CE FAMILIER LÉGENDAIRE N\'A PAS BESOIN DE MANGER)', 'ep': 1, 'g': 40, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7524] = {'n': 'Chacha Tigré', 'nn': 'CHACHA TIGRE', 't': 18, 'd': 'Cette surprenante créature résulte du croisement entre un Chacha blanc et un Chacha noir. Elle ne mange que du poisson.', 'ep': 3, 'g': 41, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7525] = {'n': 'Cadeau Dragoune Rose', 'nn': 'CADEAU DRAGOUNE ROSE', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'PZ=1', 'u': true, 'p': 1};
I.u[7526] = {'n': 'Cadeau Croum', 'nn': 'CADEAU CROUM', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner. \n(ATTENTION, ce cadeau contient des objets très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez, pensez à vous délester de vos objets lourds ou à vous faire aider d\'un ami.)', 'ep': 1, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'PZ=1', 'u': true, 'p': 1};
