I.u[7552] = {'n': 'Capodindo', 'nn': 'CAPODINDO', 't': 17, 'd': 'Parfois, lorsqu\'un guerrier et une Dragodinde s\'unissent, il peut se produire de bien étranges événements. \nCette cape en est la preuve vivante, puisqu\'il s\'agit des ailes d\'une Dragodinde cousues sur une cape. La Dragodinde qui s\'est sacrifiée pour cette cape, l\'a offerte au célèbre ménestrel Lonne Jenone, le jour de leur union. Francisque Kabroule en aurait même fait une chanson.', 'ep': 2, 'g': 90, 'l': 50, 'wd': true, 'fm': true, 'w': 5, 's': 42, 'p': 25000};
I.u[7553] = {'n': 'Chapodindo', 'nn': 'CHAPODINDO', 't': 16, 'd': 'Vous qui avez toujours rêvé de ressembler à une Dragodinde, c\'est le moment ou jamais. Cependant, si vous voulez conserver votre bonne santé, nous vous conseillons d\'éviter de vous promener dans les rues d\'Amakna durant la période de Noël.', 'ep': 2, 'g': 118, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 's': 42, 'p': 15000};
I.u[7554] = {'n': 'Botodindo', 'nn': 'BOTODINDO', 't': 11, 'd': 'Vos copines vont vous envier ces bottes, car nul doute qu\'elles vous permettront d\'aller croquer les chocolats de l\'ambassadeur durant l\'une des ses merveilleuses soirées.', 'ep': 2, 'g': 65, 'l': 50, 'wd': true, 'fm': true, 'w': 3, 's': 42, 'p': 5000};
I.u[7555] = {'n': 'Anodindo', 'nn': 'ANODINDO', 't': 9, 'd': 'Grâce à cet anneau, vos amies diront de vous ' + '"' + 'Elle a vraiment tout d\'une dinde' + '"' + '.', 'ep': 2, 'g': 97, 'l': 50, 'wd': true, 'fm': true, 'w': 1, 's': 42, 'p': 1000};
I.u[7556] = {'n': 'Cadeau Dindo', 'nn': 'CADEAU DINDO', 't': 89, 'd': 'Ce paquet cadeau contient une partie d\'un célèbre déguisement. De quoi rendre folle de jalousie vos amies les Dragodindes.', 'ep': 1, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
