I.u[7581] = {'n': 'Sakananas', 'nn': 'SAKANANAS', 't': 81, 'd': 'Ce sac ressemble à s\'y méprendre à un ananas magique, peut-être parce qu\'il s\'agit d\'un ananas magique transformé en sac pour des raisons qui restent encore inconnues. Contrairement au sac Cawotte, le Sakananas n\'est pas vidé, vous ne pouvez donc rien y mettre, et il est en permanence très lourd, un peu comme votre ami Iop perdu depuis plusieurs mois dans la taverne d\'Astrub. Contrairement aux apparences, ce sac ne fait pas partie de la célèbre panoplie Ananas. On vous a une fois de plus menti.', 'ep': 1, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
