I.u[7703] = {'n': 'Vilain Petit Corbac', 'nn': 'VILAIN PETIT CORBAC', 't': 18, 'd': 'Ce sombre volatile est avant tout connu pour apprécier les cimetières et les aventuriers à la peau blanche. Il adore casser avec son gros bec, les ossements qu\'il trouve dans les tombes.', 'ep': 3, 'g': 18, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 's': 8, 'p': 1};
I.u[7704] = {'n': 'Ecureuil Chenapan', 'nn': 'ECUREUIL CHENAPAN', 't': 18, 'd': 'Cet Ecureuil prendra un malin plaisir à vous casser les noisettes, ce qui est tout de même assez pratique il faut le reconnaître, même si cela pourrait être parfois assez douloureux. Ce familier ne mange que des graines.', 'ep': 3, 'g': 16, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7705] = {'n': 'Léopardo', 'nn': 'LEOPARDO', 't': 18, 'd': 'Cette splendide créature est un lointain cousin des célèbres Lenalds de l\'île des Wabbits. Plus téméraire, mais également beaucoup plus indisciplinée, elle saura vous apporter son aide durant vos combats, mais également faire preuve d\'une fourberie sans nom si vous ne vous occupez pas assez bien d\'elle. Cette créature mange de la viande.', 'ep': 3, 'g': 27, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7706] = {'n': 'Bilby', 'nn': 'BILBY', 't': 18, 'd': 'Bilby, ou Bilbiblabalou de son vrai nom, est une petite gelée en quête d\'aventure. Particulièrement attachée à Vald, elle possède des pouvoirs remarquables (du moins, proportionnellement à sa taille). Ce familier ne mange que des fleurs.', 'ep': 3, 'g': 43, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7707] = {'n': 'Marcassin', 'nn': 'MARCASSIN', 't': 18, 'd': 'Ce petit cochon sauvage dispose d\'un groin d\'une taille démesurée, adapté à la recherche active des gros glands. Par chance, il semble vous avoir trouvé assez facilement. Ce dévoreur d\'âmes se nourrit des restes de Porkass, cochons, et sangliers.', 'ep': 1, 'g': 20, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7708] = {'n': 'Pioute bleu', 'nn': 'PIOUTE BLEU', 't': 18, 'd': 'Ce petit Pioute n\'est pas comme les autres Pious, il suffit de regarder sa couleur pour s\'en apercevoir. En revanche, il partage avec les autres Pious, un goût prononcé pour picorer les postérieurs. Il paraît que certains aiment... Ce familier ne mange que des graines.', 'ep': 1, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
