I.u[7714] = {'n': 'Atouin', 'nn': 'ATOUIN', 't': 18, 'd': 'On raconte que cette tortue aurait été élevée par un Maître en Arts Martiaux, à l\'apparence d\'un Rat d\'Egoutant. Si vous la nourrissez avec du poisson, elle deviendra gentille et vous aidera à soigner les aventuriers blessés. Si vous lui donnez de la viande, elle deviendra plus agressive et vous aidera à combattre vos adversaires.', 'ep': 2, 'g': 17, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 's': 9, 'p': 1};
