I.u[7879] = {'n': 'L\'avènement D\'Hyrkul', 'nn': 'L\'AVENEMENT D\'HYRKUL', 't': 25, 'd': 'Les Annales Colossales, Immorales et pas Banales de Domen font froid dans le dos. A lire en respectant les doses prescrites. Effets secondaires : sueurs froides et incontinence nocturne.', 'ep': 16, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 10};
I.u[7880] = {'n': 'Amulette du Boufcoul', 'nn': 'AMULETTE DU BOUFCOUL', 't': 1, 'd': 'Cette amulette était jadis portée par tous les aventuriers qui préféraient répandre l\'amour plutôt que de faire la guerre. Chacun ses goûts.', 'ep': 20, 'g': 93, 'l': 20, 'wd': true, 'fm': true, 'w': 5, 's': 43, 'p': 1300};
I.u[7881] = {'n': 'Anneau du Boufcoul', 'nn': 'ANNEAU DU BOUFCOUL', 't': 9, 'd': 'Cet anneau vous permettra de faire encore plus mal, lorsque vous donnerez des fessées bien méritées à vos enfants.', 'ep': 20, 'g': 98, 'l': 38, 'wd': true, 'fm': true, 'w': 5, 's': 43, 'p': 4000};
I.u[7882] = {'n': 'Marteau du Boufcoul', 'nn': 'MARTEAU DU BOUFCOUL', 't': 7, 'd': 'Ce marteau est idéal pour imprimer votre pacifisme sur le crâne de vos adversaires.', 'ep': 20, 'g': 54, 'l': 41, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'e': [5, 5, 1, 1, 40, 40, false, false], 's': 43, 'p': 4520};
I.u[7883] = {'n': 'Bottes du Boufcoul', 'nn': 'BOTTES DU BOUFCOUL', 't': 11, 'd': 'Rembourrées avec de la laine de Boufcoul, ces bottes ont tout pour plaire. Légères, chaudes pendant les saisons froides, et aérées pendant les saisons chaudes, elles sauront satisfaire le plus blasé des aventuriers.', 'ep': 20, 'g': 66, 'l': 38, 'wd': true, 'fm': true, 'w': 15, 's': 43, 'p': 3925};
I.u[7884] = {'n': 'Cape du Boufcoul', 'nn': 'CAPE DU BOUFCOUL', 't': 17, 'd': 'Si vous aimez prendre la vie du bon côté, cette cape est faite pour vous. En effet, elle est si épaisse et confortable qu\'elle peut servir de lit improvisé si la fatigue commence à vous gagner. Son odeur de Kaliptus fumé lui permet même de repousser les insectes, les créatures indésirables ou encore les belles-mères.', 'ep': 20, 'g': 93, 'l': 55, 'wd': true, 'fm': true, 'w': 15, 's': 43, 'p': 8030};
I.u[7885] = {'n': 'Ceinture du Boufcoul', 'nn': 'CEINTURE DU BOUFCOUL', 't': 10, 'd': 'Portée autour des hanches, cette ceinture vous permettra de passer pour un aventurier pacifiste et ainsi de mieux surprendre vos adversaires en leur assenant un coup d\'épée dans le dos.', 'ep': 20, 'g': 84, 'l': 37, 'wd': true, 'fm': true, 'w': 10, 's': 43, 'p': 3800};
I.u[7886] = {'n': 'Coiffe du Boufcoul', 'nn': 'COIFFE DU BOUFCOUL', 't': 16, 'd': 'Avec cette coiffe sur le crâne, vous n\'aurez pas l\'air plus astucieux qu\'avant, c\'est une certitude. En revanche, vous aurez l\'air beaucoup plus ' + '"' + 'cool' + '"' + ', et finalement, c\'est tout ce qui compte.', 'ep': 20, 'g': 119, 'l': 47, 'wd': true, 'fm': true, 'w': 15, 's': 43, 'p': 6000};
I.u[7887] = {'n': 'Coiffe du Koulosse', 'nn': 'COIFFE DU KOULOSSE', 't': 16, 'd': 'Cette coiffe a appartenu au célèbre Koulosse, réputé pour ses pieds d\'argile et sa bonne humeur légendaire.', 'ep': 20, 'g': 122, 'l': 82, 'wd': true, 'fm': true, 'w': 10, 's': 44, 'p': 18375};
I.u[7888] = {'n': 'Sac du Koulosse', 'nn': 'SAC DU KOULOSSE', 't': 81, 'd': 'Ce sac permet au Koulosse de garder au frais ses feuilles de Kaliptus ou d\'étouffer les Koalaks un peu trop entreprenants.', 'ep': 20, 'g': 2, 'l': 69, 'wd': false, 'fm': true, 'w': 10, 's': 44, 'p': 12278};
I.u[7889] = {'n': 'Bottes du Koulosse', 'nn': 'BOTTES DU KOULOSSE', 't': 11, 'd': 'Ces bottes ont appartenu au Koulosse, et à défaut de se voir, cela peut se sentir. Ces bottes sont si confortables, qu\'elles vous feront presque oublier votre misérable vie.', 'ep': 20, 'g': 69, 'l': 73, 'wd': true, 'fm': true, 'w': 10, 's': 44, 'p': 13775};
I.u[7890] = {'n': 'Bâton du Koulosse', 'nn': 'BATON DU KOULOSSE', 't': 4, 'd': 'Ce bâton est en réalité un os vidé, d\'un des ancêtres du Koulosse. Percé aux deux extrémités, il peut servir de pipe à Kaliptus, mais aussi de bâton de berger. Rien n\'arrête le progrès.', 'ep': 20, 'g': 62, 'l': 75, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [10, 4, 1, 1, 20, 50, false, false], 's': 44, 'p': 14675};
I.u[7891] = {'n': 'Mini Wa', 'nn': 'MINI WA', 't': 18, 'd': 'Ce petit Wabbit, est en réalité un fils caché du tristement célèbre Wa Wabbit. Peut-être qu\'il montera un jour à son tour sur le trône.', 'ep': 3, 'g': 28, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7892] = {'n': 'Willy le Relou', 'nn': 'WILLY LE RELOU', 't': 18, 'd': 'Willy le Relou est vraiment une méchante créature. Son enfance a semble-t-il été particulièrement difficile. Il vous accompagnera partout et fera fuir vos amis.', 'ep': 3, 'g': 29, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[7893] = {'n': 'Fantôme de Mini Wa', 'nn': 'FANTOME DE MINI WA', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 18, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[7894] = {'n': 'Fantôme de Willy le Relou', 'nn': 'FANTOME DE WILLY LE RELOU', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 17, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[7895] = {'n': 'Certificat de Mise en Chanil : Mini Wa', 'nn': 'CERTIFICAT DE MISE EN CHANIL : MINI WA', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Mini Wa que vous avez placé au chanil.', 'ep': 3, 'g': 34, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[7896] = {'n': 'Certificat de Mise en Chanil : Willy le Relou', 'nn': 'CERTIFICAT DE MISE EN CHANIL : WILLY LE RELOU', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Willy le Relou que vous avez placé au chanil.', 'ep': 3, 'g': 29, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[7897] = {'n': 'Cadeau Mini Wa', 'nn': 'CADEAU MINI WA', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner. \n(ATTENTION, ce cadeau contient des objets très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez, pensez à vous délester de vos objets lourds ou a vous faire aider d\'un ami.)', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'u': true, 'p': 1};
I.u[7898] = {'n': 'Cadeau Willy le Relou', 'nn': 'CADEAU WILLY LE RELOU', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, un livre vous expliquant comment l\'élever, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner. \n(ATTENTION, ce cadeau contient des objets très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez, pensez à vous délester de vos objets lourds ou a vous faire aider d\'un ami.)', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'u': true, 'p': 1};
I.u[7899] = {'n': 'Le Mini Wa : Bien l\'élever', 'nn': 'LE MINI WA : BIEN L\'ELEVER', 't': 25, 'd': 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever un Mini Wa.', 'ep': 1, 'g': 10, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 200};
I.u[7900] = {'n': 'Willy le Relou : Bien l\'élever', 'nn': 'WILLY LE RELOU : BIEN L\'ELEVER', 't': 25, 'd': 'Ce livre écrit par Oshimo Li\'kross Babine explique comment élever un Willy le Relou.', 'ep': 1, 'g': 10, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 200};
I.u[7902] = {'n': 'Ceinture d\'une Femme en Or', 'nn': 'CEINTURE D\'UNE FEMME EN OR', 't': 10, 'd': 'Une vieille légende extraite du fameux grimoire ' + '"' + 'Toute la vérité sur les femmes' + '"' + ', raconte que cette ceinture aurait appartenu à une femme en or, plus intéressée par la richesse que par le pouvoir. Dans la version non censurée du grimoire, on y apprend également qu\'elle était avant tout connue pour son goût prononcé pour les plaisanteries salaces. Elle n\'était finalement pas si différente des autres femmes...', 'ep': 2, 'g': 86, 'l': 71, 'wd': true, 'fm': true, 'w': 5, 'p': 13300};
I.u[7903] = {'n': 'Feuille de Kaliptus', 'nn': 'FEUILLE DE KALIPTUS', 't': 36, 'd': 'Délicatement insérées au fond des narines, ces feuilles déboucheront n\'importe quel nez. Certaines légendes tribales racontent que cette technique fonctionnerait avec d\'autres orifices.', 'ep': 20, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7904] = {'n': 'Fleur de Kaliptus', 'nn': 'FLEUR DE KALIPTUS', 't': 35, 'd': 'Une fois brûlée, cette fleur dégage une fumée épaisse aux vertus hallucinogènes. Mâchée, elle a tendance à rendre impuissant. Consommée en infusion, elle peut engendrer d\'importants effets laxatifs. La meilleure solution reste de ne jamais y toucher.', 'ep': 14, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7905] = {'n': 'Laine du Boufcoul', 'nn': 'LAINE DU BOUFCOUL', 't': 57, 'd': 'Cette laine ressemble à s\'y méprendre à de la laine de Bouftou et pourtant il n\'en n\'est rien, puisqu\'elle ne sent pas mauvais.', 'ep': 20, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7906] = {'n': 'Corne du Boufcoul', 'nn': 'CORNE DU BOUFCOUL', 't': 47, 'd': 'Une vieille légende explique que la poudre extraite de ces cornes aurait des vertus aphrodisiaques. Cette même légende précise qu\'elle peut également être source d\'effets secondaires assez surprenants. Une raison de plus pour essayer.', 'ep': 20, 'g': 9, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7907] = {'n': 'Cuir du Boufcoul', 'nn': 'CUIR DU BOUFCOUL', 't': 56, 'd': 'Ce cuir multicolore permet de confectionner des sous-vêtement en cuir multicolores. De quoi rendre jaloux le plus blasé les Chafers.', 'ep': 20, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7908] = {'n': 'Clef du Donjon du Koulosse', 'nn': 'CLEF DU DONJON DU KOULOSSE', 't': 84, 'd': 'Cette clef en os vous permettra d\'accéder au donjon du Koulosse sans y avoir été invité au préalable.', 'ep': 13, 'g': 5, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[7911] = {'n': 'Koalak Sanguin', 'nn': 'KOALAK SANGUIN', 't': 18, 'd': 'Ce petit Koalak a l\'air inoffensif, mais il cache bien son jeu. Martyrisé pendant sa tendre enfance, il a reçu de nombreux boomerangs dans les dents ou même dans le derrière. Il cultive depuis ce temps-là une aversion totale pour les boomerangs, et les dévore sans même les mâcher.', 'ep': 3, 'g': 30, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 's': 46, 'p': 1};
I.u[7913] = {'n': 'Le Diviseur (MJ)', 'nn': 'LE DIVISEUR (MJ)', 't': 9, 'd': 'Cet objet mysterieux, oublié de tous, appartenait à un grand mage... Il permettait parait-il de parler avec certains animaux...', 'ep': 1, 'g': 22, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[7917] = {'n': 'Cadeau de Compensation', 'nn': 'CADEAU DE COMPENSATION', 't': 89, 'd': 'Afin de s\'excuser des récents problèmes que vous avez rencontrés, l\'équipe d\'Ankama vous offre ce paquet cadeau qui comprend : \n- 5 Bonbons de Compensation du Sage \n- 5 Bonbons de Compensation du Chanceux \n- 10 Bonbons de Compensation Energétiques \n- 10 Poudres d\'Eniripsas', 'ep': 1, 'g': 32, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO!7801&PO!7800', 'u': true, 'p': 1};
I.u[7918] = {'n': 'Clef du Donjon des Tofus', 'nn': 'CLEF DU DONJON DES TOFUS', 't': 84, 'd': 'Cette clef confectionnée à partir d\'une plume de Tofu, est capable de chatouiller l\'intérieur de certaines serrures... Accessoirement, elle vous permettra d\'accéder au Tofulailler de Farle Ingalsse.', 'ep': 1, 'g': 6, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7919] = {'n': 'Jeton du Maître de Jeu', 'nn': 'JETON DU MAITRE DE JEU', 't': 15, 'd': 'Ce splendide jeton doit sûrement pouvoir être échangé à la Foire du Trool contre de précieux cadeaux.', 'ep': 1, 'g': 737, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7920] = {'n': 'Baguette du Tournoi (MJ)', 'nn': 'BAGUETTE DU TOURNOI (MJ)', 't': 3, 'd': 'Cette modeste baguette permet aux Maîtres de Jeu de téléporter des aventuriers dans une zone réservée aux tournois.', 'ep': 1, 'g': 8, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'e': [5, 6, 1, 1, 50, 50, false, false], 'u': true, 'p': 100};
I.u[7921] = {'n': 'Couronne du Tofu Royal', 'nn': 'COURONNE DU TOFU ROYAL', 't': 16, 'd': 'Cette couronne est assez difficile à attraper, elle file entre les doigts. Aucun doute, c\'est bien la Couronne du Tofu Royal. En revanche, elle ne semble pas du tout pouvoir s\'assortir avec votre petite tête, ne parlons même pas de celle d\'un Iop !', 'ep': 13, 'g': 154, 'l': 128, 'wd': true, 'fm': true, 'w': 10, 'p': 42625};
I.u[7922] = {'n': 'Peluche du Dopeul Sacrieur', 'nn': 'PELUCHE DU DOPEUL SACRIEUR', 't': 61, 'd': 'Cette peluche est faite pour les jeunes Sacrieurs, elle est parfaite pour éponger leur sang et se nettoie facilement à n\'importe quelle température.', 'ep': 0, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[7923] = {'n': 'Peluche du Dopeul Pandawa', 'nn': 'PELUCHE DU DOPEUL PANDAWA', 't': 61, 'd': 'Cette peluche sent l\'alcool et le poil de Pandawa mouillé, comme maman.', 'ep': 1, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[7924] = {'n': 'Clef du Labyrinthe du Minotoror', 'nn': 'CLEF DU LABYRINTHE DU MINOTOROR', 't': 84, 'd': 'Cette magnifique clef vous permettra de rentrer dans le Labyrinthe du Minotoror, mais pas d\'en sortir...', 'ep': 13, 'g': 7, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7925] = {'n': 'Bois de Kaliptus', 'nn': 'BOIS DE KALIPTUS', 't': 38, 'd': 'Ce bois parfumé permet de construire des maisons qui sentent bon, même si leurs propriétaires sentent mauvais. Malheureusement, ce bois n\'est pas assez souple pour la confection des sous-vêtements.', 'ep': 20, 'g': 1, 'l': 50, 'wd': true, 'fm': true, 'w': 2, 'p': 0};
I.u[7926] = {'n': 'Clef du Donjon du Maître Corbac', 'nn': 'CLEF DU DONJON DU MAITRE CORBAC', 't': 84, 'd': 'Cette clef vous permettra de rencontrer le Maître Corbac en personne. Ce dernier vous invitera sûrement à partager un morceau de fromage en sa compagnie.', 'ep': 1, 'g': 8, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7927] = {'n': 'Clef du Donjon des Craqueleurs', 'nn': 'CLEF DU DONJON DES CRAQUELEURS', 't': 84, 'd': 'Cette clef est presque incassable, mais très usée, elle a ouvert de nombreuses portes. Elle semble avoir été confectionnée à partir des parties intimes d\'un Craqueleur. Tout simplement effrayant.', 'ep': 1, 'g': 9, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[7929] = {'n': 'Manuel du Mercenaire d\'Astrub', 'nn': 'MANUEL DU MERCENAIRE D\'ASTRUB', 't': 25, 'd': 'Le Manuel du Mercenaire d\'Astrub, écrit par le fameux Badufron, chef mercenaire d\'Astrub est le livre de chevet de tous ceux qui aiment respecter la loi ou la contourner.', 'ep': 1, 'g': 10, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 5};
I.u[7930] = {'n': 'Se faire des Amis et les garder', 'nn': 'SE FAIRE DES AMIS ET LES GARDER', 't': 25, 'd': 'Conseils et astuces pour se faire de bons et loyaux amis par Acidrik Fenlapanse', 'ep': 1, 'g': 10, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[7931] = {'n': 'Le temps des dragons - fragments retrouvés III', 'nn': 'LE TEMPS DES DRAGONS - FRAGMENTS RETROUVES III', 't': 25, 'd': 'Tome III des Fragments de l\'Histoire du Monde, retrouvés par l\'érudit Acidrik Fenlapanse, et réécrits par lui.', 'ep': 1, 'g': 19, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 50};
I.u[7932] = {'n': 'Parchemin Miss Astrub', 'nn': 'PARCHEMIN MISS ASTRUB', 't': 25, 'd': 'La plantureuse Miss Astrub de cette année nous dévoile les charmes avec lesquels elle a séduit le jury.', 'ep': 1, 'g': 9, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 100};
