I.u[8211] = {'n': 'Walk', 'nn': 'WALK', 't': 18, 'd': 'De toute évidence, cette créature s\'est échappée d\'un zoo ou d\'une île lointaine. Elle est connue pour améliorer les dommages de son maître lors des combats. Sa plus grande particularité, (qu\'elle partage parfois avec son maître) est d\'avoir une haleine de poisson moisi. Nous vous recommandons de lui clouer le bec, même si le marteau et les clous sont à commander séparément. Attention, cette petite créature est très exigeante, elle ne mange que du poisson.', 'ep': 3, 'g': 38, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
