I.u[8376] = {'n': 'Pierre d\'Aerotrugobur le Malveillant', 'nn': 'PIERRE D\'AEROTRUGOBUR LE MALVEILLANT', 't': 51, 'd': 'Cette pierre, si elle est combinée avec les trois autres manquantes, devrait libérer une onde magique assez puissante pour activer et ouvrir une porte magique.', 'ep': 10, 'g': 462, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8377] = {'n': 'Rune de Bricoleur', 'nn': 'RUNE DE BRICOLEUR', 't': 88, 'd': 'Cette pierre magique permet aux Bricoleurs de donner leur position aux clients.', 'ep': 18, 'g': 12, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8378] = {'n': 'Fragment Magique', 'nn': 'FRAGMENT MAGIQUE', 't': 88, 'd': 'Ce fragment magique, contient une partie de la magie autrefois contenue dans un objet. Avec un peu de chance, vous devriez pouvoir récupérer quelques runes magiques.', 'ep': 1, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8379] = {'n': 'Rune Vie', 'nn': 'RUNE VIE', 't': 78, 'd': 'Cette petite rune a le pouvoir de rendre plus résistant.', 'ep': 1, 'g': 59, 'l': 20, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8380] = {'n': 'Etoffe de Péki', 'nn': 'ETOFFE DE PEKI', 't': 55, 'd': 'Cette étoffe recouvrait les fesses poilues du Péki avant que vous ne décidiez de le caresser à rebrousse-poils.', 'ep': 18, 'g': 721, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8381] = {'n': 'Queue Magique du Péki', 'nn': 'QUEUE MAGIQUE DU PEKI', 't': 65, 'd': 'Cette queue est si magique, qu\'elle frétille encore, même après avoir été coupée, séchée, et empaillée. En cherchant bien, vous pourrez lui trouver une utilité autre que décorative.', 'ep': 18, 'g': 751, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8383] = {'n': 'Peau de Moon', 'nn': 'PEAU DE MOON', 't': 59, 'd': 'Privé de sa petite peau douce, le pauvre petit Moon s\'est retrouvé bien au dépourvu et à préféré fuir lâchement dans la jungle en hurlant de douleur. Une scène réjouissante que vous ne manquerez pas de raconter à vos enfants le soir, pour les aider à trouver le sommeil.', 'ep': 12, 'g': 613, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8384] = {'n': 'Etoffe Magique de Moon', 'nn': 'ETOFFE MAGIQUE DE MOON', 't': 55, 'd': 'Cette étoffe ressemble à une étoffe magique, et vous avez du mal à l\'accepter. Pourtant il faudra bien que vous reconnaissiez un jour ou l\'autre, que vous êtes trop stupide pour déterminer vous-même ce qui est magique ou non. Ne suivez pas votre instinct de pourfendeur d\'Astrubiens, faites confiance aux descriptions.', 'ep': 12, 'g': 722, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8385] = {'n': 'Peau de Shin Larve', 'nn': 'PEAU DE SHIN LARVE', 't': 59, 'd': 'Cette peau de Shin Larve est encore plus gluante et collante que vous ne l\'imaginiez. Elle vous rappelle la dernière princesse que vous avez délivrée.', 'ep': 5, 'g': 614, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8386] = {'n': 'Dent de Shin Larve', 'nn': 'DENT DE SHIN LARVE', 't': 47, 'd': 'Personne n\'aurait pu croire qu\'une Shin Larve avait la bouche remplie de dents. C\'est peut-être parce que la Shin Larve ne dispose que d\'une seule dent.', 'ep': 5, 'g': 654, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8387] = {'n': 'Plume Vibrante du Tofu Royal', 'nn': 'PLUME VIBRANTE DU TOFU ROYAL', 't': 53, 'd': 'Plus royale que la plume du Tofu Royal, plus vibrante que la plume d\'un Kirboule Vibreur des mines de Kruup, cette plume saura chatouiller qui vous voudrez, et où vous voudrez. Il est expliqué sur la notice, que son entretien est relativement simple.', 'ep': 3, 'g': 645, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8388] = {'n': 'Peau de Bworkette', 'nn': 'PEAU DE BWORKETTE', 't': 59, 'd': 'La Bworkette vous a laissé lui arracher un morceau de peau en échange de votre clémence. Mais elle a oublié de vous dire qu\'elle a prévenu son grand frère le Bworker, qui se fera un plaisir de vous arracher la votre.', 'ep': 4, 'g': 615, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8389] = {'n': 'Poil de Bworkette', 'nn': 'POIL DE BWORKETTE', 't': 54, 'd': 'La Bworkette a la peau lisse, sauf sous les aisselles. Il faut bien que les gâteaux qu\'elle roule sous ses aisselles soient assaisonnés de temps en temps.', 'ep': 4, 'g': 665, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8390] = {'n': 'Peau de Cochon de Farle', 'nn': 'PEAU DE COCHON DE FARLE', 't': 59, 'd': 'Farle était le plus grand éleveur de cochons et peut-être même de cochonnes, d\'après les éleveurs qui jalousaient Shika. Ce qui est certain, c\'est qu\'il est à l\'origine des Cochons de Farle, à qui il a donné son nom, car ils les avaient créés à son image.', 'ep': 15, 'g': 616, 'l': 50, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8391] = {'n': 'Peau de Don Dorgan', 'nn': 'PEAU DE DON DORGAN', 't': 59, 'd': 'Le Don Dorgan a été une fois de plus très généreux avec vous, malgré son terrible caractère. Il vous a fait don de sa peau avant de partir en grognant comme un gros Porkass. Quel culot !', 'ep': 15, 'g': 617, 'l': 60, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8392] = {'n': 'Peau de Don Duss Ang', 'nn': 'PEAU DE DON DUSS ANG', 't': 59, 'd': 'Le Don Duss Ang que vous avez dû peler avec une râpe à fromage pour obtenir cette peau très fine, s\'en souviendra toute sa vie. On peut supposer qu\'il vous en voudra longtemps. Ne comptez plus sur lui pour vous indiquer le bon chemin la prochaine fois que vous vous égarerez dans son labyrinthe.', 'ep': 15, 'g': 618, 'l': 60, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8393] = {'n': 'Poil de Dragon Cochon', 'nn': 'POIL DE DRAGON COCHON', 't': 54, 'd': 'Vous avez beau chercher, vous n\'arrivez pas à trouver la partie du corps du Dragon Cochon sur laquelle ce poil était planté. Cherchez-mieux, l\'anatomie du Dragon Cochon semble révéler de nombreuses surprises...', 'ep': 2, 'g': 666, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8394] = {'n': 'Méga Pierre du Craqueleur Légendaire', 'nn': 'MEGA PIERRE DU CRAQUELEUR LEGENDAIRE', 't': 51, 'd': 'Cette énorme pierre ressemble à une pierre du Craqueleur Légendaire, et pourtant il n\'en n\'est rien, c\'est bien plus encore.', 'ep': 5, 'g': 464, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8396] = {'n': 'Mojo du Mulou', 'nn': 'MOJO DU MULOU', 't': 15, 'd': 'Cette petite fiole contient toute la puissance virile du Mulou. Attention, son contenu n\'est pas comestible.', 'ep': 1, 'g': 752, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8397] = {'n': 'Poil du Wa Wabbit', 'nn': 'POIL DU WA WABBIT', 't': 54, 'd': 'Le Wa Wabbit est en règle générale assez avare et rechigne à partager ses poils. Exceptionnellement, pour récompenser votre bravoure (ou acheter votre clémence), il a décidé de vous faire don d\'une partie de son corps. Touchant.', 'ep': 2, 'g': 667, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8398] = {'n': 'Etoffe du Wa Wabbit', 'nn': 'ETOFFE DU WA WABBIT', 't': 55, 'd': 'Personne ne sait réellement d\'où le Wa Wabbit a sorti cette étoffe, et il semblerait que personne ne cherche à savoir également. A la fois inquiétante et troublante, l\'origine de cette étoffe reste un des plus grands mystères de tout Amakna.', 'ep': 2, 'g': 723, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8399] = {'n': 'Poil de Maître Pandore', 'nn': 'POIL DE MAITRE PANDORE', 't': 54, 'd': 'Une fois de plus le Maître Pandore a voulu faire le malin, et s\'est pris une bonne leçon qu\'il n\'oubliera pas de si tôt. Il aurait mieux fait de rester au fond de sa boîte.', 'ep': 18, 'g': 668, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8400] = {'n': 'Etoffe de Maître Pandore', 'nn': 'ETOFFE DE MAITRE PANDORE', 't': 55, 'd': 'Protégeant tantôt sa nuque, tantôt son arrière train, cette étoffe a sauvé la vie du Maître Pandore plus d\'une fois. Mais pas cette fois-ci.', 'ep': 18, 'g': 724, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8401] = {'n': 'Peau de Maître Pandore', 'nn': 'PEAU DE MAITRE PANDORE', 't': 59, 'd': 'Usée par les attaques magiques, desséchée par le vent de l\'île de Pandala, cette peau est désormais d\'une piètre qualité, et pourtant vous semblez vous y attacher, comme si vous cherchiez à garder un précieux souvenir de ce brave Maître Pandore, qui a tout de même failli vous ôter la vie plusieurs fois sans aucun remord. C\'est dans ce genre de situations que l\'on reconnaît un véritable monstre d\'une petite nature.', 'ep': 18, 'g': 619, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8402] = {'n': 'Pierre du Koulosse', 'nn': 'PIERRE DU KOULOSSE', 't': 51, 'd': 'Le Koulosse a beau être généreux, il ne vous a pas donné sa grosse pierre de gaieté de cœur, et on peut le comprendre lorsque l\'on sait ce que vous allez en faire.', 'ep': 20, 'g': 465, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8403] = {'n': 'Tresse du Koulosse', 'nn': 'TRESSE DU KOULOSSE', 't': 15, 'd': 'Cette énorme tresse a été confectionnée par le Koulosse en personne il y a plusieurs centaines d\'années. Elle est devenue avec le temps, presque aussi rigide qu\'un bloc de pierre. Elle est cependant encore gorgée d\'un liquide gluant et nauséabond qui attire de temps en temps les Moskitos. Le plus surprenant dans tout cela c\'est que cette tresse allait très bien au Koulosse. Comme un gros Ploukosse, vous avez eu l\'idée saugrenue de la lui voler.', 'ep': 20, 'g': 753, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8404] = {'n': 'Peau de Skeunk', 'nn': 'PEAU DE SKEUNK', 't': 59, 'd': 'Ce morceau de peau semble provenir des talons de Skeunk, ce qui explique sa couleur jaunâtre du plus bel effet. A défaut de vous confectionner des vêtements à la mode avec cette vieille peau, vous pourrez vous confectionner des vêtements d\'une autre époque, et adopter une apparence ' + '"' + 'rétro' + '"' + ' qui fera fureur auprès des plus jeunes.', 'ep': 20, 'g': 620, 'l': 400, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8405] = {'n': 'Poil de Skeunk', 'nn': 'POIL DE SKEUNK', 't': 54, 'd': 'Qui à part vous, aurait pu croire que Skeunk ne s\'épilait pas entièrement le corps depuis sa tendre enfance ?', 'ep': 20, 'g': 669, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8406] = {'n': 'Laine du Minotot', 'nn': 'LAINE DU MINOTOT', 't': 57, 'd': 'Cette laine a la particularité d\'être très fine, et permet au Minotot de ne pas avoir de bouclettes le long du corps. Personne ne sait à quoi cela lui sert, vous devriez peut-être essayer de vous confectionner des implants pilaires avec cette laine, vous pourrez ainsi arborer une imposante toison de poils bruns sur votre torse. Même les rêves d\'enfance peuvent se réaliser.', 'ep': 21, 'g': 656, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8407] = {'n': 'Cuir du Minotot', 'nn': 'CUIR DU MINOTOT', 't': 56, 'd': 'A peine plus rare que le cuir de Bouftou, ce cuir est idéal pour les créations qui nécessitent des coutures souples, comme les masques en cuir par exemple.', 'ep': 21, 'g': 658, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8408] = {'n': 'Sabot du Minotot', 'nn': 'SABOT DU MINOTOT', 't': 47, 'd': 'Ce sabot a foulé énormément d\'aventuriers, mais aussi de grosses bouses égarées dans le labyrinthe du Minotoror. A la décharge du Minotot, il faut reconnaître qu\'il n\'est parfois pas évident de faire la différence au premier coup d\'oeil.', 'ep': 21, 'g': 754, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8409] = {'n': 'Corne du Minotot', 'nn': 'CORNE DU MINOTOT', 't': 47, 'd': 'Cette corne ressemble de loin à une corne de Bouftou géante et extrêmement magique. Fait surprenant, de près, elle ressemble à une corne de Minotot.', 'ep': 21, 'g': 655, 'l': 400, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8410] = {'n': 'Fémur du Minotot', 'nn': 'FEMUR DU MINOTOT', 't': 47, 'd': 'Cet os imposant a réussi à supporter pendant plusieurs siècles, la surcharge pondérale du Minotot. Un exploit qui méritait d\'être signalé.', 'ep': 21, 'g': 656, 'l': 400, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8411] = {'n': 'Amulette du Mominotor', 'nn': 'AMULETTE DU MOMINOTOR', 't': 1, 'd': 'Cette amulette maudite recouverte de bandelettes vous permettra peut-être de survivre à la malédiction du labyrinthe du Minotoror. Mais rien n\'est moins sûr, peut-être n\'est-ce qu\'un bibelot destiné à épater les touristes.', 'ep': 0, 'g': 114, 'l': 111, 'wd': false, 'fm': true, 'w': 5, 's': 59, 'p': 31300};
I.u[8412] = {'n': 'Anneau du Mominotor', 'nn': 'ANNEAU DU MOMINOTOR', 't': 9, 'd': 'Cet anneau confectionné à partir de bandelettes de Mominotor enroulées sur elles-mêmes, sent plutôt mauvais,  et est assez laid, mais fera un très bon pansement lorsque vous vous coincerez un doigt dans une des portes du labyrinthe du Minotoror.', 'ep': 0, 'g': 119, 'l': 111, 'wd': false, 'fm': true, 'w': 10, 's': 59, 'p': 31525};
I.u[8413] = {'n': 'Marteau du Mominotor', 'nn': 'MARTEAU DU MOMINOTOR', 't': 7, 'd': 'Le bloc de pierre à l\'extrémité de ce marteau, est enroulé dans des bandelettes du Mominotor afin d\'absorber les fluides qui s\'échapperont des créatures que vous écraserez, ou tout simplement leur faire moins mal, et ne pas les tuer trop rapidement.', 'ep': 0, 'g': 60, 'l': 112, 'wd': false, 'fm': true, 'w': 10, 'an': 15, 'tw': true, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CC>100&CI>200&CW>150', 's': 59, 'p': 100};
I.u[8414] = {'n': 'Dagues du Dragoeuf', 'nn': 'DAGUES DU DRAGOEUF', 't': 5, 'd': 'Ces dagues sont idéales pour découper le haut d\'un oeuf de Dragoeuf cuit à la coque. Elles sont aussi très légères, ce qui permet de courir vite lorsque le reste de la communauté des Dragoeufs s\'en aperçoit.', 'ep': 20, 'g': 58, 'l': 128, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 30, false, true], 'c': 'CS>150&CI>150&CA>100', 'p': 39854};
I.u[8415] = {'n': 'Bottes du Mominotor', 'nn': 'BOTTES DU MOMINOTOR', 't': 11, 'd': 'Rembourrées et décorées avec des bandelettes de Mominotor, ces bottes sont à la fois très confortables et très chaudes. Elles vous rappellent peut-être quelqu\'un.', 'ep': 0, 'g': 92, 'l': 110, 'wd': false, 'fm': true, 'w': 10, 's': 59, 'p': 31255};
I.u[8416] = {'n': 'Cape du Mominotor', 'nn': 'CAPE DU MOMINOTOR', 't': 17, 'd': 'Confectionnée à partir de bandelettes du Mominotor tressées entre elles, cette cape vous donnera un style tout droit sorti d\'outre-tombe. Vos ennemis risquent de crever de jalousie.', 'ep': 0, 'g': 122, 'l': 111, 'wd': false, 'fm': true, 'w': 10, 's': 59, 'p': 31780};
I.u[8417] = {'n': 'Pelle à Gâteau', 'nn': 'PELLE A GATEAU', 't': 8, 'd': 'Cette petite pelle a été offerte a un jeune Enutrof, il y est resté si attaché qu\'il l\'utilisait encore juste avant sa mort.', 'ep': 20, 'g': 43, 'l': 131, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 30, false, true], 'c': 'CC>250&CA>100', 'p': 42514};
I.u[8418] = {'n': 'Ceinture du Mominotor', 'nn': 'CEINTURE DU MOMINOTOR', 't': 10, 'd': 'Cette grosse bandelette de Mominotor possède une valeur ajoutée extraordinaire, dont l\'origine reste cependant méconnue. Mais qu\'importe, elle se vendra cher, et sa malédiction accélèrera la putréfaction des hanches des amis à qui vous offrirez cette ceinture, ce qui est il faut bien l\'avouer, tout simplement inestimable.', 'ep': 0, 'g': 108, 'l': 112, 'wd': false, 'fm': true, 'w': 10, 's': 59, 'p': 32255};
I.u[8419] = {'n': 'Pelle Moh', 'nn': 'PELLE MOH', 't': 8, 'd': 'Avec cette pelle, Le capitaine Machab a éventré Grobill Dick, le grand Kralamoure Blanc.', 'ep': 20, 'g': 42, 'l': 115, 'wd': true, 'fm': true, 'w': 20, 'an': 16, 'tw': true, 'e': [10, 4, 1, 1, 50, 50, false, true], 'c': 'CC>200', 'p': 33653};
I.u[8420] = {'n': 'Pelle Dragoeuf', 'nn': 'PELLE DRAGOEUF', 't': 8, 'd': 'Les Dragoeufs aiment creuser des galeries, mais ne se servent pas de pelles, la communauté Enutrof a longtemps étudié l\'énigme de celle-ci, et a fini par conclure qu\'il était moins important de savoir d\'où elle venait que de taper avec.', 'ep': 20, 'g': 45, 'l': 127, 'wd': true, 'fm': true, 'w': 20, 'an': 16, 'tw': true, 'e': [10, 4, 1, 1, 40, 40, false, true], 'c': 'CC>200&CS>100', 'p': 42154};
I.u[8421] = {'n': 'Certificat de Mise en Chanil : Vilain Petit Corbac', 'nn': 'CERTIFICAT DE MISE EN CHANIL : VILAIN PETIT CORBAC', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Vilain Petit Corbac que vous avez placé au chanil.', 'ep': 3, 'g': 41, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8424] = {'n': 'Cadeau de compensation de l\'éleveur', 'nn': 'CADEAU DE COMPENSATION DE L\'ELEVEUR', 't': 89, 'd': 'Ce cadeau destiné aux éleveurs, contient de quoi remplir un enclos avec d\'excellentes machines d\'élevage. \n(Attention, les objets contenus dans ce cadeau sont très lourds, vous risquez d\'être en surcharge lorsque vous l\'ouvrirez).', 'ep': 1, 'g': 32, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8425] = {'n': 'Bourse de 10000 Kamas', 'nn': 'BOURSE DE 10000 KAMAS', 't': 100, 'd': 'Cette bourse est très lourde, elle contient sûrement une vraie fortune. Un marchand sera ravi de vous l\'échanger contre sa valeur en Kamas.', 'ep': 1, 'g': 56, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'u': true, 'p': 100000};
I.u[8428] = {'n': 'Potion d\'invisibilité Nébuleuse', 'nn': 'POTION D\'INVISIBILITE NEBULEUSE', 't': 12, 'd': 'Cette potion permet de s\'évaporer pour revenir au dernier point de sauvegarde sans laisser de trace.', 'ep': 0, 'g': 26, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': '(PX=3)|(PX=4)', 'u': true, 'ut': true, 'p': 1};
I.u[8430] = {'n': 'Ballon Jaune Magique', 'nn': 'BALLON JAUNE MAGIQUE', 't': 94, 'd': 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Confectionné à la main comme autrefois, en véritable plume de Tofu selon la traditionnelle recette du grand mage Vahy Nez.', 'ep': 1, 'g': 4, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8431] = {'n': 'Potion fumigène Cyclonique', 'nn': 'POTION FUMIGENE CYCLONIQUE', 't': 12, 'd': 'Cette potion fumigène crée un tourbillonnant écran de fumée qui camoufle vos actions avec style.', 'ep': 0, 'g': 29, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': '(PX=3)|(PX=4)', 'u': true, 'p': 1};
I.u[8435] = {'n': 'Ballon Rouge Magique', 'nn': 'BALLON ROUGE MAGIQUE', 't': 94, 'd': 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Confectionné à la main comme autrefois, en véritable paupière de Gelée Fraise selon la traditionnelle recette du grand mage Vahy Nez.', 'ep': 1, 'g': 5, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8436] = {'n': 'Clef du Donjon du Chêne Mou', 'nn': 'CLEF DU DONJON DU CHENE MOU', 't': 84, 'd': 'Cette clef vous permettra d\'accéder aux parties les plus intimes de l\'anatomie du Chêne Mou, sans pour autant comprendre où vous allez. A la fois perturbant et excitant, ce voyage vers l\'infini et l\'au-delà ne vous laissera pas indifférent.', 'ep': 1, 'g': 236, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8437] = {'n': 'Clef du Donjon Ensablé', 'nn': 'CLEF DU DONJON ENSABLE', 't': 84, 'd': 'Cette clef confectionnée à partir de détritus marins et de coquillages vous permettra d\'accéder à la plage qui dispose du sable le plus fin de toute la côte de la Mer d\'Asse.', 'ep': 1, 'g': 237, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8438] = {'n': 'Clef du Donjon des Rats de Brâkmar', 'nn': 'CLEF DU DONJON DES RATS DE BRAKMAR', 't': 84, 'd': 'Cette clef vous permettra d\'accéder au donjon des Rats situé dans les égouts de Brâkmar. Inutile de vous déguiser, vous passerez inaperçu, même si vous n\'êtes pas Brâkmarien.', 'ep': 1, 'g': 238, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8439] = {'n': 'Clef du Donjon des Rats de Bonta', 'nn': 'CLEF DU DONJON DES RATS DE BONTA', 't': 84, 'd': 'Cette clef vous permettra d\'accéder au donjon des Rats situé dans les égouts de Bonta. Inutile de vous déguiser, vous passerez inaperçu, même si vous n\'êtes pas Bontarien.', 'ep': 1, 'g': 239, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8441] = {'n': 'Billréole', 'nn': 'BILLREOLE', 't': 16, 'd': 'Bill voulait une auréole. Il cria si fort et fit si grand caprice qu\'on la lui accorda. Un vrai petit diable.', 'ep': 22, 'g': 159, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 25540};
I.u[8442] = {'n': 'Masque du Rat Noir', 'nn': 'MASQUE DU RAT NOIR', 't': 16, 'd': 'Ce masque a servi à Brouce Boulgoure lorsqu\'il infiltra subtilement un repaire de rats d\'Egoûtants afin de couper un orme en commençant par les racines. Il finit tout de même par massacrer tous les rats du repaire, parce qu\'il n\'était en réalité pas très discret, avec ses gros sabots en bois.', 'ep': 2, 'g': 158, 'l': 102, 'wd': true, 'fm': true, 'w': 1, 's': 68, 'p': 17222};
I.u[8443] = {'n': 'Cape du Rat Noir', 'nn': 'CAPE DU RAT NOIR', 't': 17, 'd': 'Cette cape peut être confectionnée avec n\'importe quels poils, à condition qu\'ils soient les plus sales possibles. Ils sont tressés entre eux puis fixés à l\'aide de sécrétions diverses. L\'odeur n\'est pas en option.', 'ep': 13, 'g': 123, 'l': 105, 'wd': true, 'fm': true, 'w': 5, 's': 68, 'p': 18356};
I.u[8444] = {'n': 'Dagues du Rat Noir', 'nn': 'DAGUES DU RAT NOIR', 't': 5, 'd': 'A la fois tranchantes et abîmées, les lames de ces dagues permettent de trancher les membres de vos adversaires avec une facilité déconcertante, tout en s\'assurant que vous leur retirerez une quantité impressionnante de lambeaux de chair. Dommage qu\'elles ne soient pas rouillées, chauffées à blanc et empoisonnées lorsque vous les utilisez.', 'ep': 8, 'g': 59, 'l': 108, 'wd': true, 'fm': true, 'w': 5, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 50, false, false], 'c': 'CA>250&CW>100&CV>300', 's': 68, 'p': 19358};
I.u[8445] = {'n': 'Collier du Rat Noir', 'nn': 'COLLIER DU RAT NOIR', 't': 1, 'd': 'Le rat qui possédait ce collier pensait devenir le chef de son clan. Il s\'est fait manger par un Lenald enragé.', 'ep': 18, 'g': 115, 'l': 103, 'wd': true, 'fm': true, 'w': 5, 's': 68, 'p': 17650};
I.u[8446] = {'n': 'Bottes du Rat Noir', 'nn': 'BOTTES DU RAT NOIR', 't': 11, 'd': 'Attention en enfilant ces bottes, il n\'est pas rare qu\'elles contiennent encore un ou deux pieds du propriétaire précédent.', 'ep': 13, 'g': 93, 'l': 101, 'wd': true, 'fm': true, 'w': 10, 's': 68, 'p': 18700};
I.u[8447] = {'n': 'Ceinture du Rat Noir', 'nn': 'CEINTURE DU RAT NOIR', 't': 10, 'd': 'Contrairement à son cousin blanc bontarien, le Rat Noir aime faire dans la discrétion, et porte donc une simple ceinture d\'étoffe. Mais il aime aussi emporter un maximum d\'armes avec lui, qui font un bruit d\'enfer en s\'entrechoquant à chaque pas.', 'ep': 13, 'g': 109, 'l': 101, 'wd': true, 'fm': true, 'w': 5, 's': 68, 'p': 18934};
I.u[8448] = {'n': 'Anneau du Rat Noir', 'nn': 'ANNEAU DU RAT NOIR', 't': 9, 'd': 'Tournez cet anneau vers la droite si vous devez serrer la main d\'un ennemi, et vers la gauche si vous devez serrer celle d\'un ami. Dans tous les cas, on vous déconseille d\'applaudir avec cet anneau.', 'ep': 20, 'g': 120, 'l': 98, 'wd': true, 'fm': true, 'w': 5, 's': 68, 'p': 16980};
I.u[8449] = {'n': 'Transformation du Donjon Abraknyde', 'nn': 'TRANSFORMATION DU DONJON ABRAKNYDE', 't': 27, 'd': 'Un Abraknyde vous a mordu et vous a transmis une étrange malédiction.', 'ep': 9, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8450] = {'n': 'Epée du Rat Blanc', 'nn': 'EPEE DU RAT BLANC', 't': 6, 'd': 'Cette Arme est le symbole du Rat Blanc. Elle est réputée pour être capable de trancher ennemis et alliés avec la même facilité.', 'ep': 16, 'g': 71, 'l': 109, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'tw': true, 'e': [5, 5, 1, 1, 40, 50, false, false], 'c': 'CA>150&CS>100', 's': 67, 'p': 17542};
I.u[8451] = {'n': 'Coiffe du Rat Blanc', 'nn': 'COIFFE DU RAT BLANC', 't': 16, 'd': 'Avec cette coiffe, le Rat Blanc ressemble à un vrai Rat Blanc de Bonta. Sans cette coiffe, il ressemble à un vrai Rat Blanc de Bonta sans coiffe.', 'ep': 13, 'g': 160, 'l': 105, 'wd': true, 'fm': true, 'w': 10, 's': 67, 'p': 18451};
I.u[8452] = {'n': 'Cape du Rat Blanc', 'nn': 'CAPE DU RAT BLANC', 't': 17, 'd': 'Cette cape est le symbole identifiant un rat blanc du réseau d\'égoûts de Bonta, elle lui est remise après un examen long et difficile, et il la porte fièrement jusqu\'à sa mort, c\'est à dire jamais longtemps.', 'ep': 14, 'g': 124, 'l': 102, 'wd': true, 'fm': true, 'w': 5, 's': 67, 'p': 17025};
I.u[8453] = {'n': 'Collier du Rat Blanc', 'nn': 'COLLIER DU RAT BLANC', 't': 1, 'd': 'Si vous le portez comme un collier, il vous protègera des émanations toxiques provenant des égoûts. En revanche, si vous le portez comme une ceinture, ce sont vos alliés qui seront protégés de vos émanations toxiques.', 'ep': 18, 'g': 116, 'l': 103, 'wd': true, 'fm': true, 'w': 5, 's': 67, 'p': 18900};
I.u[8454] = {'n': 'Gantelet du Rat Blanc', 'nn': 'GANTELET DU RAT BLANC', 't': 9, 'd': 'Ce gantelet appartenait à Marie Thé, cuisinière du palais de Bonta. Elle s\'en servait pour assommer les Bouftous qui refusaient de se faire égorger, les plantes sauvages qui ne voulaient pas aller dans le saladier, et les clients qui ne voulaient pas les manger.', 'ep': 18, 'g': 121, 'l': 101, 'wd': true, 'fm': true, 'w': 5, 's': 67, 'p': 17150};
I.u[8455] = {'n': 'Ceinture du Rat Blanc', 'nn': 'CEINTURE DU RAT BLANC', 't': 10, 'd': 'Contrairement à ce que pense son cousin noir brâkmarien, le rat blanc aime également faire dans la discrétion. Les raccords métalliques de cette ceinture sont doublés de goudron et ne font aucun bruit, sauf quand son porteur tombe lamentablement, c\'est à dire souvent puisqu\'elle pèse plusieurs tonnes.', 'ep': 16, 'g': 110, 'l': 102, 'wd': true, 'fm': true, 'w': 150, 's': 67, 'p': 18850};
I.u[8456] = {'n': 'Bottes du Rat Blanc', 'nn': 'BOTTES DU RAT BLANC', 't': 11, 'd': 'Avec ces bottes, votre équilibre est parfait, même par grand vent vous ne bougerez plus d\'un pouce.', 'ep': 3, 'g': 94, 'l': 99, 'wd': true, 'fm': true, 'w': 10, 's': 67, 'p': 17650};
I.u[8457] = {'n': 'Coiffe Cérémoniale du Seigneur des Rats', 'nn': 'COIFFE CEREMONIALE DU SEIGNEUR DES RATS', 't': 16, 'd': 'Cette coiffe n\'a rien à voir avec un Dora... Absolument rien on vous dit ! Il est donc inutile de répandre de fausses rumeurs à propos du manque d\'inspiration ou de la fainéantise de son concepteur . En revanche elle est très jolie.', 'ep': 13, 'g': 173, 'l': 133, 'wd': true, 'fm': true, 'w': 10, 's': 64, 'p': 43300};
I.u[8458] = {'n': 'Cape Cérémoniale du Seigneur des Rats', 'nn': 'CAPE CEREMONIALE DU SEIGNEUR DES RATS', 't': 17, 'd': 'Cette cape colorée fait de vous une cible privilégiée. Seuls les aventuriers vifs et agiles ont su la porter longtemps.', 'ep': 14, 'g': 125, 'l': 130, 'wd': true, 'fm': true, 'w': 10, 's': 64, 'p': 42030};
I.u[8459] = {'n': 'Collier Cérémonial du Seigneur des Rats', 'nn': 'COLLIER CEREMONIAL DU SEIGNEUR DES RATS', 't': 1, 'd': 'Afin d\'éviter qu\'on le lui vole, ce collier est glissé autour du cou de l\'héritier du Seigneur des rats à sa naissance. Ainsi, à l\'âge adulte, le seul moyen de le lui enlever est de lui couper la tête. On le lui vole tout de même.', 'ep': 18, 'g': 117, 'l': 134, 'wd': true, 'fm': true, 'w': 5, 's': 64, 'p': 45842};
I.u[8460] = {'n': 'Anneau Cérémonial du Seigneur des Rats', 'nn': 'ANNEAU CEREMONIAL DU SEIGNEUR DES RATS', 't': 9, 'd': 'Cet anneau a été conçu à une époque où le seigneur des rats s\'était mutilé et n\'avait plus qu\'un doigt. Les malheureux seigneurs suivants avaient encore tous les leurs.', 'ep': 20, 'g': 122, 'l': 131, 'wd': true, 'fm': true, 'w': 5, 's': 64, 'p': 42542};
I.u[8461] = {'n': 'Ceinture Cérémoniale du Seigneur des Rats', 'nn': 'CEINTURE CEREMONIALE DU SEIGNEUR DES RATS', 't': 10, 'd': 'Les motifs sur cette ceinture donnent l\'impression que vous avez le feu au fondement. Le trompe l\'oeil est si bon que la plupart des porteurs y croient eux-mêmes et courent partout en hurlant. Ce qui correspond exactement au rituel de la cérémonie.', 'ep': 16, 'g': 111, 'l': 133, 'wd': true, 'fm': true, 'w': 10, 's': 64, 'p': 43358};
I.u[8462] = {'n': 'Bottes Cérémoniales du Seigneur des Rats', 'nn': 'BOTTES CEREMONIALES DU SEIGNEUR DES RATS', 't': 11, 'd': 'Le tout premier Seigneur des rats est mort en marchant par inadvertance dans une flaque de lave en fusion. Ces bottes sont portées en hommage par ses seigneurs. Attention, elles ne sont pas ignifugées.', 'ep': 13, 'g': 95, 'l': 134, 'wd': true, 'fm': true, 'w': 10, 's': 64, 'p': 43541};
I.u[8463] = {'n': 'Abracaska Ancestral', 'nn': 'ABRACASKA ANCESTRAL', 't': 16, 'd': 'Cette Coiffe fut créée pour Jicé Aouaire car il a la tête plate, aucun soucis d\'équilibre pour l\'arborer donc. \nIl l\'a faite faire après avoir vaincu l\'Abraknyde Ancestral en brisant ses noisettes entre ses fesses, mais il s\'en vante moins.', 'ep': 9, 'g': 174, 'l': 114, 'wd': true, 'fm': true, 'w': 10, 's': 65, 'p': 33150};
I.u[8464] = {'n': 'Abracapa Ancestrale', 'nn': 'ABRACAPA ANCESTRALE', 't': 17, 'd': 'En été, l\'Abraknyde Ancestral aime se dorer au soleil, mais son bois habitué aux forêts sombres le supporte mal. Cette cape est confectionnée avec les pelures de son écorce.', 'ep': 18, 'g': 126, 'l': 114, 'wd': true, 'fm': true, 'w': 5, 's': 65, 'p': 33524};
I.u[8465] = {'n': 'Torque Ancestral', 'nn': 'TORQUE ANCESTRAL', 't': 1, 'd': 'Autour du cou, ce torque met en valeur votre barbe. Si vous n\'avez pas de barbe, vous ne pouvez vous en prendre qu\'à vous-même.', 'ep': 20, 'g': 118, 'l': 110, 'wd': true, 'fm': true, 'w': 10, 's': 65, 'p': 31542};
I.u[8466] = {'n': 'Anneau Ancestral', 'nn': 'ANNEAU ANCESTRAL', 't': 9, 'd': 'Les soirs où vous aurez trop bu, vous verrez peut-être le Moskito pris dans cet anneau vous faire un clin d\'oeil. Mais évitez d\'en parler à vos amis, il fait seulement semblant.', 'ep': 9, 'g': 123, 'l': 113, 'wd': true, 'fm': true, 'w': 5, 's': 65, 'p': 33241};
I.u[8467] = {'n': 'Protège-Tibias Ancestraux', 'nn': 'PROTEGE-TIBIAS ANCESTRAUX', 't': 11, 'd': 'Avec ces protège-tibias en bois massif, vos jambes ne craignent plus rien. Ils sont en revanche incompatibles avec le port de bottes . Vous pourrez les utiliser  pour vous protéger lors des compétitions de Boufball, mais vous ne pourrez plus faire de pointu avec vos bottes coquées.', 'ep': 20, 'g': 96, 'l': 110, 'wd': false, 'fm': true, 'w': 10, 's': 65, 'p': 31524};
I.u[8468] = {'n': 'Abrature Ancestrale', 'nn': 'ABRATURE ANCESTRALE', 't': 10, 'd': 'Cette ceinture est censée vous donner la virilité ancestrale. Que ce soit vrai ou pas, l\'effet est périmé.', 'ep': 9, 'g': 112, 'l': 111, 'wd': true, 'fm': true, 'w': 10, 's': 65, 'p': 32101};
I.u[8469] = {'n': 'Talisman du Chêne Mou', 'nn': 'TALISMAN DU CHENE MOU', 't': 1, 'd': 'Cette pièce de bois prélevée au coeur du Chêne mou renferme un grand pouvoir, comme celui de mettre le Chêne Mou en colère.', 'ep': 20, 'g': 119, 'l': 138, 'wd': true, 'fm': true, 'w': 10, 's': 66, 'p': 44521};
I.u[8470] = {'n': 'Anneau du Chêne Mou', 'nn': 'ANNEAU DU CHENE MOU', 't': 9, 'd': 'Cet anneau est un excrément du Chêne Mou, en bois, mais l\'odeur est la même.', 'ep': 9, 'g': 124, 'l': 139, 'wd': true, 'fm': true, 'w': 5, 's': 66, 'p': 43014};
I.u[8471] = {'n': 'Tongues du dimanche du Chêne Mou', 'nn': 'TONGUES DU DIMANCHE DU CHENE MOU', 't': 11, 'd': 'Le dimanche, le Chêne Mou fait la sieste, et lorsqu\'il se réveille, il aime qu\'un Tronknyde obéissant lui apporte ses tongues sans qu\'il les demande. Il n\'a malheureusement pas de pieds, elles sont donc encore neuves.', 'ep': 20, 'g': 97, 'l': 136, 'wd': true, 'fm': true, 'w': 5, 's': 66, 'p': 43521};
I.u[8472] = {'n': 'Cape Usée du Chêne Mou', 'nn': 'CAPE USEE DU CHENE MOU', 't': 17, 'd': 'Il y a plus de 200 ans, une étoffe d\'un tissu anodin s\'est prise dans les branches du Chêne Mou. L\'arbre a poussé autour et au travers, l\'imprégnant ainsi de sa magie. Elle est désormais indissociable de ce gros morceau de bois ce qui la rend peu pratique et inflammable, mais sa puissance est indéniable.', 'ep': 18, 'g': 127, 'l': 142, 'wd': true, 'fm': true, 'w': 10, 's': 66, 'p': 44578};
I.u[8473] = {'n': 'String Automnal du Chêne Mou', 'nn': 'STRING AUTOMNAL DU CHENE MOU', 't': 10, 'd': 'En automne, le Chêne Mou porte son string pour protéger ses précieux glands. En été, il les trimballe à l\'air.', 'ep': 9, 'g': 113, 'l': 141, 'wd': true, 'fm': true, 'w': 10, 's': 66, 'p': 44514};
I.u[8474] = {'n': 'Coiffe du Chêne Mou', 'nn': 'COIFFE DU CHENE MOU', 't': 16, 'd': 'Vous pouvez porter cette coiffe dans n\'importe quel sens, on aura toujours l\'impression qu\'elle n\'est pas droite.', 'ep': 9, 'g': 166, 'l': 145, 'wd': true, 'fm': true, 'w': 10, 's': 66, 'p': 45241};
I.u[8476] = {'n': 'Première clef du Donjon de Sphincter', 'nn': 'PREMIERE CLEF DU DONJON DE SPHINCTER', 't': 24, 'd': 'Cette clef ne vous suffira pas pour pénétrer dans le donjon de Sphincter, il vous faut l\'autre clef !', 'ep': 1, 'g': 502, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 100};
I.u[8477] = {'n': 'Deuxième clef du Donjon de Sphincter', 'nn': 'DEUXIEME CLEF DU DONJON DE SPHINCTER', 't': 24, 'd': 'Cette clef ne vous suffira pas pour pénétrer dans le donjon de Sphincter, il vous faut l\'autre clef !', 'ep': 1, 'g': 503, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 100};
I.u[8478] = {'n': 'Potion de lèche-bottes', 'nn': 'POTION DE LECHE-BOTTES', 't': 12, 'd': 'Cette potion hautement illégale est redoutée par les plus grands. Une simple gorgée et la personne n\'a qu\'une obsession, lécher les bottes les plus proches. Certains disent que des variantes qui ciblent d\'autres endroits existent. Le malheureux buveur aura alors mauvaise haleine.', 'ep': 0, 'g': 36, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 10};
I.u[8480] = {'n': 'Potion de lèche-bottes', 'nn': 'POTION DE LECHE-BOTTES', 't': 24, 'd': 'Cette potion hautement illégale est redoutée même des plus grand. En effet, une petite gorgée et le buveur n\'a plus qu\'une obsession : celle de lécher les bottes les plus proches. Des rumeurs parlent d\'une version alternative qui cible autre chose. Le seul indice quant à cet endroit est la mauvaise haleine des buveurs malchanceux.', 'ep': 2, 'g': 32, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 10};
I.u[8481] = {'n': 'Poil de Rat d\'Egoutant', 'nn': 'POIL DE RAT D\'EGOUTANT', 't': 54, 'd': 'Ce poil est sale et malodorant, il a trainé dans les égoûts les plus insalubres de la région. Et pourtant il brille encore.', 'ep': 2, 'g': 670, 'l': 42, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8482] = {'n': 'Peau de Rat d\'Egoutant', 'nn': 'PEAU DE RAT D\'EGOUTANT', 't': 59, 'd': 'Cette peau est recouverte de petites cicatrices qui témoignent de l\'enfance difficile qu\'a connue le Rat d\'Egoutant. Vous pourriez au moins avoir un peu de pitié pour lui !', 'ep': 2, 'g': 621, 'l': 42, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8483] = {'n': 'Peau de Chaman d\'Egoutant', 'nn': 'PEAU DE CHAMAN D\'EGOUTANT', 't': 59, 'd': 'Une fois lavée, cette peau pourra faire office de tapis de sol, ou de paillasson.', 'ep': 2, 'g': 622, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8484] = {'n': 'Poil de Chaman d\'Egoutant', 'nn': 'POIL DE CHAMAN D\'EGOUTANT', 't': 54, 'd': 'Utilisé autrefois pour les moustaches postiches, ce type de poil convient également parfaitement pour les poils d\'aisselle postiches.', 'ep': 2, 'g': 671, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8485] = {'n': 'Etoffe du Rat Noir', 'nn': 'ETOFFE DU RAT NOIR', 't': 55, 'd': 'Enroulée autour d\'une lamelle de bois tendre, cette étoffe pourra servir d\'éponge, ou même de gratte-fesses. Il en faut pour tous les goûts.', 'ep': 2, 'g': 725, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8486] = {'n': 'Etoffe du Rat Blanc', 'nn': 'ETOFFE DU RAT BLANC', 't': 55, 'd': 'Cette étoffe aussi grasse qu\'un poil de Wabbit trempé dans la graisse de Blop, protège efficacement du froid, surtout si vous y mettez le feu.', 'ep': 2, 'g': 726, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8487] = {'n': 'Etoffe de Sphincter Cell', 'nn': 'ETOFFE DE SPHINCTER CELL', 't': 55, 'd': 'Cette Etoffe semble recouverte d\'un produit chimique étrange aux effets secondaires inconnus. Mieux vaut ne pas garder cette Etoffe trop longtemps entre les mains, un gros poil pourrait y pousser.', 'ep': 2, 'g': 727, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8488] = {'n': 'Cubitus du Rat Noir', 'nn': 'CUBITUS DU RAT NOIR', 't': 47, 'd': 'Cet os de rat peut être vidé, percé et taillé pour ensuite servir d\'instrument de musique, ou de sarbacane si vous n\'avez pas l\'oreille musicale.', 'ep': 2, 'g': 658, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8489] = {'n': 'Dent de Rat Blanc', 'nn': 'DENT DE RAT BLANC', 't': 47, 'd': 'Cette dent est en réalité un horrible croc qui permettait au Rat Blanc de transmettre une multitude de maladies à ses victimes lorsqu\'il les mordait. Une façon comme une autre de s\'assurer de la mort de ses victimes, même s\'il ne parvenait pas à les achever. Tous les moyens sont bons lorsque l\'on veut se faire respecter.', 'ep': 2, 'g': 659, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8490] = {'n': 'Fémur de Sphincter Cell', 'nn': 'FEMUR DE SPHINCTER CELL', 't': 47, 'd': 'Sphincter n\'était pas du genre à plaisanter avec les os, il les brisait en deux, puis en trois, puis en quatre, et parfois même en cinq, lorsqu\'il fallait ragaillardir les foules endormies pas un combat lassant.', 'ep': 2, 'g': 657, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8491] = {'n': 'Peau du Rat Noir', 'nn': 'PEAU DU RAT NOIR', 't': 59, 'd': 'Le Rat Noir était réputé pour sa mauvaise haleine, mais aussi pour la peau rugueuse de son postérieur. Très pratique pour ne pas glisser sur la cuvette des toilettes. Malheureusement, le Rat Noir ne prenait jamais la peine d\'aller jusqu\'aux toilettes, puisqu\'il vivait directement dans les égouts.', 'ep': 2, 'g': 623, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8492] = {'n': 'Peau de Rat Blanc', 'nn': 'PEAU DE RAT BLANC', 't': 59, 'd': 'Le Rat Blanc prenait un malin plaisir à se morfondre au fond de ses égouts, et à attendre qu\'une personne bien attentionnée vienne le réconforter. Il profitait ensuite de la naïveté et de la crédulité de ses victimes, pour les dépecer vivantes, et les rôtir en les ayant au préalable fourrées avec des noix de cajou. Pauvres noix de cajou.', 'ep': 2, 'g': 624, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8493] = {'n': 'Peau de Sphincter Cell', 'nn': 'PEAU DE SPHINCTER CELL', 't': 59, 'd': 'Qui aurait pu croire que vous seriez un jour capable de tenir entre vos mains, la peau du célèbre Sphincter ? Certainement pas Sphincter. Sa trop grande confiance en lui aura causé sa propre perte.', 'ep': 2, 'g': 625, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 100};
I.u[8494] = {'n': 'Ecorce d\'Abraknyde Ancestral', 'nn': 'ECORCE D\'ABRAKNYDE ANCESTRAL', 't': 96, 'd': 'Cette écorce s\'est détachée de l\'Abraknyde Ancestral, sans que vous n\'ayez eu besoin de la lui arracher avec les dents.', 'ep': 9, 'g': 667, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8495] = {'n': 'Bourgeon de l\'Abraknyde Ancestral', 'nn': 'BOURGEON DE L\'ABRAKNYDE ANCESTRAL', 't': 108, 'd': 'Ce bourgeon desséché a été jadis entièrement vidé de sa sève par une créature affamée. Si vous le plongez dans l\'eau, vous pourrez le voir reprendre sa forme initiale, gonfler, puis si vous attendez très longtemps, pourrir.', 'ep': 9, 'g': 755, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8496] = {'n': 'Racine d\'Abraknyde Ancestral', 'nn': 'RACINE D\'ABRAKNYDE ANCESTRAL', 't': 98, 'd': 'Même arrachée à son propriétaire, cette racine peut vous fouetter les fesses ou vous tordre les chevilles. Sale bête !', 'ep': 9, 'g': 668, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8497] = {'n': 'La recette de la filtounga', 'nn': 'LA RECETTE DE LA FILTOUNGA', 't': 24, 'd': 'Ce livre renferme les secrets de la filtounga, le plat mythique imaginé par Mouss Bouff.', 'ep': 16, 'g': 95, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'u': true, 'p': 10};
I.u[8498] = {'n': 'Viande de Kanigrou', 'nn': 'VIANDE DE KANIGROU', 't': 63, 'd': 'Cette viande est aussi tendre qu\'un cerveau de Boue.', 'ep': 13, 'g': 375, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8499] = {'n': 'Viande de Koalak', 'nn': 'VIANDE DE KOALAK', 't': 63, 'd': 'La viande de Koalak est en règle générale assez ferme. Il suffit simplement de l\'attendrir en la frappant avec un tronc de Kaliptus. Comme pour les enfants indisciplinés.', 'ep': 20, 'g': 376, 'l': 60, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8500] = {'n': 'Viande de Crocodaille', 'nn': 'VIANDE DE CROCODAILLE', 't': 63, 'd': 'Cette viande insipide peut être conservée dans la vase pendant plusieurs années, avant de pourrir et de commencer à avoir du goût.', 'ep': 4, 'g': 377, 'l': 70, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8501] = {'n': 'Viande de Kanigrou Conservée', 'nn': 'VIANDE DE KANIGROU CONSERVEE', 't': 64, 'd': 'Cette viande de Kanigrou peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 'ep': 13, 'g': 387, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8502] = {'n': 'Viande de Koalak Conservée', 'nn': 'VIANDE DE KOALAK CONSERVEE', 't': 64, 'd': 'Cette viande Koalak peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 'ep': 20, 'g': 388, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8503] = {'n': 'Viande de Crocodaille Conservée', 'nn': 'VIANDE DE CROCODAILLE CONSERVEE', 't': 64, 'd': 'Cette viande de Crocodaille peut maintenant être conservée plusieurs jours avant d\'être utilisée pour un plat.', 'ep': 4, 'g': 389, 'l': 70, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8504] = {'n': 'Entrecôte de Kanigrou', 'nn': 'ENTRECOTE DE KANIGROU', 't': 69, 'd': 'A manger chaude ou froide, cette entrecôte saura rassasier les appétits les plus voraces.', 'ep': 13, 'g': 132, 'l': 80, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[8505] = {'n': 'Filet de Koalak', 'nn': 'FILET DE KOALAK', 't': 69, 'd': 'Ce morceau de viande remplira même les estomacs sans fond.', 'ep': 20, 'g': 133, 'l': 120, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[8506] = {'n': 'Entrecôte de Crocodaille', 'nn': 'ENTRECOTE DE CROCODAILLE', 't': 69, 'd': 'Cette part de viande imposante est de toute évidence, très difficile à digérer. Mais la gourmandise l\'emporte toujours sur la raison.', 'ep': 4, 'g': 134, 'l': 70, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[8507] = {'n': 'Plat de Filtounga', 'nn': 'PLAT DE FILTOUNGA', 't': 69, 'd': 'La Filtounga est une plat unique. Grâce aux ingrédients qui le composent, il garde une saveur ... unique. Servir tiède.', 'ep': 1, 'g': 136, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'c': 'Cv<100', 'u': true, 'ut': true, 'p': 1};
I.u[8508] = {'n': 'Plat de Filtounga', 'nn': 'PLAT DE FILTOUNGA', 't': 24, 'd': 'Ce plat est pour Paindep la sorcière.', 'ep': 1, 'g': 120, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8509] = {'n': 'La recette de la bière Bwork', 'nn': 'LA RECETTE DE LA BIERE BWORK', 't': 25, 'd': 'Le grand mage Bworknroll dévoile ici la recette sacrée de la bière Bwork. Il n\'épargne aucun secret de fabrication. Il va même jusqu\'à donner la meilleure manière de la déguster. Un régal pour les amateurs, un cauchemar pour ceux qui ont déjà bu de cette bière sans la connaître.', 'ep': 1, 'g': 130, 'l': 10, 'wd': false, 'fm': true, 'w': 5, 'u': true, 'p': 500};
I.u[8511] = {'n': 'Arbalète de Surpuissance Ténébreuse de la Mort qui Tue', 'nn': 'ARBALETE DE SURPUISSANCE TENEBREUSE DE LA MORT QUI TUE', 't': 102, 'd': '....', 'ep': 0, 'g': 0, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'an': 10, 'tw': true, 'e': [20, 7, 4, 12, 50, 30, true, true], 'p': 1};
I.u[8513] = {'n': 'Scalpel de Bworknroll', 'nn': 'SCALPEL DE BWORKNROLL', 't': 5, 'd': 'Pour récolter des « morceaux » de créature, rien ne vaut le scalpel de Bworknroll qui préserve la vitalité des membres arrachés. Il faut l\'utiliser au combat pour récupérer les parties désirées.', 'ep': 1, 'g': 60, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [10, 4, 1, 1, 30, 50, false, false], 'c': 'Qa=166', 'p': 100};
I.u[8514] = {'n': 'Cervelle de vampire', 'nn': 'CERVELLE DE VAMPIRE', 't': 69, 'd': 'Surchargée de globules frais en permanence, la cervelle d\'un vampire aspire vers lui toutes les globules rouges disponibles. C\'est ce qui donne  aux vampires un teint pâle. Chez les Iop, ce sont plutôt les pieds qui attirent leur sang, d\'où leur adresse à bondir au lieu de réfléchir...', 'ep': 3, 'g': 492, 'l': 20, 'wd': true, 'fm': true, 'w': 2, 'u': true, 'p': 10};
I.u[8515] = {'n': 'Os de Trooll', 'nn': 'OS DE TROOLL', 't': 47, 'd': 'Lorsque l\'on constate la solidité et le poids d\'un os de Trooll, on comprend mieux pourquoi leurs claques font si mal lors d\'une partie de jeu Trooll.', 'ep': 4, 'g': 640, 'l': 5, 'wd': true, 'fm': true, 'w': 50, 'p': 50};
I.u[8516] = {'n': 'Coeur de Bworkcelhaine', 'nn': 'COEUR DE BWORKCELHAINE', 't': 15, 'd': 'Cette Bworkette sans coeur qui a jeté son fils Krazybwork dans une fosse a été maudite par Bworknroll à qui elle a refusé son amour. Enfermée dans une cave, elle se nourrit de son propre coeur chaque jour. Toutes les nuits, il repousse et bat à nouveau de mille feux.', 'ep': 4, 'g': 518, 'l': 33, 'wd': true, 'fm': true, 'w': 33, 'p': 33};
I.u[8517] = {'n': 'Moumoule', 'nn': 'MOUMOULE', 't': 15, 'd': 'Cette belle Moumoule fraîche sert aux Bwork esseulés lors qu\'ils partent en rapines loin de leurs compagnes.', 'ep': 3, 'g': 756, 'l': 1, 'wd': true, 'fm': true, 'w': 3, 'p': 21};
I.u[8518] = {'n': 'Moumoules frites', 'nn': 'MOUMOULES FRITES', 't': 69, 'd': 'Dans les profondeurs de la Mer d\'Asse, les Moumoules récoltent du varech qu\'elles roulent sous leurs aisselles. Une fois la matière formée en frites, elles se hissent sur la plage pour les faire dorer au soleil avant de les ingérer.', 'ep': 3, 'g': 135, 'l': 1, 'wd': true, 'fm': true, 'w': 2, 'u': true, 'ut': true, 'p': 1};
I.u[8519] = {'n': 'Gâtrool', 'nn': 'GATROOL', 't': 69, 'd': 'Cette galette rituelle fourrée aux krottes de Trool est une vieille recette bwork. Seul un Bwork qui a vaincu un Trool à mains nues a le droit d\'en manger. S\'il a survécu à ce combat, il est prêt à avaler n\'importe quoi !', 'ep': 1, 'g': 136, 'l': 5, 'wd': true, 'fm': true, 'w': 20, 'u': true, 'p': 1};
I.u[8520] = {'n': 'Gratrooll', 'nn': 'GRATROOLL', 't': 60, 'd': 'Cette graisse épaisse et nutritive permet de cuire la plupart des aliments dans de vieilles marmites sans accrocher le plat. Certains adeptes Osamodas s\'en servent aussi pour glisser des Tofus dans des endroits que la morale Iop réprouve.', 'ep': 1, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 10};
I.u[8521] = {'n': 'La cape rouge', 'nn': 'LA CAPE ROUGE', 't': 17, 'd': 'La cape rouge est l\'artefact préféré des mégalomanes. Une fois posée sur leurs frêles épaules, ils ont l\'impression d\'incarner Superman ou un magicien surpuissant jusqu\'à ce qu\'ils croisent un Minotoror.', 'ep': 1, 'g': 128, 'l': 9, 'wd': false, 'fm': true, 'w': 1, 'p': 200};
I.u[8522] = {'n': 'Lanceur d\'effet Magique', 'nn': 'LANCEUR D\'EFFET MAGIQUE', 't': 74, 'd': 'Cet objet surprenant renferme un concentré de magie obscure plutôt instable. Personne ne peut prédire ce qu\'il renferme, mais il est déconseillé de trop attendre avant de l\'utiliser.', 'ep': 1, 'g': 31, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'ut': true, 'p': 1};
I.u[8523] = {'n': 'La relique des Robill', 'nn': 'LA RELIQUE DES ROBILL', 't': 24, 'd': 'Cet objet familial suinte d\'un flux magique extrêmement puissant. Transmis de génération en génération entre les membres de cette famille, il n\'a rien perdu de son pouvoir. Il n\'existe que peu d\'artéfacts d\'où émane une telle force. Il a peut-être été en contact avec un Dofus...', 'ep': 1, 'g': 714, 'l': 200, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8524] = {'n': 'Fantôme Walk', 'nn': 'FANTOME WALK', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 45, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8525] = {'n': 'Oeuf de piou', 'nn': 'OEUF DE PIOU', 't': 69, 'd': 'Les œufs de pious sont un vrai régal pour les amateurs de friandises. Cependant, ils éclosent très vite lorsqu\'ils sont proches d\'une source de chaleur. C\'est pourquoi, il faut éviter de les laisser traîner dans sa poche ou dans sa bouche car au bout de quelques minutes un mini piou peut sortir de sa coquille. Avoir un piou affamé coincé entre vos dents ou se faufilant dans vos vêtements peut vous chatouiller le palais ou d\'autres parties plus intimes de votre anatomie.', 'ep': 4, 'g': 38, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8526] = {'n': 'Certificat de Mise en Chanil : Koalak Sanguin', 'nn': 'CERTIFICAT DE MISE EN CHANIL : KOALAK SANGUIN', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Koalak Sanguin que vous avez placé au chanil.', 'ep': 3, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8527] = {'n': 'Gobtroteur', 'nn': 'GOBTROTEUR', 't': 11, 'd': 'Ces bottes en peaux de gobelins ont été créées par Planbworksek afin de charger l\'ennemi (si possible dans le dos) avec une grande vélocité. En chaussant ces bottes, il a sauvé plus d\'un camarade Bwork dans la panade.', 'ep': 4, 'g': 98, 'l': 14, 'wd': true, 'fm': true, 'w': 20, 'p': 400};
I.u[8528] = {'n': 'La recette des crêpes', 'nn': 'LA RECETTE DES CREPES', 't': 25, 'd': 'Grâce à Pol Bokuz, vous saurez enfin réussir votre pâte à crêpe pour nourrir vos petits enfants et les envoyer rapidement à la sieste. Le secret de cette recette nourrissante et soporifique : la poudre de perlinpainpain bien sûr !', 'ep': 1, 'g': 9, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 0};
I.u[8529] = {'n': 'Le marteau à Zaap', 'nn': 'LE MARTEAU A ZAAP', 't': 24, 'd': 'Rien ne vaut un bon coup de marteau pour réparer un Zaap déréglé !', 'ep': 1, 'g': 8, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[8530] = {'n': 'Ruskauffe', 'nn': 'RUSKAUFFE', 't': 16, 'd': 'Cette coiffe tient chaud aux oreilles, et absorbe les effluves d\'alcool qui s\'échappent de votre haleine. Que demander de plus ?', 'ep': 22, 'g': 167, 'l': 151, 'wd': true, 'fm': true, 'w': 10, 'p': 46280};
I.u[8531] = {'n': 'Lapinocoiffe', 'nn': 'LAPINOCOIFFE', 't': 16, 'd': 'Qui oserait porter une coiffe aussi ridicule ? Personne excepté vous.', 'ep': 1, 'g': 168, 'l': 33, 'wd': true, 'fm': true, 'w': 6, 'p': 3000};
I.u[8532] = {'n': 'Cape du Lapino Blasé', 'nn': 'CAPE DU LAPINO BLASE', 't': 17, 'd': 'Avec cette cape sur les épaules, vous pourrez enfin montrer aux personnes à qui vous tournez le dos, que vous êtes blasé par leur stupidité.', 'ep': 1, 'g': 129, 'l': 14, 'wd': true, 'fm': true, 'w': 1, 'p': 775};
I.u[8533] = {'n': 'Le Floude', 'nn': 'LE FLOUDE', 't': 16, 'd': 'Le Floude n\'est pas réellement un chapeau mais un parasite se développant sur le crâne des personnes trop volubiles, excessivement bruyantes, ou simplement verbalement agressives. Son aspect repoussant fait fuir les gens, ce qui pousse son porteur à crier encore plus fort pour se faire entendre, sans succès évidement, puisqu\'il n\'a rien à dire de toute façon.', 'ep': 1, 'g': 169, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 's': 69, 'p': 100};
I.u[8534] = {'n': 'La Cape S\'loque', 'nn': 'LA CAPE S\'LOQUE', 't': 17, 'd': 'Cette cape molletonnée absorbe tous les bruits environnants, obligeant son porteur à hurler en permanence.', 'ep': 1, 'g': 130, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 's': 69, 'p': 100};
I.u[8535] = {'n': 'Les Incrustes', 'nn': 'LES INCRUSTES', 't': 11, 'd': 'Ces Getas sont si légères qu\'elles poussent leur propriétaire à courir dans tous les sens et à sauter partout lorsqu\'un combat commence. Les aventuriers expérimentés détestent ces getas, qui permettent aux premiers venus de prendre part à un combat auquel ils n\'ont pas été invités.', 'ep': 1, 'g': 99, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 's': 69, 'p': 1};
I.u[8536] = {'n': 'La Spamette', 'nn': 'LA SPAMETTE', 't': 10, 'd': 'Cette ceinture se porte si serrée qu\'elle force presque son porteur à bégayer, trembloter et faire n\'importe quoi, tant que c\'est en boucle.', 'ep': 1, 'g': 114, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 's': 69, 'p': 1};
I.u[8537] = {'n': 'Le Plussain', 'nn': 'LE PLUSSAIN', 't': 9, 'd': 'Ce petit anneau ne sert à rien, sinon à être très voyant, histoire de montrer aux gens que vous existez.', 'ep': 1, 'g': 125, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 's': 69, 'p': 1};
I.u[8538] = {'n': 'Le S\'Mesme', 'nn': 'LE S\'MESME', 't': 1, 'd': 'Après plusieurs nuits de dur labeur pour réaliser cette amulette, le plus grand bijoutier d\'Astrub, connu pour avoir été élevé par les Bworks s\'exclama devant une foule ébahie : ' + '"' + 'C 1 pur amu tro bi1' + '"' + '. Même l\'illustre historien Champo Gnon ne parvint pas à déchiffrer ce que le bijoutier avait voulu dire.', 'ep': 1, 'g': 120, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 's': 69, 'p': 1};
I.u[8539] = {'n': 'Hache de l\'apprenti bûcheron', 'nn': 'HACHE DE L\'APPRENTI BUCHERON', 't': 19, 'd': 'Même si vous ne savez pas très bien manier la hache, vous ne risquez guère de vous couper avec celle-ci tant la lame est émoussée. Mais bon, en tapant suffisamment fort, vous arriverez bien à couper quelques arbres.', 'ep': 1, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 4, 1, 1, 40, 40, false, false], 'p': 0};
I.u[8540] = {'n': 'Faux de l\'apprenti paysan', 'nn': 'FAUX DE L\'APPRENTI PAYSAN', 't': 22, 'd': 'Cette faux est de qualité médiocre mais on vous l\'a offerte, vous n\'avez donc pas à vous plaindre. De plus, elle fauche correctement le blé et on ne lui en demande pas plus.', 'ep': 1, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 4, 1, 1, 50, 50, false, false], 'p': 1};
I.u[8541] = {'n': 'Canne de l\'apprenti pêcheur', 'nn': 'CANNE DE L\'APPRENTI PECHEUR', 't': 20, 'd': 'Cette canne à pêche a connu des jours meilleurs, le fil n\'est plus très solide et l\'hameçon incertain. Parfaite pour la pêche au goujon.', 'ep': 1, 'g': 8, 'l': 1, 'wd': true, 'fm': true, 'w': 4, 'an': 18, 'e': [1, 4, 1, 1, 100, 100, false, false], 'p': 1};
I.u[8542] = {'n': 'Gants de l\'apprenti alchimiste', 'nn': 'GANTS DE L\'APPRENTI ALCHIMISTE', 't': 20, 'd': 'Des gants d\'une qualité indiscutable, presque pas de trou, l\'odeur de sueur de l\'ancien propriétaire est tout juste perceptible, des doigts trop courts,  un maintien incertain... C\'est indiscutable, ces gants sont pourris.', 'ep': 1, 'g': 5, 'l': 1, 'wd': true, 'fm': true, 'w': 5, 'e': [5, 3, 1, 1, 30, 50, false, true], 'p': 1};
I.u[8543] = {'n': 'Limonade d\'Incarnam', 'nn': 'LIMONADE D\'INCARNAM', 't': 79, 'd': 'Cette limonade fabriquée par les dieux est un mélange d\'eau, de bulles, et d\'extraits d\'animaux. Elle revigore les jeunes âmes venant justes de s\'incarner dans Incarnam. Pour les autres, c\'est de l\'eau gazeuse tout juste bonne à s\'entraîner pour les concours de rots.', 'ep': 1, 'g': 4, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PL<16', 'u': true, 'ut': true, 'p': 1};
I.u[8544] = {'n': 'Certificat de Mise en Chanil : Walk', 'nn': 'CERTIFICAT DE MISE EN CHANIL : WALK', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Walk que vous avez placé au chanil.', 'ep': 3, 'g': 43, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8545] = {'n': 'Clef du Donjon d\'Incarnam', 'nn': 'CLEF DU DONJON D\'INCARNAM', 't': 84, 'd': 'Cette clef permet d\'entrer dans le donjon d\'Incarnam, habité par le terrible Milimilou.', 'ep': 1, 'g': 19, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8546] = {'n': 'Peau de Milimilou', 'nn': 'PEAU DE MILIMILOU', 't': 59, 'd': 'De légères bouclettes font de cette peau une belle descente de lit. Il est certain que quelqu\'un sur Incarnam est prêt à troquer contre cette peau. Reste à trouver qui ...', 'ep': 1, 'g': 3, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8547] = {'n': 'Trinsfirmitik ik Nikiril', 'nn': 'TRINSFIRMITIK IK NIKIRIL', 't': 31, 'd': 'Lik nisittik miditik sint mivisik pir lik sintik.', 'ep': 1, 'g': 19, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8548] = {'n': 'Twansfowmation en Tiwabbit', 'nn': 'TWANSFOWMATION EN TIWABBIT', 't': 31, 'd': 'Les cawottes maudites sont mauwaises pouw la santé.', 'ep': 8, 'g': 19, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8557] = {'n': 'Plume du Batofu', 'nn': 'PLUME DU BATOFU', 't': 53, 'd': 'Cette plume directement arrachée des aisselles du Batofu diffuse une odeur de Doubitchou ancestral mariné.', 'ep': 3, 'g': 120, 'l': 20, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8558] = {'n': 'Chapeau du Lapino', 'nn': 'CHAPEAU DU LAPINO', 't': 16, 'd': 'Si vous envisagez de dialoguer avec les Wabbits, c\'est peut-être la coiffe qu\'il vous faut. Si vous cherchez à séduire, posez cette coiffe sur la tête de vos rivaux.', 'ep': 1, 'g': 170, 'l': 6, 'wd': true, 'fm': true, 'w': 10, 'p': 1200};
I.u[8559] = {'n': 'La HmmMmmMmmm', 'nn': 'LA HMMMMMMMMM', 't': 16, 'd': 'Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.', 'ep': 2, 'g': 171, 'l': 42, 'wd': true, 'fm': true, 'w': 1, 'p': 420};
I.u[8561] = {'n': 'Bébé Pandawa', 'nn': 'BEBE PANDAWA', 't': 18, 'd': 'Cet adorable bébé Pandawa adorera vous suivre partout pour découvrir le monde de ses grands yeux ronds. Ce familier apprivoisé mange du riz, mais accepte également les noisettes.', 'ep': 3, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[8563] = {'n': 'Titi Gobelait', 'nn': 'TITI GOBELAIT', 't': 32, 'd': 'Titi doit rencontrer son futur professeur de magie.', 'ep': 1, 'g': 18, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8564] = {'n': 'Certificat de Mise en Chanil : Bébé Pandawa', 'nn': 'CERTIFICAT DE MISE EN CHANIL : BEBE PANDAWA', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Bébé Pandawa que vous avez placé au chanil.', 'ep': 3, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8565] = {'n': 'Fantôme Bébé Pandawa', 'nn': 'FANTOME BEBE PANDAWA', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 44, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8566] = {'n': 'Transformation Walk', 'nn': 'TRANSFORMATION WALK', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 20, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'm': true, 'p': 1};
I.u[8567] = {'n': 'Transformation Fantôme Bébé Pandawa', 'nn': 'TRANSFORMATION FANTOME BEBE PANDAWA', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 20, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'm': true, 'p': 1};
I.u[8568] = {'n': 'Cadeau Bébé Pandawa', 'nn': 'CADEAU BEBE PANDAWA', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8569] = {'n': 'Doro le Blak', 'nn': 'DORO LE BLAK', 't': 16, 'd': 'Cette coiffe appartenait à une petite Xélorette, qui prenait un malin plaisir à dérégler l\'écoulement du temps. La légende raconte qu\'elle parvint à voler plusieurs jours aux habitants d\'Amakna. Elle ne s\'est soustraite à la colère de la population qu\'en distribuant de nombreuses friandises.', 'ep': 22, 'g': 172, 'l': 129, 'wd': true, 'fm': true, 'w': 10, 'p': 42512};
I.u[8570] = {'n': 'Poil de Rat Bontarien', 'nn': 'POIL DE RAT BONTARIEN', 't': 54, 'd': 'Ce poil appartenait aux rats des égouts de Bonta, les seuls qui possèdent des touffes de poils assorties aux couleurs des murailles de leur cité.', 'ep': 2, 'g': 672, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8571] = {'n': 'Poil de Rat Brâkmarien', 'nn': 'POIL DE RAT BRAKMARIEN', 't': 54, 'd': 'Ce poil appartenait aux rats des égouts de Brâkmar, les seuls qui possèdent des touffes de poils assorties aux couleurs des murailles de leur cité.', 'ep': 2, 'g': 673, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[8572] = {'n': 'Potion d\'oubli : \'Apprivoisement de monture\'', 'nn': 'POTION D\'OUBLI : \'APPRIVOISEMENT DE MONTURE\'', 't': 43, 'd': 'Cette potion d\'oubli permet d\'oublier un niveau du sort ' + '"' + 'Apprivoisement de monture' + '"' + '.', 'ep': 5, 'g': 36, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
I.u[8573] = {'n': 'Potion d\'oubli : \'Boomerang perfide\'', 'nn': 'POTION D\'OUBLI : \'BOOMERANG PERFIDE\'', 't': 43, 'd': 'Cette potion d\'oubli permet d\'oublier un niveau du sort \'Boomerang perfide\'.', 'ep': 5, 'g': 36, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
I.u[8574] = {'n': 'Dofus vinaigrette', 'nn': 'DOFUS VINAIGRETTE', 't': 23, 'd': 'Avec ou sans lardons, ce Dofus est toujours aussi bon.', 'ep': 0, 'g': 13, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[8575] = {'n': 'Le Ramboton', 'nn': 'LE RAMBOTON', 't': 4, 'd': 'Un célèbre guerrier Féca qui vivait dans la jungle de Pandala disait souvent ' + '"' + 'Pour gagner la guerre, il faut devenir la guerre' + '"' + '.', 'ep': 1, 'g': 71, 'l': 200, 'wd': false, 'fm': true, 'w': 20, 'an': 12, 'tw': true, 'e': [7, 3, 1, 2, 42, 42, false, true], 'c': 'PN~xxramboplxx', 'p': 100000};
I.u[8576] = {'n': 'Parchemin de recommandation d\'Yse Vewybad', 'nn': 'PARCHEMIN DE RECOMMANDATION D\'YSE VEWYBAD', 't': 24, 'd': 'Ce parchemin vous a été remis par Yse Vewybad pour services rendus.', 'ep': 2, 'g': 26, 'l': 20, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[8588] = {'n': 'Insigne Roublard', 'nn': 'INSIGNE ROUBLARD', 't': 24, 'd': 'Cet insigne, donné par un roublard, sera peut-être la clef pour rentrer dans le repaire de ces derniers.', 'ep': 2, 'g': 86, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8590] = {'n': 'Contrat entre Vil Smisse et Yse Vewybad', 'nn': 'CONTRAT ENTRE VIL SMISSE ET YSE VEWYBAD', 't': 24, 'd': 'Ce contrat prouve la félonie d\'Yse Vewybad. Il ne reste plus qu\'à le porter à qui de droit.', 'ep': 1, 'g': 26, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8595] = {'n': 'Oeuf de Tofu Obèse', 'nn': 'OEUF DE TOFU OBESE', 't': 24, 'd': 'Cet oeuf renferme un tofu obèse, peut-être le futur vainqueur du pwince d\'Wa.', 'ep': 1, 'g': 122, 'l': 1, 'wd': true, 'fm': false, 'w': 0, 'p': 1};
I.u[8596] = {'n': 'Griffe Pourpre', 'nn': 'GRIFFE POURPRE', 't': 6, 'd': 'Cette épée acérée a pris cette teinte pourpre si élégante après avoir éviscéré des milliers de Bworks. Alors qu\'avant, elle n\'était que violet foncé.', 'ep': 22, 'g': 72, 'l': 145, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'tw': true, 'e': [8, 6, 1, 1, 45, 100, false, false], 'c': 'CS>350&CV>400', 'p': 52000};
I.u[8597] = {'n': 'Potion de Gavage', 'nn': 'POTION DE GAVAGE', 't': 24, 'd': 'Cette potion va permettre à Vil Smisse d\'engraisser le tofu obèse que vous lui avez ramené.', 'ep': 3, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8598] = {'n': 'Dagues Ruyère', 'nn': 'DAGUES RUYERE', 't': 5, 'd': 'Ces dagues sont perforées tout au long de la lame, afin d\'émettre un joli sifflement quand on les manie rapidement. Les trous sont également très efficaces pour entraîner les viscères de ses ennemis.', 'ep': 22, 'g': 61, 'l': 67, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [10, 3, 1, 1, 30, 50, false, true], 'c': 'CA>100', 'p': 10654};
I.u[8599] = {'n': 'Griffettes', 'nn': 'GRIFFETTES', 't': 5, 'd': 'Ces dagues ont été forgées pour une écaflipette maniaque de la manucure. Elle trouvait que les lourdes épées s\'accordaient mal à ses jolies griffes vernies.', 'ep': 22, 'g': 62, 'l': 69, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [15, 3, 1, 1, 30, 30, false, true], 'c': 'CA>100&CS>100', 'p': 11254};
I.u[8600] = {'n': 'La flemme de monter les escaliers', 'nn': 'LA FLEMME DE MONTER LES ESCALIERS', 't': 30, 'd': 'Vous avez attrapé un gros coup de fatigue à force de crier à tous vents, et vous ne vous sentez plus capable de grimper autant de marches avant au moins 6 minutes ...', 'ep': 1, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8603] = {'n': 'Livrée de valet du Prince Wabbit', 'nn': 'LIVREE DE VALET DU PRINCE WABBIT', 't': 24, 'd': 'Avec ça, le valet du prince Wabbit sera à la dernière mode.', 'ep': 2, 'g': 715, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8604] = {'n': 'Epée Doncule', 'nn': 'EPEE DONCULE', 't': 6, 'd': 'Cette épée brillante est idéale pour cueillir des fleurs, même si elles se défendent. Elle est même parfaite pour cueillir des arbres.', 'ep': 22, 'g': 73, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'e': [15, 8, 1, 1, 40, 50, false, false], 'c': 'CS>250&CI<1', 'p': 25654};
I.u[8605] = {'n': 'Epée Zervatif', 'nn': 'EPEE ZERVATIF', 't': 6, 'd': 'Cette lame est lubrifiée afin de glisser plus facilement dans son fourreau. En revanche elle est impossible à nettoyer et doit être jetée après utilisation, surtout si elle est recouverte de sang. N\'oubliez pas qu\'elle sert avant tout à se protéger.', 'ep': 22, 'g': 74, 'l': 73, 'wd': true, 'fm': true, 'w': 15, 'an': 14, 'e': [5, 5, 1, 1, 40, 50, false, true], 'c': 'CS>80&CI>80&CA>80', 'p': 14000};
I.u[8606] = {'n': 'Robe de la mariée', 'nn': 'ROBE DE LA MARIEE', 't': 24, 'd': 'La robe de la mariée est soigneusement emballée dans ce beau paquet. Il ne reste plus qu\'à l\'apporter à l\'intendant San Lavalss.', 'ep': 2, 'g': 715, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8607] = {'n': 'Le Bâton Cloutay', 'nn': 'LE BATON CLOUTAY', 't': 4, 'd': 'C\'est un gros bâton, avec des clous plantés dedans. N\'y cherchez pas autre chose, c\'est la simplicité même, et pourtant, il est diablement efficace pour déchausser les dents de vos adversaires.', 'ep': 22, 'g': 72, 'l': 107, 'wd': true, 'fm': true, 'w': 15, 'an': 12, 'tw': true, 'e': [7, 4, 1, 1, 30, 50, false, true], 'c': 'CA>150&CI>150', 'p': 29856};
I.u[8608] = {'n': 'La Bastonneuze', 'nn': 'LA BASTONNEUZE', 't': 4, 'd': 'On raconte qu\'un disciple de Sadida du nom de Fraye a utilisé ce bâton pour défendre sa femme et son fils face à un troupeau de Bouftous enragés. Il est regrettable qu\'il ait confondu sa famille avec les monstres pendant l\'échauffourée.', 'ep': 22, 'g': 73, 'l': 85, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [10, 4, 1, 1, 35, 40, false, true], 'c': 'CW>150&CV>200', 'p': 20000};
I.u[8609] = {'n': 'Geish\'Arc', 'nn': 'GEISH\'ARC', 't': 2, 'd': 'Cet Arc est léger, fin, élégant, et sent bon la fleur de cerisier. Il est également meurtrier si l\'on s\'en sert pour autre chose que se pavaner.', 'ep': 22, 'g': 56, 'l': 81, 'wd': true, 'fm': true, 'w': 15, 'an': 10, 'tw': true, 'e': [5, 4, 3, 7, 30, 50, false, true], 'c': 'CA>200', 'p': 16900};
I.u[8610] = {'n': 'Le Kikoularc', 'nn': 'LE KIKOULARC', 't': 2, 'd': 'Si vous tenez cet arc bien haut et prononcez avec entrain le mot ' + '"' + 'Pampulilu !' + '"' + ', vous aurez vraiment l\'air ridicule.', 'ep': 22, 'g': 57, 'l': 79, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [7, 5, 4, 7, 30, 50, false, true], 'c': 'CI>150&CC>150', 'p': 15320};
I.u[8611] = {'n': 'Bagdette Café', 'nn': 'BAGDETTE CAFE', 't': 3, 'd': 'Cette baguette appartient au célèbre Grinegau, qui fait du très bon café, mais qui ne vendra pas son échelle.', 'ep': 22, 'g': 61, 'l': 72, 'wd': true, 'fm': true, 'w': 15, 'an': 11, 'e': [5, 3, 2, 4, 15, 50, false, true], 'c': 'CI>100&CC>100', 'p': 16500};
I.u[8612] = {'n': 'La Bidjiz', 'nn': 'LA BIDJIZ', 't': 3, 'd': 'Avec la Bidjiz, vous resterez vivant, sûrement parce que vos adversaires se mettront à danser en voyant les multiples facettes de la boule qui orne cette baguette.', 'ep': 22, 'g': 62, 'l': 79, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'tw': true, 'e': [10, 4, 2, 5, 40, 50, false, true], 'c': 'CA>150', 'p': 18000};
I.u[8613] = {'n': 'Pelle Minstère', 'nn': 'PELLE MINSTERE', 't': 8, 'd': 'Créée comme une œuvre d\'art de la forgemagie, cette pelle creuse très mal, sauf dans la tête de vos adversaires.', 'ep': 22, 'g': 46, 'l': 70, 'wd': true, 'fm': true, 'w': 10, 'an': 16, 'tw': true, 'e': [5, 4, 1, 1, 30, 50, false, false], 'c': 'CC>100', 'p': 13540};
I.u[8614] = {'n': 'Pelle Ripe', 'nn': 'PELLE RIPE', 't': 8, 'd': 'Magnifique invention, cette pelle deux-en-un permet de creuser une tombe et de la laisser comme croix. A condition de ne perdre qu\'un compagnon à la fois, sous peine de creuser les tombes suivantes avec les mains.', 'ep': 22, 'g': 47, 'l': 66, 'wd': true, 'fm': true, 'w': 1, 'an': 16, 'tw': true, 'e': [5, 4, 1, 1, 20, 30, false, false], 'c': 'CI>100&CC>50', 'p': 1};
I.u[8615] = {'n': 'Marteau Mato', 'nn': 'MARTEAU MATO', 't': 7, 'd': 'Ce marteau réduit si facilement les crânes en bouillie qu\'il a pris une élégante teinte rouge tomate.', 'ep': 22, 'g': 61, 'l': 83, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'e': [10, 4, 1, 1, 40, 50, false, false], 'c': 'CI>100&CV>100', 'p': 17560};
I.u[8616] = {'n': 'Marteau Minokers', 'nn': 'MARTEAU MINOKERS', 't': 7, 'd': 'Ce marteau a été créé à l\'époque du Roi Stéphane, qui a terrorisé des millions de gens.', 'ep': 22, 'g': 62, 'l': 178, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 40, 50, false, true], 'c': 'CI>350&CW>180', 'p': 10000};
I.u[8617] = {'n': 'Hache Ebbah', 'nn': 'HACHE EBBAH', 't': 19, 'd': 'Pour dire je t\'aime.', 'ep': 22, 'g': 45, 'l': 62, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 4, 1, 1, 20, 30, false, false], 'c': 'CV>150', 'p': 10200};
I.u[8618] = {'n': 'Hache Eulouh', 'nn': 'HACHE EULOUH', 't': 19, 'd': 'Cette étrange hache est profilée de façon à décapiter plus facilement les Bworks. L\'aisance avec laquelle elle décapite aussi les habitants d\'Astrub indique clairement qu\'il existe un lien entre ces deux populations. Mais personne n\'a encore trouvé lequel.', 'ep': 22, 'g': 46, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'tw': true, 'e': [10, 4, 1, 1, 50, 50, false, true], 'c': 'CC>120&CA>60', 'p': 16700};
I.u[8619] = {'n': 'Casque Keutumedi', 'nn': 'CASQUE KEUTUMEDI', 't': 16, 'd': 'Grâce à cette coiffe guerrière, les Iops ont vraiment fière allure. Le seul problème est qu\'elle leur cache une partie de leur champ de vision et les empêche d\'entendre correctement les paroles de leurs adversaires. Le casque Keutumedi est vraiment fait pour les gens qui aiment frapper avant de réfléchir.', 'ep': 22, 'g': 175, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 81, 'p': 10000};
I.u[8621] = {'n': 'Cawotte Maudite', 'nn': 'CAWOTTE MAUDITE', 't': 94, 'd': 'Cette appétissante cawotte à l\'aiw owdinaiwe mais elle sent le maléfice à plein museau. Wésistewez-vous à la tentation de la cwoquew à pleines dents ?', 'ep': 8, 'g': 6, 'l': 21, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 100};
I.u[8624] = {'n': 'Ballon Bleu Magique', 'nn': 'BALLON BLEU MAGIQUE', 't': 94, 'd': 'Contrairement aux contrefaçons que l\'on trouve à la foire du Trool, ce ballon-ci sait au moins s\'envoler avec grâce et aisance. Il est confectionné à partir d\'une larve bleue, vidée encore remuante, puis gonflée par un Trool, selon la traditionnelle recette du grand mage Vahy Nez.', 'ep': 1, 'g': 7, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8625] = {'n': 'Ballon Vert Magique', 'nn': 'BALLON VERT MAGIQUE', 't': 94, 'd': 'Ce ballon vert est le résultat assez étrange qui se produit lorsqu\'une larve verte mange un champignon Luidegît. Notez qu\'après ce repas les yeux de la larve sortent généralement de leur orbite et roulent au sol. Ils sont alors souvent ramassés par les bworks des environs, friands de ces mets pour leur apéritif. Ce ballon a inspiré ses célèbres recettes au grand mage Vahy Nez.', 'ep': 1, 'g': 8, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8626] = {'n': 'Nisitik Miditik', 'nn': 'NISITIK MIDITIK', 't': 94, 'd': 'Cittik ippitissintik nisitik ii ik\'ik irdinirik mis illik sik lik milificik ii plinik misik. Risistirik-vis ik lik tintitinik dik lik grinitik ii plinik dints ?', 'ep': 6, 'g': 9, 'l': 21, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 100};
I.u[8627] = {'n': 'Flûte de Sarr Ys', 'nn': 'FLUTE DE SARR YS', 't': 3, 'd': 'Confrère et ami du célèbre Guy-guy (proche parent du Chêne Mou), Sarr Ys est un troubadour dont les notes enchanteresses ont gravées leurs empruntes dans la mémoire d\'Amakna. Malheureusement, ce brillant artiste est décédé tragiquement dans un accident de Koin Koin, lors d\'une beuverie estivale.', 'ep': 1, 'g': 63, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'an': 11, 'e': [10, 6, 2, 3, 100, 30, false, true], 'p': 1};
I.u[8628] = {'n': 'Chapeau Leufère', 'nn': 'CHAPEAU LEUFERE', 't': 16, 'd': 'Cette coiffe procure assurance et témérité à celui qui la porte. Grâce à elle vous irez toujours de l\'avant, en pensant être capable de réaliser tous les exploits. Pensez toutefois à l\'enlever de temps en temps, sinon elle vous entraînera dans des situations inextricables !', 'ep': 22, 'g': 185, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 88, 'p': 10000};
I.u[8629] = {'n': 'Chapeau Grave', 'nn': 'CHAPEAU GRAVE', 't': 16, 'd': 'À cause de cette coiffe, les adversaires deviennent souvent muets comme une tombe. On n\'ose demander à quoi est censé ressembler ce couvre-chef, on ne peut plus atypique. Mais ce n\'est pas très grave. Les Srams ne sont guère susceptibles.', 'ep': 22, 'g': 179, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 89, 'p': 10000};
I.u[8630] = {'n': 'Bonnet Nufar', 'nn': 'BONNET NUFAR', 't': 16, 'd': 'Cette coiffe ressemble beaucoup au Sulik et au Piruk. Mais comme elle est très confortable et que les Xélors ne la quittent jamais, même pour dormir, elle est communément nommée Bonnet Nufar. Elle dégage une agréable odeur de nymphéa qui contribue à l\'endormissement. En revanche, les ronflements qu\'elle provoque sont aussi insupportables que les chants de crapaud lors de la saison des amours.', 'ep': 22, 'g': 177, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 86, 'p': 10000};
I.u[8631] = {'n': 'Coiffe Fère', 'nn': 'COIFFE FERE', 't': 16, 'd': 'Grâce à la Coiffe Fère, les Eniripsas savent toujours comment agir en cas d\'urgence. En effet, la liste des gestes de premiers secours y est discrètement inscrite dans la doublure. Ce couvre-chef leur donne un air doctoral, comme s\'ils venaient de recevoir leur diplôme, alors que personne n\'oserait arborer un chapeau aussi ridicule lors d\'une cérémonie scolaire !', 'ep': 22, 'g': 184, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 83, 'p': 10000};
I.u[8632] = {'n': 'Chapeau Tyron', 'nn': 'CHAPEAU TYRON', 't': 16, 'd': 'On aurait pu croire que cette coiffe possédait une jolie couleur orangée. C\'est pas du tout le cas. De plus, cet accessoire de mode tient plus du masque que du chapeau. Alors pourquoi ces créateurs l\'ont-ils nommé Chapeau Tyron ? Sûrement pour faire parler les bavards !', 'ep': 22, 'g': 178, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 90, 'p': 10000};
I.u[8633] = {'n': 'Bonnet Spairance', 'nn': 'BONNET SPAIRANCE', 't': 16, 'd': 'Les pointes acérées qui sortent de ce bonnet permettent non seulement de blesser l\'adversaire mais aussi d\'avoir plus de chance de se prendre la foudre sur le crâne par temps d\'orage. Les Sacrieurs sont en effet une classe qui aime autant faire souffrir les autres qu\'eux-mêmes. Une bonne odeur de chair grillée : rien de tel pour commencer la journée !', 'ep': 22, 'g': 180, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 87, 'p': 10000};
I.u[8634] = {'n': 'Capuche Apin', 'nn': 'CAPUCHE APIN', 't': 16, 'd': 'Grâce à cette coiffe, vous aurez vraiment l\'air d\'une bête à cornes. Nul doute que l\'on se retourne pour admirer la très grosse paire qui orne votre tête. Cette ample capuche permet aussi de conserver au frais des aliments comme le foin pour Bouftou ou le pain pour Tofu.', 'ep': 22, 'g': 181, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 84, 'p': 10000};
I.u[8635] = {'n': 'Chapeau Lithique', 'nn': 'CHAPEAU LITHIQUE', 't': 16, 'd': 'Cette coiffe a la propriété de faire dire au porteur des promesses qu\'il oublie aussitôt. Est-ce parce qu\'elle exerce une pression sur les zones de la mémoire ou sur celle du langage ? Nul ne le sait précisément. L\'important est de ne prendre en compte que les paroles les moins extravagantes.', 'ep': 22, 'g': 176, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 92, 'p': 10000};
I.u[8636] = {'n': 'Coiffe de Robbie Capuche', 'nn': 'COIFFE DE ROBBIE CAPUCHE', 't': 16, 'd': 'Robbie Capuche était un célèbre Crâ qui vivait dans les bois, d\'où la couleur verte de sa coiffe pour se fondre dans le paysage. Il se prenait pour un justicier et passait tout son temps à dérober l\'argent des riches au profit d\'une bonne cause : la sienne.', 'ep': 22, 'g': 186, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 82, 'p': 10000};
I.u[8637] = {'n': 'Bonnet Toual', 'nn': 'BONNET TOUAL', 't': 16, 'd': 'En revêtant cette coiffe, le Féca accroît sa chance et celle de ses alliés. Si votre groupe est guidé par un Féca portant un Bonnet Toual, vous êtes sûr d\'arriver à bon port et ce presque sans une égratignure. Mais l\'odeur est si nauséabonde que cela en fait l\'objet idéal pour se protéger de la veuve et de l\'orphelin.', 'ep': 22, 'g': 182, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 91, 'p': 10000};
I.u[8638] = {'n': 'Chapeau Taufeu', 'nn': 'CHAPEAU TAUFEU', 't': 16, 'd': 'Ce couvre-chef sert aussi bien de protection contre les intempéries que d\'accessoire de cuisine, pour mitonner des plats à la bonne température. L\'agitation du chapeau permet d\'apporter l\'afflux d\'air nécessaire à la bonne tenue du feu de cuisson. Et, comme tout le monde sait que le pot au feu est un plat qui se mijote pendant longtemps, on comprend mieux pourquoi les Enutrofs ont des poignets si musclés.', 'ep': 22, 'g': 183, 'l': 40, 'wd': true, 'fm': false, 'w': 1, 's': 85, 'p': 10000};
I.u[8639] = {'n': 'Cape Aurale', 'nn': 'CAPE AURALE', 't': 17, 'd': 'La cape qui flotte au vent est indispensable pour vous procurer une aura de guerrier, surtout si vous tournez le dos à l\'adversaire. Certains pensent qu\'elle est renforcée par une plaque de métal qui permet de parer tous les coups sournois.', 'ep': 22, 'g': 131, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 81, 'p': 10000};
I.u[8640] = {'n': 'Cape Aillé', 'nn': 'CAPE AILLE', 't': 17, 'd': 'Faite dans un tissu doux et résistant, cette cape donne aux Ecaflips l\'impression qu\'ils sont toujours des as, quoi qu\'il arrive. Lorsqu\'ils remportent la victoire, ils adorent se draper dans ce vêtement avant de réclamer leur récompense : « Et maintenant, t\'as qu\'à payer ! »', 'ep': 22, 'g': 133, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 88, 'p': 10000};
I.u[8641] = {'n': 'Cape Routh', 'nn': 'CAPE ROUTH', 't': 17, 'd': 'Cette cape est si légère et si fine qu\'elle s\'envole à la moindre brise de vent, de n\'importe quel vent. Pas toujours très pratique, surtout lorsque l\'on veut se faire discret, après un repas composé de légumineuses et de diverses boissons fermentées.', 'ep': 22, 'g': 140, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 89, 'p': 10000};
I.u[8642] = {'n': 'Cape Huchon', 'nn': 'CAPE HUCHON', 't': 17, 'd': 'La couleur sombre de cette cape lui permet d\'être en harmonie avec n\'importe quel vêtement, quel que soit son coloris. Comme elle est très ample, elle permet aussi de protéger la tête et le bout du nez.', 'ep': 22, 'g': 141, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 86, 'p': 10000};
I.u[8643] = {'n': 'Cape Sulhit', 'nn': 'CAPE SULHIT', 't': 17, 'd': 'La Cape Sulhit se met délicatement sur les épaules afin de protéger son porteur des tendinites et de l\'enraidissement des articulations. Vêtement aux vertus médicales, il est regardé avec envie par les Pandawas, qui passent beaucoup de temps à porter leur adversaire comme leur allié. Eux-aussi, ils aimeraient avoir un vêtement de ce type.', 'ep': 22, 'g': 134, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 83, 'p': 10000};
I.u[8644] = {'n': 'Cape Hitton', 'nn': 'CAPE HITTON', 't': 17, 'd': 'Cet objet sert à cacher les surcharges pondérales des Sadidas. À force de dormir au lieu de faire de l\'exercice physique, les personnages de cette classe développent une tendance à l\'embonpoint. Si les Sadidettes possèdent des réserves anti-famine, avantageusement placées pour flatter les regards masculins, les Sadidas tentent plutôt de masquer les leurs grâce à cette cape.', 'ep': 22, 'g': 139, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 90, 'p': 10000};
I.u[8645] = {'n': 'Cape Ytale', 'nn': 'CAPE YTALE', 't': 17, 'd': 'Ce vêtement joue un rôle primordial dans la prestance des Sacrieurs. Ils s\'en servent comme bandage pour panser les plaies, comme serpillière pour essuyer le sang, comme descente de lit pour ne pas avoir froid aux pieds. On ne dira jamais à quel point les personnages de cette classe redoutent les sols gelés !', 'ep': 22, 'g': 138, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 87, 'p': 10000};
I.u[8646] = {'n': 'Cape Lyne', 'nn': 'CAPE LYNE', 't': 17, 'd': 'Cette douce cape est parfois employée par les Osamodettes coquettes en guise de couvre-chef aux larges bords. Les Osamodas mâles ne s\'en servent que comme pèlerine. Grâce au dessin qui orne cet habit, cette classe de personnages a hérité d\'une réputation de grande franchise. On ne les voit jamais rire sous cape car le rire est cousu dessus.', 'ep': 22, 'g': 137, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 84, 'p': 10000};
I.u[8647] = {'n': 'Cape Wéra', 'nn': 'CAPE WERA', 't': 17, 'd': 'Les Pandawas se servent de cette cape comme protection contre les intempéries et comme accessoire de danse. Ils la posent à terre, au centre d\'un cercle de danseurs éméchés. Puis, ils commencent leur chorégraphie improvisée sans que le pied touche le sol en dehors de la zone délimitée par ce vêtement.', 'ep': 22, 'g': 142, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 92, 'p': 10000};
I.u[8648] = {'n': 'Cape Hulco', 'nn': 'CAPE HULCO', 't': 17, 'd': 'La cape Hulco tire son origine du nom d\'un Crâ atypique. Celui-ci possédait un sens de l\'orientation très particulier. Il était capable de se perdre chez lui. Et pourtant ce n\'était pas bien grand ! Son problème résidait dans une déformation des fonctions du cerveau : pour lui, tous les lieux ressemblent une vaste plage, entourée de cocotiers, baignée par la lumière chaude d\'un soleil couchant.', 'ep': 22, 'g': 132, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 82, 'p': 10000};
I.u[8649] = {'n': 'Cape Hadosse', 'nn': 'CAPE HADOSSE', 't': 17, 'd': 'Les couleurs chaudes et réconfortantes de cette cape peuvent entraîner son porteur dans un voyage imaginaire, dans des contrées ensoleillées, pleines de canyons creusés par l\'érosion, et de décors rupestres taillées dans les roches et les falaises. C\'est extrêmement utile pour oublier le froid et la grisaille par temps de pluie.', 'ep': 22, 'g': 136, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 91, 'p': 10000};
I.u[8650] = {'n': 'Cape Haharnum', 'nn': 'CAPE HAHARNUM', 't': 17, 'd': 'Les Enutrofs ont pris l\'habitude de dessiner une carte sur leur cape, car ils vivent dans un tel foutoir qu\'il leur est difficile de retrouver le chemin des toilettes. Cela est très problématique, surtout lorsque l\'on est sujet à des envies aussi pressantes qu\'incontrôlables !', 'ep': 22, 'g': 135, 'l': 80, 'wd': true, 'fm': false, 'w': 1, 's': 85, 'p': 10000};
I.u[8651] = {'n': 'Sangle Hynère', 'nn': 'SANGLE HYNERE', 't': 10, 'd': 'Cette magnifique sangle ajoute du prestige à la tenue des Iops. Certains prétendent que la croix centrale peut se transformer en une arme amovible, lorsque l\'épée n\'est pas à portée de main. C\'est bien sûr une légende, car seuls les Srams seraient assez fourbes pour ce genre de pratique.', 'ep': 22, 'g': 116, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 81, 'p': 10000};
I.u[8652] = {'n': 'Ceinture Buhlent', 'nn': 'CEINTURE BUHLENT', 't': 10, 'd': 'Lorsqu\'un Ecaflip ne sait pas quoi faire, il dégaine son jeu de carte de sa ceinture et entame un solitaire. En combat, il se sert également de ses cartes en tant que projectiles. Il tire plus vite que son ombre et, après la victoire, il est toujours temps de faire une petite partie !', 'ep': 22, 'g': 117, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 88, 'p': 10000};
I.u[8653] = {'n': 'Sangle Glinglin', 'nn': 'SANGLE GLINGLIN', 't': 10, 'd': 'L\'origine du nom de cette ceinture provient du bruit particulier qu\'elle produit. L\'entrechoc des os ornant la sangle empêche les Srams, même invisibles, de passer inaperçus. Aussi, on peut les entendre dire : « Surprendre quelqu\'un avec la Sangle Glinglin ? Tu peux toujours attendre ! ».', 'ep': 22, 'g': 118, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 89, 'p': 10000};
I.u[8654] = {'n': 'Ceinture Lupine', 'nn': 'CEINTURE LUPINE', 't': 10, 'd': 'Le tic-tac incessant du système d\'horlogerie de la Ceinture Lupine empêche les Xélors de s\'endormir lorsque les combats s\'éternisent. Il est donc vivement recommandé d\'enlever cette ceinture avant d\'aller se coucher.', 'ep': 22, 'g': 119, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 86, 'p': 10000};
I.u[8655] = {'n': 'Sangle Holon', 'nn': 'SANGLE HOLON', 't': 10, 'd': 'À défaut d\'enrayer les pleurs, la sangle Holon permet de transporter du matériel médical. Inutile de faire jouer les violons de l\'automne qui blessent les tympans d\'une langueur monotone. Les diverses potions utiles pour soigner les maux de gorge et autres affections ORL s\'y trouvent soigneusement rangées. En effet, un Eniripsa à la voix enrouée ne peut pas lancer correctement ses sorts. Lorsqu\'il est aphone, il est aussi utile qu\'une veste polaire en pleine canicule.', 'ep': 22, 'g': 120, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 83, 'p': 10000};
I.u[8656] = {'n': 'Ceinture Luthe', 'nn': 'CEINTURE LUTHE', 't': 10, 'd': 'Les raisons qui ont poussé les concepteurs de cet accessoire de mode à placer une tête de poupée près de l\'entrejambe restent mystérieuses. Bien des théories ont été avancées, mais chacun sait que tout ceci n\'est que du pipeau !', 'ep': 22, 'g': 121, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 90, 'p': 10000};
I.u[8657] = {'n': 'Sangle Hans', 'nn': 'SANGLE HANS', 't': 10, 'd': 'Guerriers d\'une ancienne tribu réputée pour son goût du sang, les Hans seraient les premiers adorateurs de la déesse Sacrieur. Sous son apparence inoffensive, cette ceinture est en réalité un instrument de torture sophistiqué.', 'ep': 22, 'g': 122, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 87, 'p': 10000};
I.u[8658] = {'n': 'Ceinture Bodiézèle', 'nn': 'CEINTURE BODIEZELE', 't': 10, 'd': 'Les Osamodas ont la réputation d\'être un peu impulsif. Ils ont tendance à démarrer au quart de tour. Cette ceinture aux multiples boucles leur sert à refréner cette spontanéité : « Avant d\'allumer ta colère, et d\'avoir les yeux injectés de sang, touche toutes les cornes de ta Ceinture Bodiézèle ! »', 'ep': 22, 'g': 123, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 84, 'p': 10000};
I.u[8659] = {'n': 'Sangle Huée', 'nn': 'SANGLE HUEE', 't': 10, 'd': 'Cette ceinture aide les Pandawas à se tenir à peu près droit lorsqu\'ils sont saouls, ce qui leur arrive souvent. Dans ces moments-là, ils ont tendance à se sentir englués au sol, alors que la gravité n\'a aucun rapport avec cette sensation de pesanteur. Elle est bien trop occupée à assommer les scientifiques à coup de pommes.', 'ep': 22, 'g': 124, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 92, 'p': 10000};
I.u[8660] = {'n': 'Sangle Cible', 'nn': 'SANGLE CIBLE', 't': 10, 'd': 'Ce ceinturon permet à la fois de retenir les vêtements tombants (pour ne pas effrayer les âmes sensibles) et d\'offrir une mire pour les jeunes Crâ en phase d\'apprentissage. En effet, on leur apprend à ne jamais tirer en dessous de la ceinture, mais juste au milieu.', 'ep': 22, 'g': 125, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 82, 'p': 10000};
I.u[8661] = {'n': 'Gaine Hage', 'nn': 'GAINE HAGE', 't': 10, 'd': 'Prévoyants, les Fécas conservent des provisions de survie dans une petite sacoche. Celles-ci se composent essentiellement de pain en pierre de Craqueboule. C\'est pourquoi cette nourriture dure si longtemps. La Ceinture Deucékurité arrime fermement la sacoche à la taille, car le choc lié à la chute de ce sac de nourriture fait encore trop de blessés graves, par négligence ou inconscience.', 'ep': 22, 'g': 126, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 91, 'p': 10000};
I.u[8662] = {'n': 'Ceinture Gessant', 'nn': 'CEINTURE GESSANT', 't': 10, 'd': 'La Ceinture Gessant est un accessoire de mode très utile auprès les Enutrofs mâles. Grâce à la carte qui y est cousue, ils peuvent cacher certains accidents de parcours, lorsqu\'ils se sont perdus sur le chemin des toilettes.', 'ep': 22, 'g': 127, 'l': 130, 'wd': true, 'fm': false, 'w': 1, 's': 85, 'p': 10000};
I.u[8663] = {'n': 'Bottes Antrin', 'nn': 'BOTTES ANTRIN', 't': 11, 'd': 'Avec les bottes Antrin aux pieds, les Iops sont toujours les premiers à arriver sur le champ de bataille et à mettre de l\'ambiance. Il faut dire que cette classe de personnages adore amuser la galerie par ses exploits guerriers. Mais elle n\'est jamais prise au sérieux en raison de son intelligence inversement proportionnelle à sa force.', 'ep': 22, 'g': 100, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 81, 'p': 10000};
I.u[8664] = {'n': 'Charentaises à poils', 'nn': 'CHARENTAISES A POILS', 't': 11, 'd': 'On dit que les Sadidas ne se sentent jamais seuls, car ils peuvent invoquer plein de poupées pour leur tenir compagnie. Vous aussi, vous ne souffrirez plus de solitude grâce à ces chaussures ! Non seulement vous pourrez prendre votre pied pour lui parler, mais en plus, grâce à ces charentaises à poils, personne ne pourra plus mettre votre jeu à nu. Une fois qu\'on les a enfilées, on se sent vraiment bien, même si on a un peu honte de sortir avec.', 'ep': 22, 'g': 105, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 88, 'p': 10000};
I.u[8665] = {'n': 'Bottes Hox', 'nn': 'BOTTES HOX', 't': 11, 'd': 'Imprégnées d\'un produit repulpant à diffusion lente, ces bottes permettent d\'améliorer le galbe des jambes et de lutter contre le teint naturellement cadavérique des Srams. Cette crème a des effets spectaculaires sur la plastique des Srams femelles, mais semble totalement inefficace sur les mâles. Serait-ce un problème d\'hormone ?', 'ep': 22, 'g': 102, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 89, 'p': 10000};
I.u[8666] = {'n': 'Botte Hairo', 'nn': 'BOTTE HAIRO', 't': 11, 'd': 'Créées par un artiste Xélor, ces bottes devaient lui permettre de peindre plus rapidement. C\'est le cas ! En revanche, elles ont tendance à déformer la vision et plus précisément le sens des distances. Avec ces bottes, tout paraît plus rond. Appréciés par les Sadidas, les tableaux de ce Xélor ont contribué à rendre populaires les courbes généreuses des femmes un peu fortes.', 'ep': 22, 'g': 103, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 86, 'p': 10000};
I.u[8667] = {'n': 'Botte Ulisme', 'nn': 'BOTTE ULISME', 't': 11, 'd': 'Grâce à ces mi-bottes, vous serez toujours protégés des toxines provenant du sol. On ne se méfie jamais assez des microbes et autres bestioles qui traînent. Selon certains observateurs, ces chaussures ressemblent plus à des pantoufles qu\'à des bottes. Pourtant, les Eniripsas les nomment bien ainsi. Est-ce à cause de leur petite taille qu\'ils voient les choses sous un angle si différent ?', 'ep': 22, 'g': 104, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 83, 'p': 10000};
I.u[8668] = {'n': 'Bottes Hanik', 'nn': 'BOTTES HANIK', 't': 11, 'd': 'L\'amour des plantes pousse les Sadidas à s\'équiper des seules chaussures à reconnaissance florale. Grâce à leur système de détection, elles permettent à son porteur d\'éviter d\'écraser les plantes rares. Par contre, elles ne vous empêchent pas de marcher sur des excréments divers et variés, si vous ne regardez pas où vous mettez les pieds.', 'ep': 22, 'g': 101, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 90, 'p': 10000};
I.u[8669] = {'n': 'Tong Aclou', 'nn': 'TONG ACLOU', 't': 11, 'd': 'Contrairement aux autres classes, les Sacrieurs aiment vivre avec une épine dans le pied plutôt que de l\'enlever du talon. La douleur leur rappelle qu\'ils sont vivants et leur donne la rage de massacrer leur ennemi. De plus les traces de sang laissées en chemin permettent aux Sacrieurs de ne jamais se perdre. Ils sont toujours capables de retourner sur leur pas, ce qui n\'aurait pas été le cas s\'ils avaient des chaussures de mauvaises qualité.', 'ep': 22, 'g': 106, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 87, 'p': 10000};
I.u[8670] = {'n': 'Bottes Swana', 'nn': 'BOTTES SWANA', 't': 11, 'd': 'Ces chaussures permettent aux Osamodas d\'arpenter de longues distances à travers les continents, même les plus reculés. À part ça, on ne sait pas très bien à quoi elles peuvent servir. Certains estiment qu\'il est possible d\'en faire des nids à Tofus ou d\'élégants vases pour mettre en valeur les fleurs des champs. Tout cela n\'est guère convaincant. Bref, les Bottes Swana sont essentiellement des chaussures.', 'ep': 22, 'g': 107, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 84, 'p': 10000};
I.u[8671] = {'n': 'Relique du Corailleur Magistral', 'nn': 'RELIQUE DU CORAILLEUR MAGISTRAL', 't': 24, 'd': 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 'ep': 22, 'g': 152, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8672] = {'n': 'Relique de Gourlo le Terrible', 'nn': 'RELIQUE DE GOURLO LE TERRIBLE', 't': 24, 'd': 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 'ep': 22, 'g': 153, 'l': 31, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8673] = {'n': 'Relique du Rasboul Majeur', 'nn': 'RELIQUE DU RASBOUL MAJEUR', 't': 24, 'd': 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 'ep': 22, 'g': 154, 'l': 61, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8674] = {'n': 'Relique du Tynril', 'nn': 'RELIQUE DU TYNRIL', 't': 24, 'd': 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 'ep': 22, 'g': 155, 'l': 101, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8675] = {'n': 'Relique du Kimbo', 'nn': 'RELIQUE DU KIMBO', 't': 24, 'd': 'Cette impressionnante relique vous permettra peut-être d\'oublier tous vos soucis.', 'ep': 22, 'g': 156, 'l': 141, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8676] = {'n': 'Epée qui Pète', 'nn': 'EPEE QUI PETE', 't': 6, 'd': 'Vlad était tombé amoureux de cette magnifique épée. Il a participé à la plus terrible des courses de Dragokart afin de pouvoir enfin l\'acheter. Malheureusement, il n\'avait pas compris que cette épée renfermait une terrible malédiction...', 'ep': 1, 'g': 75, 'l': 95, 'wd': true, 'fm': true, 'w': 1, 'an': 14, 'tw': true, 'e': [10, 4, 1, 1, 40, 50, false, false], 'c': 'CV>50&CA>50&CS>50', 'p': 9500};
I.u[8677] = {'n': 'Ross', 'nn': 'ROSS', 't': 18, 'd': 'Ce magnifique Lapino est le familier préféré du célèbre Maître Noir Jack. Ne vous fiez pas à son apparence, il peut se montrer redoutable en combat. Ce familier ne mange que des Cawottes et des plantes.', 'ep': 3, 'g': 44, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[8678] = {'n': 'Chapeau de Satanusse', 'nn': 'CHAPEAU DE SATANUSSE', 't': 16, 'd': 'Satanusse était jadis un patineur artistique traînant ses patins de Holiboul on Ice en patinoires de seconde zone. C\'est en tombant sur le coccyx qu\'il eut la vision qui allait changer sa vie : son destin était d\'être le conducteur de Dragokart le plus doué de sa génération ! Un petit choc provoque parfois un grand déclic.', 'ep': 1, 'g': 187, 'l': 36, 'wd': true, 'fm': true, 'w': 20, 'p': 3550};
I.u[8679] = {'n': 'Fantôme Ross', 'nn': 'FANTOME ROSS', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 46, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8680] = {'n': 'Ecaille poisseuse', 'nn': 'ECAILLE POISSEUSE', 't': 59, 'd': 'Cette écaille poisseuse et glissante permettait à son propriétaire de ne pas se faire attraper facilement par les aventuriers qui ont décidé de pêcher avec les dents. Malheureusement pour lui, elle ne le protégeait pas du tout contre un bon coup d\'épée rouillée.', 'ep': 1, 'g': 626, 'l': 10, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8681] = {'n': 'Peau de Raul Mops', 'nn': 'PEAU DE RAUL MOPS', 't': 59, 'd': 'La vraie faiblesse du Raul Mops, c\'est qu\'il aime se badigeonner d\'eau, de vin, ou même de vinaigre. Mais il aime avant tout se rouler dans des pots en verre autour d\'un oignon. Encore une créature aux moeurs mystérieuses.', 'ep': 1, 'g': 627, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8682] = {'n': 'Peau de Mob l\'Eponge', 'nn': 'PEAU DE MOB L\'EPONGE', 't': 59, 'd': 'Cette peau peut être utilisée des deux côtés, le premier est doux et permet de laver les surfaces fragiles, l\'autre côté est beaucoup plus rugueux, il permet par exemple de récurer les parties de son anatomie qui étaient restées inaccessibles.', 'ep': 1, 'g': 628, 'l': 10, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8683] = {'n': 'Cadeau Walk', 'nn': 'CADEAU WALK', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8684] = {'n': 'Certificat de Mise en Chanil : Ross', 'nn': 'CERTIFICAT DE MISE EN CHANIL : ROSS', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du familier Ross que vous avez placé au chanil.', 'ep': 3, 'g': 45, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8685] = {'n': 'Certificat de Mise en Chanil : Bilby', 'nn': 'CERTIFICAT DE MISE EN CHANIL : BILBY', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du familier Bilby que vous avez placé au chanil.', 'ep': 3, 'g': 46, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[8686] = {'n': 'Cadeau Ross', 'nn': 'CADEAU ROSS', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8687] = {'n': 'Cadeau Bilby', 'nn': 'CADEAU BILBY', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8688] = {'n': 'Transformation Fantôme Ross', 'nn': 'TRANSFORMATION FANTOME ROSS', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 20, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8691] = {'n': 'Marque de victoire', 'nn': 'MARQUE DE VICTOIRE', 't': 24, 'd': 'Vous avez vaincu le disciple aisément. Il vous a remis ce parchemin en attestant.', 'ep': 2, 'g': 253, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8692] = {'n': 'Formule de potion de transformation', 'nn': 'FORMULE DE POTION DE TRANSFORMATION', 't': 24, 'd': 'Ce recueil contient les théories de divers alchimistes sur la possibilité de se transformer en Wabbit. Comme quoi ils n\'ont vraiment rien à faire.', 'ep': 2, 'g': 95, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[8693] = {'n': 'Fëanor', 'nn': 'FEANOR', 't': 18, 'd': 'Grâce à ce familier, n\'importe quelle personne du sexe opposé vous fera les yeux doux. Un conseil : évitez de triompher. Bien vite, vous vous apercevrez qu\'en réalité, votre prétendant(e) est hypnotisé(e) par Fëanor. N\'espérez pas en profiter : désormais votre soupirant(e) mange du Pichon cru en se frottant contre vos jambes... Côté glamour, on a connu mieux, pas vrai ? Ce familier ne mange que du poisson.', 'ep': 3, 'g': 45, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[8694] = {'n': 'Piment confit', 'nn': 'PIMENT CONFIT', 't': 42, 'd': 'Ce piment confit est enrobé de bonbon rouge surpuissant fondu. Ce mélange explosif entre la confiserie et le piment a permis à la dragodinde Bruyère Blonde, de gagner une des plus célèbres courses de Dragokart. Vous pouvez l\'utiliser comme suppositoire si vous voulez avoir le feu aux fesses ou comme dragée si vous recherchez une haleine chargée.', 'ep': 1, 'g': 111, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO!1723', 'u': true, 'p': 1};
I.u[8695] = {'n': 'L\'Épée Nice', 'nn': 'L\'EPEE NICE', 't': 6, 'd': 'Comme disait Brice : « Ce n\'est pas sa taille qui compte, mais la façon de s\'en servir. »', 'ep': 22, 'g': 76, 'l': 177, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'e': [5, 3, 1, 1, 50, 50, false, false], 'c': 'CM>5', 'p': 50050};
I.u[8699] = {'n': 'Coiffe du Tynril', 'nn': 'COIFFE DU TYNRIL', 't': 16, 'd': 'Avec cette coiffe sur le crâne, vous aurez toujours une tête en pétard, même si vous n\'êtes pas en colère. Il faut dire que les écorces de la chevelure du Tynril frisent lorsque le temps est humide, ce qui fait de cet animal l\'indicateur météorologique le plus sûr au monde. En revanche, il redoute le feu. Faites donc très attention aux flammes si vous ne voulez pas vous transformer en torche humaine.', 'ep': 22, 'g': 188, 'l': 164, 'wd': true, 'fm': true, 'w': 10, 'p': 51250};
I.u[8700] = {'n': 'Coquille Emeraude', 'nn': 'COQUILLE EMERAUDE', 't': 16, 'd': 'Cette coiffe semble avoir été fabriquée à partir d\'un Dofus Emeraude brisé. Le Dofus n\'est pas encore complètement vide, vous pourrez profiter de cette coiffe pour vous faire un shampooing aux oeufs.', 'ep': 1, 'g': 189, 'l': 21, 'wd': true, 'fm': true, 'w': 5, 'p': 1400};
I.u[8701] = {'n': 'Epée Choh', 'nn': 'EPEE CHOH', 't': 6, 'd': 'Cette somptueuse épée appartenait à un illustre voleur, réputé pour se faire attraper à chaque fois qu\'il commettait un délit.', 'ep': 0, 'g': 77, 'l': 95, 'wd': false, 'fm': true, 'w': 10, 'an': 14, 'tw': true, 'e': [10, 4, 1, 1, 40, 50, false, false], 'c': 'CV>50&CA>50&CS>50', 'p': 9500};
I.u[8704] = {'n': 'Le Nahitse', 'nn': 'LE NAHITSE', 't': 16, 'd': 'Si vous agitez vos deux petits grelots rapidement, vous pourrez presque jouer de la musique.', 'ep': 22, 'g': 190, 'l': 160, 'wd': true, 'fm': true, 'w': 10, 'p': 47625};
I.u[8706] = {'n': 'Fantôme Fëanor', 'nn': 'FANTOME FEANOR', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 48, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8707] = {'n': 'Certificat de Mise en Chanil : Fëanor', 'nn': 'CERTIFICAT DE MISE EN CHANIL : FEANOR', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du Fëanor que vous avez placé au chanil.', 'ep': 3, 'g': 47, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8708] = {'n': 'Certificat de Mise en Chanil : Atouin', 'nn': 'CERTIFICAT DE MISE EN CHANIL : ATOUIN', 't': 77, 'd': 'Ce certificat décrit les caractéristiques d\'Atouin que vous avez placée au chanil.', 'ep': 3, 'g': 24, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8709] = {'n': 'Transformation Fantôme Fëanor', 'nn': 'TRANSFORMATION FANTOME FEANOR', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 20, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[8711] = {'n': 'Cadeau Fëanor', 'nn': 'CADEAU FEANOR', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier, des ressources pour le nourrir et des poudres d\'Eniripsa pour le soigner.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8712] = {'n': 'Bout de Goldemort', 'nn': 'BOUT DE GOLDEMORT', 't': 110, 'd': 'Bravo ! Vous avez réussi à dépouiller le cadavre de Goldemort d\'une cuillerée de sa substance. Les vautours sont fiers de vous.', 'ep': 1, 'g': 490, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8713] = {'n': 'Getas Bernacle', 'nn': 'GETAS BERNACLE', 't': 11, 'd': 'Dans certaines contrées, il semble que les Getas Bernacle sont lancées en guise d\'insulte pour provoquer les duels. Même si cela peut prêter à sourire, ce n\'est finalement pas plus stupide que de frapper l\'adversaire avec une paire de gants. L\'avantage des Getas Bernacle est d\'ajouter une commotion olfactive au coup physique. Les Pandawas n\'ont jamais été réputés pour l\'hygiène de leurs pieds...', 'ep': 22, 'g': 108, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 92, 'p': 10000};
I.u[8714] = {'n': 'Anneau Bhli', 'nn': 'ANNEAU BHLI', 't': 9, 'd': 'Porter cet anneau est une marque honorifique. Cela signifie que vous êtes un digne fidèle de la déesse Crâ, la seule qui vous révèle comment bander plus vite afin de tirer efficacement.', 'ep': 22, 'g': 126, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 82, 'p': 10000};
I.u[8715] = {'n': 'Bague Houx', 'nn': 'BAGUE HOUX', 't': 9, 'd': 'La volubilité des Ecaflips est légendaire. Ils sont capables de vous sortir n\'importe quel baratin pour vous faire jouer. Cette bague célèbre cette loquacité sans faille. Accessoirement, elle peut servir de dé de rechange et elle est également très pratique pour se gratter... à peu près partout.', 'ep': 22, 'g': 127, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 88, 'p': 10000};
I.u[8716] = {'n': 'Bague Héra', 'nn': 'BAGUE HERA', 't': 9, 'd': 'Les Osamodettes adorent la bague Héra qui complète leur démarche féline d\'une touche de grâce. Il faut dire qu\'à force de côtoyer les monstres, elles finissent parfois par se comporter en vraies tigresses. Mais en réalité, elles sont aussi dévouées que des mères louves.', 'ep': 22, 'g': 128, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 84, 'p': 10000};
I.u[8717] = {'n': 'Bague Harre', 'nn': 'BAGUE HARRE', 't': 9, 'd': 'Les mauvaises langues prétendent que la bague Harre est l\'accessoire de mode le plus inutile au monde. Les ailes sur le côté sont fort embarrassantes quand vous voulez chercher des mouchoirs dans vos poches. Or, comme les Iops n\'ont ni mouchoir ni poche, tout va bien. De plus, elles permettent de déchiqueter un peu de chair à chaque fois qu\'elles frôlent l\'ennemi. C\'est à se demander si ce n\'est pas un bijou de Sacrieur.', 'ep': 22, 'g': 129, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 81, 'p': 10000};
I.u[8718] = {'n': 'Anneau Tassion', 'nn': 'ANNEAU TASSION', 't': 9, 'd': 'Les mini boucliers de l\'anneau Tassion servent de pense-bête aux Fécas qui peuvent y glisser des petits mots et des listes de choses à faire. Ce bijou est surnommé le bouclier anti-oubli. En revanche, il ne protège ni du bégaiement ni des lapsus.', 'ep': 22, 'g': 130, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 91, 'p': 10000};
I.u[8719] = {'n': 'Anneau Stalgik', 'nn': 'ANNEAU STALGIK', 't': 9, 'd': 'Grâce à cet objet, les Enutrofs peuvent à tout moment se remémorer les instants heureux. Un doux parfum s\'en échappe. Il suffit pour cela de retirer la pelle qui y est fichée. Au préalable, il faut bien sûr y mettre l\'odeur que l\'on veut conserver en souvenir, et ce n\'est pas toujours facile.', 'ep': 22, 'g': 131, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 85, 'p': 10000};
I.u[8720] = {'n': 'Anneau Zamour', 'nn': 'ANNEAU ZAMOUR', 't': 9, 'd': 'Cet objet a été donné par la déesse Eniripsa à ses fidèles en signe d\'alliance spirituelle lors de la séance d\'initiation aux sorts de la classe. Accessoirement, les Eniripsas peuvent aussi s\'en servir comme bracelet mousse pour éponger le sang des alliés.', 'ep': 22, 'g': 132, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 83, 'p': 10000};
I.u[8721] = {'n': 'Anneau Raille', 'nn': 'ANNEAU RAILLE', 't': 9, 'd': 'Ce bijou a tendance à rendre les Pandawas un peu moqueurs, surtout après la troisième bière. Ils peuvent même aller jusqu\'aux insultes. Mais ce n\'est pas très important car, comme le dit le célèbre proverbe Pandawa, « Ventre imbibé n\'a pas d\'oreille ».', 'ep': 22, 'g': 133, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 92, 'p': 10000};
I.u[8722] = {'n': 'Anneau Hell', 'nn': 'ANNEAU HELL', 't': 9, 'd': 'Ce bijou à tête de mort était traditionnellement offert en cadeau, lors d\'une fête récompensant tous les enfants Sram pour leur fourberie et leurs coups bas. Les autres classes ont tendance à déconsidérer cette pratique, qui rend les gamins trop agités. Ils deviennent alors infernaux.', 'ep': 22, 'g': 134, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 89, 'p': 10000};
I.u[8723] = {'n': 'Anneau Tilus', 'nn': 'ANNEAU TILUS', 't': 9, 'd': 'L\'anneau Tilus est le seul bijou qui donne l\'heure et qui est parfaitement résistant à l\'eau. Certains pensent qu\'en agrandissant les plans de cet objet et en les modifiant, on pourrait en faire un véhicule se déplaçant sous l\'eau. Où peuvent-ils aller chercher tout cela ?', 'ep': 22, 'g': 135, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 86, 'p': 10000};
I.u[8724] = {'n': 'Anneau Pwal', 'nn': 'ANNEAU PWAL', 't': 9, 'd': 'Contrairement à la rumeur, les Sadidas n\'ont pas de poils dans la main. Non ! Ceux-ci sont en fait ajustés autour d\'un superbe anneau, dont ils renforcent les effets bénéfiques : ils ne doivent en aucun cas être coupés. Grâce à l\'Anneau Pwal, vous serez toujours parfait !', 'ep': 22, 'g': 136, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 90, 'p': 10000};
I.u[8725] = {'n': 'Anneau Pitale', 'nn': 'ANNEAU PITALE', 't': 9, 'd': 'Si vous voyez un personnage qui n\'est pas Sacrieur mettre un Anneau Pitale, emmenez-le d\'urgence en soins intensif. Ce bijou est en effet extrêmement blessant. En général, les gens perdent leur sang-froid devant le bain d\'hémoglobine provoqué par cet anneau.', 'ep': 22, 'g': 137, 'l': 150, 'wd': true, 'fm': false, 'w': 1, 's': 87, 'p': 10000};
I.u[8726] = {'n': 'Chaussures Lepon-Davignon', 'nn': 'CHAUSSURES LEPON-DAVIGNON', 't': 11, 'd': 'Ces chaussures permettent à son porteur de danser jusqu\'au bout de la nuit, malgré les cors et les ampoules qu\'elles occasionnent ! Elles bougent toutes seules au bruit de la musique et font des « bip bip » lorsqu\'elles se trouvent à proximité de minerais précieux. C\'est pourquoi les Enutrofs sont souvent appelés les « beat-machines ».', 'ep': 22, 'g': 109, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 85, 'p': 10000};
I.u[8727] = {'n': 'Bottes Antouche', 'nn': 'BOTTES ANTOUCHE', 't': 11, 'd': 'Lorsque les Fécas sont embarrassés et souhaitent détourner la discussion, ils évoquent toujours leurs bottes Antouche. Ils décrivent de quelle manière ces chaussures leur permettent d\'arpenter tous types de terrains. Lorsque leurs alliés sont en grosse difficulté lors de combats, le confort de ces bottes leur permet de se ressaisir pour détourner la menace.', 'ep': 22, 'g': 110, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 91, 'p': 10000};
I.u[8728] = {'n': 'Bottes Deuradi', 'nn': 'BOTTES DEURADI', 't': 11, 'd': 'Les multiples sangles entourant ces chaussures peuvent servir de corde de remplacement, lorsque celle de l\'arc est rompue. Les jeunes femmes Crâ les emploient aussi pour faire des bottes de légumes en cuisine. Il faut croire qu\'elles n\'ont pas peur des odeurs de pieds.', 'ep': 22, 'g': 111, 'l': 100, 'wd': true, 'fm': false, 'w': 1, 's': 82, 'p': 10000};
I.u[8729] = {'n': 'Corail usé', 'nn': 'CORAIL USE', 't': 51, 'd': 'Se détachant du Corailleur par temps sec, le corail est bien joli à voir. Certains en font même des bijoux. D\'autres les mangent. Mais ils sont rares et ne le font que lorsqu\'ils le confondent avec des bâtons de crabes sourimis.', 'ep': 22, 'g': 2, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8730] = {'n': 'Coccyx du Corailleur', 'nn': 'COCCYX DU CORAILLEUR', 't': 47, 'd': 'Situé à un endroit stratégique, cet os permet au Corailleur de s\'installer dignement. Maintenant qu\'il est mort, vous pouvez toujours vous en servir pour asseoir votre autorité sur ses congénères.', 'ep': 16, 'g': 12, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8731] = {'n': 'Corail Magistral', 'nn': 'CORAIL MAGISTRAL', 't': 51, 'd': 'La seule différence entre le Corail usé et le Corail Magistral réside dans la taille et dans l\'usage que l\'on peut en faire. Mais, hélas, un amalgame de Coraux usés ne remplacera jamais un seul Corail Magistral.', 'ep': 22, 'g': 9, 'l': 150, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8732] = {'n': 'Corail Kouraçao', 'nn': 'CORAIL KOURACAO', 't': 51, 'd': 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 'ep': 16, 'g': 3, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8733] = {'n': 'Corail Malibout', 'nn': 'CORAIL MALIBOUT', 't': 51, 'd': 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 'ep': 16, 'g': 4, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8734] = {'n': 'Corail Passaoh', 'nn': 'CORAIL PASSAOH', 't': 51, 'd': 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 'ep': 16, 'g': 5, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8735] = {'n': 'Corail Morito', 'nn': 'CORAIL MORITO', 't': 51, 'd': 'La couleur remarquable de ce corail vient de l\'alimentation déréglée du Crustorail. Encore un qui a oublié de manger son quota de fruits et légumes !', 'ep': 16, 'g': 6, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 1};
I.u[8736] = {'n': 'Coeur de pierre poli', 'nn': 'COEUR DE PIERRE POLI', 't': 51, 'd': 'La seule chose qui distingue un cœur de Craqueleur de celui d\'un Craqueleur poli est la délicatesse avec laquelle l\'objet peut s\'écraser sur vos doigts de pieds quand vous vous y attendez le moins.', 'ep': 16, 'g': 7, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8737] = {'n': 'Boule polie', 'nn': 'BOULE POLIE', 't': 51, 'd': 'De quelle partie de l\'anatomie du Craqueboule peut bien venir cette boule ? Et pourquoi est-ce qu\'on en retrouve souvent par paire ?', 'ep': 16, 'g': 8, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8738] = {'n': 'Sacrum magistral', 'nn': 'SACRUM MAGISTRAL', 't': 47, 'd': 'Le Corailleur vous offrait un os de son postérieur. Le Corailleur Magistral vous permet de prendre possession d\'une autre partie de son anatomie, mais à peu près dans le même secteur.', 'ep': 22, 'g': 11, 'l': 150, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8739] = {'n': 'Humérus du Sparo', 'nn': 'HUMERUS DU SPARO', 't': 47, 'd': 'Bien qu\'on le nomme Humérus, rien n\'indique que cet os vient vraiment du bras de Sparo. Comme tout son squelette a été broyé par les épées transperçant le tonneau, alors tout est un peu en miettes.', 'ep': 22, 'g': 18, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8740] = {'n': 'Chicot du Flib', 'nn': 'CHICOT DU FLIB', 't': 47, 'd': 'À votre place, je ne ramasserai pas cet objet provenant d\'une bouche à l\'hygiène plus que douteuse. Mais bon, c\'est vous l\'aventurier !', 'ep': 22, 'g': 19, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8741] = {'n': 'Bec du Kido', 'nn': 'BEC DU KIDO', 't': 47, 'd': 'Le bec du Kido est si peu solide que les disciples d\'Otomaï s\'en servaient pour faire des flèches d\'entraînement à la pointe émoussée pour ne pas faire de dégâts.', 'ep': 16, 'g': 22, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8744] = {'n': 'Pince de Crustorail', 'nn': 'PINCE DE CRUSTORAIL', 't': 47, 'd': 'Évitez de serrer la pince du Crustorail ! Vous risquez de perdre la main pour un simple geste de politesse.', 'ep': 22, 'g': 17, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8745] = {'n': 'Pétale Kouraçao', 'nn': 'PETALE KOURACAO', 't': 35, 'd': 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 'ep': 22, 'g': 3, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8746] = {'n': 'Pétale Malibout', 'nn': 'PETALE MALIBOUT', 't': 35, 'd': 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 'ep': 22, 'g': 5, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8747] = {'n': 'Pétale Passaoh', 'nn': 'PETALE PASSAOH', 't': 35, 'd': 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 'ep': 22, 'g': 4, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8748] = {'n': 'Pétale Morito', 'nn': 'PETALE MORITO', 't': 35, 'd': 'La couleur de ce pétale témoigne de sa provenance douteuse. L\'abus d\'alcool chez les disciples d\'Otomaï se perçoit même dans leurs créations.', 'ep': 22, 'g': 6, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8749] = {'n': 'Bulbe Kouraçao', 'nn': 'BULBE KOURACAO', 't': 36, 'd': 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 'ep': 22, 'g': 3, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8750] = {'n': 'Bulbe Malibout', 'nn': 'BULBE MALIBOUT', 't': 36, 'd': 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 'ep': 22, 'g': 6, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8751] = {'n': 'Bulbe Passaoh', 'nn': 'BULBE PASSAOH', 't': 36, 'd': 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 'ep': 22, 'g': 4, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8752] = {'n': 'Bulbe Morito', 'nn': 'BULBE MORITO', 't': 36, 'd': 'Le Palmifleur ne naît pas d\'une graine mais d\'un bulbe que l\'on trempe dans l\'alcool. Pourquoi ? Parce que !', 'ep': 22, 'g': 5, 'l': 40, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8753] = {'n': 'Crinière fleurie', 'nn': 'CRINIERE FLEURIE', 't': 36, 'd': 'Hybridation improbable entre des poils et des pétales de fleurs, cette crinière est doublement allergène. Veillez à rester à distance si vous êtes sensibles à ces deux éléments sous peine d\'expulser votre cerveau en éternuant.', 'ep': 22, 'g': 2, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8754] = {'n': 'Barbe inexistante du Barbroussa', 'nn': 'BARBE INEXISTANTE DU BARBROUSSA', 't': 54, 'd': 'Cette minuscule touffe de poils vous rappellera les vacances grâce à son odeur de sable, de produits solaires et d\'alcool. Dommage qu\'elle pue autant la poudre !', 'ep': 22, 'g': 10, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8755] = {'n': 'Touffe rousse du Flib', 'nn': 'TOUFFE ROUSSE DU FLIB', 't': 54, 'd': 'On n\'a jamais su si la couleur de cette touffe était naturelle ou si elle était liée à un feu de broussaille intempestif.', 'ep': 22, 'g': 11, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8756] = {'n': 'Duvet du Kilibriss', 'nn': 'DUVET DU KILIBRISS', 't': 54, 'd': 'En raison de sa légèreté, le duvet du Kilibris est très recherché pour la confection de matelas. C\'est pourquoi, en attendant la création d\'une espèce de matelas vivants que l\'on peut tuer lors de safari, les artisans chassent activement le Kilibris.', 'ep': 22, 'g': 12, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8757] = {'n': 'Maillot de corps de Barbroussa', 'nn': 'MAILLOT DE CORPS DE BARBROUSSA', 't': 15, 'd': 'Besoin d\'un répulsif contre les insectes ? Adoptez le Maillot de corps de Barbroussa ! Mais renoncez aussi à toute tentative de fréquentation humaine !', 'ep': 22, 'g': 11, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8758] = {'n': 'Morceau de caleçon de Gourlo', 'nn': 'MORCEAU DE CALECON DE GOURLO', 't': 15, 'd': 'Il n\'a jamais été possible de retrouver un caleçon de Gourlo intact. À force de jouer avec la poudre, il en vient toujours à y mettre le feu.', 'ep': 22, 'g': 12, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8759] = {'n': 'Coffret maudit du Flib', 'nn': 'COFFRET MAUDIT DU FLIB', 't': 15, 'd': 'Ce coffre a pris les formes de Flib, à moins que ce ne soit l\'inverse... Dans tous les cas, ça reste un coffre maudit.', 'ep': 22, 'g': 13, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8760] = {'n': 'Foulard du Sparo', 'nn': 'FOULARD DU SPARO', 't': 15, 'd': 'Accessoire de mode indispensable été comme hiver, ce foulard vous donnera un look original, mais un peu kitsch. Grâce à sa couleur éclatante, vous êtes sûr d\'exciter les bouftous mâles. Mais est-ce là votre intention ?', 'ep': 22, 'g': 14, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8761] = {'n': 'Poudre explosive de Gourlo', 'nn': 'POUDRE EXPLOSIVE DE GOURLO', 't': 48, 'd': 'À défaut de se greffer un canon à la place du bras, Gourlo ne sort jamais sans son arme. Mais il n\'est pas capable de tirer son coup très vite, car il lui faut à chaque fois faire sécher sa poudre, signe de sa mauvaise qualité.', 'ep': 22, 'g': 1, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8762] = {'n': 'Fragment de cerveau poli', 'nn': 'FRAGMENT DE CERVEAU POLI', 't': 50, 'd': 'Grâce à ce fragment de cerveau, vous allez enfin apprendre les bonnes manières à la façon des Craqueleurs : broyage de main en guise de bonjour.', 'ep': 16, 'g': 3, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8763] = {'n': 'Moustache du Mufafah', 'nn': 'MOUSTACHE DU MUFAFAH', 't': 15, 'd': 'Plus fournie que celle des poissons chatons, la moustache du Mufafah peut servir à faire des pinceaux pour le peintre Marylork.', 'ep': 22, 'g': 15, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8764] = {'n': 'Sourcil du Rasboul majeur', 'nn': 'SOURCIL DU RASBOUL MAJEUR', 't': 15, 'd': 'Afin de prouver qu\'il est bien le Boss, le Rasboul majeur garde toujours les sourcils froncés. Même après la mort, ils le restent.', 'ep': 22, 'g': 16, 'l': 400, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8765] = {'n': 'Bâton du Kilibriss', 'nn': 'BATON DU KILIBRISS', 't': 15, 'd': 'Grâce à sa longueur, ce bâton va vous permettre d\'atteindre tous les endroits difficiles d\'accès et de vous gratter partout.', 'ep': 22, 'g': 17, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8766] = {'n': 'Plume de fesse du Kido', 'nn': 'PLUME DE FESSE DU KIDO', 't': 53, 'd': 'Cette ressource a servi à créer l\'une des plus grandes énigmes d\'Otomaï : qu\'est-ce qui est le plus lourd ? cent pods de plumes du Kido ou cent pods de Pyrute ?', 'ep': 22, 'g': 5, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8767] = {'n': 'Aile du Bitouf des plaines', 'nn': 'AILE DU BITOUF DES PLAINES', 't': 104, 'd': 'Le Bitouf n\'a jamais été connu pour ses performances en vol. Vu les ailes qu\'il a, c\'est normal.', 'ep': 22, 'g': 1, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8768] = {'n': 'Oreille déchirée de Pumbaa', 'nn': 'OREILLE DECHIREE DE PUMBAA', 't': 106, 'd': 'En collant cette oreille à la vôtre, vous pourrez entendre le galop du sanglier des plaines à la place du bruit de la mer.', 'ep': 22, 'g': 1, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8769] = {'n': 'Coco du Bitouf des plaines', 'nn': 'COCO DU BITOUF DES PLAINES', 't': 111, 'd': 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 'ep': 16, 'g': 1, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8770] = {'n': 'Ecorce du Tynril', 'nn': 'ECORCE DU TYNRIL', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 1, 'l': 500, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8771] = {'n': 'Ecorce de Floribonde', 'nn': 'ECORCE DE FLORIBONDE', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 2, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8772] = {'n': 'Ecorce de Brouture', 'nn': 'ECORCE DE BROUTURE', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 5, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8773] = {'n': 'Ecorce de Nerbe', 'nn': 'ECORCE DE NERBE', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 3, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8774] = {'n': 'Ecorce de Fécorce', 'nn': 'ECORCE DE FECORCE', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 6, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8775] = {'n': 'Ecorce de Chiendent', 'nn': 'ECORCE DE CHIENDENT', 't': 96, 'd': 'Cette écorce est curieusement recourbée, comme si on l\'avait obtenue par le biais d\'une râpe.', 'ep': 22, 'g': 4, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8776] = {'n': 'Coco du Bitouf sombre', 'nn': 'COCO DU BITOUF SOMBRE', 't': 111, 'd': 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 'ep': 22, 'g': 2, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8777] = {'n': 'Pistil du Tynril', 'nn': 'PISTIL DU TYNRIL', 't': 36, 'd': 'Les fleurs correspondent aux organes sexuels des plantes. Le pistil faisant partie de la fleur, à vous d\'en déduire ce que vous voulez.', 'ep': 22, 'g': 7, 'l': 500, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8778] = {'n': 'Etamine de Floribonde', 'nn': 'ETAMINE DE FLORIBONDE', 't': 36, 'd': 'Une étamine est l\'organe mâle de la reproduction sexuée chez les végétaux. Eh oui, malgré les apparences, Floribonde serait de sexe masculin.', 'ep': 22, 'g': 8, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8779] = {'n': 'Carpelle de Brouture', 'nn': 'CARPELLE DE BROUTURE', 't': 36, 'd': 'Les fleurs correspondent aux organes sexuels des plantes. Le pistil faisant partie de la fleur, et la carpelle étant un élément du pistil, à vous d\'en déduire ce que vous voulez.', 'ep': 22, 'g': 9, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8780] = {'n': 'Sépale de Nerbe', 'nn': 'SEPALE DE NERBE', 't': 36, 'd': 'Cette partie du corps de Nerbe reste toujours verte. Est-ce dû à l\'excès de chlorophylle ou à autre chose ?', 'ep': 22, 'g': 10, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8781] = {'n': 'Calice de Fécorce', 'nn': 'CALICE DE FECORCE', 't': 36, 'd': 'Ce n\'est pas en utilisant le calice de Fécorce que vous arriverez à boire quoi que ce soit. Malgré sa forme en coupe, elle est percée.', 'ep': 22, 'g': 12, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8782] = {'n': 'Bractée de Chiendent', 'nn': 'BRACTEE DE CHIENDENT', 't': 36, 'd': 'La Bractée de Chiendent correspond à une zone que la morale nous interdit de nommer.', 'ep': 22, 'g': 11, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8783] = {'n': 'Amygdales du Bitouf Sombre', 'nn': 'AMYGDALES DU BITOUF SOMBRE', 't': 15, 'd': 'Une fois qu\'on lui a retiré les amygdales, le Bitouf sombre a moins les boules. C\'est normal, en général l\'opération conduit à sa mort.', 'ep': 22, 'g': 18, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8784] = {'n': 'Talon d\'achille de l\'Abrakleur sombre', 'nn': 'TALON D\'ACHILLE DE L\'ABRAKLEUR SOMBRE', 't': 15, 'd': 'Ce n\'est pas en tirant une flèche dans son talon d\'Achille que vous vaincrez l\'Abrakleur sombre. Mais vous pouvez toujours essayer.', 'ep': 22, 'g': 19, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8785] = {'n': 'Graine de l\'Abrakleur sombre', 'nn': 'GRAINE DE L\'ABRAKLEUR SOMBRE', 't': 58, 'd': 'Avec beaucoup de patience, de temps, d\'eau et d\'engrais, vous parviendrez à faire pousser un Abrakleur dans votre jardin pour le combattre en guise d\'entraînement. Mais il est plus simple d\'aller les décimer sur l\'île d\'Otomaï', 'ep': 22, 'g': 1, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8786] = {'n': 'Tresse du Poolay', 'nn': 'TRESSE DU POOLAY', 't': 15, 'd': 'Cette tignasse rêche et épaisse peut servir de serpillère à défaut de cacher la calvitie. Mais il faudra auparavant la laver à de nombreuses reprises', 'ep': 22, 'g': 20, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8787] = {'n': 'Cloaque du Poolay', 'nn': 'CLOAQUE DU POOLAY', 't': 15, 'd': 'Non ce n\'est pas répugnant, c\'est la nature !', 'ep': 22, 'g': 21, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8788] = {'n': 'Croupion du Bitouf aérien', 'nn': 'CROUPION DU BITOUF AERIEN', 't': 15, 'd': 'Ce croupion vous permettra de créer des objets pour ne plus avoir le cul à l\'air.', 'ep': 22, 'g': 22, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8789] = {'n': 'Chaussette du Kimbo', 'nn': 'CHAUSSETTE DU KIMBO', 't': 15, 'd': 'Malgré les apparences, Kimbo porte bien des chaussettes, mais pas aux pieds. Il préfère les rouler en boule et les placer à un endroit stratégique.', 'ep': 22, 'g': 23, 'l': 500, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8790] = {'n': 'Rembourrage de Meupette', 'nn': 'REMBOURRAGE DE MEUPETTE', 't': 15, 'd': 'La Nature ayant modestement pourvu la Meupette, celle-ci doit user d\'artifice pour paraître esthétique. Il arrive qu\'elle s\'en serve aussi pour améliorer le moelleux de son lit.', 'ep': 22, 'g': 24, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8791] = {'n': 'Etoffe de Meupette', 'nn': 'ETOFFE DE MEUPETTE', 't': 55, 'd': 'Cette étoffe a une texture bizarre mais elle habille en un rien de temps n\'importe quel monstre un peu pudique.', 'ep': 22, 'g': 16, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8792] = {'n': 'Coco du Bitouf aérien', 'nn': 'COCO DU BITOUF AERIEN', 't': 111, 'd': 'Dans ce Coco du Bitouf, il n\'y a pas de lait, mais du jus de cerveau et parfois quelques neurones flottant en surface.', 'ep': 22, 'g': 3, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8793] = {'n': 'Coquille du Kaskargo', 'nn': 'COQUILLE DU KASKARGO', 't': 111, 'd': 'Ronde et luisante à la fois, cette coquille a été lustrée avec de la bave pendant plusieurs siècles. Chacun son truc.', 'ep': 22, 'g': 4, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8795] = {'n': 'Perruque du Kimbo', 'nn': 'PERRUQUE DU KIMBO', 't': 54, 'd': 'Pour masquer sa calvitie naissante, Kimbo met cette perruque ridicule. Heureusement que la noix de coco la cache en grande partie.', 'ep': 22, 'g': 13, 'l': 500, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8796] = {'n': 'Noeud de l\'Abrakleur clair', 'nn': 'NOEUD DE L\'ABRAKLEUR CLAIR', 't': 38, 'd': 'C\'est à cause de cette ressource que beaucoup de personnes surnomment l\'Abrakleur « tête de nœud ».', 'ep': 22, 'g': 2, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8797] = {'n': 'Souche de l\'Abrakleur clair', 'nn': 'SOUCHE DE L\'ABRAKLEUR CLAIR', 't': 38, 'd': 'Une souche différente des autres souches. Et pourtant elle tourne !', 'ep': 22, 'g': 3, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8798] = {'n': 'Queue emplumée du Rasboul Majeur', 'nn': 'QUEUE EMPLUMEE DU RASBOUL MAJEUR', 't': 65, 'd': 'Les plumes du Rasboul sont collées sur son appendice caudale, une à une, année après année. Plus la queue est touffue, plus le Rasboul est vieux.', 'ep': 22, 'g': 1, 'l': 500, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8799] = {'n': 'Poil d\'aisselle de Pumbaa', 'nn': 'POIL D\'AISSELLE DE PUMBAA', 't': 54, 'd': 'Même s\'il se les rase souvent, ses poils repoussent drus et gardent constamment une odeur rance. Comme quoi ce n\'est pas la sueur qui est en cause.', 'ep': 22, 'g': 14, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8800] = {'n': 'Etoffe Zoth', 'nn': 'ETOFFE ZOTH', 't': 55, 'd': 'Faite dans une matière à la fois résistante et souple, cette étoffe s\'adapte parfaitement à la silhouette des Zoths pour en cacher l\'essentiel.', 'ep': 22, 'g': 17, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8801] = {'n': 'Etoffe de Ouassingue', 'nn': 'ETOFFE DE OUASSINGUE', 't': 55, 'd': 'Cette étoffe comporte plus de trous qu\'un gruyère, mais elle est pourtant capable d\'absorber un maximum de déchets pour les régurgiter au moment le moins opportun.', 'ep': 5, 'g': 18, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8802] = {'n': 'Tibia du Guerrier Zoth', 'nn': 'TIBIA DU GUERRIER ZOTH', 't': 47, 'd': 'Comme tous autres os du Guerrier Zoth, ce tibia a subi de multiples fractures. Il s\'est parfaitement ressoudé et il est devenu plus solide. Comme quoi, s\'il avait eu le don de la parole, lui aussi aurait pu dire : « Ce qui ne me tue pas, me rend plus fort ».', 'ep': 22, 'g': 20, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8803] = {'n': 'Rotule du Disciple Zoth', 'nn': 'ROTULE DU DISCIPLE ZOTH', 't': 47, 'd': 'À force de donner des coups de genou, la rotule du Disciple Zoth est devenu très résistante et a pris du volume.  Bientôt, il sera possible d\'en faire des boules de pétanque.', 'ep': 22, 'g': 21, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8804] = {'n': 'Braguette du Maître Zoth', 'nn': 'BRAGUETTE DU MAITRE ZOTH', 't': 15, 'd': 'La braguette du Maître Zoth est remarquable, elle a été spécialement étudiée pour ne pas déchirer les chaires. Les aventuriers qui ont été un jour traumatisés par leur braguette comprendront.', 'ep': 22, 'g': 25, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8805] = {'n': 'Mouchoir de la Gamine Zoth', 'nn': 'MOUCHOIR DE LA GAMINE ZOTH', 't': 15, 'd': 'La Gamine Zoth ne se sert pas de ce mouchoir pour faire des adieux larmoyants, mais pour essuyer le sang de ses ennemis.', 'ep': 22, 'g': 27, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8806] = {'n': 'Ecusson du Sergent Zoth', 'nn': 'ECUSSON DU SERGENT ZOTH', 't': 15, 'd': 'Donné par sa mère et brodé sur une étoffe, cet écusson est un cuisant souvenir d\'enfance avant d\'être un insigne militaire.', 'ep': 22, 'g': 757, 'l': 120, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8807] = {'n': 'Jus de Ouassingue', 'nn': 'JUS DE OUASSINGUE', 't': 15, 'd': 'À moins d\'être totalement saoul, impossible de confondre le jus de Ouassingue avec un quelconque liquide potable. L\'odeur nauséabonde dissuaderait même un aveugle d\'en prendre une gorgée.', 'ep': 5, 'g': 758, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8808] = {'n': 'Etoffe du Roissingue', 'nn': 'ETOFFE DU ROISSINGUE', 't': 55, 'd': 'Cette étoffe comporte plus de trous qu\'un gruyère, mais elle est pourtant capable d\'absorber un maximum de déchets. Là où cette étoffe passe, la crasse trépasse.', 'ep': 22, 'g': 19, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8809] = {'n': 'Culotte à l\'envers du Roissingue', 'nn': 'CULOTTE A L\'ENVERS DU ROISSINGUE', 't': 15, 'd': 'Depuis l\'habitude prise par le Roissingue Dagobert, tous les Roissingues portent la culotte à l\'envers. L\'important est que cette pratique ne leur retourne pas l\'estomac.', 'ep': 22, 'g': 759, 'l': 200, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8810] = {'n': 'Tourbe séchée de Tourbassingue', 'nn': 'TOURBE SECHEE DE TOURBASSINGUE', 't': 15, 'd': 'Faite à partir de végétaux en décomposition, cette tourbe possède un pouvoir absorbant étonnant. Les Mama Bworks s\'en servent pour régler un problème mensuel.', 'ep': 22, 'g': 760, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8811] = {'n': 'Faux menton du Bourbassingue', 'nn': 'FAUX MENTON DU BOURBASSINGUE', 't': 15, 'd': 'Le Bourbassingue passe beaucoup de temps à prendre des bains de boue en espérant maigrir. Au lieu de perdre du poids, il a juste gagné un double menton pour harmoniser sa silhouette.', 'ep': 22, 'g': 761, 'l': 80, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8812] = {'n': 'Encre du Kralamoure géant', 'nn': 'ENCRE DU KRALAMOURE GEANT', 't': 15, 'd': 'Visqueuse et bien couvrante, l\'encre du Kralamoure peut servir à l\'écriture comme à la peinture des murs d\'une chambre de dépressif.', 'ep': 22, 'g': 762, 'l': 999, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8813] = {'n': 'Ventouse du Kralamoure géant', 'nn': 'VENTOUSE DU KRALAMOURE GEANT', 't': 15, 'd': 'Vu la taille de cette ventouse, nul doute que l\'adhérence doit être bonne et, quand on la retire, le bruit de succion est tonitruant.', 'ep': 22, 'g': 763, 'l': 999, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8814] = {'n': 'Bourse de 5000 Kamas', 'nn': 'BOURSE DE 5000 KAMAS', 't': 100, 'd': 'Cette bourse est très lourde, elle contient sûrement une vraie fortune.', 'ep': 1, 'g': 56, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'u': true, 'p': 50000};
I.u[8815] = {'n': 'Bourse de 1000 Kamas', 'nn': 'BOURSE DE 1000 KAMAS', 't': 100, 'd': 'Cette bourse est très lourde, elle contient sûrement une vraie fortune. Un marchand sera ravi de vous l\'échanger contre sa valeur en Kamas.', 'ep': 1, 'g': 56, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'u': true, 'p': 10000};
I.u[8816] = {'n': 'Cadeau Epée qui Pète', 'nn': 'CADEAU EPEE QUI PETE', 't': 89, 'd': 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8817] = {'n': 'Cadeau Chapeau Satanusse', 'nn': 'CADEAU CHAPEAU SATANUSSE', 't': 89, 'd': 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 'ep': 1, 'g': 42, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[8818] = {'n': 'Cape Souveraine du Roissingue', 'nn': 'CAPE SOUVERAINE DU ROISSINGUE', 't': 17, 'd': 'Constituée d\'une étoffe de Roissingue, cette cape comporte des micro trous permettant une meilleure évacuation de la sueur en cas d\'effort intense, comme lors de mêlées belliqueuses en zone marécageuse. Cette cape laisse passer l\'humidité mais garde la chaleur. Ainsi, vous restez sec quelle que soit la situation. Dommage que l\'odeur persistante de moisissure soit inaltérable.', 'ep': 22, 'g': 143, 'l': 152, 'wd': true, 'fm': true, 'w': 10, 's': 78, 'p': 46520};
I.u[8819] = {'n': 'Cape de la Ouassingue', 'nn': 'CAPE DE LA OUASSINGUE', 't': 17, 'd': 'Moins performante que la Cape du Roissingue, cette cape présente néanmoins les mêmes avantages quant à l\'évacuation de la sueur. Avec elle, vous allez pouvoir faire face à toutes les situations... Si vous arrivez à combattre en apnée, car vu l\'odeur, il est vraiment impossible de ne pas défaillir.', 'ep': 22, 'g': 144, 'l': 97, 'wd': true, 'fm': true, 'w': 10, 's': 77, 'p': 27650};
I.u[8820] = {'n': 'Masque du Sergent Zoth', 'nn': 'MASQUE DU SERGENT ZOTH', 't': 16, 'd': 'Grâce à ce masque, vous affronterez tous les dangers sans aucune crainte ! C\'est normal vu qu\'il obstrue tout le champ de vision.', 'ep': 22, 'g': 191, 'l': 133, 'wd': true, 'fm': true, 'w': 10, 'p': 43340};
I.u[8821] = {'n': 'Coiffe du Disciple Zoth', 'nn': 'COIFFE DU DISCIPLE ZOTH', 't': 16, 'd': 'De loin, cette coiffe ressemble à un abat-jour avec deux trous pour les yeux. De près, aussi.', 'ep': 22, 'g': 192, 'l': 128, 'wd': true, 'fm': true, 'w': 10, 'p': 41688};
I.u[8822] = {'n': 'Masque de l\'Abrakleur clair', 'nn': 'MASQUE DE L\'ABRAKLEUR CLAIR', 't': 16, 'd': 'Ce masque ne permet ni de prévenir ni de guérir la gueule de bois, mais il vous donne au moins l\'occasion de la dissimuler de façon élégante.', 'ep': 22, 'g': 193, 'l': 134, 'wd': true, 'fm': true, 'w': 10, 's': 79, 'p': 42200};
I.u[8823] = {'n': 'Masque de l\'Abrakleur sombre', 'nn': 'MASQUE DE L\'ABRAKLEUR SOMBRE', 't': 16, 'd': 'Ce masque ne permet ni de prévenir ni de guérir la gueule de bois, mais il vous permet au moins de la dissimuler de façon élégante. La nuance sombre indique juste que vous êtes de mauvaise humeur et qu\'il ne faut pas vous chauffer longtemps pour que vous lanciez à tout le monde une volée de bois vert.', 'ep': 22, 'g': 194, 'l': 95, 'wd': true, 'fm': true, 'w': 10, 's': 80, 'p': 23150};
I.u[8824] = {'n': 'Kaskargo', 'nn': 'KASKARGO', 't': 16, 'd': 'Avec ça sur le crâne, vous aurez l\'air d\'un Kaskargo. Certes vous serez protégé des coups à la tête, mais est-ce une raison pour baver ainsi ? Vous n\'avez pourtant pas besoin de ça pour vous déplacer !', 'ep': 22, 'g': 195, 'l': 123, 'wd': true, 'fm': true, 'w': 10, 's': 96, 'p': 43250};
I.u[8825] = {'n': 'Masse du Corailleur Magistral', 'nn': 'MASSE DU CORAILLEUR MAGISTRAL', 't': 7, 'd': 'Plus grande, plus lourde, plus puissante, cette masse s\'abat plus bruyamment sur les ennemis. Mais curieusement, elle est plus légère et d\'une prise en main plus agréable. Le Corailleur dont on s\'est servi pour la confectionner n\'était pas magistral pour rien.', 'ep': 22, 'g': 63, 'l': 125, 'wd': true, 'fm': true, 'w': 8, 'an': 15, 'tw': true, 'e': [10, 5, 1, 1, 100, 50, false, false], 'c': 'CA>130&CC>130&CW>130', 'p': 40150};
I.u[8826] = {'n': 'Marteau de la Gamine Zoth', 'nn': 'MARTEAU DE LA GAMINE ZOTH', 't': 7, 'd': 'Malgré sa petite taille, la Gamine Zoth arbore un immense marteau. C\'est une façon comme une autre de renforcer la musculature. Pas besoin de mettre des poids aux pieds ou aux poignets pour augmenter la force : traîner le marteau est bien suffisant !', 'ep': 22, 'g': 64, 'l': 132, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'e': [10, 4, 1, 1, 45, 45, false, false], 'c': 'CA>250&CW>150', 's': 93, 'p': 43140};
I.u[8827] = {'n': 'Hache du Guerrier Zoth', 'nn': 'HACHE DU GUERRIER ZOTH', 't': 19, 'd': 'Le Guerrier Zoth a pris l\'habitude de porter deux haches, car il est incapable de toucher le flanc gauche de son ennemi avec sa main droite. Problème de schéma corporel ou maladresse congénitale ? Difficile de se prononcer là-dessus. Mais avec ses deux haches, il fait feu de tout bois à défaut de s\'en servir pour couper des rondins.', 'ep': 22, 'g': 47, 'l': 139, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'tw': true, 'e': [5, 5, 1, 1, 60, 50, false, false], 'c': 'CW>250&CV>500', 's': 95, 'p': 44350};
I.u[8828] = {'n': 'Perruque du Poolay', 'nn': 'PERRUQUE DU POOLAY', 't': 16, 'd': 'Le Poolay est un volatile malhabile qui a autant de vivacité qu\'une poule atteinte de grippe aviaire et une intelligence comparable à celle du Tofu. Autant dire qu\'il était mal parti pour survivre. Pourtant certains semblent adorer sa curieuse chevelure évoquant une serpillère tressée en nattes par une ménagère teutonne. La nature humaine est décidément bien étrange.', 'ep': 0, 'g': 196, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[8829] = {'n': 'Chapeau de Barbroussa', 'nn': 'CHAPEAU DE BARBROUSSA', 't': 16, 'd': 'Ce chapeau était suffisamment large pour dissimuler la tête et la barbe ridiculement peu fournie de Barbroussa. Mais il n\'est pas capable de couvrir le crâne de quelqu\'un ayant la grosse tête.', 'ep': 22, 'g': 197, 'l': 79, 'wd': true, 'fm': true, 'w': 1, 'p': 16455};
I.u[8832] = {'n': 'Bave du Kaskargo', 'nn': 'BAVE DU KASKARGO', 't': 15, 'd': 'La bave du Kaskargo ne peut jamais atteindre le plumage du Bitouf, mais elle peut vous engluer au sol.', 'ep': 22, 'g': 6, 'l': 110, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8833] = {'n': 'Masse du Corailleur', 'nn': 'MASSE DU CORAILLEUR', 't': 7, 'd': 'Ce marteau tire sa jolie couleur des morceaux de Corailleur qui le composent. Contrairement à ce que l\'on pourrait croire, il ne servait pas initialement à écrabouiller les Iops ou les ennemis. En réalité, il s\'agit d\'un objet d\'artisanat laissé par une ancienne civilisation. Cette masse servait de heurtoir pour que les personnes ayant des problèmes d\'audition puissent comprendre que quelqu\'un frappe à la porte.', 'ep': 22, 'g': 65, 'l': 85, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'tw': true, 'e': [10, 4, 1, 1, 50, 50, false, false], 'c': 'CC>100&CA>100&CV>150', 'p': 18650};
I.u[8834] = {'n': 'Branche de l\'Abrakleur sombre', 'nn': 'BRANCHE DE L\'ABRAKLEUR SOMBRE', 't': 3, 'd': 'Cette branche servait à racler certaines parties du corps inaccessibles autrement. Mais rassurez-vous, la couleur sombre est d\'origine. Aucun rapport avec les dépôts contenus dans les cavités les plus inaccessibles de l\'Abrakleur.', 'ep': 22, 'g': 64, 'l': 97, 'wd': true, 'fm': true, 'w': 1, 'an': 11, 'tw': true, 'e': [5, 5, 2, 4, 40, 40, false, true], 'c': 'CS>100&CI>100', 's': 80, 'p': 25000};
I.u[8835] = {'n': 'Branche de l\'Abrakleur clair', 'nn': 'BRANCHE DE L\'ABRAKLEUR CLAIR', 't': 3, 'd': 'Cette branche servait à racler certaines parties du corps inaccessibles autrement. Ceci explique peut-être l\'odeur étrange de cette branche.', 'ep': 22, 'g': 65, 'l': 132, 'wd': true, 'fm': true, 'w': 5, 'an': 11, 'tw': true, 'e': [4, 5, 2, 5, 10, 50, false, true], 'c': 'CA>200&CS>200', 's': 79, 'p': 43225};
I.u[8836] = {'n': 'Tige du Brouture', 'nn': 'TIGE DU BROUTURE', 't': 4, 'd': 'Les Broutures se servent de leur tige pour se nettoyer les oreilles. Les sculpteurs de bâton préfèrent les employer comme arme. Comme quoi, les goûts et les couleurs, ça ne discute pas.', 'ep': 22, 'g': 75, 'l': 119, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [5, 3, 1, 1, 45, 45, false, false], 'c': 'CA>200&CI>200', 'p': 36025};
I.u[8837] = {'n': 'Bâton du Maître Zoth', 'nn': 'BATON DU MAITRE ZOTH', 't': 4, 'd': 'Le Maître Zoth est capable de vaincre n\'importe qui avec son bâton. Aucun adversaire ne lui fait peur ! Et c\'est bien normal. Vu qu\'avec sa coiffe il ne voit rien, il ne peut pas être terrorisé par son ennemi. Cette technique bien pratique au combat est toutefois problématique lorsqu\'il s\'agit de prendre les repas. Ayant un champ de vision limité, le Maître Zoth a toujours eu quelques problèmes pour manger sans en mettre partout.', 'ep': 22, 'g': 76, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [15, 5, 1, 1, 40, 50, false, false], 'c': 'CI>180&CS>100', 's': 94, 'p': 47300};
I.u[8838] = {'n': 'Rhizome du Tynril', 'nn': 'RHIZOME DU TYNRIL', 't': 4, 'd': 'Telle la mauvaise herbe, le Tynril est capable de se reproduire à l\'infini grâce à un simple bout de rhizome. C\'est à partir de cette constatation que certains sculpteurs ont créé un bâton à base de Tynril. Ils espéraient pouvoir le reproduire facilement et à moindre frais pour le revendre au plus offrant. C\'est raté.', 'ep': 22, 'g': 77, 'l': 186, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 4, 1, 1, 40, 50, false, false], 'c': 'CI>250&CS>200', 'p': 51248};
I.u[8839] = {'n': 'Masque Vaudou Thierry', 'nn': 'MASQUE VAUDOU THIERRY', 't': 16, 'd': 'Ce masque Vaudou sert essentiellement à masquer le visage des Kannibouls qui aiment la fronde (comme Thierry), mais qui ratent souvent leur cible. C\'est pourquoi, ils sont toujours un peu verts de rage.', 'ep': 22, 'g': 199, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 'p': 49000};
I.u[8840] = {'n': 'Masque Vaudou Jav', 'nn': 'MASQUE VAUDOU JAV', 't': 16, 'd': 'Les Kannibouls Jav ont souvent le ' + '"' + 'blues' + '"' + ' et peignent leur coiffe en bleu. Est-ce lié à un chagrin d\'amour ou à une autre raison ? Difficile de connaître le fin mot de cette histoire. Mais ce serait bien qu\'ils se contentent de porter le masque et qu\'ils arrêtent de chanter leur mélancolie.', 'ep': 22, 'g': 200, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 'p': 49000};
I.u[8841] = {'n': 'Masque Vaudou Sarbak', 'nn': 'MASQUE VAUDOU SARBAK', 't': 16, 'd': 'À force de rire jaune car ils loupent leur objectif, certains Kanniboules ont peint leur masque de cette couleur. Ainsi, même lorsqu\'ils rient de bon cœur, on a l\'impression qu\'ils se forcent.', 'ep': 22, 'g': 201, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 'p': 49000};
I.u[8842] = {'n': 'Masque Vaudou Archer', 'nn': 'MASQUE VAUDOU ARCHER', 't': 16, 'd': 'Les Kannibouls Archer n\'arrivaient pas à se concentrer et à bien viser sauf lorsqu\'ils étaient très en colère. Ainsi, pour être toujours sur de voir rouge, ils ont peint leur masque dans cette couleur.', 'ep': 22, 'g': 202, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 'p': 49000};
I.u[8843] = {'n': 'Chapeau de Crocodaille Dandi', 'nn': 'CHAPEAU DE CROCODAILLE DANDI', 't': 16, 'd': 'Avec ce chapeau sur le crâne, le Crocodaille pense être à la pointe de la mode. Il faudrait que celle-ci soit vraiment bien émoussée pour ce que cela soit possible. Mais il vaut mieux éviter de lui faire remarquer son côté ridicule. Le Crocodaille est très susceptible...', 'ep': 22, 'g': 203, 'l': 180, 'wd': true, 'fm': true, 'w': 10, 'p': 50475};
I.u[8844] = {'n': 'Capuche Souveraine du Roissingue', 'nn': 'CAPUCHE SOUVERAINE DU ROISSINGUE', 't': 16, 'd': 'Coiffe royale, cette capuche possède les mêmes vertus que la Cape du Roissingue. Ses micro-aérations contribuent à une meilleure évacuation de la sueur pour toujours garder la tête froide. Hélas, elle possède également les défauts de la cape : son odeur nauséabonde est si présente qu\'on pourrait presque la découper au couteau.', 'ep': 22, 'g': 204, 'l': 168, 'wd': true, 'fm': true, 'w': 10, 's': 78, 'p': 48800};
I.u[8845] = {'n': 'Capuche de la Ouassingue', 'nn': 'CAPUCHE DE LA OUASSINGUE', 't': 16, 'd': 'Moins efficace que la Coiffe royale, cette capuche permet toutefois une très bonne évacuation de la sueur. Un peu trop bonne, en fait. Du coup, que l\'on porte la capuche ou qu\'on ne la porte pas ne fait aucune différence.', 'ep': 22, 'g': 205, 'l': 104, 'wd': true, 'fm': true, 'w': 10, 's': 77, 'p': 27650};
I.u[8846] = {'n': 'Chapeau de la Gamine Zoth', 'nn': 'CHAPEAU DE LA GAMINE ZOTH', 't': 16, 'd': 'Le Chapeau de la Gamine Zoth a la particularité de lui faire voir les choses en double. Ainsi, lorsqu\'elle voit une personne de sa tribu, elle zoth zoth.', 'ep': 22, 'g': 206, 'l': 128, 'wd': true, 'fm': true, 'w': 10, 's': 93, 'p': 41950};
I.u[8847] = {'n': 'Casque du Guerrier Zoth', 'nn': 'CASQUE DU GUERRIER ZOTH', 't': 16, 'd': 'Ce casque a les mêmes avantages que les autres coiffes Zoth : il protège des coups de soleil même en plein cagnard, il amortit les coups portés à la tête, et il empêche de prendre conscience du danger en restreignant le champ de vision de celui qui le porte. Bref, ceci est le couvre-chef idéal du guerrier.', 'ep': 22, 'g': 207, 'l': 134, 'wd': true, 'fm': true, 'w': 100, 's': 95, 'p': 44000};
I.u[8848] = {'n': 'Coiffe du Maître Zoth', 'nn': 'COIFFE DU MAITRE ZOTH', 't': 16, 'd': 'La coiffe du Maître Zoth possède l\'immense avantage de restreindre le champ de vision de manière encore plus importante que les autres casques. C\'est grâce à lui que l\'on peut accéder à la fameuse technique de combat dite « de la fouine ». En gros, il suffit de frapper n\'importe où en utilisant toutes ses forces. Étant ainsi totalement imprévisible, vous êtes sûr de vaincre l\'adversaire (ou du moins le surprendre suffisamment pour lui donner des coups bien placés).', 'ep': 22, 'g': 208, 'l': 156, 'wd': true, 'fm': true, 'w': 10, 's': 94, 'p': 46900};
I.u[8849] = {'n': 'Racine de Fécorce', 'nn': 'RACINE DE FECORCE', 't': 4, 'd': 'Ce bâton est très branché auprès des femmes troncs. Mais si vous préférez séduire d\'autres types de femmes, cela est aussi possible (même si cela risque d\'être moins efficace).', 'ep': 22, 'g': 78, 'l': 138, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [7, 4, 1, 1, 40, 50, false, false], 'c': 'CV>500', 'p': 44200};
I.u[8850] = {'n': 'Racine de Floribonde', 'nn': 'RACINE DE FLORIBONDE', 't': 4, 'd': 'Si vous êtes superstitieux et que vous avez toujours besoin de toucher du bois, choisissez cette Racine de Floribonde ! D\'un autre côté, vous pouvez aussi essayer d\'être prudent, de ne pas scier la branche sur laquelle vous êtes assis et de ne surtout pas mettre le doigt entre l\'arbre et l\'écorce.', 'ep': 22, 'g': 79, 'l': 144, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [10, 2, 1, 1, 40, 50, false, false], 'p': 45125};
I.u[8851] = {'n': 'Worn Treasure Map', 'nn': 'WORN TREASURE MAP', 't': 24, 'd': 'Event Shika', 'ep': 7, 'g': 6, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'c': 'SI=1001', 'p': 1};
I.u[8854] = {'n': 'Crack Sparrow\'s Own Withered Hat', 'nn': 'CRACK SPARROW\'S OWN WITHERED HAT', 't': 16, 'd': 'Event Shika', 'ep': 7, 'g': 5, 'l': 1, 'wd': false, 'fm': true, 'w': 13, 'c': 'SI=1001', 'p': 1};
I.u[8855] = {'n': 'Bouclier Fi\'Squale', 'nn': 'BOUCLIER FI\'SQUALE', 't': 82, 'd': 'Certes ce bouclier, vous assure une protection effective mais ne rêvez pas, il ne durera pas.', 'ep': 16, 'g': 35, 'l': 11, 'wd': true, 'fm': true, 'w': 25, 'c': 'PK>790000', 'p': 1};
I.u[8856] = {'n': 'Ceinture Rasboulaire du Rasboul', 'nn': 'CEINTURE RASBOULAIRE DU RASBOUL', 't': 10, 'd': 'Lorsque le Rasboul a les boules, il porte sa ceinture Rasboulaire pour envoyer bouler tous les casse-boules.', 'ep': 22, 'g': 115, 'l': 182, 'wd': true, 'fm': true, 'w': 10, 'p': 51020};
I.u[8858] = {'n': 'Bottes Horchons', 'nn': 'BOTTES HORCHONS', 't': 11, 'd': 'Ces Bottes émettent un immonde bruit de succion à chaque pas, ce qui n\'est pas sans vous rappeler le chant d\'amour des Trools en rut. Un souvenir douloureux dont vous vous seriez bien passé.', 'ep': 22, 'g': 112, 'l': 100, 'wd': true, 'fm': true, 'w': 10, 's': 77, 'p': 25775};
I.u[8859] = {'n': 'Sceau Souverain du Roissingue', 'nn': 'SCEAU SOUVERAIN DU ROISSINGUE', 't': 9, 'd': 'Ce sceau désigne son possesseur comme étant le souverain incontesté de la Tourbière sans fond de l\'île d\'Otomaï. Difficile d\'imaginer un royaume plus bucolique.', 'ep': 22, 'g': 138, 'l': 158, 'wd': true, 'fm': true, 'w': 10, 's': 78, 'p': 44581};
I.u[8860] = {'n': 'Alliance de Corail', 'nn': 'ALLIANCE DE CORAIL', 't': 9, 'd': 'Cet anneau a été arraché au doigt encore chaud d\'un jeune Corailleur fraichement massacré. Sa mère l\'attendait pour le repas, jusqu\'à ce qu\'elle s\'aperçoive que son rejeton venait d\'être transformé en pierre tombale.  Même le corail a un coeur, et pas forcément de pierre.', 'ep': 22, 'g': 139, 'l': 60, 'wd': true, 'fm': true, 'w': 60, 'p': 9500};
I.u[8861] = {'n': 'Sandales Circulaires du Kimbo', 'nn': 'SANDALES CIRCULAIRES DU KIMBO', 't': 11, 'd': 'Seul le Kimbo et ses pieds totalement loufoques peuvent se sentir à l\'aise dans ces sandales. En revanche il n\'est pas le seul à pouvoir profiter de leur puissance. Attention tout de même de ne pas vous tromper de sens en les enfilant.', 'ep': 22, 'g': 113, 'l': 195, 'wd': true, 'fm': true, 'w': 10, 'p': 57325};
I.u[8862] = {'n': 'Ceinture Bitoufale de Prosper Youpla', 'nn': 'CEINTURE BITOUFALE DE PROSPER YOUPLA', 't': 10, 'd': 'Prosper Youpla était persuadé de pouvoir voler grâce à cette ceinture ornée d\'ailes de Bitouf. Ignorant que très peu de Bitoufs savent voler, il s\'élançait du haut de l\'arbre Hakam et s\'écrasait systématiquement au sol, tant et si bien qu\'il fût surnommé ' + '"' + 'Boum' + '"' + '.', 'ep': 22, 'g': 128, 'l': 148, 'wd': true, 'fm': true, 'w': 20, 'p': 78780};
I.u[8863] = {'n': 'Zothulette', 'nn': 'ZOTHULETTE', 't': 1, 'd': 'Cette amulette est un vulgaire morceau de bois et de tissu déchiré, mais les Zoths croient dur comme fer à ses pouvoirs. Les pauvres fous !', 'ep': 22, 'g': 124, 'l': 162, 'wd': true, 'fm': true, 'w': 10, 'p': 55420};
I.u[8864] = {'n': 'Kask\'Arc Go', 'nn': 'KASK\'ARC GO', 't': 2, 'd': 'La corde de cet arc est faite de bave de Kaskargo, plus ou moins sèche, son élasticité est sans pareille, sa texture gluante et visqueuse en revanche rappelle... On ne sait pas trop ce que ça rappelle mais ça n\'est pas agréable.', 'ep': 22, 'g': 58, 'l': 122, 'wd': true, 'fm': true, 'w': 10, 'an': 10, 'tw': true, 'e': [10, 5, 5, 10, 30, 50, false, true], 'c': 'CC>250', 's': 96, 'p': 43125};
I.u[8865] = {'n': 'Anneau Skargo', 'nn': 'ANNEAU SKARGO', 't': 9, 'd': 'Sculpté dans une carapace de Kaskargo, cet anneau résiste à n\'importe quoi ou n\'importe qui.', 'ep': 22, 'g': 140, 'l': 120, 'wd': true, 'fm': true, 'w': 10, 's': 96, 'p': 28500};
I.u[8866] = {'n': 'Puissante Cape Fulgurante', 'nn': 'PUISSANTE CAPE FULGURANTE', 't': 17, 'd': 'Tissée dans des étoffes de Zoths, cette cape possède un pouvoir extraordinaire dont l\'origine reste encore inconnue.', 'ep': 22, 'g': 145, 'l': 110, 'wd': true, 'fm': true, 'w': 10, 'p': 45000};
I.u[8867] = {'n': 'Cape de la Meupette', 'nn': 'CAPE DE LA MEUPETTE', 't': 17, 'd': 'En portant cette cape, vous serez pris d\'une furieuse envie de vinaigrette.', 'ep': 22, 'g': 146, 'l': 61, 'wd': true, 'fm': true, 'w': 12, 'p': 9675};
I.u[8868] = {'n': 'Poolache', 'nn': 'POOLACHE', 't': 19, 'd': 'Le fait qu\'un bec de Poolay orne cette arme ne sert absolument à rien, voire handicape l\'utilisateur. Heureusement qu\'elle est puissante.', 'ep': 22, 'g': 48, 'l': 137, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'tw': true, 'e': [10, 5, 1, 1, 120, 50, false, false], 'p': 15400};
I.u[8869] = {'n': 'Bottines en bois d\'abrakleur', 'nn': 'BOTTINES EN BOIS D\'ABRAKLEUR', 't': 11, 'd': 'Ces bottes sont si lourdes qu\'elles seraient plutôt à classer dans la catégorie des armes tellement les coups de pieds deviennent meurtriers.', 'ep': 22, 'g': 114, 'l': 136, 'wd': true, 'fm': true, 'w': 50, 's': 79, 'p': 43850};
I.u[8870] = {'n': 'Ceinture sombre en Abrakleur', 'nn': 'CEINTURE SOMBRE EN ABRAKLEUR', 't': 10, 'd': 'Taillée dans un Abrakleur sombre, cette ceinture n\'est pas assez flexible pour permettre de bouger librement, mais au moins, elle protège bien.', 'ep': 22, 'g': 129, 'l': 92, 'wd': true, 'fm': true, 'w': 10, 's': 80, 'p': 21975};
I.u[8871] = {'n': 'Ceinture Claire en Abrakleur', 'nn': 'CEINTURE CLAIRE EN ABRAKLEUR', 't': 10, 'd': 'Taillée dans un Abrakleur clair, cette ceinture ne protège pas bien, mais au moins, elle est assez flexible pour bouger librement.', 'ep': 22, 'g': 130, 'l': 128, 'wd': true, 'fm': true, 'w': 10, 's': 79, 'p': 41755};
I.u[8872] = {'n': 'Palmano', 'nn': 'PALMANO', 't': 9, 'd': 'Ce bijou n\'est pas très précieux, mais il a la taille idéale pour servir à doser le mourgale dans un bon belgrouth à la glaviouze.', 'ep': 16, 'g': 141, 'l': 46, 'wd': true, 'fm': true, 'w': 9, 'p': 3630};
I.u[8873] = {'n': 'Krustoture', 'nn': 'KRUSTOTURE', 't': 10, 'd': 'Enfin une bonne excuse de sentir la marée !', 'ep': 22, 'g': 131, 'l': 39, 'wd': true, 'fm': true, 'w': 1, 'p': 4225};
I.u[8874] = {'n': 'Ouassulette', 'nn': 'OUASSULETTE', 't': 1, 'd': 'Ce bijou essaye parfois de vous voler des aliments au passage pendant votre repas, ne le laissez pas pendre trop bas.', 'ep': 22, 'g': 125, 'l': 105, 'wd': true, 'fm': true, 'w': 10, 's': 77, 'p': 28452};
I.u[8876] = {'n': 'Voile d\'encre', 'nn': 'VOILE D\'ENCRE', 't': 17, 'd': 'Cette cape étrange semble faite d\'encre noire, mais étrangement, elle se comporte comme une étoffe et ne coule pas. En revanche elle tâche. Votre arrière train n\'aura jamais été aussi sale.', 'ep': 22, 'g': 147, 'l': 191, 'wd': true, 'fm': true, 'w': 15, 'p': 52000};
I.u[8877] = {'n': 'Kralano', 'nn': 'KRALANO', 't': 9, 'd': 'Une fois enfilé, vous ne pourrez plus jamais l\'enlever tellement ses ventouses sont efficaces.', 'ep': 22, 'g': 142, 'l': 199, 'wd': true, 'fm': true, 'w': 10, 's': 97, 'p': 49000};
I.u[8878] = {'n': 'Kidorteau', 'nn': 'KIDORTEAU', 't': 7, 'd': 'Ce marteau n\'est pas pratique, pas spécialement beau, pas très ergonomique, pas puissant, pas assez lourd, trop fragile, mal équilibré, il brille trop et sent mauvais. \nMais il est coloré ! Enfin, un peu de couleurs dans ce monde de brutes.', 'ep': 22, 'g': 66, 'l': 79, 'wd': true, 'fm': true, 'w': 10, 'an': 15, 'tw': true, 'e': [5, 5, 1, 1, 50, 50, false, false], 'p': 16100};
I.u[8879] = {'n': 'Anneau Poli', 'nn': 'ANNEAU POLI', 't': 9, 'd': 'Cet anneau n\'est malheureusement poli qu\'à l\'extérieur. On y enfile le doigt par un trou orné d\'éclats de roche acérés. Recommandé pour les Sacrieurs.', 'ep': 16, 'g': 143, 'l': 66, 'wd': true, 'fm': true, 'w': 1, 'p': 4755};
I.u[8880] = {'n': 'Amufafah', 'nn': 'AMUFAFAH', 't': 1, 'd': 'Ce collier donne une furieuse envie de rugir à son possesseur, simplement parce que les moustaches du Mufafah qui l\'ornent lui chatouillent les tétons.', 'ep': 22, 'g': 126, 'l': 84, 'wd': true, 'fm': true, 'w': 10, 'p': 18225};
I.u[8881] = {'n': 'Anneau Solo', 'nn': 'ANNEAU SOLO', 't': 9, 'd': 'Solo était un gentil vaurien, d\'ailleurs il le disait lui-même. Ça ne l\'a pas empêché de mourir pendu sur la place du village après avoir dérobé une petite culotte à la femme du chef. Solo n\'était vraiment pas futé, mais gentil quand-même...', 'ep': 22, 'g': 144, 'l': 31, 'wd': true, 'fm': true, 'w': 12, 'p': 2625};
I.u[8883] = {'n': 'Potion de Foyer de Guilde', 'nn': 'POTION DE FOYER DE GUILDE', 't': 12, 'd': 'Cette potion vous permet de retourner dans votre foyer de guilde.', 'ep': 5, 'g': 152, 'l': 1, 'wd': true, 'fm': true, 'w': 2, 'c': 'PZ=1', 'u': true, 'p': 100};
I.u[8885] = {'n': 'Fantôme Chacha Tigré', 'nn': 'FANTOME CHACHA TIGRE', 't': 90, 'd': 'Ce Chacha Tigré n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 3, 'g': 20, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[8886] = {'n': 'Transformation Fantôme Chacha Tigré', 'nn': 'TRANSFORMATION FANTOME CHACHA TIGRE', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 20, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
