I.u[8985] = {'n': 'Eupéoh pour Dragoune et Tifoux', 'nn': 'EUPEOH POUR DRAGOUNE ET TIFOUX', 't': 116, 'd': 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Dragoune ou de votre Tifoux de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 1, 'g': 13, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=7519|PO=8155|PO=11554', 'u': true, 'p': 1};
I.u[8986] = {'n': 'Eupéoh pour Bouloute et Fotome', 'nn': 'EUPEOH POUR BOULOUTE ET FOTOME', 't': 116, 'd': 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Bouloute ou de votre Fotome de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 1, 'g': 12, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=8151|PO=7518', 'u': true, 'p': 1};
I.u[8987] = {'n': 'Eupéoh pour El Scarador et Croum', 'nn': 'EUPEOH POUR EL SCARADOR ET CROUM', 't': 116, 'd': 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre El Scarador ou de votre Croum de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 1, 'g': 10, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=8154|PO=7520', 'u': true, 'p': 1};
I.u[8988] = {'n': 'Eupéoh pour Abra Kadabra et Minimino', 'nn': 'EUPEOH POUR ABRA KADABRA ET MINIMINO', 't': 116, 'd': 'En utilisant ce comprimé puissant, vous augmenterez les capacités de votre Abra Kadabra ou de votre Minimino de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 1, 'g': 11, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=8153|PO=7522', 'u': true, 'p': 1};
I.u[8989] = {'n': 'Casque du Bitouf Aérien', 'nn': 'CASQUE DU BITOUF AERIEN', 't': 16, 'd': 'Avec ce casque sur la tête, vous pouvez espérer vous élever dans les airs si vous tournez sur vous-même à la vitesse de l\'éclair. Pour l\'atterrissage, débrouillez-vous.', 'ep': 22, 'g': 209, 'l': 154, 'wd': true, 'fm': true, 'w': 10, 'p': 44350};
I.u[8990] = {'n': 'Prisme de conquête', 'nn': 'PRISME DE CONQUETE', 't': 112, 'd': 'Cet objet magique en pierre rayonne dans toute la zone dans laquelle il est posé. Il permet de marquer votre territoire sans avoir besoin de gâcher votre urine. À utiliser sans modération si vous avez l\'âme d\'un conquérant. Attention, vous ne pouvez poser un prisme de conquête que si vous affichez clairement votre grade (mode joueur contre joueur activé), et si vous êtes dans une zone ne contenant aucun prisme. La zone dans laquelle vous voulez poser un prisme de conquête doit en outre être mitoyenne d\'une zone devenue alliée depuis au moins cinq minutes.', 'ep': 4, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PL>9&PP>2', 'u': true, 'p': 1};
I.u[8991] = {'n': 'Annolamour', 'nn': 'ANNOLAMOUR', 't': 9, 'd': 'Cet anneau vous suce le doigt en permanence, il est gluant et froid, si vous supportez ça vous pourrez profiter de ses immenses pouvoirs.', 'ep': 22, 'g': 145, 'l': 189, 'wd': true, 'fm': true, 'w': 10, 's': 97, 'p': 55000};
I.u[8992] = {'n': 'Faux maudite du Saigneur Guerrier', 'nn': 'FAUX MAUDITE DU SAIGNEUR GUERRIER', 't': 22, 'd': 'Cette lame fauche vos ennemis comme les blés, mais elle attise également la jalousie de vos alliés. Tel est le destin des puissants.', 'ep': 22, 'g': 3, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'tw': true, 'e': [10, 5, 1, 1, 100, 50, false, false], 'p': 58000};
I.u[8993] = {'n': 'Epée Maudite du Saigneur Guerrier', 'nn': 'EPEE MAUDITE DU SAIGNEUR GUERRIER', 't': 6, 'd': 'Cette épée dégage un pouvoir impressionnant, les carnages qu\'elle augure sont de ceux restant dans les livres d\'histoire. Mais son maniement reste étrangement hasardeux. Il existe peut-être quelqu\'un capable de corriger cela.', 'ep': 20, 'g': 83, 'l': 200, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'tw': true, 'e': [10, 5, 1, 1, 100, 2, false, false], 'p': 58000};
I.u[8994] = {'n': 'Etoffe Corailleuse', 'nn': 'ETOFFE CORAILLEUSE', 't': 55, 'd': 'Cette étoffe humide est restée sous l\'eau pendant plusieurs années. De petites particules de corail ont commencé à la recouvrir. Dommage qu\'elle soit aussi rigide, elle aurait pu servir de mouchoir.', 'ep': 22, 'g': 728, 'l': 150, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8995] = {'n': 'Etoffe de Gourlo le Terrible', 'nn': 'ETOFFE DE GOURLO LE TERRIBLE', 't': 55, 'd': 'Autrefois utilisée comme pansement pour soigner les cloques de Gourlo le Terrible, cette étoffe est encore imbibée d\'un liquide à l\'odeur surprenante. Le plus étrange c\'est que cela semble vous donner de l\'appétit.', 'ep': 22, 'g': 729, 'l': 150, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8996] = {'n': 'Peau du Rasboul Majeur', 'nn': 'PEAU DU RASBOUL MAJEUR', 't': 59, 'd': 'Cette peau est plus douce que celle que l\'on peut trouver sur les fesses d\'une femelle Kilibriss. Ca vous fait une belle jambe.', 'ep': 22, 'g': 48, 'l': 250, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8997] = {'n': 'Peau lacérée du Tynril', 'nn': 'PEAU LACEREE DU TYNRIL', 't': 59, 'd': 'Cette peau recouvrait sûrement un point sensible du Tynril. Le pauvre.', 'ep': 22, 'g': 629, 'l': 400, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[8998] = {'n': 'Pierre précieuse du Kimbo', 'nn': 'PIERRE PRECIEUSE DU KIMBO', 't': 50, 'd': 'Pendant des années, le Kimbo a sucé cette pierre précieuse pour la rendre plus lisse et pouvoir l\'introduire plus facilement dans ses narines. La nature est parfois difficile à comprendre.', 'ep': 22, 'g': 109, 'l': 900, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[9001] = {'n': 'Bouclier de Sidimote', 'nn': 'BOUCLIER DE SIDIMOTE', 't': 82, 'd': 'Ce bouclier est censé rappeler à vos adversaires que vous avez grandi dans les Landes de Sidimote. Il paraît que cela pourrait suffire à les effrayer.', 'ep': 18, 'g': 8, 'l': 5, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>4', 'p': 15650};
I.u[9002] = {'n': 'Ftalmo', 'nn': 'FTALMO', 't': 82, 'd': 'Ce bouclier est recouvert de divers yeux, pour permettre à son porteur de fixer plus facilement son adversaire dans les yeux.', 'ep': 18, 'g': 5, 'l': 5, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>4', 'p': 33000};
I.u[9003] = {'n': 'Bouclier Taverne', 'nn': 'BOUCLIER TAVERNE', 't': 82, 'd': 'Le tavernier de la brasserie Feubuk de Bonta devait certainement s\'ennuyer fermement lorsqu\'il eu soudainement l\'idée d\'équiper les videurs de sa taverne avec ces boucliers publicitaires.', 'ep': 18, 'g': 6, 'l': 4, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>3', 'p': 16200};
I.u[9004] = {'n': 'Bouclier Akwadala', 'nn': 'BOUCLIER AKWADALA', 't': 82, 'd': 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village d\'Akwadala devrait faire l\'affaire.', 'ep': 14, 'g': 31, 'l': 3, 'wd': true, 'fm': true, 'w': 2, 'c': 'PP>2', 's': 34, 'p': 5350};
I.u[9005] = {'n': 'Bouclier Ventaille', 'nn': 'BOUCLIER VENTAILLE', 't': 82, 'd': 'Lorsque vos alliés commencent à s\'essouffler ou même lorsque vous voulez dissiper les effets d\'un Vent de Panique, ce bouclier peut vous sauver la vie, il suffit de l\'agiter vigoureusement dans tous les sens, un peu comme si vous vouliez calmer un nourrisson un peu trop bruyant.', 'ep': 18, 'g': 11, 'l': 9, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>8', 'p': 54450};
I.u[9006] = {'n': 'Bouclier du Sadida', 'nn': 'BOUCLIER DU SADIDA', 't': 82, 'd': 'Ce bouclier servait à l\'origine de tabouret aux Sadidas lorsque ces derniers devaient se reposer. Une fois les pieds repliés, il vous protègera de beaucoup d\'attaques, mais pas des fous rires de vos adversaires.', 'ep': 18, 'g': 12, 'l': 7, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>6', 'p': 18700};
I.u[9007] = {'n': 'Bouclier en Slip', 'nn': 'BOUCLIER EN SLIP', 't': 82, 'd': 'Cette création surprenante, est recouverte d\'un Slip en Cuir du Chafer lancier, bouilli, nettoyé et détendu pour épouser les formes du bouclier, qui sont loin de rappeler celles du Chafer, bien plus avantageuses et aguichantes...', 'ep': 18, 'g': 13, 'l': 6, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>5', 'p': 26700};
I.u[9008] = {'n': 'Bouclier d\'Asse', 'nn': 'BOUCLIER D\'ASSE', 't': 82, 'd': 'Ce splendide bouclier contient un échantillon d\'eau de la Mer d\'Asse, ce qui en plus de vous porter bonheur, pourra vous servir de gourde, si votre dulcinée ne vous accompagne pas durant vos combats.', 'ep': 18, 'g': 16, 'l': 8, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>7', 'p': 32450};
I.u[9009] = {'n': 'Bouclier Abraknyde', 'nn': 'BOUCLIER ABRAKNYDE', 't': 82, 'd': 'Caché derrière ce bouclier, les aventuriers les plus naïfs pourront vous prendre pour un Abraknyde et se sauver en courant. Les autres vous agresseront en pensant récupérer quelques ambres.', 'ep': 18, 'g': 19, 'l': 3, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>2', 'p': 5950};
I.u[9010] = {'n': 'Bouclier Pandawa', 'nn': 'BOUCLIER PANDAWA', 't': 82, 'd': 'Idéal pour se faire discret sur Pandala, et pour se faire remarquer partout ailleurs, ce bouclier a surtout l\'avantage d\'être recouvert de poils de Pandawas, réputés pour ne jamais déclencher la moindre allergie. Vous pourrez donc sans crainte ranger ce bouclier directement dans votre slip en cuir.', 'ep': 18, 'g': 22, 'l': 3, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>2', 'p': 5600};
I.u[9011] = {'n': 'Cadran de Feu', 'nn': 'CADRAN DE FEU', 't': 82, 'd': 'Ce bouclier original vous protégera de l\'élément Feu, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 'ep': 18, 'g': 24, 'l': 2, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>1', 'p': 2000};
I.u[9012] = {'n': 'Cadran d\'Air', 'nn': 'CADRAN D\'AIR', 't': 82, 'd': 'Ce bouclier original vous protègera de l\'élément Air, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 'ep': 18, 'g': 26, 'l': 2, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>1', 'p': 2000};
I.u[9013] = {'n': 'Cadran de Terre', 'nn': 'CADRAN DE TERRE', 't': 82, 'd': 'Ce bouclier original vous protégera de l\'élément Terre, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 'ep': 18, 'g': 27, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>0', 'p': 2000};
I.u[9014] = {'n': 'Cadran d\'Eau', 'nn': 'CADRAN D\'EAU', 't': 82, 'd': 'Ce bouclier original vous protégera de l\'élément Eau, et accessoirement, donnera l\'heure à vos adversaires. Très utile pour les aider à chronométrer leur défaite.', 'ep': 18, 'g': 25, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>0', 'p': 2000};
I.u[9015] = {'n': 'Bouclier du Bûcheron', 'nn': 'BOUCLIER DU BUCHERON', 't': 82, 'd': 'Ce bouclier servait à l\'origine aux bûcherons qui voulaient se protéger de la chute des arbres. Il a vite été détourné de son usage, et sert maintenant à se protéger des chutes des ennemis qui ont parfois une fâcheuse tendance à vous tomber dessus sans prévenir.', 'ep': 18, 'g': 4, 'l': 2, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>1', 'p': 1200};
I.u[9016] = {'n': 'Bouclier du Mont Kipou', 'nn': 'BOUCLIER DU MONT KIPOU', 't': 82, 'd': 'Verdâtre et malodorant, ce bouclier n\'en reste pas moins une protection de choix, lorsqu\'il s\'agît d\'affronter les créatures du Mont Kipou.', 'ep': 18, 'g': 1, 'l': 3, 'wd': true, 'fm': true, 'w': 20, 'c': 'PP>2', 'p': 5400};
I.u[9017] = {'n': 'Bouclier des Brigandins', 'nn': 'BOUCLIER DES BRIGANDINS', 't': 82, 'd': 'Si vous avez toujours rêvé d\'être un vrai Brigandin, c\'est le bouclier qu\'il vous faut. Transmis de générations en générations, il vous permettra de détrousser sans prendre le moindre coup, les jeunes aventuriers d\'Astrub.', 'ep': 18, 'g': 9, 'l': 7, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>6', 'p': 30700};
I.u[9018] = {'n': 'Le Karde Coeur', 'nn': 'LE KARDE COEUR', 't': 82, 'd': 'Un illustre aventurier collectionneur, a passé sa vie à chercher ce type de bouclier. On raconte qu\'une fois quatre de ces boucliers réunis, on pouvait jouir d\'une meilleure vie.', 'ep': 18, 'g': 7, 'l': 4, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>3', 'p': 13000};
I.u[9019] = {'n': 'Bouclier du Bawbawe', 'nn': 'BOUCLIER DU BAWBAWE', 't': 82, 'd': 'Tous les Wabbits ne sont pas de petites créatures inoffensives. En réalité, tous les Wabbits sont d\'infâmes créatures, certains ont même des moeurs barbares et écrasent les Cawottes avec cet énorme bouclier, pour en faire du jus.', 'ep': 18, 'g': 2, 'l': 4, 'wd': true, 'fm': true, 'w': 15, 'c': 'PP>3', 'p': 10500};
I.u[9020] = {'n': 'Derma Tho', 'nn': 'DERMA THO', 't': 82, 'd': 'Ce bouclier en peau, risque de vous coller à la peau, tellement vous l\'apprécierez. N\'oubliez pas de soigner ses verrues et ses furoncles de temps en temps pour éviter qu\'il ne s\'abîme.', 'ep': 18, 'g': 3, 'l': 3, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>2', 'p': 2200};
I.u[9021] = {'n': 'Bouclier du Captain Amakna', 'nn': 'BOUCLIER DU CAPTAIN AMAKNA', 't': 82, 'd': 'Un jeune aventurier avait voulu s\'enrôler dans la milice de Bonta pour défendre les opprimés. Réformé en raison de sa constitution trop faible, il fut tout de même contacté par un Alchimiste d\'Amakna, déterminé à l\'utiliser comme cobaye pour tester une de ses nouvelles potions magiques. L\'effet fut immédiat, le jeune aventurier devint rapidement un véritable guerrier d\'une force extraordinaire, mais aussi complètement stupide. Il avait en fait été transformé en Iop. Il se fit forger ce bouclier réputé indestructible, et le surnom de Captain Amakna (en hommage à l\'illustre Captain Chafer qui disparut dans des circonstances bien mystérieuses) lui fut attribué pour l\'éternité.', 'ep': 18, 'g': 14, 'l': 10, 'wd': true, 'fm': true, 'w': 30, 'c': 'PP>9', 'p': 63200};
I.u[9022] = {'n': 'Kloume', 'nn': 'KLOUME', 't': 82, 'd': 'Cet énorme bouclier a jadis, permis au célèbre aventurier Kloume, de ne pas mourir écrasé sous le poids d\'un Craqueleur qui était tombé amoureux de lui. L\'histoire ne raconte pas s\'il a survécu aux effets secondaires de sa relation passionnée avec le Craqueleur.', 'ep': 18, 'g': 15, 'l': 5, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>4', 'p': 22100};
I.u[9023] = {'n': 'Bouclier Volant', 'nn': 'BOUCLIER VOLANT', 't': 82, 'd': 'Aussi étrange que cela puisse paraître, on raconte que ce bouclier en bois et en poils, permet aux aventuriers les plus légers, de s\'envoler quelques instants dans les airs, pour impressionner une dernière fois ses adversaires avant de s\'écraser stupidement sur le sol.', 'ep': 18, 'g': 17, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PP>0', 'p': 1200};
I.u[9024] = {'n': 'Bouclier du Chouque', 'nn': 'BOUCLIER DU CHOUQUE', 't': 82, 'd': 'Le Chouque se servait de ce bouclier pour se protéger des gros boulets qui lui étaient régulièrement envoyés. Les histoires les plus folles, racontent même que certains boulets étaient vivants.', 'ep': 18, 'g': 18, 'l': 7, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>6', 'p': 36850};
I.u[9025] = {'n': 'Bouclier du Bouftou', 'nn': 'BOUCLIER DU BOUFTOU', 't': 82, 'd': 'Assez inutile mais tout de même impressionnant grâce à l\'odeur qu\'il dégage, ce bouclier sera le compagnon de beaucoup de jeunes aventuriers.', 'ep': 1, 'g': 20, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>0', 'p': 400};
I.u[9026] = {'n': 'Bouclier de Bowisse', 'nn': 'BOUCLIER DE BOWISSE', 't': 82, 'd': 'Ce bouclier est clairement un hommage à la cape du Bowisse, elle-même étant un hommage à une célèbre relique composée de trois fragments de forme triangulaire. Encore une histoire à dormir debout.', 'ep': 18, 'g': 21, 'l': 4, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>3', 'p': 10150};
I.u[9027] = {'n': 'Bouclier du Craqueleur', 'nn': 'BOUCLIER DU CRAQUELEUR', 't': 82, 'd': 'Ce bouclier en pierre est en fait une tête de Craqueleur écrasée par le pied d\'un Minotoror. Une façon comme une autre de combiner grosse tête et odeurs de pieds.', 'ep': 5, 'g': 23, 'l': 3, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>2', 'p': 6300};
I.u[9028] = {'n': 'Bouclier Terrdala', 'nn': 'BOUCLIER TERRDALA', 't': 82, 'd': 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village de Terrdala devrait faire l\'affaire.', 'ep': 18, 'g': 32, 'l': 4, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>3', 's': 36, 'p': 14100};
I.u[9029] = {'n': 'Bouclier Feudala', 'nn': 'BOUCLIER FEUDALA', 't': 82, 'd': 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village de Feudala devrait faire l\'affaire.', 'ep': 18, 'g': 33, 'l': 6, 'wd': true, 'fm': true, 'w': 15, 'c': 'PP>5', 's': 37, 'p': 27100};
I.u[9030] = {'n': 'Bouclier Aerdala', 'nn': 'BOUCLIER AERDALA', 't': 82, 'd': 'Pour parer les coups de bourre ou les coups tordus, ce bouclier issu du village d\'Aerdala devrait faire l\'affaire.', 'ep': 18, 'g': 30, 'l': 5, 'wd': true, 'fm': true, 'w': 10, 'c': 'PP>4', 's': 35, 'p': 11600};
I.u[9031] = {'n': 'Annobusé de Maître Jarbo', 'nn': 'ANNOBUSE DE MAITRE JARBO', 't': 9, 'd': 'En son temps, Maître Jarbo était très fort et il possédait richesses et femmes à foison. Mais il n\'avait guère de mérite puisqu\'il tirait tout son pouvoir de son joli anneau. Un jour, il traversa une route. Et PAF Maître Jarbo. Depuis, son anneau se transmet de main en main entre personnes peu scrupuleuses.', 'ep': 0, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9035] = {'n': 'Potion d\'enclos de Guilde', 'nn': 'POTION D\'ENCLOS DE GUILDE', 't': 12, 'd': 'Cette potion vous permet de retourner dans votre enclos de guilde.', 'ep': 5, 'g': 25, 'l': 1, 'wd': true, 'fm': true, 'w': 2, 'c': 'PZ=1', 'u': true, 'p': 100};
I.u[9036] = {'n': 'Potion du village des Zoths', 'nn': 'POTION DU VILLAGE DES ZOTHS', 't': 12, 'd': 'Cette potion vous permet de vous téléporter dans le village des Zoths, si ce dernier vous appartient.', 'ep': 0, 'g': 24, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'Ps=1|Ps=2', 'u': true, 'p': 10};
I.u[9037] = {'n': 'Potion de découverte', 'nn': 'POTION DE DECOUVERTE', 't': 14, 'd': 'Cette potion permet de dévoiler les personnages invisibles de votre entourage.', 'ep': 0, 'g': 0, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[9038] = {'n': 'Petite potion d\'agression', 'nn': 'PETITE POTION D\'AGRESSION', 't': 14, 'd': 'Cette potion vous permet d\'entrer dans une telle rage que vous attaquez automatiquement les ennemis qui s\'approcheront trop près de vous.', 'ep': 0, 'g': 32, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'Pg=21', 'u': true, 'p': 10};
