I.u[9126] = {'n': 'Blopanneau Griotte Royal', 'nn': 'BLOPANNEAU GRIOTTE ROYAL', 't': 9, 'd': 'Kroula avait jadis tenté d\'enfiler cet anneau autour de son gros orteil. Il espérait ainsi que ses ennemis daigneraient lui lécher les pieds dans l\'espoir de récupérer quelques gouttes de jus de Blop Royal.', 'ep': 5, 'g': 153, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 's': 102, 'p': 15000};
