I.u[9130] = {'n': 'Ougamulette', 'nn': 'OUGAMULETTE', 't': 1, 'd': 'Cette réplique approximative du grand Ougah se porte autour du cou, avec un regard noir et une barbe correctement entretenue.', 'ep': 23, 'g': 127, 'l': 181, 'wd': true, 'fm': true, 'w': 15, 's': 118, 'p': 58000};
I.u[9131] = {'n': 'Anneau Colerette', 'nn': 'ANNEAU COLERETTE', 't': 9, 'd': 'Colerette la jeune Crâette, a perdu la tête dans les bois de Litneg. La pauvre fille a reçu une hache lancée par Brouce Boulgoure, qui l\'avait prise par méprise pour une fougère géante. Etre une belle plante ne paie pas toujours.', 'ep': 23, 'g': 146, 'l': 188, 'wd': true, 'fm': true, 'w': 10, 's': 119, 'p': 57950};
I.u[9132] = {'n': 'Anneau Chevelu', 'nn': 'ANNEAU CHEVELU', 't': 9, 'd': 'Avec cet anneau, en plus d\'avoir un cheveu sur la langue et un poil dans la main, vous pourrez vous vanter d\'avoir des cheveux autour des doigts.', 'ep': 23, 'g': 147, 'l': 180, 'wd': true, 'fm': true, 'w': 10, 's': 121, 'p': 57822};
I.u[9133] = {'n': 'Alliance Boletée', 'nn': 'ALLIANCE BOLETEE', 't': 9, 'd': 'Si vos ennemis sont allergiques aux champignons, laissez-les vous croquer les doigts.', 'ep': 23, 'g': 148, 'l': 186, 'wd': true, 'fm': true, 'w': 10, 's': 107, 'p': 56000};
I.u[9134] = {'n': 'Arc à Lamelles', 'nn': 'ARC A LAMELLES', 't': 2, 'd': 'Construit à la base pour servir de lattes pour les sommiers de lits, ces lamelles ont fini par être utilisées dans la fabrication de cet arc, qui vous permettra d\'endormir vos ennemis pour l\'éternité.', 'ep': 23, 'g': 61, 'l': 187, 'wd': true, 'fm': true, 'w': 15, 'an': 10, 'tw': true, 'e': [10, 5, 2, 7, 30, 50, false, true], 'c': 'CS>300&CI>300', 'p': 58421};
I.u[9135] = {'n': 'Baguetterelle', 'nn': 'BAGUETTERELLE', 't': 3, 'd': 'A l\'origine, il suffisait de souffler très fort dans cette trompette fongique, pour faire arriver le ménestrel Francisque Kabroule. Ce dernier se mettait alors à chanter, et tous les monstres mourraient sur place. Bon comme c\'était un peu trop facile comme technique pour tuer les monstres, les dieux ont décidé de la boucher et de la transformer en une vulgaire baguette.', 'ep': 23, 'g': 66, 'l': 184, 'wd': true, 'fm': true, 'w': 10, 'an': 11, 'e': [5, 4, 2, 4, 45, 50, false, true], 'c': 'CI>300&CA>300', 'p': 54284};
I.u[9136] = {'n': 'Bâton Champmanique', 'nn': 'BATON CHAMPMANIQUE', 't': 4, 'd': 'Les trois pointes de ce bâton permettent de concentrer les résidus de plasmogrine présents dans la brise quadramentale. Mettez un peu de salive sur les pointes, orientez le bâton dans le sens des aiguilles d\'une montre Xélor inversée, comptez jusqu\'à soixante, ou essayez jusqu\'à six si vous êtes Iop. Restez concentré, serrez les fesses, voilà vous avez une chance sur deux de vous prendre un coup de tonnerre, ou de transformer vos ennemis en Kirboules hirsutes.', 'ep': 23, 'g': 80, 'l': 191, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'tw': true, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CS>200&CC>200&CI>100', 'p': 55000};
I.u[9137] = {'n': 'Couteaux à Champignons', 'nn': 'COUTEAUX A CHAMPIGNONS', 't': 5, 'd': 'Ces couteaux étaient autrefois utilisés pour retirer les mycoses qui parasitaient les pieds des aventuriers. On leur coupait les pieds juste au niveau du genou.', 'ep': 23, 'g': 69, 'l': 187, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'tw': true, 'e': [8, 3, 1, 1, 30, 50, false, false], 'c': 'CA>450', 's': 119, 'p': 57000};
I.u[9138] = {'n': 'Hache à Lamelles', 'nn': 'HACHE A LAMELLES', 't': 19, 'd': 'Les différentes lamelles de cette hache permettent de couper très rapidement le saucisson. Un seul coup de hache permet de couper trois tranches. Pour tuer les ennemis, c\'est un peu moins utile, sauf si vous avez l\'habitude de les manger en tranches.', 'ep': 23, 'g': 51, 'l': 176, 'wd': true, 'fm': true, 'w': 15, 'an': 17, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CC>450', 's': 120, 'p': 54854};
I.u[9139] = {'n': 'Bottines des sous-bois', 'nn': 'BOTTINES DES SOUS-BOIS', 't': 11, 'd': 'Ces bottines sont parfaites pour marcher dans les sous-bois, sans écraser les feuilles mortes. Attention cependant, leurs origines végétales les poussent inexorablement à écraser tout ce qui s\'apparente de près ou de loin à du fumier.', 'ep': 23, 'g': 115, 'l': 175, 'wd': true, 'fm': true, 'w': 10, 's': 120, 'p': 54852};
I.u[9140] = {'n': 'Chaussons Pignons', 'nn': 'CHAUSSONS PIGNONS', 't': 11, 'd': 'Ces chaussons sont recouverts de petites aérations qui contrairement aux idées reçues, ne permettent pas à vos pieds de mieux s\'aérer, mais plutôt aux spores des champignons installés sur vos pieds, de s\'enfuir rapidement pour aller parasiter d\'autres aventuriers plus facilement.', 'ep': 23, 'g': 116, 'l': 181, 'wd': true, 'fm': true, 'w': 15, 's': 121, 'p': 57000};
I.u[9141] = {'n': 'Caprin', 'nn': 'CAPRIN', 't': 17, 'd': 'Si cette cape n\'était pas recouverte de moisissure, elle pourrait servir de nappe. Ce n\'est pas grave, elle pourra toujours vous servir de linceul.', 'ep': 23, 'g': 154, 'l': 181, 'wd': true, 'fm': true, 'w': 10, 's': 119, 'p': 58000};
I.u[9142] = {'n': 'Capignon', 'nn': 'CAPIGNON', 't': 17, 'd': 'Cette cape était autrefois réservée aux meilleurs grimpeurs, aux aventuriers qui étaient les plus rapides pour escalader la montagne des Craqueleurs. Aujourd\'hui elle sert surtout à se faire remarquer dans les soirées mondaines.', 'ep': 23, 'g': 150, 'l': 190, 'wd': true, 'fm': true, 'w': 10, 's': 107, 'p': 60000};
I.u[9143] = {'n': 'String Tue-Mouche', 'nn': 'STRING TUE-MOUCHE', 't': 10, 'd': 'Comme son nom l\'indique, ce string est particulièrement efficace pour tuer les mouches un peu trop intéressées par votre anatomie. Il est déconseillé de l\'arracher avec les dents, même si vous appréciez cela.', 'ep': 23, 'g': 132, 'l': 192, 'wd': true, 'fm': true, 'w': 20, 's': 107, 'p': 48000};
I.u[9144] = {'n': 'Ceinture Mycosine', 'nn': 'CEINTURE MYCOSINE', 't': 10, 'd': 'La meilleure façon de ne pas avoir de champignons dans l\'entrejambe, c\'est de les attirer ailleurs. Comme il n\'y avait déjà plus de place dans vos chaussures pour loger d\'autres champignons, vous pourrez utiliser cette ceinture, véritable substrat pour tout bon champignon digne de ce nom.', 'ep': 23, 'g': 133, 'l': 177, 'wd': true, 'fm': true, 'w': 10, 's': 121, 'p': 58444};
I.u[9145] = {'n': 'Tranche des Sous-bois', 'nn': 'TRANCHE DES SOUS-BOIS', 't': 10, 'd': 'Prenez un Orme, retirez-lui son écorce, laissez-la tremper dans une flaque, enfouissez-la dans la vase pendant plusieurs mois, recouvrez-là de spores de champignons, mettez-là sous votre lit pendant une semaine en la badigeonnant de graisse de Blop tous les soirs, et voilà vous avez une ceinture en écorce qui sent très mauvais. Alors heureux ?', 'ep': 23, 'g': 134, 'l': 179, 'wd': true, 'fm': true, 'w': 10, 's': 120, 'p': 68420};
I.u[9146] = {'n': 'Ougature', 'nn': 'OUGATURE', 't': 10, 'd': 'Sur l\'étiquette de cette ceinture, on peut lire : ' + '"' + 'Nous sommes désolés mais ce n\'est pas en portant cette ceinture que vous aurez le déhanchement légendaire d\'Ougah' + '"' + '. Et alors ?', 'ep': 23, 'g': 135, 'l': 185, 'wd': true, 'fm': true, 'w': 10, 's': 118, 'p': 56000};
I.u[9147] = {'n': 'Chapignon', 'nn': 'CHAPIGNON', 't': 16, 'd': 'Prenez un Dora, recouvrez-le de bave de Bouftou et de la sueur de Iop. Laissez le tout moisir pendant quelques semaines, et voilà vous avec une réplique de Chapignon. Attention, ce chapeau donne parfois des hallucinations.', 'ep': 23, 'g': 221, 'l': 185, 'wd': true, 'fm': true, 'w': 10, 's': 119, 'p': 48521};
I.u[9148] = {'n': 'Blopanneau Multicolore Royal', 'nn': 'BLOPANNEAU MULTICOLORE ROYAL', 't': 9, 'd': 'Plutôt que de réduire sa consommation de jus de Blop frelaté, Shika Ingalsse préféra continuer de faucher en état d\'ébriété. C\'est en titubant dans les champs qu\'elle tomba sur cet étrange anneau. Malheureusement, cette histoire ne comporte qu\'une seule chute.', 'ep': 5, 'g': 157, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 's': 106, 'p': 20000};
I.u[9149] = {'n': 'Amublop Griotte', 'nn': 'AMUBLOP GRIOTTE', 't': 1, 'd': 'Quand Lorkos voulut pénétrer dans le Labyrinthe du Minotoror, il n\'hésita pas une seconde à équiper son Amublop. Personne n\'a jamais su pourquoi.', 'ep': 5, 'g': 128, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 's': 98, 'p': 1000};
