I.u[9158] = {'n': 'Bloptes Griottes', 'nn': 'BLOPTES GRIOTTES', 't': 11, 'd': 'Inutile de râler parce que le nom de ces bottes est imprononçable, cette particularité vous sauvera la vie, quand un brigand de grand chemin vous demandera : ' + '"' + 'Donne-moi tes Blopetes, non tes Blotpes, non tes Plobtes, non...' + '"' + '. Vous aurez alors tout le temps nécessaire pour vous enfuir en courant.', 'ep': 5, 'g': 117, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 's': 98, 'p': 1000};
