I.u[9162] = {'n': 'Bloptes Griotte Royales', 'nn': 'BLOPTES GRIOTTE ROYALES', 't': 11, 'd': 'Prononcez dix-huit fois le mot ' + '"' + 'Bloptes' + '"' + ' le plus rapidement possible. Voilà, vous avez l\'air d\'un Iop.', 'ep': 5, 'g': 121, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 's': 102, 'p': 16000};
