I.u[9166] = {'n': 'Bloptes Multicolores Royales', 'nn': 'BLOPTES MULTICOLORES ROYALES', 't': 11, 'd': 'Avec ou sans rembourrage ces bottes restent étranges. Il est donc inutile de les rembourrer avec autre chose que vos pieds.', 'ep': 5, 'g': 125, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 's': 106, 'p': 20000};
I.u[9167] = {'n': 'Blopture Griotte', 'nn': 'BLOPTURE GRIOTTE', 't': 10, 'd': 'Derrière ce nom stupide, se cache en réalité une ceinture originale, dont on ne connaît pas vraiment les défauts, ni les qualités. On sait tout de même qu\'elle est reconnue d\'utilité publique grâce à la protection exceptionnelle qu\'elle confère aux poignées d\'amour.', 'ep': 5, 'g': 136, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 's': 98, 'p': 1000};
