I.u[9171] = {'n': 'Blopture Griotte Royale', 'nn': 'BLOPTURE GRIOTTE ROYALE', 't': 10, 'd': 'Dépourvue de boucle, cette ceinture peut tout de même faire très mal si vous vous en servez comme fouet sur un postérieur à la peau fragile. Les pointes en fer rouillées sont à commander séparément.', 'ep': 5, 'g': 140, 'l': 80, 'wd': true, 'fm': true, 'w': 10, 's': 102, 'p': 16000};
