I.u[9175] = {'n': 'Blopture Multicolore Royale', 'nn': 'BLOPTURE MULTICOLORE ROYALE', 't': 10, 'd': 'En serrant suffisamment fort cette ceinture, on peut réussir à bloquer entièrement l\'appareil digestif de son propriétaire. Il ne reste ensuite plus qu\'à trouver une utilité à cet acte profondément débile.', 'ep': 5, 'g': 144, 'l': 90, 'wd': true, 'fm': true, 'w': 10, 's': 106, 'p': 20000};
I.u[9176] = {'n': 'Lame Assacre', 'nn': 'LAME ASSACRE', 't': 5, 'd': 'Lorsque le Bworker commença à étriper lentement Francisque Kabroule, ce dernier se mit à chanter : ' + '"' + 'Et ça continue encore et encore, c\'est que le début d\'accord, d\'accord...' + '"' + '. Depuis, le Bworker est devenu sourd.', 'ep': 22, 'g': 70, 'l': 182, 'wd': true, 'fm': true, 'w': 10, 'an': 13, 'e': [7, 4, 1, 1, 30, 40, false, false], 'c': 'CS>200&CI>150&CC>150&CA>150', 's': 108, 'p': 58000};
I.u[9177] = {'n': 'Bracelet Ventré', 'nn': 'BRACELET VENTRE', 't': 9, 'd': 'Les trois pointes de ce bracelet représentent les trois faiblesses du Bworker : sa soif de vengeance, sa soif de victoire, et sa soif tout court.', 'ep': 22, 'g': 158, 'l': 179, 'wd': true, 'fm': true, 'w': 10, 's': 108, 'p': 54000};
I.u[9178] = {'n': 'Anneau Bliteré', 'nn': 'ANNEAU BLITERE', 't': 9, 'd': 'Cet anneau est recouvert des mucosités du Bworker. Les petites pointes lui permettent de se curer le nez avec plus d\'efficacité.', 'ep': 22, 'g': 159, 'l': 179, 'wd': true, 'fm': true, 'w': 10, 's': 109, 'p': 54000};
I.u[9179] = {'n': 'Amulette Ripage', 'nn': 'AMULETTE RIPAGE', 't': 1, 'd': 'Un jour, le Captain Chafer rencontra le Bworker, il prit l\'initiative de lui dire : ' + '"' + 'ton postérieur, ta tête, quelle différence ?' + '"' + '. Depuis ce jour, personne n\'a revu le Captain Chafer. Même son célèbre slip moulant en cuir semble avoir disparu.', 'ep': 22, 'g': 137, 'l': 184, 'wd': true, 'fm': true, 'w': 10, 's': 108, 'p': 52458};
I.u[9180] = {'n': 'Cape Erforée', 'nn': 'CAPE ERFOREE', 't': 17, 'd': 'On raconte que le Bworker s\'est cousu cette cape avec la peau des fesses de Rushu. Cette histoire aurait pu être crédible si le Bworker savait coudre.', 'ep': 22, 'g': 151, 'l': 185, 'wd': true, 'fm': true, 'w': 10, 's': 108, 'p': 58000};
I.u[9181] = {'n': 'Casque Harnage', 'nn': 'CASQUE HARNAGE', 't': 16, 'd': 'Ce magnifique casque renferme bien des secrets, pendant de longues années, lorsqu\'il était le seul compagnon du Bworker, et lorsqu\'il était encore vivant, le Bworker lui aurait confié toutes ses histoires de protections usagées. A force d\'entendre ces atrocités, le casque a fini par mourir.', 'ep': 22, 'g': 212, 'l': 189, 'wd': true, 'fm': true, 'w': 10, 's': 109, 'p': 59000};
I.u[9182] = {'n': 'Bottes Répané', 'nn': 'BOTTES REPANE', 't': 11, 'd': 'Il y a bien longtemps, Danous Kouaide a voulu faire le malin et battre le Bworker dans un concours de blagues : ' + '"' + 'Si tes bottes sont recouvertes de boucles d\'oreilles c\'est parce que tu n\'as pas compris que les bottes ne se mettaient pas aux oreilles' + '"' + '. Le Bworker lui a répondu avec un coup de hache sur le crâne.', 'ep': 22, 'g': 126, 'l': 184, 'wd': true, 'fm': true, 'w': 10, 's': 109, 'p': 58000};
I.u[9183] = {'n': 'Ceinture Toré', 'nn': 'CEINTURE TORE', 't': 10, 'd': 'Les deux clous de la ceinture se plantaient directement dans les poignées d\'amour du Bworker. Lorsqu\'il se trémoussait en faisant la danse du ventre pour distraire ses ennemis, on pouvait parfois apercevoir les coutures de ses sous-vêtements en peau de Kilibriss. L\'érotisme exacerbé du Bworker a fait vaciller plus d\'un ennemi. Sa lame s\'est contentée de les achever.', 'ep': 22, 'g': 145, 'l': 181, 'wd': true, 'fm': true, 'w': 10, 's': 109, 'p': 58000};
I.u[9184] = {'n': 'Casque de Galgarion', 'nn': 'CASQUE DE GALGARION', 't': 16, 'd': 'Malgré les apparences, ce casque ne vous permettra pas de mieux entendre... mais de voir plus loin ! En revanche, méfiez-vous des bourrasques inattendues car vous allez finir par vous envoler.', 'ep': 1, 'g': 213, 'l': 33, 'wd': true, 'fm': true, 'w': 10, 'p': 3000};
I.u[9185] = {'n': 'Coiffe de Goultard', 'nn': 'COIFFE DE GOULTARD', 't': 16, 'd': 'Cette coiffe ne vous rendra pas plus féroce et encore moins plus puissant... Et si vous croyez que les aventuriers un peu naïfs vont vous prendre pour Goultard vous vous fourrez le doigt dans l\'œil ! Mais grâce à elle on vous verra arriver de loin, c\'est déjà ça !', 'ep': 1, 'g': 214, 'l': 30, 'wd': true, 'fm': true, 'w': 10, 'ce': true, 'p': 2600};
I.u[9186] = {'n': 'Ceinture de Flash Gorgone', 'nn': 'CEINTURE DE FLASH GORGONE', 't': 10, 'd': 'On ne connait que peu de chose sur Flash Gorgone, hormis sa passion pour les vases en porcelaine. Une légende raconte que ce héros courait tellement vite que même les Tofus ne parvenaient pas à le rattraper. Malheureusement, à force d\'être tout le temps pressé, il arriva un jour où il attacha mal sa ceinture... et s\'empêtra les pieds dedans. Sa collection de porcelaine s\'en souvient encore...', 'ep': 1, 'g': 146, 'l': 48, 'wd': true, 'fm': true, 'w': 30, 'p': 6075};
I.u[9187] = {'n': 'Coiffe de Maître Noir Jack', 'nn': 'COIFFE DE MAITRE NOIR JACK', 't': 16, 'd': 'L\'Eniripsa Maître Noir Jack a toujours été passionné par la couture. C\'est ce qui l\'a d\'ailleurs conduit à devenir un expert en points de suture. Ami des tailleurs, il aurait conçu cette coiffure bicolore en s\'inspirant de celle d\'une tailleuse cruelle qui extermina jadis la tribu Ouginak des Maciens... Charmant, non ?', 'ep': 1, 'g': 215, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'ce': true, 'p': 3075};
I.u[9188] = {'n': 'Sombrero de Pépitox', 'nn': 'SOMBRERO DE PEPITOX', 't': 16, 'd': 'Ce sombrero est le seul vestige d\'un sombre héros Xélor qui aurait soudainement disparu. La dernière fois qu\'on l\'aurait vu, il venait tout juste de chanter la sérénade à sa belle. On raconte que les frères de la jeune fille ne seraient pas étrangers à cette disparition, mais certains pensent qu\'il aurait été emmené dans une dimension parallèle...  Le mystère reste entier...', 'ep': 1, 'g': 216, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 'p': 5000};
I.u[9189] = {'n': 'Cornes de XVII', 'nn': 'CORNES DE XVII', 't': 16, 'd': 'A force de vouloir encorner les autres aventuriers, c\'est vous qui risquez d\'avoir la tête comme une passoire ! En effet, les Cornes de XVII, le Démon de la dix-septième Heure, ont la faculté extraordinaire de vous faire oublier pratiquement tout... sauf peut-être l\'heure du déjeuner !', 'ep': 1, 'g': 217, 'l': 20, 'wd': true, 'fm': true, 'w': 4, 'p': 1300};
I.u[9190] = {'n': 'Coiffe de Crâ Cramé', 'nn': 'COIFFE DE CRA CRAME', 't': 16, 'd': 'Voici une coiffe parfaitement adaptée aux Crâs qui n\'ont pas peur de passer pour des abrutis. C\'est vrai qu\'en la portant vous n\'aurez pas franchement l\'air très intelligent. D\'ailleurs ceux qui osent l\'arborer sont généralement des Iops ou des aventuriers avec déjà quelques neurones en moins...', 'ep': 1, 'g': 218, 'l': 35, 'wd': true, 'fm': true, 'w': 5, 'p': 10000};
I.u[9191] = {'n': 'Epée de Pym', 'nn': 'EPEE DE PYM', 't': 6, 'd': 'Cette épée semble avoir été arrachée à l\'enseigne d\'un honnête forgeron... Espérons qu\'elle vous enseignera à frapper plus fort qu\'avant ! Sinon il ne vous restera plus qu\'à ouvrir votre propre échoppe.', 'ep': 1, 'g': 84, 'l': 35, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'e': [10, 4, 1, 1, 30, 50, false, false], 'c': 'CV>10&CS>10&CA>10', 'p': 3500};
I.u[9192] = {'n': 'Beignature', 'nn': 'BEIGNATURE', 't': 10, 'd': 'Lorsque vous aurez équipé cette ceinture, vous vous apercevrez rapidement que vos hanches n\'auront jamais été aussi alléchantes.', 'ep': 1, 'g': 147, 'l': 45, 'wd': true, 'fm': true, 'w': 2, 's': 110, 'p': 5600};
I.u[9193] = {'n': 'Tartamulette', 'nn': 'TARTAMULETTE', 't': 1, 'd': 'Si vous avez toujours rêvé de distribuer des tartes à vos amis, offrez-leur cette amulette.', 'ep': 1, 'g': 138, 'l': 43, 'wd': true, 'fm': true, 'w': 2, 's': 110, 'p': 5000};
I.u[9194] = {'n': 'Caskogato', 'nn': 'CASKOGATO', 't': 16, 'd': 'Autrefois, les poux vous dévoraient le crâne. Avec ce chapeau sur la tête, les Pious vous picoreront le crâne. Parfois, il vaut mieux rester chauve.', 'ep': 1, 'g': 219, 'l': 44, 'wd': true, 'fm': true, 'w': 2, 's': 110, 'p': 5200};
I.u[9195] = {'n': 'Capogato', 'nn': 'CAPOGATO', 't': 17, 'd': 'Une fois enroulée autour de fruits confits et recouverte de gelée royale, cette cape peut être dégustée en suppositoire.', 'ep': 1, 'g': 152, 'l': 45, 'wd': true, 'fm': true, 'w': 2, 's': 110, 'p': 5500};
I.u[9196] = {'n': 'Cape Paupayahn', 'nn': 'CAPE PAUPAYAHN', 't': 17, 'd': 'Cette cape confectionnée à partir d\'énormes graines diffuse une odeur persistante d\'aisselle de Bitouf aérien. Il paraît que ça permet d\'exciter son entourage à moindre frais.', 'ep': 1, 'g': 153, 'l': 45, 'wd': true, 'fm': true, 'w': 2, 's': 111, 'p': 5500};
I.u[9197] = {'n': 'Chapeau Paupayahn', 'nn': 'CHAPEAU PAUPAYAHN', 't': 16, 'd': 'Ce chapeau vous permettra d\'étancher vos petites soifs. Le sucre est à commander séparément.', 'ep': 1, 'g': 220, 'l': 44, 'wd': true, 'fm': true, 'w': 2, 's': 111, 'p': 5200};
I.u[9198] = {'n': 'Anneau Paupayahn', 'nn': 'ANNEAU PAUPAYAHN', 't': 9, 'd': 'Lorsque votre eau ou votre bière n\'a plus de goût, trempez-y cet anneau.', 'ep': 1, 'g': 160, 'l': 45, 'wd': true, 'fm': true, 'w': 2, 's': 111, 'p': 5600};
I.u[9199] = {'n': 'Bottes Paupayahn', 'nn': 'BOTTES PAUPAYAHN', 't': 11, 'd': 'Voilà ce qui arrive lorsque l\'on essaye de casser des tasses à coups de bottes.', 'ep': 1, 'g': 127, 'l': 43, 'wd': true, 'fm': true, 'w': 2, 's': 111, 'p': 5000};
I.u[9200] = {'n': 'Parchemin de Sort Invocation de Chaferfu', 'nn': 'PARCHEMIN DE SORT INVOCATION DE CHAFERFU', 't': 75, 'd': '(Double clic pour apprendre le sort) \nCe parchemin vous permettra d\'apprendre le sort d\'invocation de Chaferfu.', 'ep': 1, 'g': 17, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 10000};
I.u[9201] = {'n': 'Pawchemin de la Cawotte', 'nn': 'PAWCHEMIN DE LA CAWOTTE', 't': 75, 'd': 'Ce pawchemin décwit une méthode simple en 101 leçons, qui vous pewmettwa d\'appwendwe en autodidacte les bases de la fameuse, mais pas si secwète que ça, technique du Wa Wabbit.', 'ep': 1, 'g': 21, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 10000};
I.u[9202] = {'n': 'L\'autre Annobusé de Maître Jarbo', 'nn': 'L\'AUTRE ANNOBUSE DE MAITRE JARBO', 't': 9, 'd': 'Même mort, Maître Jarbo continua à forger des artefact complètement déphasés avec l\'équilibre cosmique du Monde. Quand il eut forgé son second anneau, il se dit avec tristesse que s\'il l\'avait eu plus tôt, il aurait pu traverser les routes sans risques. Un démon le lui vola un jour et le cacha dans le monde des vivants pour les aventuriers en mal de puissance.', 'ep': 1, 'g': 9, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 0};
I.u[9233] = {'n': 'Cape Obvijevan', 'nn': 'CAPE OBVIJEVAN', 't': 113, 'd': 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les capes inanimées. (Vous devez nourrir cette cape vivante en lui donnant à manger d\'autres capes. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 'ep': 1, 'g': 149, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[9234] = {'n': 'Chapeau Obvijevan', 'nn': 'CHAPEAU OBVIJEVAN', 't': 113, 'd': 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les couvres-chef inanimés. (Vous devez nourrir ce chapeau vivant en lui donnant à manger d\'autres chapeaux. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 'ep': 1, 'g': 211, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[9247] = {'n': 'Clef du Donjon Fungus', 'nn': 'CLEF DU DONJON FUNGUS', 't': 84, 'd': 'Cette clef vous permettra de rentrer dans le terrible donjon Fungus.', 'ep': 13, 'g': 247, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9248] = {'n': 'Clef du donjon des Blops', 'nn': 'CLEF DU DONJON DES BLOPS', 't': 84, 'd': 'Cette clef vous permettra de rentrer dans le donjon des Blops.', 'ep': 5, 'g': 248, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9249] = {'n': 'Morceau de clef Griotte', 'nn': 'MORCEAU DE CLEF GRIOTTE', 't': 84, 'd': 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 'ep': 5, 'g': 250, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9250] = {'n': 'Morceau de clef Reinette', 'nn': 'MORCEAU DE CLEF REINETTE', 't': 84, 'd': 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 'ep': 5, 'g': 251, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9251] = {'n': 'Morceau de clef Coco', 'nn': 'MORCEAU DE CLEF COCO', 't': 84, 'd': 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 'ep': 5, 'g': 252, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9252] = {'n': 'Morceau de clef Indigo', 'nn': 'MORCEAU DE CLEF INDIGO', 't': 84, 'd': 'Si vous retrouvez les autres morceaux de cette clef, vous aurez peut-être l\'occasion d\'affronter un Blop multicolore.', 'ep': 5, 'g': 249, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9254] = {'n': 'Clef de l\'antre du Blop Multicolore', 'nn': 'CLEF DE L\'ANTRE DU BLOP MULTICOLORE', 't': 84, 'd': 'Cette clef vous permettra d\'affronter un Blop Multicolore. Vous devriez être heureux.', 'ep': 5, 'g': 253, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9255] = {'n': 'Amulette Obvijevan', 'nn': 'AMULETTE OBVIJEVAN', 't': 113, 'd': 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les amulettes inanimées. (Vous devez nourrir cette amulette vivante en lui donnant à manger d\'autres amulettes. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 'ep': 1, 'g': 139, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[9256] = {'n': 'Anneau Obvijevan', 'nn': 'ANNEAU OBVIJEVAN', 't': 113, 'd': 'Cet objet polymorphe établit une relation de prédateur ou de symbiote avec les anneaux inanimés. (Vous devez nourrir cet anneau vivant en lui donnant à manger d\'autres anneaux. Vous pouvez lui donner un nouveau repas toutes les douze heures.)', 'ep': 1, 'g': 161, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[9263] = {'n': 'Ecorce de Champaknyde', 'nn': 'ECORCE DE CHAMPAKNYDE', 't': 96, 'd': 'Le Champaknyde est un Abraknyde parasité par des champignons sans scrupules qui s\'incrustent jusque dans son écorce. De temps en temps en se grattant le postérieur, il arrache un morceau de mycélium purulent qui finira par donner vie à un magnifique champignon qui à son tour ira parasiter un Abraknyde.', 'ep': 23, 'g': 109, 'l': 113, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[9265] = {'n': 'Miteters', 'nn': 'MITETERS', 't': 24, 'd': 'Voici des Miteters que l\'on trouve parfois sur la tête des Craqueleurs à l\'hygiène douteuse.', 'ep': 5, 'g': 727, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9266] = {'n': 'Graisse de Gelée Royale', 'nn': 'GRAISSE DE GELEE ROYALE', 't': 24, 'd': 'Cette graisse a été récupérée sur une gelée royale. C\'est un ingrédient essentiel entrant dans la composition d\'une potion de paralysie.', 'ep': 7, 'g': 32, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9267] = {'n': 'Trompe de la Tromperelle', 'nn': 'TROMPE DE LA TROMPERELLE', 't': 15, 'd': 'Encore chargée de l\'haleine putride de son ancien propriétaire, cette surprenante trompe peut servir à jouer de la musique tout en asphyxiant votre auditoire.', 'ep': 23, 'g': 764, 'l': 125, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[9269] = {'n': 'Langue du Champodonte', 'nn': 'LANGUE DU CHAMPODONTE', 't': 15, 'd': 'Pour lécher les spores de ses compagnons, le Champodonte dispose d\'une langue agile et incroyablement souple. C\'est bien la seule chose que l\'on puisse envier au Champodonte.', 'ep': 23, 'g': 765, 'l': 134, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9277] = {'n': 'Oeil de Champmane', 'nn': 'OEIL DE CHAMPMANE', 't': 109, 'd': 'Le Champmane a la fâcheuse habitude de vouloir se gratter les paupières avec son bâton à pointes. Parfois il perd un oeil. Quand il se gratte le cou, il lui arrive de perdre la tête.', 'ep': 23, 'g': 587, 'l': 152, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9278] = {'n': 'Lamelle de Champbis', 'nn': 'LAMELLE DE CHAMPBIS', 't': 15, 'd': 'Le Champbis possède deux pieds, deux bras, et deux têtes. Ce qui en fait une créature deux fois plus bête que les autres.', 'ep': 23, 'g': 766, 'l': 144, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9279] = {'n': 'Bave de Champ à Gnons', 'nn': 'BAVE DE CHAMP A GNONS', 't': 15, 'd': 'Gluante mais appétissante, cette bave sert parfois à huiler les armes, ou les corps des aventuriers qui aiment combattre nus dans les arènes.', 'ep': 23, 'g': 45, 'l': 149, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9280] = {'n': 'Epine d\'Ougah', 'nn': 'EPINE D\'OUGAH', 't': 15, 'd': 'Ougah ne possède que quatre épines sur la tête, mais elles sont grosses.', 'ep': 23, 'g': 40, 'l': 900, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[9281] = {'n': 'Fragment d\'Ougalurette', 'nn': 'FRAGMENT D\'OUGALURETTE', 't': 15, 'd': 'Ougah possède une magnifique coiffe, et vous tenez entre vos mains, un de ses fragments.', 'ep': 23, 'g': 41, 'l': 900, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
