I.u[9525] = {'n': 'Cadeau de la Sain Ballotin', 'nn': 'CADEAU DE LA SAIN BALLOTIN', 't': 89, 'd': 'Ce cadeau contient un kit de survie pour les opérations amoureuses risquées.', 'ep': 1, 'g': 4, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[9526] = {'n': 'Memo de menaces', 'nn': 'MEMO DE MENACES', 't': 24, 'd': 'Vous avez écrit sur ce bout de papier pour vous rappeler qu\'il ne faut pas menacer un astrubien lorsque les mercenaires chargés de la sécurité dans le village se trouvent à proximité.', 'ep': 0, 'g': 50, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9527] = {'n': 'Poudre d\'ongles incarnés', 'nn': 'POUDRE D\'ONGLES INCARNES', 't': 24, 'd': 'De la vieille poudre d\'ongles incarnés ayant appartenus jadis à des pieds d\'Enutrof. Malgré le passage du temps, l\'odeur de pied persiste. Tout porte à croire que vous avez été berné en beauté.', 'ep': 1, 'g': 37, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9528] = {'n': 'Amulette de Lear', 'nn': 'AMULETTE DE LEAR', 't': 24, 'd': 'Cette puissante amulette appartenait autrefois à Lear, un chef de culte aujourd\'hui disparu. Il était en contact avec des créatures extra-dimensionnelles et pouvait, dit-on, cloner les âmes incarnées. Il était également doté de la faculté d\'auto-résurrection, un pouvoir bien pratique lorsqu\'aucun prêtre n\'est dans le coin.', 'ep': 9, 'g': 48, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9529] = {'n': 'Potion de Résurrection Forcée', 'nn': 'POTION DE RESURRECTION FORCEE', 't': 24, 'd': 'Il arrive parfois qu\'une âme ne puisse pas ou ne veuille pas se réincarner. On utilise alors cette potion pour lui restituer son corps d\'origine contre sa volonté.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9530] = {'n': 'Canne à Pichon Ensorcelée', 'nn': 'CANNE A PICHON ENSORCELEE', 't': 24, 'd': 'Avec un peu de chance, cette canne à pichon vous permettra d\'obtenir une langue hiyeu sur un pichon.', 'ep': 0, 'g': 739, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9531] = {'n': 'Langue Hiyeu', 'nn': 'LANGUE HIYEU', 't': 24, 'd': 'Cet étrange organe est parfois utilisé dans la méthode de la Langue Hiyeu. \nCette méthode sournoise consiste à faire avaler une langue hyieu à la victime qui ne peut alors plus s\'empêcher de parler en gesticulant dans tous les sens comme si elle faisait du smourf ou pire, de la Pektonique, ce qui a pour effet de la fatiguer très rapidement. Ce qui est intéressant c\'est l\'effet secondaire produit lorsque la victime est fatiguée : elle prend la première personne qu\'elle voit pour sa meilleure amie, ce qui la rend plus encline à dévoiler des informations.', 'ep': 1, 'g': 740, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9533] = {'n': 'Pierre d\'âme adouée', 'nn': 'PIERRE D\'AME ADOUEE', 't': 24, 'd': 'Ensorcelée par le maître de l\'Ordre de l\'Oeil Putride en personne, cette pierre d\'âme a la faculté d\'amadouer les âmes pour qu\'elles se laissent capturer de leur plein gré.', 'ep': 2, 'g': 732, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9534] = {'n': 'Pierre d\'âme de Terra Tibya', 'nn': 'PIERRE D\'AME DE TERRA TIBYA', 't': 24, 'd': 'Cette pierre d\'âme contient l\'âme de l\'Enutrof Terra Tibya. Vous avez intérêt à en prendre soin si vous ne voulez pas que votre âme termine à l\'intérieur.', 'ep': 2, 'g': 732, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9535] = {'n': 'Potion de Transgénèse', 'nn': 'POTION DE TRANSGENESE', 't': 24, 'd': 'Correctement utilisée, cette potion permet d\'accélérer la croissance des céréales en modifiant leurs gênes. Il se pourrait que cela entraîne des effets secondaires lors de leur consommation mais chut ! Les consommateurs ne doivent rien savoir. \nLa participation de deux paysans et deux alchimistes est nécessaire.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9536] = {'n': 'Parchemin de Transgénèse', 'nn': 'PARCHEMIN DE TRANSGENESE', 't': 24, 'd': 'Ce parchemin permet d\'activer les effets de la Potion de Transgénèse lorsque cette dernière a été versée sur des céréales d\'avoine.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9537] = {'n': 'La bénédiction d\'Erazal', 'nn': 'LA BENEDICTION D\'ERAZAL', 't': 24, 'd': 'Ce livre, en plus des histoires loufoques de morts qui marchent et de fantômes qu\'il raconte, décrit le rituel pour forcer une âme à réintégrer son corps.', 'ep': 0, 'g': 95, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9539] = {'n': 'Badge du chef des renégats', 'nn': 'BADGE DU CHEF DES RENEGATS', 't': 24, 'd': 'Vous avez pris ce badge sur un renégat bontarien qui ne le méritait pas.', 'ep': 0, 'g': 49, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9540] = {'n': 'Cape du Parrain', 'nn': 'CAPE DU PARRAIN', 't': 17, 'd': 'Cette cape protégera votre cou du frimas, et votre postérieur des coups bas.', 'ep': 0, 'g': 163, 'l': 48, 'wd': true, 'fm': true, 'w': 10, 's': 126, 'p': 6200};
I.u[9541] = {'n': 'Borsalino du Parrain', 'nn': 'BORSALINO DU PARRAIN', 't': 16, 'd': 'Ce chapeau plutôt original permet d\'affirmer avec fierté votre rôle de parrain. Vous auriez tort de vous en priver.', 'ep': 0, 'g': 234, 'l': 43, 'wd': true, 'fm': true, 'w': 10, 's': 126, 'p': 5100};
I.u[9542] = {'n': 'Souliers laqués du Parrain', 'nn': 'SOULIERS LAQUES DU PARRAIN', 't': 11, 'd': 'Ces souliers brillent de mille feux, même lorsqu\'ils sont complètement usés. Très efficace pour éblouir vos adversaires lorsqu\'ils les recevront en pleine tête.', 'ep': 0, 'g': 130, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 's': 126, 'p': 4450};
I.u[9543] = {'n': 'Grosse Bagouze du Parrain', 'nn': 'GROSSE BAGOUZE DU PARRAIN', 't': 9, 'd': 'Cette lourde bague permet de donner un peu plus d\'inertie à vos gifles, et un peu plus de piquant à vos caresses.', 'ep': 0, 'g': 166, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 's': 126, 'p': 0};
I.u[9544] = {'n': 'Tourmenteur de Ténèbres', 'nn': 'TOURMENTEUR DE TENEBRES', 't': 114, 'd': 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 'ep': 0, 'g': 1, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 1, 'e': [5, 6, 2, 4, 50, 50, false, false], 'p': 1};
I.u[9545] = {'n': 'Tourmenteur de Flamme', 'nn': 'TOURMENTEUR DE FLAMME', 't': 114, 'd': 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 'ep': 0, 'g': 2, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 1, 'e': [5, 6, 2, 4, 50, 50, false, false], 'p': 1};
