I.u[9548] = {'n': 'Tourmenteur de Nuage', 'nn': 'TOURMENTEUR DE NUAGE', 't': 114, 'd': 'Cette terrible arme magique a été confectionnée par le célèbre héros bricoleur Issering. Elle canalise la magie de celui qui l\'utilise pour la faire ressortir sous forme de puissantes décharges. Mais ce n\'est pas tout, puisque cette arme magique change l\'apparence de celui qui l\'utilise, et lui permet d\'utiliser de nouveaux sortilèges. Son propriétaire devient alors une autre personne, et son Tourmenteur devient son seul ami, jusqu\'à ce qu\'il décide de ne plus l\'utiliser.', 'ep': 0, 'g': 5, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 1, 'e': [5, 6, 2, 4, 50, 50, false, false], 'p': 1};
I.u[9549] = {'n': 'Caleçon à bretelles du Parrain', 'nn': 'CALECON A BRETELLES DU PARRAIN', 't': 10, 'd': 'Le slogan du couturier à l\'origine de cette merveille était : ' + '"' + 'Même dans le feu de l\'action, ce caleçon restera solidement accroché à votre postérieur, grâce à ses bretelles en lin d\'une qualité supérieure' + '"' + '. Avant d\'être couturier, il était mauvais poète.', 'ep': 0, 'g': 152, 'l': 48, 'wd': true, 'fm': true, 'w': 10, 's': 126, 'p': 6175};
I.u[9550] = {'n': 'Emplacement du champ', 'nn': 'EMPLACEMENT DU CHAMP', 't': 24, 'd': 'Merlan vous a indiqué où le milicien va utiliser le sort de Transgénèse. Il faut vous dépêcher d\'arriver avant qu\'il ne soit trop tard.', 'ep': 0, 'g': 50, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9551] = {'n': 'Graine de scorbute modifiée', 'nn': 'GRAINE DE SCORBUTE MODIFIEE', 't': 24, 'd': 'Ces graines de scorbute ont été modifiées mais vous ne voyez pas la différence avec des graines de scorbute classiques. Le vrai problème est que par contre vous voyez clairement la différence entre ces graines et des graines de pavot. Seul un idiot pourrait se méprendre.', 'ep': 0, 'g': 405, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
