I.u[9557] = {'n': 'Clef du coffre', 'nn': 'CLEF DU COFFRE', 't': 24, 'd': 'Cette clef sert à ouvrir le coffre qui, selon Terra Tibya, abriterait les statuettes de Sumens.', 'ep': 1, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9558] = {'n': 'Potion de remouflage', 'nn': 'POTION DE REMOUFLAGE', 't': 14, 'd': 'Cette potion vous permet de révéler tous les personnages invisibles présents autour de vous.', 'ep': 0, 'g': 73, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'Pg>23,3', 'u': true, 'p': 1};
I.u[9566] = {'n': 'Bouclier Pararayon', 'nn': 'BOUCLIER PARARAYON', 't': 82, 'd': 'C\'est dans les tavernes de Pandala que le bouclier Pararayon fut pour la première fois forgée.  Il est dit que ce bouclier, inspiré par la déesse Pandawa elle-même protégerait des effets du rayon cosmique. Réalité ou opération marketing de forgeurs de boucliers Pandawas, le mystère reste entier.', 'ep': 0, 'g': 34, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 5000};
I.u[9567] = {'n': 'Coiffe du Black Wab', 'nn': 'COIFFE DU BLACK WAB', 't': 16, 'd': 'Avec cette coiffe, vous pourrez facilement vous métamorphoser en vengeur masqué, et peut-être même en  mangeur vasqué. A vous de voir.', 'ep': 0, 'g': 235, 'l': 49, 'wd': true, 'fm': true, 'w': 10, 's': 127, 'p': 6325};
I.u[9569] = {'n': 'Cape du Black Wab', 'nn': 'CAPE DU BLACK WAB', 't': 17, 'd': 'Le petit pompon accroché à l\'extrémité de cette cape permet de ramasser efficacement les poussières de votre maison, il est normalement assez petit pour passer sous les meubles. N\'oubliez pas de l\'enlever lorsque vous partez travailler aux champs.', 'ep': 0, 'g': 164, 'l': 46, 'wd': true, 'fm': true, 'w': 10, 's': 127, 'p': 5600};
I.u[9575] = {'n': 'Ceinture du Black Wab', 'nn': 'CEINTURE DU BLACK WAB', 't': 10, 'd': 'Cette ceinture peut se porter dans les deux sens, suivant ce que vous désirez cacher ou montrer...', 'ep': 0, 'g': 153, 'l': 46, 'wd': true, 'fm': true, 'w': 10, 's': 127, 'p': 5600};
I.u[9576] = {'n': 'Bottines du Black Wab', 'nn': 'BOTTINES DU BLACK WAB', 't': 11, 'd': 'Ces bottines en peau de fesse de Black Wabbit, vous permettront de prendre une bonne revanche sur ces terribles créatures, en ayant l\'impression de leur botter le derrière à chaque fois que vous taperez dans quelque chose. La vie est parfois faîte de plaisirs simples.', 'ep': 0, 'g': 131, 'l': 47, 'wd': true, 'fm': true, 'w': 10, 's': 127, 'p': 5850};
I.u[9577] = {'n': 'Malédiction d\'Assan Trapick', 'nn': 'MALEDICTION D\'ASSAN TRAPICK', 't': 30, 'd': 'Vous devez être vraiment vert.', 'ep': 0, 'g': 5, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
