I.u[9617] = {'n': 'Chacha Angora', 'nn': 'CHACHA ANGORA', 't': 18, 'd': 'Cette boule de poils est mieux protégée contre le froid que le Chacha classique, elle est plus douce, mais il paraît que son caractère est encore plus insupportable. Cette créature ne mange que de la viande et du poisson.', 'ep': 0, 'g': 50, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
