I.u[9619] = {'n': 'Tiwabbit Kiafin', 'nn': 'TIWABBIT KIAFIN', 't': 18, 'd': 'Cette créature est un peu stupide, la seule façon de la faire avancer est de lui accrocher dans le dos un bâton soutenant une Cawotte. Heureusement, ce familier a été correctement dressé, et ne tentera pas d\'envoyer des vents de panique. Ce dévoreur d\'âmes se nourrit en mangeant les restes d\'autres Wabbits.', 'ep': 0, 'g': 51, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[9620] = {'n': 'Miniminotot', 'nn': 'MINIMINOTOT', 't': 18, 'd': 'Cette créature est un Minimino élevé par le Minotot en personne. Il lui a malheureusement transmis son caractère, ainsi qu\'une partie de ses odeurs corporelles à force de le cajoler sous ses aisselles. Ce dévoreur d\'âmes mange les dépouilles des créatures de l\'île du Minotoror.', 'ep': 0, 'g': 49, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[9621] = {'n': 'Cadeau venu d\'ailleurs', 'nn': 'CADEAU VENU D\'AILLEURS', 't': 89, 'd': 'Vous êtes sûr que ce sac n\'était pas là il y a encore deux minutes. Mais que peut-il bien contenir ? (DOUBLE-CLIC POUR UTILISER)', 'ep': 0, 'g': 32, 'l': 1, 'wd': false, 'fm': false, 'w': 1, 'u': true, 'p': 0};
I.u[9622] = {'n': 'Pousse de Tanfouguite', 'nn': 'POUSSE DE TANFOUGUITE', 't': 36, 'd': 'L\'existence de cette plante est aussi mystérieuse et improbable que son nom. A la fois ici et ici, mais pas maintenant, heureusement qu\'elle n\'est pas ailleurs, on n\'y comprendrait plus rien. Amenez-la au temple Xélor d\'Amakna (coordonnées 3,1) , seuls des illuminés comme eux peuvent tenter d\'y comprendre quelque chose.', 'ep': 0, 'g': 638, 'l': 1, 'wd': false, 'fm': false, 'w': 1, 'p': 0};
I.u[9623] = {'n': 'Crocodaille', 'nn': 'CROCODAILLE', 't': 18, 'd': 'Ne vous méprenez pas, les dents pointues de cette créature finiront un jour ou l\'autre par se planter dans votre postérieur. Ce familier ne mange que de la viande et du poisson.', 'ep': 0, 'g': 47, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
I.u[9624] = {'n': 'Dragoune Noire', 'nn': 'DRAGOUNE NOIRE', 't': 18, 'd': 'Prenez une Dragoune Rose, teignez-la en noir, saupoudrez-la de poussière d\'or, trempez-la dans l\'huile, trempez-la dans l\'eau, et vous aurez une Dragoune Noire. Ce dévoreur d\'âmes ne mange que les dépouilles de dragoeufs.', 'ep': 0, 'g': 48, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
