I.u[9785] = {'n': 'Shushu de Rushu', 'nn': 'SHUSHU DE RUSHU', 't': 18, 'd': 'Ce démon mineur vous accompagnera durant toutes vos pérégrinations, du Zaap d\'Astrub au cimetière, voire même du cimetière au Zaap d\'Astrub. Cette créature est animée d\'une haine viscérale envers les Ouassingues. Une sombre histoire de ménage paraît-il... Attaquez des Ouassingues, et elle se repaîtra de leurs dépouilles.', 'ep': 0, 'g': 52, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'c': 'PZ=1', 'p': 1};
