I.u[9921] = {'n': 'Bracelet du Tétounik', 'nn': 'BRACELET DU TETOUNIK', 't': 9, 'd': 'Ce bracelet est censé briller, mais uniquement la nuit et dans les tavernes.', 'ep': 0, 'g': 168, 'l': 45, 'wd': true, 'fm': true, 'w': 10, 's': 132, 'p': 5525};
I.u[9922] = {'n': 'Ceinture du Tétounik', 'nn': 'CEINTURE DU TETOUNIK', 't': 10, 'd': 'Cette ceinture est dotée d\'un mécanisme magnétique incroyablement puissant qui lui permet de se rester fermée sans utiliser la moindre boucle de ceinture. Attention, il est déconseillé de l\'utiliser en même temps qu\'un slip de plomb.', 'ep': 0, 'g': 154, 'l': 38, 'wd': true, 'fm': true, 'w': 10, 's': 132, 'p': 4050};
I.u[9923] = {'n': 'Chaussures du Tétounik', 'nn': 'CHAUSSURES DU TETOUNIK', 't': 11, 'd': 'Si vous êtes bien musclé, et que vous voulez danser comme un robot, ces chaussures sont faîtes pour vous. Attention, les lacets sont en option.', 'ep': 0, 'g': 135, 'l': 40, 'wd': true, 'fm': true, 'w': 10, 's': 132, 'p': 4300};
I.u[9924] = {'n': 'Corno fulgures', 'nn': 'CORNO FULGURES', 't': 16, 'd': 'La légende raconte que ces cornes servent de paratonnerre, concentrent la foudre pendant plusieurs heures puis projettent des éclairs contre tous les imprudents qui s\'approchent un peu trop près. Une autre légende raconte qu\'elles servent juste à vous faire passer pour un idiot.', 'ep': 0, 'g': 239, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 's': 139, 'p': 4825};
I.u[9925] = {'n': 'Fulgu au poing', 'nn': 'FULGU AU POING', 't': 9, 'd': 'Cet anneau est plus proche du gant ou de la moufle que de l\'alliance mais qu\'importe, plus personne ne vous serrera la main comme avant.', 'ep': 0, 'g': 169, 'l': 44, 'wd': true, 'fm': true, 'w': 10, 's': 139, 'p': 4400};
I.u[9926] = {'n': 'Hache Téreau hache', 'nn': 'HACHE TEREAU HACHE', 't': 19, 'd': 'Cette hache composée de deux lames permet de trancher deux têtes simultanément et donc de décapiter un huitième d\'une hydre à seize têtes.', 'ep': 0, 'g': 57, 'l': 39, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [3, 5, 1, 1, 20, 50, false, false], 'c': 'CC>60&CV>50&CW>30', 's': 139, 'p': 3900};
I.u[9927] = {'n': 'Golbottes', 'nn': 'GOLBOTTES', 't': 11, 'd': 'Olcar portait ces bottes lorsqu\'il aperçut du haut du mont Jifu d\'étranges objets non identifiés traversant le ciel.', 'ep': 0, 'g': 136, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 's': 139, 'p': 4805};
I.u[9928] = {'n': 'Bottes Siks Won Naïne', 'nn': 'BOTTES SIKS WON NAINE', 't': 11, 'd': 'Il vous faudra environ 12 heures pour nouer les lacets de ces bottes et 16 heures pour les dénouer. Si vous décidez de les enlever une fois par jour, vous prendrez donc du retard tous les jours, à moins de prendre de l\'avance dès aujourd\'hui pour les jours suivants.', 'ep': 0, 'g': 137, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 's': 131, 'p': 4750};
I.u[9929] = {'n': 'Ceinture Siks Won Naïne', 'nn': 'CEINTURE SIKS WON NAINE', 't': 10, 'd': 'Chez certains combattants, le talon d\'Achille se situe au niveau du nombril. Avec cette ceinture autour des hanches, vos amis vous trouveront deux fois plus lourd, mais vous serez mieux protégé.', 'ep': 0, 'g': 155, 'l': 41, 'wd': true, 'fm': true, 'w': 10, 's': 131, 'p': 4825};
I.u[9930] = {'n': 'Masque Siks Won Naïne', 'nn': 'MASQUE SIKS WON NAINE', 't': 16, 'd': 'Avec ce masque sur la tête, vous ressemblerez de loin à une larve géante mutante, mais de près vous ressemblerez à un terrible combattant. Évitez les combats en distance.', 'ep': 0, 'g': 240, 'l': 38, 'wd': true, 'fm': true, 'w': 10, 's': 131, 'p': 4000};
I.u[9931] = {'n': 'Coiffe Mulet du Tétounik', 'nn': 'COIFFE MULET DU TETOUNIK', 't': 16, 'd': 'Nuque longue et crête de Pioute, cette coiffe vous ira comme un gant, surtout si vous l\'enfilez ailleurs que sur vos mains.', 'ep': 0, 'g': 241, 'l': 39, 'wd': true, 'fm': true, 'w': 10, 's': 132, 'p': 4255};
I.u[9932] = {'n': 'Touffe de poils du Tavernier Bagrutte', 'nn': 'TOUFFE DE POILS DU TAVERNIER BAGRUTTE', 't': 24, 'd': 'Cette touffe de poils poisseuse a été arrachée aux aisselles du Tavernier Bagrutte. L\'odeur qui s\'en dégage vous donne envie de courir et sauter en hurlant Groink ! Encore un trouble psychiatrique latent.', 'ep': 0, 'g': 30, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9933] = {'n': 'Cape Siks Won Naïne', 'nn': 'CAPE SIKS WON NAINE', 't': 17, 'd': 'Les poils de Bitoufs cousus sur le haut de cette cape, protégeront efficacement votre nuque lorsque le public décidera de vous envoyer quelques chaises afin de vous signifier la médiocrité de vos prestations.', 'ep': 0, 'g': 167, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 's': 131, 'p': 4825};
I.u[9934] = {'n': 'Clef de l\'enclos', 'nn': 'CLEF DE L\'ENCLOS', 't': 24, 'd': 'Les gobelins étant équipés d\'outils rudimentaires, ils recyclent un maximum de choses et cet os ne fait pas exception à la règle. Qui aurait crû qu\'un simple os permettait d\'ouvrir leur enclos ? Pas vous en tout cas.', 'ep': 0, 'g': 57, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9935] = {'n': 'Corde d\'escalade', 'nn': 'CORDE D\'ESCALADE', 't': 15, 'd': 'Cette corde très solide en vogue chez les alpinistes en herbe peut aussi bien servir à monter qu\'à descendre. Cependant, une vieille tradition amaknéenne consiste à y faire un noeud coulant au bout et à passer ce noeud autour du cou du chef du village, pour lui faire comprendre que ses décisions ne font pas l\'unanimité.', 'ep': 0, 'g': 170, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 1};
I.u[9936] = {'n': 'Caskostar', 'nn': 'CASKOSTAR', 't': 16, 'd': 'Ce casque est parfait si vous voulez ressembler à un méchant malgré votre visage de chérubin et vos boutons d\'acné.', 'ep': 0, 'g': 242, 'l': 37, 'wd': true, 'fm': true, 'w': 10, 's': 117, 'p': 3825};
I.u[9937] = {'n': 'Le Chapleau', 'nn': 'LE CHAPLEAU', 't': 16, 'd': 'Ce chapeau est livré avec une moustache postiche qui ne pousse pas, ce qui vous permettra d\'économiser quelques séances chez le barbier.', 'ep': 0, 'g': 243, 'l': 37, 'wd': true, 'fm': true, 'w': 10, 's': 116, 'p': 3700};
I.u[9938] = {'n': 'Sabroh', 'nn': 'SABROH', 't': 6, 'd': 'La lame de ce sabre a été trempée pendant 18 mois dans un concentré de purée de lucioles. C\'est franchement ignoble, mais au moins il brille dans le noir.', 'ep': 0, 'g': 91, 'l': 38, 'wd': true, 'fm': true, 'w': 10, 'an': 14, 'tw': true, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'CV>30&CS>20&CW>20', 's': 117, 'p': 3800};
I.u[9939] = {'n': 'La Chaplanne', 'nn': 'LA CHAPLANNE', 't': 4, 'd': 'Cette canne souple en bambou a appartenu à un illustre vagabond aux manières raffinées.', 'ep': 0, 'g': 88, 'l': 37, 'wd': true, 'fm': true, 'w': 10, 'an': 12, 'e': [5, 3, 1, 1, 40, 50, false, false], 'c': 'CC>25', 's': 116, 'p': 3700};
I.u[9940] = {'n': 'Nacre brute', 'nn': 'NACRE BRUTE', 't': 51, 'd': 'Correctement polie, cette pierre peut donner une magnifique Nacre.', 'ep': 0, 'g': 10, 'l': 20, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[9941] = {'n': 'Nacre', 'nn': 'NACRE', 't': 50, 'd': 'Composé de cristaux d\'aragonite et de conchyoline, la nacre était inconnue jusqu\'à la découverte de l\'île d\'Otomaï et des crustorails. C\'est un élément très prisé en alchimie et joaillerie, bien que les recettes dans lesquelles il intervient soient jalousement tenues secrètes.', 'ep': 0, 'g': 4, 'l': 50, 'wd': true, 'fm': true, 'w': 10, 'p': 5000};
I.u[9942] = {'n': 'Anneau de la mort', 'nn': 'ANNEAU DE LA MORT', 't': 9, 'd': 'La construction de cet anneau, aussi connu sous le nom ' + '"' + 'Anneau noir' + '"' + ', ne semble pas encore achevée. Mais qu\'importe, sa puissance est suffisante pour détruire une lune.', 'ep': 0, 'g': 170, 'l': 36, 'wd': true, 'fm': true, 'w': 10, 's': 117, 'p': 3600};
I.u[9943] = {'n': 'Les Chaplures', 'nn': 'LES CHAPLURES', 't': 11, 'd': 'Ces magnifiques chaussures sont recouvertes d\'un vernis à base de... Personne ne sait réellement, mais tant qu\'elles brillent tout le monde s\'en moque.', 'ep': 0, 'g': 138, 'l': 43, 'wd': true, 'fm': true, 'w': 10, 's': 116, 'p': 4975};
I.u[9944] = {'n': 'La Chaplivate', 'nn': 'LA CHAPLIVATE', 't': 1, 'd': 'A la fois amulette et cravate, cet objet d\'apparat permettra à vos proches de vous tenir en laisse facilement. Et vous aimerez ça.', 'ep': 0, 'g': 145, 'l': 43, 'wd': true, 'fm': true, 'w': 10, 's': 116, 'p': 5000};
I.u[9945] = {'n': 'Sac de Bouba le Prophète', 'nn': 'SAC DE BOUBA LE PROPHETE', 't': 81, 'd': 'Bouba a toujours prétendu être un prophète, porteur d\'un message qu\'il a fini par lui-même oublier. reconverti pendant plusieurs années comme chasseur de primes, il a terminé sa triste carrière, digéré dans le ventre d\'une créature des sables.', 'ep': 0, 'g': 33, 'l': 38, 'wd': true, 'fm': true, 'w': 10, 's': 117, 'p': 4050};
I.u[9946] = {'n': 'Cristal de Kain Dharyn', 'nn': 'CRISTAL DE KAIN DHARYN', 't': 24, 'd': 'Kain Dharyn était un chasseur de trésors réputé à travers tout Amakna. Parmi ses découvertes se trouvent des cristaux précieux aux propriétés surprenantes, dont la faculté de loucher à l\'envers sans les mains. Kain cacha l\'emplacement du gisement et aujourd\'hui encore de nombreux Enutrofs sont à sa recherche.', 'ep': 0, 'g': 744, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9947] = {'n': 'Cristal de Kain Dharyn enchanté', 'nn': 'CRISTAL DE KAIN DHARYN ENCHANTE', 't': 24, 'd': 'Ce Cristal de Kain Dharyn a été enchanté de manière à décupler l\'avidité de ceux qui l\'observent.', 'ep': 0, 'g': 717, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9948] = {'n': 'Tibia du chef des voleurs', 'nn': 'TIBIA DU CHEF DES VOLEURS', 't': 24, 'd': 'Avec un tibia en moins, le chef des voleurs va avoir du mal à marcher. Tant pis pour lui, ça lui servira de leçon.', 'ep': 0, 'g': 57, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9949] = {'n': 'Pâte à Tra Khben', 'nn': 'PATE A TRA KHBEN', 't': 110, 'd': 'Cette pâte fut inventée par le célèbre Tra Khben, géologue spécialiste de l\'écosystème et des moissons, précocement atteint d\'arthrose dans le dos. Cette pâte avait comme particularité de raidir et durcir toute substance organique avec laquelle elle entrait en contact, ce qui permettait à Tra Khben de se tenir droit. Ce ne fut qu\'après la mort de ce dernier qu\'on trouva à la pâte un tout autre usage, très en vogue surtout chez les Enutrofs. Son seul inconvénient est l\'odeur, ce qui explique l\'haleine de certaines Enutrofettes.', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9950] = {'n': 'Pierre de souillure bleue impure', 'nn': 'PIERRE DE SOUILLURE BLEUE IMPURE', 't': 51, 'd': 'Correctement polie, cette pierre dévoilera son plein potentiel.', 'ep': 0, 'g': 151, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 1};
I.u[9951] = {'n': 'Pierre de souillure jaune impure', 'nn': 'PIERRE DE SOUILLURE JAUNE IMPURE', 't': 51, 'd': 'Correctement polie, cette pierre dévoilera son plein potentiel.', 'ep': 0, 'g': 145, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 1};
I.u[9952] = {'n': 'Pierre de souillure verte impure', 'nn': 'PIERRE DE SOUILLURE VERTE IMPURE', 't': 51, 'd': 'Correctement polie, cette pierre dévoilera son plein potentiel.', 'ep': 0, 'g': 76, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 1};
I.u[9953] = {'n': 'Pierre de souillure bleue', 'nn': 'PIERRE DE SOUILLURE BLEUE', 't': 50, 'd': 'Cette pierre est capable de souiller une âme sans grande volonté, ce qui peut s\'avérer efficace pour transformer des tofus en tofus maléfiques. Combinée à d\'autres pierres de souillure, elle serait à même de donner un contrôle total sur les âmes souillées.', 'ep': 0, 'g': 460, 'l': 50, 'wd': false, 'fm': true, 'w': 10, 'p': 100};
I.u[9954] = {'n': 'Pierre de souillure jaune', 'nn': 'PIERRE DE SOUILLURE JAUNE', 't': 50, 'd': 'Cette pierre est capable de souiller une âme sans grande volonté, ce qui peut s\'avérer efficace pour transformer des tofus en tofus maléfiques. Combinée à d\'autres pierres de souillure, elle serait à même de donner un contrôle total sur les âmes souillées.', 'ep': 0, 'g': 463, 'l': 50, 'wd': false, 'fm': true, 'w': 10, 'p': 100};
I.u[9955] = {'n': 'Pierre de souillure verte', 'nn': 'PIERRE DE SOUILLURE VERTE', 't': 50, 'd': 'Cette pierre est capable de souiller une âme sans grande volonté, ce qui peut s\'avérer efficace pour transformer des tofus en tofus maléfiques. Combinée à d\'autres pierres de souillure, elle serait à même de donner un contrôle total sur les âmes souillées.', 'ep': 0, 'g': 461, 'l': 50, 'wd': false, 'fm': true, 'w': 10, 'p': 100};
I.u[9956] = {'n': 'Pierre des Âmes Souillées', 'nn': 'PIERRE DES AMES SOUILLEES', 't': 24, 'd': 'Cette pierre provient du Puits des Âmes Souillées. Grâce à elle, il est possible de contrôler les âmes des créatures piégées en son sein.', 'ep': 0, 'g': 462, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9958] = {'n': 'Caisse d\'équipement bontarien', 'nn': 'CAISSE D\'EQUIPEMENT BONTARIEN', 't': 24, 'd': 'Cette caisse renferme le kit du parfait petit milicien. Si le contenu de cette caisse est de la même qualité que le contenant, il ne faudra pas s\'étonner que la milice de Bonta soit vaincue en moins d\'une journée.', 'ep': 0, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9959] = {'n': 'Rapport d\'expertise', 'nn': 'RAPPORT D\'EXPERTISE', 't': 24, 'd': 'Comme vous vous y attendiez, ce rapport d\'expertise confirme la mauvaise qualité de l\'équipement des miliciens bontariens. Cette nouvelle devrait ravir Oto Mustam.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9960] = {'n': 'Clefs de l\'entrepôt', 'nn': 'CLEFS DE L\'ENTREPOT', 't': 24, 'd': 'Ce bocal contient les restes de ce qui résidait jadis dans le ventre d\'Ybur Effel. La bonne nouvelle, c\'est qu\'il contient également les clefs de l\'entrepôt. Il ne vous reste qu\'à y mettre la main pour les récupérer et surtout, n\'oubliez pas de vous lécher les doigts après.', 'ep': 0, 'g': 32, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9961] = {'n': 'Marteau Martel', 'nn': 'MARTEAU MARTEL', 't': 7, 'd': 'Ce marteau de piètre qualité a été conçu pour leurrer les forgerons, en leur faisant croire qu\'ils avaient entre leurs mains un marteau d\'excellente qualité. Il est fortement déconseillé de s\'en servir, même pour ne rien faire.', 'ep': 0, 'g': 2, 'l': 1, 'wd': true, 'fm': false, 'w': 5, 'an': 15, 'e': [5, 4, 1, 1, 60, 20, false, false], 'p': 10};
I.u[9962] = {'n': 'Caisse de minerai', 'nn': 'CAISSE DE MINERAI', 't': 24, 'd': 'Vous avez volé cette caisse de minerai afin que Latem Sa ne puisse pas s\'en servir pour forger les nouveaux équipements destinés aux miliciens de Bonta.', 'ep': 0, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9963] = {'n': 'Marteau de Forgeron', 'nn': 'MARTEAU DE FORGERON', 't': 24, 'd': 'Vous avez dérobé ce marteau à Latem Sa et vous l\'avez remplacé par un Marteau de Martel. Latem Sa est tellement incompétent qu\'il ne devrait pas faire la différence.', 'ep': 0, 'g': 8, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9964] = {'n': 'Cadeau Dragodinde Kraméléhon', 'nn': 'CADEAU DRAGODINDE KRAMELEHON', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature encore vivante. Ne perdez pas une seule seconde, ouvrez-le vite !', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[9965] = {'n': 'Méthode d\'élevage canin', 'nn': 'METHODE D\'ELEVAGE CANIN', 't': 24, 'd': 'Cette méthode, rédigée par le célèbre dresseur de chachas Riyou Tchevlakouk, explique comment dompter un Croc Gland pour en faire le meilleur ami de l\'homme, mais pas de la femme.', 'ep': 0, 'g': 95, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9966] = {'n': 'Butin du convoi', 'nn': 'BUTIN DU CONVOI', 't': 24, 'd': 'Vous avez obtenu ce butin en attaquant un convoi bontarien. Piétinor le bourrin, dans le bâtiment de la milice de Brâkmar, saura vous récompenser pour vos efforts. Avec de la chance, il acceptera même de vous laisser repartir en un seul morceau.', 'ep': 0, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9967] = {'n': 'Comment préparer du Gloutoburg', 'nn': 'COMMENT PREPARER DU GLOUTOBURG', 't': 24, 'd': 'Laura Soho, serveuse à la Taverne d\'Amakna, vous a écrit sur ce morceau de papier comment préparer une bonne bouteille de Gloutoburg à l\'aide d\'un alchimiste. \n- 5 Fioles de Pandaburg. \n- 1 Glouto Rhum. \n- 10 Feuilles de Salace.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9968] = {'n': 'Bouteille de Gloutoburg', 'nn': 'BOUTEILLE DE GLOUTOBURG', 't': 79, 'd': 'Ce mélange d\'alcool surpuissant arrache la langue, racle le palais, brûle l\'oesophage et explose l\'estomac avant de faire bouillir le cerveau. Autant dire que c\'est une boisson pour les Pandawas, les vrais ! \nIl est écrit en tout petit au fond de la bouteille : l\'abus de boisson est dangereux pour la santé, à consommer avec modération sauf en cas de libation pour la déesse.', 'ep': 0, 'g': 177, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'u': true, 'p': 1};
I.u[9969] = {'n': 'Salace de poissons empoisonnée', 'nn': 'SALACE DE POISSONS EMPOISONNEE', 't': 15, 'd': 'Comme le dit le dicton : une odeur peut en cacher une autre. En effet, le parfum dégagé par cette salace de poissons cache un puissant poison qui, une fois ingurgité, vous fait régurgiter. Très efficace pour animer un mariage un peu mou ou jouer un tour à son chef de guilde préféré.', 'ep': 0, 'g': 80, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9970] = {'n': 'Recette de la Salace de poissons', 'nn': 'RECETTE DE LA SALACE DE POISSONS', 't': 24, 'd': 'Gropinson Cruaulé a écrit la recette de la salace de poissons sur le sable de la plage et vous l\'avez recopiée sur ce morceau de papier. \n- Un poissonnier (le mettre dans le plat est optionnel). \n- 2 Bars Rikains. \n- 3 Bâton de crabe ***. \n- 2 Citrons. \n- 4 Feuilles de Salace. \n- 1 Blopisier empoisonné (ça, c\'est votre touche personnelle).', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9971] = {'n': 'Clefs de Mulic Bere', 'nn': 'CLEFS DE MULIC BERE', 't': 24, 'd': 'Ces clefs appartiennent à Mulic Bere. Elles servent à ouvrir l\'accès à sa forge spéciale qui lui permet, entre autre, de fabriquer des objets peu ordinaires pour des personnes très ordinaires telles que vous.', 'ep': 0, 'g': 61, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9972] = {'n': 'Marteau de Forgeur de Grattoir', 'nn': 'MARTEAU DE FORGEUR DE GRATTOIR', 't': 7, 'd': 'Ce marteau destiné à la forge a été conçu pour un usage précis, ce qui rend son utilisation difficile pour autre chose. Seule une personne désespérée ou marginale s\'en servirait pour forger des armes.', 'ep': 0, 'g': 2, 'l': 1, 'wd': true, 'fm': true, 'w': 20, 'an': 15, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'PJ>20,49', 'p': 150};
I.u[9973] = {'n': 'Extrémité du Grattoir', 'nn': 'EXTREMITE DU GRATTOIR', 't': 15, 'd': 'Cette extrémité de grattoir possède plusieurs articulations pour faciliter son emploi. Ses nombreux piquants illustrent parfaitement le vieux dicton amaknéen \'Qui s\'y frotte s\'y pique\'.', 'ep': 0, 'g': 716, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9974] = {'n': 'Tailladeuse de Manche', 'nn': 'TAILLADEUSE DE MANCHE', 't': 5, 'd': 'Si vous utilisez cette tailladeuse en combat, vous vous battrez comme un manche. Par contre, si vous vous en servez pour sculpter des manches, les tailleurs se retrouveront sur la paille, ce qui rendra les paysans mécontents.', 'ep': 0, 'g': 17, 'l': 1, 'wd': true, 'fm': true, 'w': 5, 'e': [5, 4, 1, 1, 50, 50, false, false], 'c': 'PJ>19,49', 'p': 150};
I.u[9975] = {'n': 'Manche du Grattoir', 'nn': 'MANCHE DU GRATTOIR', 't': 15, 'd': 'Seul, ce manche ne vous est d\'aucune utilité. Il est possible d\'y ajouter un grattoir à son extrémité, ce qui ne vous sera pas plus utile. Vous pouvez raisonnablement  en conclure que seul un esprit tordu saurait quoi en faire.', 'ep': 0, 'g': 52, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'p': 1};
I.u[9976] = {'n': 'Grattoir à dos inachevé', 'nn': 'GRATTOIR A DOS INACHEVE', 't': 15, 'd': 'Ce grattoir à dos est presque parfait. Presque, mais pas totalement. Seul un forgeron de grand talent pourra l\'achever, malheureusement vous n\'en connaissez aucun.', 'ep': 0, 'g': 52, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'p': 1};
I.u[9977] = {'n': 'Grattoir à dos Spentox', 'nn': 'GRATTOIR A DOS SPENTOX', 't': 24, 'd': 'Ce grattoir à dos couvert de pointes est articulé de manière à épouser la forme du corps et ainsi atteindre des endroits jusqu\'alors inaccessibles. Ne rêvez pas, la beauté n\'est pas un endroit.', 'ep': 0, 'g': 745, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9978] = {'n': 'Armée de Tiques de sanglier des plaines', 'nn': 'ARMEE DE TIQUES DE SANGLIER DES PLAINES', 't': 24, 'd': 'Plus grosses que les tiques de bouftou, les tiques de sanglier des plaines peuvent absorber jusqu\'à cent fois leur poids en sang. De quoi faire pâlir d\'envie les vampires et même le Dark Vlad en personne.', 'ep': 0, 'g': 727, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9979] = {'n': 'Philtre de Longévité', 'nn': 'PHILTRE DE LONGEVITE', 't': 12, 'd': 'L\'alchimiste Nileza créa cette potion dans l\'espoir qu\'elle lui octroierait l\'immortalité. Malheureusement, il mourut avant de pouvoir l\'utiliser, la confondant avec le Sang de Likrone empoisonné qui se trouvait à côté.', 'ep': 0, 'g': 40, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9980] = {'n': 'Plat de Gra-vette', 'nn': 'PLAT DE GRA-VETTE', 't': 49, 'd': 'Ce plat illustre parfaitement l\'expression favorite du chevalier Kacador \'Le gras, c\'est la vie\'.', 'ep': 0, 'g': 82, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'u': true, 'ut': true, 'p': 1};
I.u[9981] = {'n': 'Farine Humée', 'nn': 'FARINE HUMEE', 't': 52, 'd': 'Cette farine fut utilisée par Xavier le Boulanger pour concevoir le pain servi à chacune des funérailles du célèbre ménestrel Francisque Kabroule.', 'ep': 0, 'g': 7, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[9982] = {'n': 'Salade Houbée', 'nn': 'SALADE HOUBEE', 't': 69, 'd': 'Le nom de cette salade est un hommage au jour de sa conception. En effet, elle fut servie pour la première fois lors de la cérémonie d\'adoubement du chevalier Kacador. Comme toute nourriture destinée au chevalier, cette salade est déconseillée aux végétariens.', 'ep': 0, 'g': 129, 'l': 1, 'wd': false, 'fm': true, 'w': 5, 'u': true, 'ut': true, 'p': 1};
I.u[9983] = {'n': 'Pain Phecte', 'nn': 'PAIN PHECTE', 't': 33, 'd': 'Servi lors des funérailles du célèbre ménestrel Franscique Kabroule, le goût et l\'odeur de ce pain sont si infects qu\'ils réveilleraient un mort, ou tueraient un vivant. Ceci pourrait expliquer les nombreux retour à la vie du ménestrel Francisque Kabroule.', 'ep': 0, 'g': 13, 'l': 1, 'wd': false, 'fm': true, 'w': 2, 'u': true, 'ut': true, 'p': 1};
I.u[9984] = {'n': 'Liste des ingrédients d\'antan', 'nn': 'LISTE DES INGREDIENTS D\'ANTAN', 't': 24, 'd': 'Voici la liste donnée par Oto Mustam : \n- 1 Pain Phecte. \n- 1 Salade Houbée. \n- 1 Plat de Gra-vette. \n- 1 Philtre de Longévité.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9985] = {'n': 'Recette du Pain Phecte', 'nn': 'RECETTE DU PAIN PHECTE', 't': 24, 'd': '- 2 Farines Humées. \n- 5 Eaux. \n- 2 Levures de Boulanger.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9986] = {'n': 'Recette de la Farine Humée', 'nn': 'RECETTE DE LA FARINE HUMEE', 't': 24, 'd': '- 1 Farine de Xavier le Boulanger. \n- 1 Poudre d\'Eniripsa. \n- 4 Oignons.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9987] = {'n': 'Recette de la Salade Houbée', 'nn': 'RECETTE DE LA SALADE HOUBEE', 't': 24, 'd': '- 5 Salades de Museau ***. \n- 20 Pollens de Blop. \n- 10 Bourgeons d\'Abraknyde.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9988] = {'n': 'Recette du Plat de Gra-vette', 'nn': 'RECETTE DU PLAT DE GRA-VETTE', 't': 24, 'd': '- 10 Beignets de Greu-vette ***. \n- 5 Citrons. \n- 10 Feuilles de Salace.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9989] = {'n': 'Recette du Philtre de Longévité', 'nn': 'RECETTE DU PHILTRE DE LONGEVITE', 't': 24, 'd': '- 2 Sangs de Likrone. \n- 10 Potions de Vieillesse. \n- 2 Potions de Souvenir.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9990] = {'n': 'Broche de Gueurle', 'nn': 'BROCHE DE GUEURLE', 't': 24, 'd': 'Cette broche vous a été remise par Gueurle pour avoir vaillamment défendu son convoi de marchandises. C\'est également la marque de sa promesse de vous remercier personnellement lors de son retour à Bonta.', 'ep': 0, 'g': 69, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9993] = {'n': 'Sabine', 'nn': 'SABINE', 't': 32, 'd': 'Vous devez emmener Sabine au bâtiment de la milice de Brâkmar.', 'ep': 0, 'g': 25, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[9995] = {'n': 'Parchemin lié de mercenaire', 'nn': 'PARCHEMIN LIE DE MERCENAIRE', 't': 87, 'd': 'Ce parchemin permet de localiser sa cible afin de la traquer.', 'ep': 0, 'g': 2, 'l': 10, 'wd': false, 'fm': true, 'w': 1, 'c': 'Ps=3', 'u': true, 'p': 1};
I.u[9996] = {'n': 'Lot de cent parchemins de mercenariat', 'nn': 'LOT DE CENT PARCHEMINS DE MERCENARIAT', 't': 87, 'd': 'Ce lot permet de ' + '"' + 'marquer' + '"' + ' <b>une seule cible</b> pour ensuite permettre à un mercenaire de la traquer plusieurs fois.', 'ep': 0, 'g': 3, 'l': 10, 'wd': false, 'fm': true, 'w': 100, 'ut': true, 'p': 3500};
I.u[9997] = {'n': 'Clef du repaire des bandits', 'nn': 'CLEF DU REPAIRE DES BANDITS', 't': 24, 'd': 'Cette clef permet d\'ouvrir la porte du repaire des bandits. Grâce à Grimpill, vous savez qu\'un mécanisme ferme automatiquement la porte dès qu\'une personne entre, c\'est pourquoi chaque personne habilitée par les bandits possède un exemplaire de la clef.', 'ep': 0, 'g': 790, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[9999] = {'n': 'Copie de la clef du repaire des bandits', 'nn': 'COPIE DE LA CLEF DU REPAIRE DES BANDITS', 't': 84, 'd': 'Cette copie de la clef du repaire des bandits Ecaflips semble sur le point de se briser. Il y a fort à parier que ça se produira lorsque vous voudrez l\'utiliser. La mention \'A manier avec précaution\' ne figurant pas sur l\'emballage, vous en déduisez qu\'il s\'agit d\'une contrefaçon, et vous avez raison !', 'ep': 0, 'g': 61, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10000] = {'n': 'Touffe de poils de Grimpill', 'nn': 'TOUFFE DE POILS DE GRIMPILL', 't': 24, 'd': 'Lorsque vous tenez cette touffe de poils dans votre main, vous avez l\'impression qu\'elle grouille d\'activité. En regardant de plus près, votre impression se confirme. Ce n\'est pas une touffe de poils mais une touffe de puces et de tiques géantes. En résumé, vous tenez un véritable écosystème dans le creux de votre main.', 'ep': 0, 'g': 30, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10001] = {'n': 'Lot de dix parchemins de mercenariat', 'nn': 'LOT DE DIX PARCHEMINS DE MERCENARIAT', 't': 87, 'd': 'Ce lot permet de ' + '"' + 'marquer' + '"' + ' <b>une seule cible</b> pour ensuite permettre à un mercenaire de la traquer plusieurs fois.', 'ep': 0, 'g': 3, 'l': 10, 'wd': false, 'fm': true, 'w': 10, 'ut': true, 'p': 500};
I.u[10002] = {'n': 'Parchemin vierge de mercenariat', 'nn': 'PARCHEMIN VIERGE DE MERCENARIAT', 't': 87, 'd': 'Ce parchemin permet de ' + '"' + 'marquer' + '"' + ' une cible pour ensuite permettre à un mercenaire de la traquer.', 'ep': 0, 'g': 1, 'l': 10, 'wd': false, 'fm': false, 'w': 1, 'ut': true, 'p': 100};
I.u[10003] = {'n': 'Gelée Sbihaine', 'nn': 'GELEE SBIHAINE', 't': 110, 'd': 'Seule Liroye Merline connaît la recette de cette gelée artificielle. Lorsqu\'elle est combinée à du gazon humide, la gelée se durcit et épouse la forme de tout objet ayant été préalablement glissé à l\'intérieur, ce qui rend l\'usage de la Gelée Sbihaine très populaire pour la confection de moules.', 'ep': 0, 'g': 47, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10004] = {'n': 'L\'art d\'utiliser la Gelée Sbihaine', 'nn': 'L\'ART D\'UTILISER LA GELEE SBIHAINE', 't': 24, 'd': 'Ce document rédigé par Liroye Merline explique mille et un usages de la Gelée Sbihaine. La partie qui vous intéresse est celle où elle explique comment créer des clefs à moindre frais : \n- 1 Gelée Sbihaine. \n- 1 Herbe Folle. \n- 1 Bakélélite.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10005] = {'n': 'Documents confidentiels', 'nn': 'DOCUMENTS CONFIDENTIELS', 't': 24, 'd': 'Une liste de documents confidentiels bontariens. On peut se demander comment de tels documents se sont retrouvés dans un repaire de bandits.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10006] = {'n': 'Rapport suspicieux', 'nn': 'RAPPORT SUSPICIEUX', 't': 24, 'd': 'Ce rapport fait peser de lourds soupçons sur vous. Il remet en cause votre loyauté envers Bonta et vous implique dans de nombreuses affaires louches. Seul un expert pourra vous dire s\'il s\'agit d\'un document authentique.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10007] = {'n': 'Fiole de poison brâkmarien', 'nn': 'FIOLE DE POISON BRAKMARIEN', 't': 24, 'd': 'Cette fiole de poison brâkmarien préparée à l\'ancienne porte la mention \'A conserver au chaud et à consommer très lentement après ouverture\', suivie de la mention \'Ne pas avaler, sauf si vous êtes la victime ou Bontarien\'. Décidément, les Brâkmariens ne plaisantent pas avec le poison.', 'ep': 0, 'g': 39, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10008] = {'n': 'Registre des clients', 'nn': 'REGISTRE DES CLIENTS', 't': 24, 'd': 'Ce registre contient la liste de tous les clients de l\'atelier des alchimistes de Brâkmar de ces deux dernières semaines. Le problème est que tout est écrit en Brâkmarien et que vous n\'y comprenez rien.', 'ep': 0, 'g': 95, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10009] = {'n': 'Xephirès', 'nn': 'XEPHIRES', 't': 32, 'd': 'Vous devez amener le traître Xephirès auprès d\'Amayiro. Il a des comptes à lui rendre.', 'ep': 0, 'g': 24, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10010] = {'n': 'Clef de la salle de jeu', 'nn': 'CLEF DE LA SALLE DE JEU', 't': 24, 'd': 'Cette clef permet l\'accès à la salle de jeu de la Taverne du Chabrulé.', 'ep': 0, 'g': 61, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10011] = {'n': 'Coeur de Trape', 'nn': 'COEUR DE TRAPE', 't': 24, 'd': 'Ceci est le coeur encore palpitant de Trape. Qu\'une disciple du dieu Sram n\'ait opposée aucune résistance quand vous lui avez ôté la vie vous trouble encore, mais après réflexion, vous vous dites que le résultat aurait été le même et c\'est le coeur léger que vous apportez ce coeur à votre chef adoré.', 'ep': 0, 'g': 518, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10012] = {'n': 'Coeur de Trape', 'nn': 'COEUR DE TRAPE', 't': 24, 'd': 'Ceci est le coeur encore palpitant de Trape. Qu\'une disciple du dieu Sram n\'ait opposée aucune résistance quand vous lui avez ôté la vie vous trouble encore, mais après réflexion, vous vous dites que le résultat aurait été le même et c\'est le coeur léger que vous apportez ce coeur à votre chef adoré.', 'ep': 0, 'g': 518, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10013] = {'n': 'Coeur de Trape', 'nn': 'COEUR DE TRAPE', 't': 24, 'd': 'Ceci est le coeur encore palpitant de Trape. Qu\'une disciple du dieu Sram n\'ait opposée aucune résistance quand vous lui avez ôté la vie vous trouble encore, mais après réflexion, vous vous dites que le résultat aurait été le même et c\'est le coeur léger que vous apportez ce coeur à votre chef adoré.', 'ep': 0, 'g': 518, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10014] = {'n': 'Chèque de Trape', 'nn': 'CHEQUE DE TRAPE', 't': 24, 'd': 'Ce chèque destiné à Oto Mustam a été préparé par Trape. Dommage qu\'il ne s\'agisse pas de Kamas sonnants et trébuchants sinon vous auriez pu vous servir discrètement.', 'ep': 0, 'g': 54, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10015] = {'n': 'Liste de courses d\'Oto Mustam', 'nn': 'LISTE DE COURSES D\'OTO MUSTAM', 't': 24, 'd': 'Vous avez lamentablement échoué au test de malveillance et Oto Mustam veut vous le faire payer en vous obligeant à trouver les objets suivants : \n- 1 Sac de Bronze. \n- 1 Sac de Malt. \n- 1 Sac de Fleurs de Chanvre.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10016] = {'n': 'Hache Léenne', 'nn': 'HACHE LEENNE', 't': 24, 'd': 'Cette hache à l\'aspect rudimentaire semble appartenir à un autre âge. Sa qualité est si médiocre qu\'il vous semble impossible de couper un Tronknyde avec.', 'ep': 0, 'g': 746, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10017] = {'n': 'Katana de Nara', 'nn': 'KATANA DE NARA', 't': 24, 'd': 'Ce katana a été forgé par Nara lors de sa mise à l\'épreuve. Sa qualité est sans commune mesure avec celle de la Hache Léenne forgée par Latem Sa.', 'ep': 0, 'g': 53, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10018] = {'n': 'Schéma de la Pince à Linge', 'nn': 'SCHEMA DE LA PINCE A LINGE', 't': 15, 'd': 'Ce schéma est si clair qu\'un enfant Iop pourrait peut-être le comprendre. Peut-être, car un Iop reste un Iop. Entre les mains d\'un Bricoleur, ce schéma pourra même servir à fabriquer des objets. Si en plus le Bricoleur est un Iop, il se pourrait que vous assistiez à un miracle. \nIl vous faut le présent schéma, 10 Planches en Bois de Kaliptus et 10 Aluminites.', 'ep': 0, 'g': 767, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10019] = {'n': 'Seau de Pinces à Linge', 'nn': 'SEAU DE PINCES A LINGE', 't': 15, 'd': 'Ce seau contient suffisamment de pinces à linge pour accrocher les sous-vêtements de toute la garnison d\'Amakna sur les remparts. On peut également s\'en servir pour faire sécher les peaux et les cuirs des monstres fraîchement tués ou de vos beaux-parents.', 'ep': 0, 'g': 768, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'p': 1};
I.u[10020] = {'n': 'Poupée Malmenée', 'nn': 'POUPEE MALMENEE', 't': 24, 'd': 'Vous avez du mal à croire que cette poupée à l\'allure déplorable et à l\'odeur repoussante était autrefois un bwork mage. Puis vous vous dites que l\'allure d\'un bwork mage est repoussante et que son odeur est déplorable et l\'histoire prend alors tout son sens.', 'ep': 0, 'g': 747, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10021] = {'n': 'Poupée Rafistolée', 'nn': 'POUPEE RAFISTOLEE', 't': 24, 'd': 'Vous vous demandez si la poupée était mieux avant ou après avoir été rafistolée par Maskara. Une chose est certaine, seul un dieu pouvait rendre la poupée plus belle que son modèle d\'origine. On comprend alors mieux pourquoi le bwork mage s\'était enfermé dans une caverne et la raison de son mauvais caractère.', 'ep': 0, 'g': 747, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10022] = {'n': 'Poupée Enchantée', 'nn': 'POUPEE ENCHANTEE', 't': 24, 'd': 'Quel enchantement de recevoir cette poupée enchantée des mains de l\'enchanteur qui l\'a enchantée dans les Lacs enchantés. S\'il était encore en vie, le ménestrel Francisque Kabroule vous l\'aurait volontiers offerte en chantant.', 'ep': 0, 'g': 747, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10023] = {'n': 'Registre des rondes', 'nn': 'REGISTRE DES RONDES', 't': 24, 'd': 'Contrairement à ce que son titre indique, ce registre ne parle pas des mamas bworks mais du parcours emprunté par les patrouilles brâkmariennes. Pour tendre une embuscade il y a l\'embarras du choix.', 'ep': 0, 'g': 95, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10024] = {'n': 'Vieux Grimoire Bwork', 'nn': 'VIEUX GRIMOIRE BWORK', 't': 24, 'd': 'C\'est le vieux grimoire d\'un bwork mage des cavernes, ce qui signifie que les illustrations qu\'il contient sont difficilement compréhensibles pour un bwork mage des cavernes moderne et davantage encore pour un bwork mage standard. Reste à espérer que Danathor lui trouvera une utilité. Ce serait dommage de s\'être donné tant de mal pour rien, vous ne trouvez pas ?', 'ep': 0, 'g': 95, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10025] = {'n': 'Fièvre du Gloutoburg', 'nn': 'FIEVRE DU GLOUTOBURG', 't': 30, 'd': 'Vous étiez prévenu : l\'abus de Gloutoburg est dangereux pour la santé.', 'ep': 0, 'g': 6, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10026] = {'n': 'Recette de la salace de poissons', 'nn': 'RECETTE DE LA SALACE DE POISSONS', 't': 24, 'd': 'Gropinson Cruaulé a écrit la recette de la salace de poissons sur le sable de la plage et vous l\'avez recopiée sur ce morceau de papier. - Un poissonnier (le mettre dans le plat est optionnel). - 2 Bars Rikains. - 3 Bâton de crabe ***. - 2 Citrons. - 4 Feuilles de Salace. - 2 Vertgely (ça, c\'est votre touche personnelle).', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10028] = {'n': 'Recette du Tissu de Rapiéçage', 'nn': 'RECETTE DU TISSU DE RAPIECAGE', 't': 24, 'd': 'Cette recette a été mise au point par le tailleur Sosh pour rapiécer les vêtements magiques. Les tailleurs expérimentés peuvent s\'en servir pour créer un tissu à l\'épreuve du temps et des intempéries. (action Coudre une cape) \n- 5 Poils de Barbe de Bwork Mage. \n- 5 Poils de Black Tiwabbit. \n- 3 Poils de Barbe du Grand Pa Wabbit. \n- 3 poils du Milimulou. \n- 1 Fil de Soie.', 'ep': 0, 'g': 55, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10029] = {'n': 'Recette de la Teinture Orange Sanguine', 'nn': 'RECETTE DE LA TEINTURE ORANGE SANGUINE', 't': 24, 'd': 'Cette recette a été mise au point par le célèbre alchimiste Uba Tessé. Nul ne l\'a encore utilisée car Uba Tessé l\'avait oubliée chez son ami Sosh, qui vous en a généreusement fait cadeau. \n- 1 Teinture Magique de Rougeur. \n- 1 Teinture Magique Orange. \n- 10 Sangs de Bouftou. \n- 5 Sardines Brillantes.', 'ep': 0, 'g': 55, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10030] = {'n': 'Tissu de Rapiéçage', 'nn': 'TISSU DE RAPIECAGE', 't': 55, 'd': 'Ce tissu de synthèse inventé par le tailleur Sosh permet de rapiécer les vêtements magiques sans altérer leurs pouvoirs. On comprend pourquoi les tailleurs expérimentés le prisent autant.', 'ep': 0, 'g': 434, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10031] = {'n': 'Teinture Orange Sanguine', 'nn': 'TEINTURE ORANGE SANGUINE', 't': 70, 'd': 'Cette teinture magique inventée par Uba Tessé est extrêmement agressive, comme si elle était animée d\'une volonté propre la poussant à faire le mal. Se pose alors la question de savoir pourquoi elle est aussi méchante.', 'ep': 0, 'g': 63, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10032] = {'n': 'Bandana Rapiécé', 'nn': 'BANDANA RAPIECE', 't': 24, 'd': 'Ce bandana est dans un bien meilleur état que lors de sa découverte. Il sent un peu moins la cawotte et un peu plus le poisson, signe qu\'il ressemble plus à ce qu\'il était autrefois. Turorte devrait apprécier de le récupérer en si bon état.', 'ep': 0, 'g': 749, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10033] = {'n': 'Ordre de mission', 'nn': 'ORDRE DE MISSION', 't': 24, 'd': 'Cet ordre de mission signé par Kaffra Kyper indique aux Brâkmariens qu\'ils doivent remettre les documents à Seci Ves, en poste au pied de la Tour des Ordres de Brâkmar.', 'ep': 0, 'g': 33, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10034] = {'n': 'Liste du Mage Ax', 'nn': 'LISTE DU MAGE AX', 't': 24, 'd': 'Liste des objets à apporter pour le rituel de Révélation : \n- 5 Potions de Crachin. \n- 10 Eaux. \n- 10 Graines de Pandouille. \n- 4 Poudres de Perlinpainpain. \n- 2 Bois de Charme. \n- 4 Potions de Courant d\'Air. \n- 2 Personnes de Confiance. \n- PAS de soufre sur soi.', 'ep': 0, 'g': 74, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10035] = {'n': 'Résultat de la Révélation', 'nn': 'RESULTAT DE LA REVELATION', 't': 24, 'd': 'Le Mage Ax a écrit sur ce parchemin le résultat du rituel de Révélation. Pour utiliser la Corne Edfrit, il suffit de plonger sa main dedans et il en sort des bâtonnets de patate frits.', 'ep': 0, 'g': 26, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10036] = {'n': 'Fée lanceuse de Griffe Joueuse', 'nn': 'FEE LANCEUSE DE GRIFFE JOUEUSE', 't': 74, 'd': 'Alors qu\'elle vivait dans la Tour Enfer Mâle, Mylaise avait commandé à un fameux artisan un grand nombre de fées d\'artifices pour animer ses soirées. Aujourd\'hui encore, elle en distribue parfois quand elle est de bon poil.', 'ep': 0, 'g': 30, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'ut': true, 'p': 1};
I.u[10042] = {'n': 'Fée lanceuse de Langue Rapeuse', 'nn': 'FEE LANCEUSE DE LANGUE RAPEUSE', 't': 74, 'd': 'Alors qu\'elle vivait dans la Tour Enfer Mâle, Mylaise avait commandé à un fameux artisan un grand nombre de fées d\'artifices pour animer ses soirées. Aujourd\'hui encore, elle en distribue parfois quand elle est de bon poil.', 'ep': 0, 'g': 32, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'ut': true, 'p': 1};
I.u[10043] = {'n': 'Le désir d\'être belle', 'nn': 'LE DESIR D\'ETRE BELLE', 't': 30, 'd': 'Une lotion de beauté très puissante vous a donné cette apparence... Vous voilà prête à faire fondre tous les matous ! Meow !', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': false, 'w': 0, 'm': true, 'p': 1};
I.u[10044] = {'n': 'Lotion de beauté de Mylaise', 'nn': 'LOTION DE BEAUTE DE MYLAISE', 't': 12, 'd': 'Mylaise s\'applique chaque jour cette lotion sur le corps pour rester jeune et belle... Essayez, vous verrez ! Cependant, le moindre effort en combat vous rendra votre allure décharnée et vos traits tirés... Ce n\'est pas la lotion qui fait la Prêtresse de l\'Amour.', 'ep': 0, 'g': 40, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[10052] = {'n': 'Potion d\'oubli : \'Laisse spirituelle\'', 'nn': 'POTION D\'OUBLI : \'LAISSE SPIRITUELLE\'', 't': 43, 'd': 'Cette potion permet d\'oublier un niveau du sort spécial \'Laisse spirituelle\'', 'ep': 0, 'g': 31, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1000};
I.u[10054] = {'n': 'Anneau du Vampyre', 'nn': 'ANNEAU DU VAMPYRE', 't': 9, 'd': 'Cet anneau a trempé pendant trois ans dans de la fiente de chauve-souris. Mais il est magique.', 'ep': 0, 'g': 171, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 'c': 'PO!10119', 's': 130, 'p': 4703};
I.u[10055] = {'n': 'Amulette du Vampyre', 'nn': 'AMULETTE DU VAMPYRE', 't': 1, 'd': 'Cette amulette est censée prévenir les Vampyres qui voudraient vous mordre dans le cou, qu\'il est tout simplement inutile d\'essayer de vous sucer le sang, puisque vous êtes vous-même un Vampyre.', 'ep': 0, 'g': 146, 'l': 45, 'wd': true, 'fm': true, 'w': 10, 'c': 'PO!10119', 's': 130, 'p': 5500};
I.u[10056] = {'n': 'Ceinture du Vampyre', 'nn': 'CEINTURE DU VAMPYRE', 't': 10, 'd': 'Sur le slogan publicitaire de cette ceinture vous pouvez lire ' + '"' + 'Et en plus elle brille la nuit !' + '"' + '. Oui mais en plus de quoi ?', 'ep': 0, 'g': 156, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 'c': 'PO!10119', 's': 130, 'p': 4805};
I.u[10057] = {'n': 'Rune de chasse', 'nn': 'RUNE DE CHASSE', 't': 78, 'd': 'Souvenez-vous de ce que disait le très connu Lézain : ' + '"' + 'Bon, le mauvais chasseur, il a un arc... Il voit un truc qui bouge y tire ! Et le bon chasseur, il a un arc aussi, y voit un truc, y tire mais bon... C\'est un bon chasseur...' + '"' + '. Vous pourrez vérifier cela avec n\'importe laquelle de vos armes grâce à cette rune.', 'ep': 0, 'g': 60, 'l': 10, 'wd': false, 'fm': true, 'w': 1, 'p': 10};
I.u[10058] = {'n': 'Cape du Vampyre', 'nn': 'CAPE DU VAMPYRE', 't': 17, 'd': 'Bram avait raison, il faut toujours se méfier des personnes aux dents longues, surtout lorsqu\'elles portent la cape du Vampyre.', 'ep': 0, 'g': 168, 'l': 41, 'wd': true, 'fm': true, 'w': 5, 'c': 'PO!10119', 's': 130, 'p': 4550};
I.u[10061] = {'n': 'Bottes du Vampyre', 'nn': 'BOTTES DU VAMPYRE', 't': 11, 'd': 'On raconte qu\'Elizabeth Bythora en personne a porté ces bottes. Ça vous fait une belle jambe.', 'ep': 0, 'g': 139, 'l': 41, 'wd': true, 'fm': true, 'w': 10, 'c': 'PO!10119', 's': 130, 'p': 4550};
I.u[10063] = {'n': 'Le désir d\'être belle', 'nn': 'LE DESIR D\'ETRE BELLE', 't': 31, 'd': 'Une lotion de beauté très puissante vous a donné cette apparence... Vous voilà prête à faire fondre tous les matous ! Meow !', 'ep': 0, 'g': 13, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10073] = {'n': 'Bouclier hispanique', 'nn': 'BOUCLIER HISPANIQUE', 't': 82, 'd': 'Le mythique Dal-Uk-Wet, unificateur des royaumes de HispaÑia, avait un bouclier magique. Son arrière petit-fils, Sir-Dal, en fit forger quelques reproductions pour récompenser les meilleurs guerriers de HispaÑia. Ce bouclier est l\'une de ces rares copies.', 'ep': 0, 'g': 40, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10074] = {'n': 'Lettre du chef des voleurs', 'nn': 'LETTRE DU CHEF DES VOLEURS', 't': 24, 'd': 'Retrouvée lors du combat contre les voleurs chez Milone : \nMilone Corichel le bijoutier vient de créer un joyau de grande valeur. Dérobez-le par tous les moyens possibles. \nHeureusement, Milone leur a remis un faux, et ce n\'est pas grâce à vous. \nPar contre, au dos du message se trouve l\'emplacement de leur repaire. Une revanche s\'impose, mais mieux vaut y aller accompagné.', 'ep': 0, 'g': 55, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10075] = {'n': 'Bouillie infâme', 'nn': 'BOUILLIE INFAME', 't': 24, 'd': 'Cette bouillie infâme est apparue comme par enchantement dans votre poche.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10076] = {'n': 'Bouclier hispanique unique', 'nn': 'BOUCLIER HISPANIQUE UNIQUE', 't': 82, 'd': 'Le mythique Dal-Uk-Wet, unificateur du royaume de HispaÑia, concentrait tout son pouvoir dans son bouclier, au grand dam de ses adversaires. Des années plus tard, Sir-Dal, son arrière petit-fils, en fit forger quelques reproductions pour récompenser les meilleurs guerriers de HispaÑia, mais celui-ci est l\'original, l\'unique, le plus puissant de tous !', 'ep': 0, 'g': 40, 'l': 10, 'wd': false, 'fm': true, 'w': 30, 'c': 'PP>9', 'p': 63200};
I.u[10077] = {'n': 'Terra Cogita', 'nn': 'TERRA COGITA', 't': 32, 'd': 'Vous devez escorter Terra Cogita à plusieurs endroits avant de le présenter à Jerhyn Gholein.', 'ep': 0, 'g': 22, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10078] = {'n': 'Eni Hoube', 'nn': 'ENI HOUBE', 't': 32, 'd': 'Vous devez escorter et protéger l\'eni Hoube. Depuis qu\'il vous accompagne, on dirait que le destin s\'acharne contre vous.', 'ep': 0, 'g': 13, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10079] = {'n': 'Pain Trépide', 'nn': 'PAIN TREPIDE', 't': 33, 'd': 'Très prisé par les Iops, ce pain rend courageux et téméraire à la fois, ce qui a déjà provoqué la mort prématurée de nombreux aventuriers. Xavier le Boulanger cessa d\'en préparer lorsqu\'une compagnie entière de troubadours chargea une meute de mulous enragés.', 'ep': 0, 'g': 13, 'l': 100, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[10080] = {'n': 'Message des renégats', 'nn': 'MESSAGE DES RENEGATS', 't': 24, 'd': 'Ce message donne rendez-vous aux renégats à proximité du Donjon des Scarafeuilles. Vous devriez vous y rendre pour en savoir plus.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10081] = {'n': 'Message du chef des renégats', 'nn': 'MESSAGE DU CHEF DES RENEGATS', 't': 24, 'd': 'Dans ce message, le chef des renégats leur demande de le rejoindre au sud du territoire des bandits. C\'est pour vous l\'occasion d\'éliminer ce traître.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10082] = {'n': 'Cocktail Moritov', 'nn': 'COCKTAIL MORITOV', 't': 24, 'd': 'Qu\'obtient-on en pressant un pétale morito ? De la sève alcoolisée à base de nombreux cocktails, dont les disciples d\'Otomaï se délectent lors des fêtes estivales. En effet, ce cocktail détonant saura mettre le feu à vos soirées, au propre comme au figuré.', 'ep': 0, 'g': 762, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10083] = {'n': 'Salace de poissons', 'nn': 'SALACE DE POISSONS', 't': 49, 'd': 'Comme le dit le dicton : une odeur peut en cacher une autre. En effet, le parfum dégagé par cette salace de poissons cache une forte odeur de pieds. A ne pas consommer en présence de Porkass en rut, sauf si vous êtes une cochonne.', 'ep': 0, 'g': 80, 'l': 1, 'wd': false, 'fm': true, 'w': 3, 'u': true, 'ut': true, 'p': 1};
I.u[10084] = {'n': 'Sifflet d\'appel', 'nn': 'SIFFLET D\'APPEL', 't': 24, 'd': 'Ce sifflet, conçu d\'après la méthode d\'élevage canin de Riyou Tchevlakouk, permet d\'appeler les crocs glands domptés. En revanche, il ne permet pas de se faire passer pour le maître d\'un croc gland qui ne vous appartient pas. Il marche aussi très bien avec les crocs glands sauvages.', 'ep': 0, 'g': 755, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10085] = {'n': 'Ordre d\'exécution', 'nn': 'ORDRE D\'EXECUTION', 't': 87, 'd': 'Les ordres sont clairs et nets, pas comme les caleçons du Minotot. Trouvez et abattez la cible désignée.', 'ep': 0, 'g': 2, 'l': 10, 'wd': false, 'fm': true, 'w': 1, 'c': 'Ps!0&PP>0', 'u': true, 'p': 0};
I.u[10086] = {'n': 'Canine de bandit des plaines', 'nn': 'CANINE DE BANDIT DES PLAINES', 't': 24, 'd': 'La violence du combat contre les bandits des plaines était telle que l\'un d\'entre eux a perdu une canine.', 'ep': 0, 'g': 13, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10087] = {'n': 'Rendez-vous de Xarthan', 'nn': 'RENDEZ-VOUS DE XARTHAN', 't': 24, 'd': 'Ce papier rédigé par un Brâkmarien donne rendez-vous à Xarthan dans la Tour de Bonta après sa prochaine réunion. Cela signifie que le rendez-vous est peut-être déjà en cours.', 'ep': 0, 'g': 50, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10088] = {'n': 'Mouchoir usé', 'nn': 'MOUCHOIR USE', 't': 24, 'd': 'Vous avez ramassé ce mouchoir lors de votre combat contre Xephirès. Ca vous fait un petit souvenir utile et agréable, surtout si vous avez le nez bouché ou êtes allergique aux poils de chacha.', 'ep': 0, 'g': 756, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10089] = {'n': 'Caisse de marchandises', 'nn': 'CAISSE DE MARCHANDISES', 't': 24, 'd': 'Xephirès vous a demandé de livrer cette caisse de marchandises au conseiller Boyowa, chez le Grandapan, en guise de bonne foi. Vous ignorez son contenu exact mais il s\'agit sûrement d\'objets de valeur.', 'ep': 0, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10090] = {'n': 'Liste de fournitures de Nara', 'nn': 'LISTE DE FOURNITURES DE NARA', 't': 24, 'd': 'Nara vous a fait une liste de ce dont il a besoin pour son nouvel atelier de forgeron : 20 Bois de Chêne, 1 Blague de Soufre, 30 Fers, 1 Kouartz, 5 Bakélélites et 10 Cuirs de Sanglier des Plaines.', 'ep': 0, 'g': 41, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10091] = {'n': 'Notes sur La malédiction d\'Erazal', 'nn': 'NOTES SUR LA MALEDICTION D\'ERAZAL', 't': 24, 'd': 'La malédiction d\'Erazal indique comment ressusciter une âme contre sa volonté. Il vous faut 1 Sang de Phénix, 5 Poudres de Perlinpainpain et 1 Amulette de Lear, obtenue sur les cadavres des abraknes et des abraknes sombres.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10092] = {'n': 'Ordre d\'annulation', 'nn': 'ORDRE D\'ANNULATION', 't': 24, 'd': 'Cette lettre, datée d\'il y a quelques heures seulement, indique que l\'assaut sur Bonta a été annulé en raison de l\'amélioration en équipement que leurs miliciens ont reçu, et de la capture du traître Xephirès.', 'ep': 0, 'g': 33, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10102] = {'n': 'Masque du Vampyre', 'nn': 'MASQUE DU VAMPYRE', 't': 16, 'd': 'Ce masque vous protégera des rayons du soleil à défaut d\'autre chose.', 'ep': 0, 'g': 244, 'l': 42, 'wd': true, 'fm': true, 'w': 10, 'c': 'PO!10119', 's': 130, 'p': 4725};
I.u[10103] = {'n': 'Lettre pour Fidji Merline', 'nn': 'LETTRE POUR FIDJI MERLINE', 't': 24, 'd': 'Ebru Of El vous a confié cette lettre à remettre à Fidji Merline. Apparemment, il faudra suivre les instructions de la bricoleuse de Brâkmar.', 'ep': 0, 'g': 65, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10104] = {'n': 'Mangeoire trafiquée', 'nn': 'MANGEOIRE TRAFIQUEE', 't': 24, 'd': 'Cette mangeoire a été trafiquée pour cacher des aubergines et mieux vaut ne pas traverser Brâkmar sur une monture s\'étant rassasiée dans cette mangeoire. En effet, les flatulences engendrées par la consommation excessive d\'aubergines pourraient provoquer un incident détonant.', 'ep': 0, 'g': 759, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10105] = {'n': 'Patte couverte de poils', 'nn': 'PATTE COUVERTE DE POILS', 't': 24, 'd': 'Cette patte d\'arakne couverte de poils d\'arakne et de chacha est une arme redoutable si l\'on doit faire face à Ledrob Terceséc.', 'ep': 0, 'g': 11, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10106] = {'n': 'Vampyrette', 'nn': 'VAMPYRETTE', 't': 18, 'd': 'Cette terrible créature prendra un malin plaisir à sucer le sang de vos amis, ou celui de vos chevilles si elles sont un peu trop grosses. Mais cela ne suffira pas à la divertir pour autant, elle aime par dessus tout que vous affrontiez avec elle des squelettes pour se repaître de leurs dépouilles. On vous avait bien dit qu\'elle était terrible.', 'ep': 0, 'g': 53, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[10107] = {'n': 'Chauffe-souris', 'nn': 'CHAUFFE-SOURIS', 't': 18, 'd': 'Ce familier a eu une enfance très difficile, il a hérité d\'un nom franchement stupide. C\'est peut-être ce qui explique pourquoi il est devenu un peu fou et n\'a plus qu\'une seule obsession dans la vie, tuer toutes les Ouassingues qu\'il rencontre pour se nourrir de leurs dépouilles.', 'ep': 0, 'g': 54, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[10108] = {'n': 'Fantôme de Vampyrette', 'nn': 'FANTOME DE VAMPYRETTE', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 53, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[10109] = {'n': 'Fantôme de Chauffe-souris', 'nn': 'FANTOME DE CHAUFFE-SOURIS', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 54, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[10118] = {'n': 'Croc Gland fraichement dompté', 'nn': 'CROC GLAND FRAICHEMENT DOMPTE', 't': 32, 'd': 'Ce Croc Gland a été dressé selon la méthode d\'élevage canin mise au point par le célèbre dresseur de chachas Riyou Tchevlakouk.', 'ep': 0, 'g': 23, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10119] = {'n': 'Goulyfié', 'nn': 'GOULYFIE', 't': 30, 'd': 'Vous vous sentez différent...', 'ep': 0, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'c': 'POX10055&POX10054&POX10056&POX10061&POX10058&POX10102', 'p': 0};
I.u[10121] = {'n': 'Petit caillou', 'nn': 'PETIT CAILLOU', 't': 51, 'd': 'Ce petit caillou sert à activer la magie des dalles pour atteindre l\'esprit de l\'eau. Son utilisation est des plus simples : il suffit de le poser sur une dalle et la magie opère d\'elle-même. Simple et efficace. Même un Iop peut y arriver, s\'il ne trouve aucun ennemi sur qui jeter le petit caillou avant.', 'ep': 0, 'g': 267, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10122] = {'n': 'Liste de Norb', 'nn': 'LISTE DE NORB', 't': 24, 'd': 'Norb vous a fait une liste des ressources à apporter à Nara. Il faut 2 Bakélélites, 10 Manganèses, 20 Bauxites, 15 Dolomites et 20 Bois d\'Oliviolet.', 'ep': 0, 'g': 41, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10125] = {'n': 'Arc du bandit archer', 'nn': 'ARC DU BANDIT ARCHER', 't': 2, 'd': 'Cet arc appartenait à un ancien bandit archer qui s\'en servait pour achever ses victimes à distance, afin de ne pas se salir. Il est imprégné d\'une magie si puissante que vous risquez de vous transformer en bandit archer si vous l\'équipez...', 'ep': 0, 'g': 67, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 10, 'tw': true, 'e': [2, 6, 3, 5, 40, 40, false, true], 'p': 3000};
I.u[10126] = {'n': 'Epée du bandit fine-lame', 'nn': 'EPEE DU BANDIT FINE-LAME', 't': 6, 'd': 'Cette épée appartenait à un ancien bandit fine-lame, qui ne supportait pas de devoir poursuivre ses adversaires. Il commençait par leur couper les deux jambes et posait ses questions ensuite. Elle est imprégnée d\'une magie si puissante que vous risquez de vous transformer en bandit fine-lame si vous l\'équipez...', 'ep': 0, 'g': 92, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 14, 'tw': true, 'e': [5, 5, 1, 1, 40, 40, false, false], 'p': 3000};
I.u[10127] = {'n': 'Bâton du bandit baroudeur', 'nn': 'BATON DU BANDIT BAROUDEUR', 't': 4, 'd': 'Ce bâton appartenait à un ancien bandit baroudeur, constamment ivre, il était incapable de faire les poches de ses victimes sans s\'écrouler. Ce bâton lui permettait de tenir debout le temps qu\'il termine son office. Il est imprégné d\'une magie si puissante que vous risquez de vous transformer en bandit baroudeur si vous l\'équipez.', 'ep': 0, 'g': 89, 'l': 30, 'wd': true, 'fm': false, 'w': 10, 'an': 12, 'e': [5, 6, 1, 1, 40, 40, false, false], 'p': 3000};
I.u[10131] = {'n': 'Cadeau Vampyrette', 'nn': 'CADEAU VAMPYRETTE', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révéleront la présence d\'une créature prête à vous sauter au cou. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier.', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[10132] = {'n': 'Cadeau Chauffe-souris', 'nn': 'CADEAU CHAUFFE-SOURIS', 't': 89, 'd': 'En posant votre oreille sur ce cadeau ou en le secouant vigoureusement, vous entendrez peut-être d\'étranges bruits qui vous révèleront la présence d\'une créature prête à vous sauter au cou. Ne perdez pas une seule seconde, ouvrez-le vite, vous y trouverez un superbe familier.', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
