I.u[10784] = {'n': 'Amulette du débutant', 'nn': 'AMULETTE DU DEBUTANT', 't': 1, 'd': 'Personne ne sait exactement ce que vous apporte cette amulette, mais tout le monde sait ce qu\'elle vous retire : votre crédibilité.', 'ep': 0, 'g': 7, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10785] = {'n': 'Anneau du débutant', 'nn': 'ANNEAU DU DEBUTANT', 't': 9, 'd': 'Cet anneau protégera vos doigts des crottes de nez de vos adversaires.', 'ep': 0, 'g': 7, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10786] = {'n': 'Peau parfaite de Koalak Immature', 'nn': 'PEAU PARFAITE DE KOALAK IMMATURE', 't': 24, 'd': 'Le petit Koalak Immature à qui vous avez arraché cette peau, n\'était pas d\'accord pour vous la donner, mais qu\'importe, vous étiez plus fort et plus cruel que lui.', 'ep': 20, 'g': 811, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 10};
I.u[10787] = {'n': 'Aile parfaite de Dragodinde Rousse Sauvage', 'nn': 'AILE PARFAITE DE DRAGODINDE ROUSSE SAUVAGE', 't': 24, 'd': 'Cette Aile sent le soufre. Tout bon éleveur de Dragodindes vous dira que c\'est la partie la plus tendre pour un barbeulcu. Assaisonnez tout de même la viande, car l\'Aile est la partie la plus fade.', 'ep': 2, 'g': 812, 'l': 29, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[10788] = {'n': 'Aile parfaite de Dragodinde', 'nn': 'AILE PARFAITE DE DRAGODINDE', 't': 24, 'd': 'On peut dire que la Dragodinde domestique est bien meilleure que sa cousine sauvage. Déjà, elle n\'a pas un arrière-goût de soufre, mais la chair est goûteuse à souhait, ce qui en fait le plat favori de tous les petits.', 'ep': 2, 'g': 813, 'l': 29, 'wd': true, 'fm': true, 'w': 0, 'p': 1};
I.u[10789] = {'n': 'Poils irritants de Koalak Forestier', 'nn': 'POILS IRRITANTS DE KOALAK FORESTIER', 't': 24, 'd': 'Ces poils sont recouverts de sève de Kaliptus, ce qui leur confère un aspect luisant et brillant. Malheureusement, ils sont inutilisables en haute couture à cause de leur odeur de Dragodinde morte.', 'ep': 20, 'g': 814, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 100};
I.u[10790] = {'n': 'Os magique de Mama Koalak', 'nn': 'OS MAGIQUE DE MAMA KOALAK', 't': 24, 'd': 'La Mama Koalak possède des os particulièrement résistants qui ne cèdent pas sous son poids. On ne peut pas en dire autant de Francisque Kabroule, le célèbre Ménestrel, qui perdit l\'usage de ses deux bras en se faisant écraser par les énormes cuisses de la Mama Koalak. La curiosité est un vilain défaut.', 'ep': 20, 'g': 815, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 10};
I.u[10791] = {'n': 'Poils de Barbe urticants du Warko Marron', 'nn': 'POILS DE BARBE URTICANTS DU WARKO MARRON', 't': 24, 'd': 'Ces poils sont urticants, assez pour transformer les bises du Warko Marron en armes de destruction massives.', 'ep': 20, 'g': 816, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 10};
I.u[10792] = {'n': 'Potion de soin du débutant', 'nn': 'POTION DE SOIN DU DEBUTANT', 't': 12, 'd': 'Cette fiole servait autrefois aux analyses d\'urine. Elle contient désormais une potion capable de restaurer les points de vie perdus.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[10793] = {'n': 'Pain du débutant', 'nn': 'PAIN DU DEBUTANT', 't': 33, 'd': 'Il est sec, il fait mal aux dents, il sent le slip de Bwork, mais il permet de regagner des points de vie. Arrêtez de faire la fine bouche.', 'ep': 0, 'g': 6, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[10794] = {'n': 'Bottes du débutant', 'nn': 'BOTTES DU DEBUTANT', 't': 11, 'd': 'Chaudes à l\'intérieur et froides à l\'extérieur, ces bottes vous permettront de botter les fesses des bonshommes de neige sans leur faire fondre le postérieur.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10795] = {'n': 'Poisson Deukloche du débutant', 'nn': 'POISSON DEUKLOCHE DU DEBUTANT', 't': 49, 'd': 'Si vous frappez violemment ce poisson, vous l\'entendrez résonner. Vous pouvez le manger et vous faire frapper pour vous transformer en instrument de musique.', 'ep': 0, 'g': 92, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[10796] = {'n': 'Mexicanos du débutant', 'nn': 'MEXICANOS DU DEBUTANT', 't': 69, 'd': 'Cette boulette de viande hachée épicée concentre tout ce qu\'il y a de plus indigeste dans la contrée d\'Amakna, mais c\'est trop bon et votre petit corps en redemande.', 'ep': 0, 'g': 113, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'ut': true, 'p': 1};
I.u[10797] = {'n': 'Epée Tulante du débutant', 'nn': 'EPEE TULANTE DU DEBUTANT', 't': 6, 'd': 'Sortie de son fourreau, cette épée peut couper le jambon, les Enutrofs, les unijambistes, les danseurs et les Enutrofs unijambistes enroulés dans une tranche de jambon qui dansent un soir de pleine lune. En revanche pour trancher les monstres, elle est plutôt inefficace.', 'ep': 0, 'g': 96, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'an': 14, 'e': [5, 4, 1, 1, 40, 50, false, false], 's': 150, 'p': 1};
I.u[10798] = {'n': 'Bouclier du débutant', 'nn': 'BOUCLIER DU DEBUTANT', 't': 82, 'd': 'Ce bouclier ne vous protégera pas de votre bêtise.', 'ep': 0, 'g': 55, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10799] = {'n': 'Ceinture du débutant', 'nn': 'CEINTURE DU DEBUTANT', 't': 10, 'd': 'Vous n\'arriviez pas à cacher votre épée ? Pas de problème, vous pourrez la coincer entre vos poignées d\'amour et cette ceinture.', 'ep': 0, 'g': 10, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10800] = {'n': 'Cape du débutant', 'nn': 'CAPE DU DEBUTANT', 't': 17, 'd': 'Cette cape permet de voler, il suffit de fermer les yeux, serrer les poings, ouvrir la bouche et sauter d\'une falaise en écartant les bras tout en criant ' + '"' + 'je vole' + '"' + '. Quelques instants plus tard, vous vous réveillerez avec deux jambes cassées.', 'ep': 0, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10801] = {'n': 'Chapeau du débutant', 'nn': 'CHAPEAU DU DEBUTANT', 't': 16, 'd': 'Ce chapeau cache admirablement votre calvitie. Malheureusement, il n\'en n\'existe pas d\'assez grand pour cacher votre fausse modestie.', 'ep': 0, 'g': 2, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 's': 150, 'p': 1};
I.u[10802] = {'n': 'Dragoune Dorée', 'nn': 'DRAGOUNE DOREE', 't': 18, 'd': 'Plus dorée que la Dragoune Noire, moins rose que la Dragoune Rose, et plus rare que la Dragoune Squelette, ce familier attirera tous les regards sur vous, même si vous êtes laid comme un Piou. Ce familier dévoreur d\'âmes ne mange que les Dopeuls présents dans les temples de classe.', 'ep': 0, 'g': 57, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'c': 'PZ=1', 's': 151, 'p': 1};
I.u[10804] = {'n': 'Cadeau Dragoune Dorée', 'nn': 'CADEAU DRAGOUNE DOREE', 't': 89, 'd': 'En secouant vigoureusement ce cadeau, vous comprenez qu\'il n\'est pas vide. Peut-être que pour une fois, les dieux ne se sont pas moqués de vous.', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[10805] = {'n': 'Transformation Fantôme Dragoune Dorée', 'nn': 'TRANSFORMATION FANTOME DRAGOUNE DOREE', 't': 27, 'd': 'Vous avez été transformé en fantôme afin de pouvoir pénétrer dans le sanctuaire des familiers.', 'ep': 0, 'g': 3, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[10806] = {'n': 'Certificat de mise en chanil : Dragoune Dorée', 'nn': 'CERTIFICAT DE MISE EN CHANIL : DRAGOUNE DOREE', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 'ep': 0, 'g': 69, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[10807] = {'n': 'Fantôme de Dragoune Dorée', 'nn': 'FANTOME DE DRAGOUNE DOREE', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 61, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[10808] = {'n': 'Hormone de Dragoune Dorée', 'nn': 'HORMONE DE DRAGOUNE DOREE', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 0, 'g': 240, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[10809] = {'n': 'Potion d\'Amélioration de Dragoune Dorée', 'nn': 'POTION D\'AMELIORATION DE DRAGOUNE DOREE', 't': 116, 'd': 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 0, 'g': 59, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=10802', 'u': true, 'p': 10};
I.u[10810] = {'n': 'Hormone de Chercheur d\'Ogrines', 'nn': 'HORMONE DE CHERCHEUR D\'OGRINES', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 0, 'g': 234, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 10};
I.u[10811] = {'n': 'Potion d\'Amélioration de Chercheur d\'Ogrines', 'nn': 'POTION D\'AMELIORATION DE CHERCHEUR D\'OGRINES', 't': 116, 'd': 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 0, 'g': 54, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=10657', 'u': true, 'p': 10};
I.u[10812] = {'n': 'Message anonyme', 'nn': 'MESSAGE ANONYME', 't': 24, 'd': '' + '"' + ' Si tu cherches du travail facile et bien rémunéré, rends-toi au nord de la cité, à l\'est de la statue du dieu Sram. Viens seul. ' + '"' + '', 'ep': 0, 'g': 50, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10813] = {'n': 'Liste de noms', 'nn': 'LISTE DE NOMS', 't': 24, 'd': 'Vous avez trouvé cette liste de noms dans la maison de Pandale Douce. Il semblerait qu\'il s\'agisse de Pandawas.', 'ep': 0, 'g': 74, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10814] = {'n': 'Caisse pour Pandetté', 'nn': 'CAISSE POUR PANDETTE', 't': 24, 'd': 'Vous devez livrer cette caisse à Pandetté, au village d\'Akwadala. Son contenu reste un mystère.', 'ep': 0, 'g': 44, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10815] = {'n': 'Liquide étrange', 'nn': 'LIQUIDE ETRANGE', 't': 24, 'd': 'Sel Dawa vous a demandé de quérir l\'aide du Mage Ax pour analyser ce liquide.', 'ep': 0, 'g': 32, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10816] = {'n': 'Pétale Fané de Rose Démoniaque', 'nn': 'PETALE FANE DE ROSE DEMONIAQUE', 't': 24, 'd': 'Ce pétale fripé a perdu de sa superbe et sa texture rappelle la peau des jeunes Enutrofs.', 'ep': 0, 'g': 817, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10817] = {'n': 'Anti-dépendant', 'nn': 'ANTI-DEPENDANT', 't': 24, 'd': 'Ce prototype d\'antidote devrait pouvoir soigner la dépendance au jus de ouassingue.', 'ep': 0, 'g': 500, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10818] = {'n': 'Hache de l\'initié', 'nn': 'HACHE DE L\'INITIE', 't': 19, 'd': 'Cette arme d\'apparence rudimentaire vous donnera l\'impression de savoir vous battre.', 'ep': 0, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'an': 17, 'e': [5, 4, 1, 1, 50, 50, false, false], 'p': 1};
I.u[10825] = {'n': 'Goulifié', 'nn': 'GOULIFIE', 't': 30, 'd': 'Était-ce vraiment nécessaire de se donner tout ce mal pour en arriver là ?', 'ep': 0, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 0};
I.u[10826] = {'n': 'Avis d\'expulsion', 'nn': 'AVIS D\'EXPULSION', 't': 24, 'd': 'Comme vous vous êtes mal comporté avec vote hôte, ce dernier a décidé de vous fermer l\'accès à sa crypte pour les prochaines 24 heures.', 'ep': 0, 'g': 33, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 0};
I.u[10827] = {'n': 'Potion de soin larvesque', 'nn': 'POTION DE SOIN LARVESQUE', 't': 12, 'd': 'Un liquide orangé avec des bulles, personne ne peut vouloir boire ça.', 'ep': 0, 'g': 192, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'Sc=7', 'u': true, 'ut': true, 'p': 0};
I.u[10828] = {'n': 'Casque de boufbowl', 'nn': 'CASQUE DE BOUFBOWL', 't': 16, 'd': 'Il est dit que le ridicule ne tue pas. C\'est exact, mais avec ce casque vous aurez vraiment l\'air ridicule.', 'ep': 0, 'g': 253, 'l': 29, 'wd': false, 'fm': true, 'w': 10, 'c': 'Sc=10', 'p': 2400};
I.u[10829] = {'n': 'Kamapêche', 'nn': 'KAMAPECHE', 't': 20, 'd': 'Grâce à ce bâton les négociations pécuniaires tourneront à votre avantage.', 'ep': 0, 'g': 91, 'l': 40, 'wd': false, 'fm': true, 'w': 10, 'an': 12, 'e': [7, 3, 1, 1, 40, 50, false, false], 'c': 'Sc=13', 'p': 4200};
I.u[10830] = {'n': 'Banana Cape', 'nn': 'BANANA CAPE', 't': 17, 'd': 'Ikko, un célèbre artiste d\'Amakna fut le premier à oser porter cette cape. Tout le monde lui répétait pourtant : ' + '"' + 'Quand c\'est trop, c\'est trop Ikko' + '"' + '.', 'ep': 0, 'g': 172, 'l': 28, 'wd': false, 'fm': true, 'w': 10, 'c': 'Sc=14', 'p': 2305};
I.u[10831] = {'n': 'Bananagrume', 'nn': 'BANANAGRUME', 't': 46, 'd': 'Flambée ou en tranche, nappée de chocolat fondu ou nature, ce fruit fait un succulent dessert.', 'ep': 0, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[10832] = {'n': 'Craqueloroche', 'nn': 'CRAQUELOROCHE', 't': 94, 'd': 'Cette pierre polie renferme un Craqueboule qui lui, ne l\'est pas. Elle ne semble être utilisable qu\'à proximité d\'autres Craqueleurs ou Craqueboules...', 'ep': 0, 'g': 18, 'l': 1, 'wd': false, 'fm': true, 'w': 20, 'c': 'Sc=15&(PB=2|PB=96|PB=480)&(Sc!1003|PB!2)&(Sc!1006|PB!96)', 'u': true, 'p': 0};
I.u[10833] = {'n': 'Chapain', 'nn': 'CHAPAIN', 't': 33, 'd': 'Ce pain est étonnant, quand on mord dedans, il miaule !', 'ep': 0, 'g': 4, 'l': 1, 'wd': false, 'fm': true, 'w': 2, 'c': 'Sc=16', 'u': true, 'ut': true, 'p': 0};
I.u[10834] = {'n': 'Coiffe Wouaf', 'nn': 'COIFFE WOUAF', 't': 16, 'd': 'Il faut peu de choses pour que vous ressembliez à un Ouginak. Attention aux puces.', 'ep': 0, 'g': 256, 'l': 11, 'wd': false, 'fm': true, 'w': 10, 'c': 'Sc=17', 'p': 530};
I.u[10835] = {'n': 'Cachet du bizut', 'nn': 'CACHET DU BIZUT', 't': 50, 'd': 'Piétiné, mâchouillé, écrasé, lavé, repassé, séché, on vous a tout fait. Mais vous n\'êtes plus un bleu; vous êtes recouvert de bleus.', 'ep': 0, 'g': 707, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 0};
I.u[10836] = {'n': 'Boufbamu', 'nn': 'BOUFBAMU', 't': 1, 'd': 'Vous portez fièrement cette amulette, symbole de votre participation à cette grande manifestation sportive. Il faut ça pour rester fier après être passé sous la mêlée du B.C Trool.', 'ep': 0, 'g': 158, 'l': 64, 'wd': false, 'fm': true, 'w': 1, 'c': 'Sc=18', 'p': 11765};
I.u[10838] = {'n': 'Orangé', 'nn': 'ORANGE', 't': 30, 'd': 'Vous avez encore bu quelque chose sans savoir ce que c\'était.', 'ep': 0, 'g': 1, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'c': 'Pn!24&Pn!25', 'p': 0};
I.u[10839] = {'n': 'Monstre Pain', 'nn': 'MONSTRE PAIN', 't': 33, 'd': 'On peut parfois se briser les dents sur du pain trop dur. Mangez celui-ci et vous recevrez un pain à vous faire tomber toutes les dents.', 'ep': 0, 'g': 12, 'l': 1, 'wd': false, 'fm': true, 'w': 100, 'c': 'Sc=8&PB!463&PB!459&PB!470&PB!460&PB!474&PB!538&PB!496&PB!497', 'u': true, 'p': 0};
I.u[10840] = {'n': 'Monstre Pain consommable', 'nn': 'MONSTRE PAIN CONSOMMABLE', 't': 33, 'd': 'Celui-ci est plus tendre, bon appétit.', 'ep': 0, 'g': 12, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'Sc=8', 'u': true, 'ut': true, 'p': 0};
I.u[10841] = {'n': 'Marron', 'nn': 'MARRON', 't': 30, 'd': 'Personne ne vous a prévenu des effets secondaires ?', 'ep': 0, 'g': 1, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'm': true, 'c': 'Pn!24&Pn!25', 'p': 0};
I.u[10842] = {'n': 'Transformation en chacha', 'nn': 'TRANSFORMATION EN CHACHA', 't': 31, 'd': 'Voilà, il fallait bien que ça arrive ! Si vous recrachez des boules de poils, ne venez pas vous plaindre.', 'ep': 0, 'g': 21, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'c': 'Sc=16', 'p': 0};
I.u[10843] = {'n': 'Note sur Krtek', 'nn': 'NOTE SUR KRTEK', 't': 24, 'd': 'Vous avez noté à quelle heure Krtek s\'est pris une raclée. Ainsi, vous pouvez savoir quand retourner lui en mettre une nouvelle.', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'p': 1};
I.u[10844] = {'n': 'Mmmmm', 'nn': 'MMMMM', 't': 31, 'd': 'Mmmmm mm mmmmmm mmmmm, mmm mmm mm mmmmmm mmmmm mmmmmmm mmmmmm mmm mmmm\'m mmmmm mmmm mmmmmmm.', 'ep': 0, 'g': 19, 'l': 1, 'wd': true, 'fm': false, 'w': 0, 'm': true, 'p': 1};
I.u[10846] = {'n': 'Phéro-Cape', 'nn': 'PHERO-CAPE', 't': 17, 'd': 'Pris d\'une étrange frénésie, les tofus que vous croisez veulent se frotter contre votre jambe. Ce n\'est tout de même pas cette cape qui les attire ?', 'ep': 0, 'g': 173, 'l': 61, 'wd': false, 'fm': true, 'w': 10, 'c': 'Sc=19', 'p': 9700};
I.u[10847] = {'n': 'Bottes d\'Hulkrap', 'nn': 'BOTTES D\'HULKRAP', 't': 11, 'd': 'Hulkrap enfilait ces bottes une fois par an, mais il les enlevait tous les jours. On peut donc en déduire que ces bottes sont magiques.', 'ep': 0, 'g': 151, 'l': 53, 'wd': true, 'fm': true, 'w': 10, 's': 152, 'p': 7400};
I.u[10848] = {'n': 'Bottes de Klüme', 'nn': 'BOTTES DE KLUME', 't': 11, 'd': 'Ces bottes coquées peuvent servir d\'enclumes. Son ancien propriétaire vous conseille vivement de ne pas danser avec.', 'ep': 0, 'g': 152, 'l': 52, 'wd': false, 'fm': true, 'w': 10, 's': 153, 'p': 7175};
I.u[10849] = {'n': 'Ceinture d\'Hulkrap', 'nn': 'CEINTURE D\'HULKRAP', 't': 10, 'd': 'Cette ceinture est fabriquée autour d\'une armature métallique aimantée qui attire les bourses des imprudents qui oseraient se frotter à vous.', 'ep': 0, 'g': 169, 'l': 51, 'wd': true, 'fm': true, 'w': 10, 's': 152, 'p': 6825};
I.u[10850] = {'n': 'Ceinture de Klüme', 'nn': 'CEINTURE DE KLUME', 't': 10, 'd': 'Klüme avait trois faiblesses, les araknes, les chatouilles et les araknes chatouilleuses.', 'ep': 0, 'g': 167, 'l': 52, 'wd': false, 'fm': true, 'w': 10, 's': 153, 'p': 7100};
I.u[10851] = {'n': 'Ceinture de Kloug', 'nn': 'CEINTURE DE KLOUG', 't': 10, 'd': 'Cette ceinture est encore recouverte de farine. Peut-être parce qu\'elle servait de tablier à Kloug le Boulanger Sombre. A moins que ce ne soit la farine qu\'il utilisait pour se poudrer le postérieur.', 'ep': 0, 'g': 168, 'l': 51, 'wd': false, 'fm': true, 'w': 10, 's': 154, 'p': 6928};
I.u[10852] = {'n': 'Amulette d\'Hulkrap', 'nn': 'AMULETTE D\'HULKRAP', 't': 1, 'd': 'Hulkrap a jadis volé cette amulette à Gonztipay, un gobelin dénué de toute forme d\'humour, même le plus lourd.', 'ep': 0, 'g': 156, 'l': 53, 'wd': true, 'fm': true, 'w': 10, 's': 152, 'p': 7405};
I.u[10853] = {'n': 'Amulette de Kloug', 'nn': 'AMULETTE DE KLOUG', 't': 1, 'd': 'Cette amulette vous permet de pétrir la peau de votre cou sans utiliser vos mains.', 'ep': 0, 'g': 155, 'l': 53, 'wd': false, 'fm': true, 'w': 10, 's': 154, 'p': 7400};
I.u[10854] = {'n': 'Anneau de Klüme', 'nn': 'ANNEAU DE KLUME', 't': 9, 'd': 'Gontran Klüme le forgeron a échangé cet anneau contre une épée qui appartenait à la Dame Antium.', 'ep': 0, 'g': 183, 'l': 54, 'wd': false, 'fm': true, 'w': 10, 's': 153, 'p': 7650};
I.u[10855] = {'n': 'Anneau de Kloug', 'nn': 'ANNEAU DE KLOUG', 't': 9, 'd': 'Cet anneau a été trempé dans une multitude de levures différentes. On raconte qu\'il est capable de transformer en moisissure ceux qui le portent. Certains aventuriers ne perçoivent aucune différence après l\'avoir porté.', 'ep': 0, 'g': 184, 'l': 51, 'wd': false, 'fm': true, 'w': 10, 's': 154, 'p': 6975};
I.u[10856] = {'n': 'Hache d\'Hulkrap', 'nn': 'HACHE D\'HULKRAP', 't': 19, 'd': 'Hulkrap était un très mauvais bandit rongé par les remords, il se sentait obligé de rendre ce qu\'il avait volé. Cette arme magique est encore imprégnée de l\'âme du Bandit Hulkrap. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 'ep': 0, 'g': 58, 'l': 47, 'wd': true, 'fm': false, 'w': 10, 'an': 17, 'e': [5, 4, 1, 1, 40, 50, false, false], 's': 152, 'p': 5900};
I.u[10857] = {'n': 'Marteau de Klüme', 'nn': 'MARTEAU DE KLUME', 't': 7, 'd': 'Ce marteau a permis de forger une braguette en Kriptonite pour le Captain Chafer. Cette arme magique est encore imprégnée de l\'âme du Forgeron Sombre Klüme. En l\'équipant, vous pourrez peut-être parvenir à l\'incarner.', 'ep': 0, 'g': 724, 'l': 51, 'wd': false, 'fm': false, 'w': 10, 'an': 15, 'e': [5, 4, 1, 1, 40, 50, false, false], 's': 153, 'p': 7000};
I.u[10858] = {'n': 'Baguette de Kloug', 'nn': 'BAGUETTE DE KLOUG', 't': 3, 'd': 'Kloug aimait se montrer généreux en distribuant des pains à ceux qui osaient lui parler. Il utilisait cette baguette pour rendre son jugement et punir les innocents. Cette arme est encore imprégnée de la magie de Kloug le Boulanger Sombre. Vous pourrez peut-être réussir à l\'incarner en utilisant cette arme.', 'ep': 0, 'g': 73, 'l': 53, 'wd': false, 'fm': false, 'w': 10, 'an': 11, 'e': [5, 4, 3, 5, 50, 50, false, false], 's': 154, 'p': 5000};
I.u[10860] = {'n': 'Potion de changement de nom', 'nn': 'POTION DE CHANGEMENT DE NOM', 't': 12, 'd': 'Cette potion permet de changer de nom. Plus personne ne se souviendra que vous vous appeliez Xx-Roxxor-naruto-killer-féca-xX. Une nouvelle vie sans moquerie s\'offre à vous. Vous allez enfin devenir quelqu\'un.', 'ep': 0, 'g': 718, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'u': true, 'p': 0};
I.u[10861] = {'n': 'Potion de changement des couleurs', 'nn': 'POTION DE CHANGEMENT DES COULEURS', 't': 12, 'd': 'Du rose pour les cheveux, du mauve pour les chaussettes, et du fuchsia pour la peau. La nature ne vous a peut-être pas gâté, mais vous avez enfin l\'opportunité d\'y remédier. L\'occasion rêvée pour voir la vie en caca d\'oie.', 'ep': 0, 'g': 717, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'u': true, 'p': 0};
I.u[10862] = {'n': 'Potion de changement de sexe', 'nn': 'POTION DE CHANGEMENT DE SEXE', 't': 12, 'd': 'Cette potion à boire directement au goulot vous permettra de devenir lui si vous étiez elle ou de devenir elle si vous étiez lui. A consommer sans modération.', 'ep': 0, 'g': 719, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'u': true, 'p': 0};
I.u[10863] = {'n': 'Raknaille', 'nn': 'RAKNAILLE', 't': 18, 'd': 'Cette Arakne est vraiment très mal élevée, elle saute partout, elle crie, elle mord n\'importe qui, mais vous l\'aimez beaucoup sans savoir pourquoi. La nature l\'a en outre dotée d\'un appétit féroce, ce familier dévoreur d\'âme adore attaquer puis dévorer les Moskitos et les Larves.', 'ep': 0, 'g': 58, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[10864] = {'n': 'Meuch', 'nn': 'MEUCH', 't': 18, 'd': 'Ce Champ Champ pas comme les autres a été élevé par une meute de Mulous. Ça n\'explique pas pourquoi il a du poil sous les aisselles. Ce familier dévoreur d\'âmes adore les fruits de mer et ne mange que les créatures des plages.', 'ep': 0, 'g': 59, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[10865] = {'n': 'Tofoudre', 'nn': 'TOFOUDRE', 't': 18, 'd': 'Ce Tofu a reçu la foudre 11 fois durant sa croissance. Vous recevrez des décharges électriques si vous le caressez et il vous foudroiera si vous ne le caressez pas. Pour une fois vous avez le choix. Ce dévoreur d\'âme adore les rats et s\'en nourrit dès que l\'occasion se présente à lui.', 'ep': 0, 'g': 60, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[10866] = {'n': 'Pykur', 'nn': 'PYKUR', 't': 18, 'd': 'Ce familier aime les cœurs d\'artichauts au sang de Rasboul, les endives aux poils de Bitouf, et les chansons de Francisque Kabroule. Il semble également apprécier votre compagnie. Ce dévoreur d\'âme ne mange que les créatures de la Jungle Obscure.', 'ep': 0, 'g': 61, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[10867] = {'n': 'Fantôme de Raknaille', 'nn': 'FANTOME DE RAKNAILLE', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 57, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
