I.u[11100] = {'n': 'Pack Surprise Bwork', 'nn': 'PACK SURPRISE BWORK', 't': 89, 'd': 'L\'ouverture de ce pack requiert de la part de son possesseur, une grande sérénité, qui influencera directement sur la qualité de son contenu.', 'ep': 1, 'g': 48, 'l': 1, 'wd': false, 'fm': true, 'w': 4, 'u': true, 'p': 100};
I.u[11465] = {'n': 'Kometh', 'nn': 'KOMETH', 't': 18, 'd': 'Amoureux inconditionnel de l\'humour douteux des glutins, Kometh a été subjugué par le vôtre. Il a donc décidé de quitter les forêts enneigées de l\'île de Nowel pour vivre la plus formidable des aventures à vos côtés. Son secret pour accélérer la repousse de ses deux magnifiques appendices, une fois la période de mue passée ? Faire feu de tout bois... Jusqu\'à se nourrir de ce dernier ! Avec lui : rien ne se perd, tout se transforme !', 'ep': 0, 'g': 62, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
