I.u[11471] = {'n': 'Tioube', 'nn': 'TIOUBE', 't': 17, 'd': 'Très spéciale, cette cape comptabilise le nombre de personnes qui se sont intéressées à elle. Elle est parfois utilisée dans le but d\'exposer ses trophées de guerre, en les y attachant, et ainsi jauger l\'intérêt qu\'ils peuvent susciter. Certains aventuriers et commerçants vont même parfois jusqu\'à former une chaîne de Tioubes lorsqu\'ils veulent promouvoir plusieurs objets à la fois.', 'ep': 0, 'g': 174, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11472] = {'n': 'Bouclier Hitche', 'nn': 'BOUCLIER HITCHE', 't': 82, 'd': 'En portant ce bouclier, vous serez visible de loin. Ceci permettra à n\'importe qui de suivre vos aventures les plus palpitantes, où que vous soyez, y compris et surtout à la taverne d\'Astrub.', 'ep': 0, 'g': 91, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11473] = {'n': 'Caskwitteur', 'nn': 'CASKWITTEUR', 't': 16, 'd': 'Ce casque peut parler : il répète vos paroles et les transmet aux autres Caskwitteurs à proximité qui les répéteront à leur tour. Il fut très utile en complément des Pious voyageurs jusqu\'à ce qu\'il se popularise davantage : les messages transmis ont tendance à revenir au Caskwitteur d\'origine, générant une boucle et donc un brouhaha incessant. Aujourd\'hui il est utilisé dans le jeu du Ragekwitt visant à tester la patience des participants : chacun en pose un sur sa tête et celui qui supporte le bruit le plus longtemps est vainqueur.', 'ep': 0, 'g': 259, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11474] = {'n': 'Clef du Belvédère d\'Ilyzaelle', 'nn': 'CLEF DU BELVEDERE D\'ILYZAELLE', 't': 84, 'd': 'Cette clef permet de rentrer dans le belvédère d\'Ilyzaelle. Attention, elle sera détruite après utilisation.', 'ep': 35, 'g': 255, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[11475] = {'n': 'Clef du Sanctuaire de Qu\'Tan', 'nn': 'CLEF DU SANCTUAIRE DE QU\'TAN', 't': 84, 'd': 'Cette clef permet d\'ouvrir la grille permetant d\'entrer dans le sanctuaire de Qu\'Tan. Attention, elle sera détruite après utilisation.', 'ep': 35, 'g': 256, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1};
I.u[11476] = {'n': 'Bandeau Komintot Polykrome', 'nn': 'BANDEAU KOMINTOT POLYKROME', 't': 16, 'd': 'Cette coiffe aux allures familières a été enchantée par Hel Munster lui-même suite aux demandes incessantes d\'un célèbre couturier d\'Astrub. Il désirait proposer une collection qui s\'adapte aux couleurs de l\'individu qui la porte. Décolorée par un procédé top secret, vous reconnaissez pourtant l\'odeur caractéristique de la bave de Mulou qui s\'en dégage... Beurk !', 'ep': 34, 'g': 260, 'l': 1, 'wd': true, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
