I.u[11746] = {'n': 'Les Six Atouts de Napo', 'nn': 'LES SIX ATOUTS DE NAPO', 't': 5, 'd': '---', 'ep': 36, 'g': 77, 'l': 99, 'wd': true, 'fm': true, 'w': 5, 'an': 13, 'e': [1000, 3, 1, 1, 25, 50, false, false], 'p': 150};
I.u[11747] = {'n': 'Coiffe de l\'Amour', 'nn': 'COIFFE DE L\'AMOUR', 't': 16, 'd': 'Cette coiffe symbolise l\'amour. L\'amour de la guerre. L\'amour des cris de douleur de vos victimes. L\'amour d\'humilier les plus faibles que soi. En résumé : l\'amour inconditionnel qui lie tout Iop, qu\'il le soit de cœur ou de sang, à la bagarre avec un grand « B » comme dans « baston ». Tout cela est terriblement romantique, n\'est-ce pas... ?', 'ep': 0, 'g': 286, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[11748] = {'n': 'Cape de la Gloire', 'nn': 'CAPE DE LA GLOIRE', 't': 17, 'd': 'Porter une cape donne toujours un petit côté classe, presque héroïque, vous ne trouvez pas ? Bon, hormis lorsque vous vous prenez les pieds dedans ou qu\'elle recouvre votre visage après une rafale de vent. Rhooo, mais faites un effort, aussi !', 'ep': 0, 'g': 178, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[11749] = {'n': 'Bouclier de la Baston', 'nn': 'BOUCLIER DE LA BASTON', 't': 82, 'd': 'Les Iops qui savent se servir de leur tête autrement que pour donner des coups remarqueront la subtilité de ce bouclier : il permet à son propriétaire de se protéger, mais aussi de couper d\'impeccables tranches de saucisson de porkass grâce à ses lames finement aiguisées. Malin...  Accessoirement, il fait aussi de vilains bobos à l\'ennemi.', 'ep': 0, 'g': 101, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[11750] = {'n': 'Écu-qui-pique', 'nn': 'ECU-QUI-PIQUE', 't': 82, 'd': 'Quand vous avez un coup de sang, ça part tout de suite en effusion. En plus d\'épancher votre soif de vaincre, ce bouclier répandra le sang de vos adversaires, tout en vous protégeant des éclaboussures. Pratique, non ? En plus, le rouge lui va à merveille.', 'ep': 0, 'g': 102, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11751] = {'n': 'Bouclier Sbrouffe', 'nn': 'BOUCLIER SBROUFFE', 't': 82, 'd': 'Roi de l\'esbrouffe, reine de la duperie : ce bouclier colorable se destine à ceux dans les yeux desquels il est impossible de lire. Vous êtes particulièrement doué(e) pour brouiller les cartes ? Vous êtes capable d\'esquiver une attaque tout en semant le trouble dans l\'esprit de votre adversaire ? Décidément, quel(le) as vous faites...', 'ep': 0, 'g': 103, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11752] = {'n': 'Fourblard', 'nn': 'FOURBLARD', 't': 16, 'd': 'Un foulard pour celles et ceux qui ont l\'art et la manière de tout contester, puis se cachent pour mieux accuser leur voisin. Malin...', 'ep': 0, 'g': 293, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[11753] = {'n': 'Capandor', 'nn': 'CAPANDOR', 't': 17, 'd': 'Inspirée du Maître Pandore en personne, cette cape est tellement vicieuse qu\'elle est capable de mettre des coups de couteau dans le dos de son propre propriétaire. Admirez la fourberie de la chose...', 'ep': 0, 'g': 184, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11754] = {'n': 'Bouclier Temps-Mort', 'nn': 'BOUCLIER TEMPS-MORT', 't': 82, 'd': 'Un bouclier pour s\'offrir et accorder à l\'adversaire un court instant de répit avant de retourner défendre sa chair et ses idéaux.', 'ep': 0, 'g': 105, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11755] = {'n': 'Chenapandi', 'nn': 'CHENAPANDI', 't': 18, 'd': 'Ce familier vous défendra mieux que personne. Il vous défendra même mieux que vous-même ne sauriez le faire. Il va sans dire qu\'il se défendra mieux que vous ne pourriez le défendre. Il paraît même qu\'il sait mieux défendre vos idées et convictions que vous ne le feriez. Bref, vous l\'aurez compris : n\'importe qui semble bien minable face à ce petit panda armé (vous y compris, mais peu importe, du moment qu\'il vous sauve la peau). Ce familier dévoreur d\'âmes ne mange que des Pandits.', 'ep': 36, 'g': 72, 'l': 60, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[11756] = {'n': 'Bouclier Ternel', 'nn': 'BOUCLIER TERNEL', 't': 82, 'd': 'Les rouages du temps ont cela d\'impénétrable qu\'un repas de famille de deux heures peut vous paraître interminable tandis qu\'une partie de Chinq de 20 minutes beaucoup trop courte. Avec ce bouclier muni d\'une aiguille tranchante, là au moins, le ressenti sera toujours le même : ça va piquer et vos ennemis reposeront en Externam pour l\'éternité...', 'ep': 0, 'g': 106, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11757] = {'n': 'Bouclier Jyde', 'nn': 'BOUCLIER JYDE', 't': 82, 'd': 'Les protecteurs dans l\'âme, ceux prêts à tous les sacrifices et à encaisser les coups pour la vie d\'autrui, le savent bien : certaines attaques, plus virulentes, méritent une réponse d\'une autre ampleur. Le Bouclier Jyde est un rempart quasi impossible à franchir, capable de couvrir vos arrières... mais aussi vos devants et vos côtés, ce qui est plutôt appréciable !', 'ep': 0, 'g': 107, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11758] = {'n': 'Coiffe du Grand Pa Wabbit', 'nn': 'COIFFE DU GRAND PA WABBIT', 't': 16, 'd': 'Le clou de cette panoplie, c\'est cette coiffe qui vous donne cet air cool, serein, pépère, dont personne ne se méfie... Et là, bim !!! Vous attaquez ! (Vous commencez à comprendre...)', 'ep': 0, 'g': 292, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[11759] = {'n': 'Cape du Grand Pa Wabbit', 'nn': 'CAPE DU GRAND PA WABBIT', 't': 17, 'd': 'Encore plus ancienne que Grand Pa Wabbit lui-même, qui la tiendrait de son arrière-grand-tante, cette cape est sans égal pour résister aux affres du temps.', 'ep': 0, 'g': 183, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11760] = {'n': 'Bouclier du Grand Pa Wabbit', 'nn': 'BOUCLIER DU GRAND PA WABBIT', 't': 82, 'd': 'Ne vous méprenez pas : avoir un trou au beau milieu de son bouclier, c\'est stratégique ! Ça permet de voir arriver vos adversaires avant de vous enfuir.', 'ep': 0, 'g': 108, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
