I.u[11772] = {'n': 'Casque à pointes Zoth', 'nn': 'CASQUE A POINTES ZOTH', 't': 16, 'd': 'Sous cet imposant couvre-chef, certains penseront peut-être que vous essayez de dissimuler une gueule de bois. Vrai ou pas, au moins, on vous laissera tranquille.', 'ep': 0, 'g': 295, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[11773] = {'n': 'Cape Zoth', 'nn': 'CAPE ZOTH', 't': 17, 'd': 'La légende autour de cette cape voudrait que ceux qui cassent du bois dans votre dos finissent par s\'en mordre les doigts. Ça peut se vérifier...', 'ep': 0, 'g': 185, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[11774] = {'n': 'Bouclier Zoth', 'nn': 'BOUCLIER ZOTH', 't': 82, 'd': 'Malgré les insultes et les brimades les plus virulentes, ce bouclier vous aidera à rester de bois en toute circonstance.', 'ep': 0, 'g': 110, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[11775] = {'n': 'Minipoth', 'nn': 'MINIPOTH', 't': 18, 'd': 'Petit guerrier stoïque, Minipoth est monoexpressif. Vous le câlinez, ça le laisse de bois. Vous le disputez parce qu\'il n\'a pas débarrassé la table, il reste de bois. Vous menacez de l\'abandonner, il part couper du bois... Cela peut être déstabilisant. \nPourtant, vous devez savoir que tous ces signaux... enfin, « ce » signal est la seule chose qu\'il puisse faire pour vous faire comprendre qu\'il vous aime plus que tout au monde.', 'ep': 36, 'g': 74, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
