I.u[12746] = {'n': 'Coeur de Cible', 'nn': 'COEUR DE CIBLE', 't': 82, 'd': 'Lorsqu\'ils vous ont dans le viseur, certains adversaires ne vous lâchent plus. Le meilleur moyen de s\'en défaire, c\'est de les laisser vous attaquer sans broncher. Ou du moins de leur faire croire que c\'est le cas... Ce bouclier vous permet de leur donner l\'illusion d\'avoir atteint leur cible, alors même qu\'ils ne vous ont pas touché(e) d\'un millikamètre. Après quoi, il ne vous restera plus qu\'à leur assener le coup fatal. Prodigieux, n\'est-ce pas ?', 'ep': 0, 'g': 113, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12747] = {'n': 'Tibilax Saphir', 'nn': 'TIBILAX SAPHIR', 't': 18, 'd': 'Ne vous fiez pas à cette bouille si mignonne, les Shushus sont généralement des êtres sanguinaires, effrayants et cruels. Il serait donc préférable pour vous de ne pas utiliser ce familier comme objet de réconfort lors de vos longues nuits d\'hiver. On ne sait pas de quelle partie du corps il pourrait vouloir vous amputer.', 'ep': 0, 'g': 75, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[12748] = {'n': 'Hormone de Tibilax Saphir', 'nn': 'HORMONE DE TIBILAX SAPHIR', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 0, 'g': 274, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[12749] = {'n': 'Fantôme de Tibilax Saphir', 'nn': 'FANTOME DE TIBILAX SAPHIR', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 77, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[12750] = {'n': 'Certificat de mise en chanil : Tibilax Saphir', 'nn': 'CERTIFICAT DE MISE EN CHANIL : TIBILAX SAPHIR', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 'ep': 0, 'g': 87, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
I.u[12751] = {'n': 'Potion d\'Amélioration de Tibilax Saphir', 'nn': 'POTION D\'AMELIORATION DE TIBILAX SAPHIR', 't': 116, 'd': 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 0, 'g': 74, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=12747', 'u': true, 'p': 10};
I.u[12753] = {'n': 'Armet du Paladin', 'nn': 'ARMET DU PALADIN', 't': 16, 'd': 'Robustesse et noblesse résultent de cet alliage chromé conçu dans la forge d\'une petite bourgade dont le nom est gardé secret. Vu le résultat, espérons que l\'artisan qui a réalisé cette merveille de casque est quant à lui grassement payé.', 'ep': 0, 'g': 297, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12754] = {'n': 'Pelisse du Paladin', 'nn': 'PELISSE DU PALADIN', 't': 17, 'd': 'Même loin et de dos, on reconnaît le noble et vaillant paladin. Sauf s\'il a oublié sa cape. Là, c\'est plus difficile.', 'ep': 0, 'g': 187, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12755] = {'n': 'Pavois du Paladin', 'nn': 'PAVOIS DU PALADIN', 't': 82, 'd': 'Finement forgé dans un métal des plus épais, ce bouclier impénétrable reste pourtant d\'une extrême légèreté. Ne l\'ébruitez pas et laissez les autres penser que vous êtes un expert du développé couché.', 'ep': 0, 'g': 114, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12756] = {'n': 'Plan K', 'nn': 'PLAN K', 't': 82, 'd': 'Pour être sûr de se souvenir de l\'emplacement exact de la planque de son dernier butin, Enutrof a pensé à tout ! Il l\'a marqué d\'une croix sur une carte. Malin. Puis, il a punaisé son plan quelque part. Futé. Le souci, c\'est qu\'il ne sait plus trop où. Dommage... En attendant qu\'il le retrouve sur votre bouclier, pouvez-vous veiller à ce que le plan kamas d\'Enutrof ne soit pas abîmé ? Il suffit qu\'il ne reçoive aucun coup ou projectile.', 'ep': 0, 'g': 115, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12757] = {'n': 'Bouclier Gri-gri', 'nn': 'BOUCLIER GRI-GRI', 't': 82, 'd': 'Au combat, tous les moyens sont bons pour remporter la victoire. Pour se porter chance, certains ont une patte de wabbit dans la poche. D\'autres ne bataillent jamais sans leur odorante cotte de mailles fétiche. Mais les vrais savent que pour conjurer le mauvais sort, rien ne surpasse un talisman conçu rituellement par un sorcier sadida. Comme ce bouclier Gri-gri par exemple.', 'ep': 0, 'g': 116, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12758] = {'n': 'Protection Chaulair', 'nn': 'PROTECTION CHAULAIR', 't': 82, 'd': 'Quand le fond de l\'air est chaud, votre peau est exposée aux rayons ultra-vénère (UV) du soleil. C\'est pas bien ! Parce que le lendemain, vous tirez soigneusement sur votre peau desséchée en essayant de faire le plus gros morceau... et c\'est dégoûtant. Pour vous, et surtout pour nous, protégez-vous : utilisez votre bouclier, utilisez votre Protection Chaulair.', 'ep': 0, 'g': 117, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12759] = {'n': 'Lorgnettes de Chauleil', 'nn': 'LORGNETTES DE CHAULEIL', 't': 16, 'd': 'Chaque année, des estivants perdent la vue à cause du soleil. Stop maintenant ! Munissez-vous de cette paire de lorgnettes. Sa haute technologie et ses verres atypiques ne permettent pas de voir de plus loin ou de plus près, ni de corriger votre vue défaillante. Non ! Ils transforment le jour en nuit, corrigent la luminosité trop forte de l\'astre céleste et préservent vos globes oculaires d\'une chaleur qui pourrait les faire fondre en cas de surexposition.', 'ep': 0, 'g': 298, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12760] = {'n': 'Capuchaud', 'nn': 'CAPUCHAUD', 't': 17, 'd': 'Vous avez trop chaud ? Mettez cette cape... Tin-din ! C\'est qui qu\'a pu chaud ? \nEh dites... on vous voit cacher vos yeux dans la paume de votre main en hochant la tête. C\'est pas sympa de juger les blagues des autres comme ça.', 'ep': 0, 'g': 188, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12761] = {'n': 'Patrick le pâté de sable', 'nn': 'PATRICK LE PATE DE SABLE', 't': 18, 'd': 'Sur les plages, c\'est un expert. Armé de sa pelle, il remplit son corps de sable et d\'eau de mer. Puis, il se jette en avant pour se retourner et former ainsi un joli pâté. Patrick aura toutefois besoin de vous pour le remettre à l\'endroit : il a tendance à péter un câble quand il reste trop longtemps la tête en bas.', 'ep': 0, 'g': 76, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
