I.u[12766] = {'n': 'Rempart du Guerrier sanctifié', 'nn': 'REMPART DU GUERRIER SANCTIFIE', 't': 82, 'd': 'Rien ne passera outre ce bouclier : ni les flèches, ni les coups d\'épée, ni les insultes, ni les malédictions proférées. Par quel miracle ? Uniquement parce que vous y croyez !', 'ep': 0, 'g': 118, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12767] = {'n': 'Casque du Guerrier sanctifié', 'nn': 'CASQUE DU GUERRIER SANCTIFIE', 't': 16, 'd': 'Avec ses pointes tournées vers le ciel, ce casque est idéal pour se connecter spirituellement avec les dieux, que ce soit dans un sanctuaire ou au combat. Encore faut-il que la divinité que vous cherchez à joindre ne soit pas occupée...', 'ep': 0, 'g': 299, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12768] = {'n': 'Pelisse du Guerrier sanctifié', 'nn': 'PELISSE DU GUERRIER SANCTIFIE', 't': 17, 'd': 'Cette cape finement brodée laissera flotter derrière vous vos remords et vos regrets, pour qu\'au moment de combattre, votre esprit soit serein, comme purifié.', 'ep': 0, 'g': 189, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12769] = {'n': 'La Boufteuse Polykrome', 'nn': 'LA BOUFTEUSE POLYKROME', 't': 17, 'd': 'Cette cape aux allures familières a été enchantée par Hel Munster lui-même suite aux demandes incessantes d\'un célèbre couturier d\'Astrub. Il désirait proposer une collection qui s\'adapte aux couleurs de l\'individu qui la porte. Décolorée par un procédé top secret, vous reconnaissez pourtant l\'odeur caractéristique de la bave de Mulou qui s\'en dégage... Beurk !', 'ep': 0, 'g': 190, 'l': 23, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
