I.u[12776] = {'n': 'Dragodinde du Paladin', 'nn': 'DRAGODINDE DU PALADIN', 't': 97, 'd': 'Ce certificat vous permet d\'aller reprendre votre monture dans une étable. \nAttention, ce certificat n\'est valide que 20 jours, une fois ce délai dépassé, votre monture sera relâchée dans la nature et votre certificat ne sera plus valide, vous ne pourrez plus récupérer votre monture. Pensez à laisser votre monture dans une étable si vous devez vous absenter longtemps.', 'ep': 0, 'g': 95, 'l': 60, 'wd': false, 'fm': true, 'w': 1, 'c': 'PL>59', 'p': 1};
I.u[12777] = {'n': 'Cadeau Dragodinde du Paladin', 'nn': 'CADEAU DRAGODINDE DU PALADIN', 't': 89, 'd': 'Sa détermination n\'a d\'égal que la robustesse de son armure. Son prestige, que la noblesse de son cavalier. Pour devenir un vrai héros ou une  vraie héroïne du Monde des Douze, il faut une monture digne de ce nom. Cette dragodinde est taillée pour l\'épopée.', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[12778] = {'n': 'Potion de transformation en Wa Wabbit', 'nn': 'POTION DE TRANSFORMATION EN WA WABBIT', 't': 31, 'd': 'Cette potion vous a été remise par Uba Tessé. Elle va vous transformer en Wabbit et devrait vous permettre de vous faire passer pour le prétendant d\'Allisteria.', 'ep': 2, 'g': 27, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'm': true, 'p': 10000};
