I.u[12781] = {'n': 'Bouclier Totem', 'nn': 'BOUCLIER TOTEM', 't': 82, 'd': 'On dit de ce bouclier qu\'il repousse les mauvais esprits. On ne lui en demande pas tant, vous nous direz. Ah oui ? Pourtant, vous serez bien content(e) de l\'avoir avec vous quand le spectre de votre pire ennemi(e) viendra vous rendre une petite visite nocturne pour vous chatouiller les orteils avec une plume de piou.', 'ep': 0, 'g': 119, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
