I.u[12794] = {'n': 'L\'Ossuaire', 'nn': 'L\'OSSUAIRE', 't': 82, 'd': 'Conçu à partir de restes de Douziens, ce bouclier ravira les adeptes de la récup et du zéro déchet. Pas d\'inquiétude, tous les os sont propres : ils ont été soigneusement rongés durant des heures par une horde de charognards voraces. Vous voilà rassuré(e) ?', 'ep': 0, 'g': 120, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12795] = {'n': 'L\'Empaleur', 'nn': 'L\'EMPALEUR', 't': 82, 'd': 'Faites-nous confiance : une fois que vous aurez compris comment l\'utiliser sans perdre un doigt ou vous embrocher vous-même, ce bouclier deviendra votre accessoire de combat préféré.', 'ep': 0, 'g': 121, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12796] = {'n': 'La Futée', 'nn': 'LA FUTEE', 't': 16, 'd': 'Voici probablement l\'invention la plus maline (et maligne) qui soit sortie d\'un cerveau de Brâkmarien. Ses cornes affutées sont toutes placées à des endroits stratégiques et embrochent tous ceux qui se tiennent à moins de 30 centikamètres de vous. Seule précaution à prendre : bien penser à la retirer lorsque vous faites la bise à vos proches.', 'ep': 0, 'g': 301, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12797] = {'n': 'Terreur Nocturne', 'nn': 'TERREUR NOCTURNE', 't': 17, 'd': 'Cette cape a été conçue à partir d\'une couverture qui appartenait à un petit démon. Elle lui a été arrachée des mains sans ménagement alors qu\'il faisait de doux cauchemars. Celui-ci aurait alors crié « Skribidibeudu reugneugneu scrouchniou boudoudoudi oh ! », ce que nous n\'allons pas traduire, autrement vous risquez de ne plus fermer l\'œil de la nuit.', 'ep': 0, 'g': 195, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12798] = {'n': 'Boucl\'Iop', 'nn': 'BOUCL\'IOP', 't': 82, 'd': 'De tous temps, les Iops se sont servis de leur tête pour se défendre. Désormais ils pourront se servir de ce bouclier. Une nouvelle lignée de guerriers roux, à la cervelle un peu moins ratatinée, est peut-être sur le point de voir le jour...', 'ep': 0, 'g': 122, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12799] = {'n': 'La Gratte-Ciel', 'nn': 'LA GRATTE-CIEL', 't': 17, 'd': 'Regardez les autres de haut (en prenant l\'air le plus méprisant possible, évidemment) est un sport national chez certains Bontariens. Pour aller encore plus loin, l\'un d\'eux a conçu une cape ailée dans l\'espoir de prendre un peu plus de hauteur encore. Un échec cuisant, mais une cape qui porte en partie bien son nom, puisque les plumes avec lesquelles elle est conçue provoquent d\'insupportables démangeaisons.', 'ep': 0, 'g': 196, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12800] = {'n': 'Aura Bontarienne', 'nn': 'AURA BONTARIENNE', 't': 16, 'd': 'Cette coiffe donnera l\'illusion que vous êtes un esprit pur. Certains penseront même que vous venez tout droit de l\'Ingloriom, porteur d\'un message divin, annonciateur d\'une bonne nouvelle, voire que vous êtes l\'élu(e). Alors qu\'en réalité, votre seule et unique intention est de massacrer tous ceux qui se mettent en travers de votre chemin pour accéder à la gloire et prouver, une fois de plus, que vous êtes le/la meilleur(e).', 'ep': 0, 'g': 302, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12801] = {'n': 'Providence Bontarienne', 'nn': 'PROVIDENCE BONTARIENNE', 't': 82, 'd': 'Les hauts dignitaires de l\'armée bontarienne et les meilleurs forgerons de Bonta ont travaillé de concert pour concevoir ce prestigieux bouclier. Une tête de félin incrustée dans un cœur en or le tout fendu d\'une épée rutilante. Rien n\'est jamais trop beau pour les défenseurs de la Cité Blanche. Rien n\'est jamais trop, d\'ailleurs.', 'ep': 0, 'g': 123, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12802] = {'n': 'Certificat Gladiatrool', 'nn': 'CERTIFICAT GLADIATROOL', 't': 24, 'd': 'Ce certificat précise la date de votre dernière entrée au Gladiatrool. Il faut attendre 10 minutes avant de pouvoir y retourner.', 'ep': 0, 'g': 50, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 0};
I.u[12803] = {'n': 'Certificat de transformation', 'nn': 'CERTIFICAT DE TRANSFORMATION', 't': 24, 'd': 'Ce certificat précise la date de votre dernière transformation au Gladiatrool. Il faut attendre 1 minute avant de pouvoir changer d\'arme.', 'ep': 0, 'g': 58, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 0};
I.u[12804] = {'n': 'Jeton d\'entrée au Gladiatrool', 'nn': 'JETON D\'ENTREE AU GLADIATROOL', 't': 15, 'd': 'Ce jeton permet de participer au Gladiatrool. Il était dissimulé dans la fourrure de la créature que vous venez d\'occire. Si elle n\'a pas de fourrure, elle était coincée entre deux écailles. Ou alors collé à la peau de celle-ci... oh et puis zut, vous l\'avez trouvé sur un monstre, c\'est tout ce qui compte.', 'ep': 13, 'g': 780, 'l': 50, 'wd': true, 'fm': true, 'w': 1, 'p': 100};
I.u[12805] = {'n': 'Classeur de cartes Tragic The Gardening', 'nn': 'CLASSEUR DE CARTES TRAGIC THE GARDENING', 't': 24, 'd': 'Ce gros livre vous a été remis par Lainu Prof et contient l\'intégralité des cartes que vous avez collectionné jusqu\'à présent Il dispose d\'intercalaires par famille de monstres pour simplifier sa lecture et voir où vous en êtes.', 'ep': 0, 'g': 866, 'l': 1, 'wd': false, 'fm': true, 'w': 0, 'u': true, 'p': 1};
I.u[12806] = {'n': 'Tabi', 'nn': 'TABI', 't': 31, 'd': 'Lainu Prof vous a prêté ce Tabi, prenez-en soin !', 'ep': 13, 'g': 28, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'm': true, 'p': 1};
I.u[12807] = {'n': 'Cadeau Tabi', 'nn': 'CADEAU TABI', 't': 89, 'd': 'Le légendaire Tabi est désormais entre vos mains, après votre long périple c\'est mérité !', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[12808] = {'n': 'Promesse de Timmy', 'nn': 'PROMESSE DE TIMMY', 't': 24, 'd': 'Le grand fan du Gladiatrool, Timmy, vous offrira des Gladiatons si vous réussissez son défi.', 'ep': 0, 'g': 50, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'p': 0};
I.u[12809] = {'n': 'Trool de Cape', 'nn': 'TROOL DE CAPE', 't': 17, 'd': 'Le Trool se rase la tête environ une fois tous les cinq ans, quand les pointes de sa crinière deviennent plus sèches que la corne qu\'il a aux pieds. Il aura fallu beaucoup de patience pour confectionner cette cape que vous parviendrez à sublimer mieux que personne, cela ne fait aucun doute.', 'ep': 0, 'g': 197, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12810] = {'n': 'Trool de Coiffe', 'nn': 'TROOL DE COIFFE', 't': 16, 'd': 'C\'est fou ce que ça vous va bien... Non, vraiment, vous avez rajeuni de dix ans ! À vrai dire, vous n\'avez jamais été aussi séduisant(e)... Quoi ? Oh ! Bah, puisque c\'est comme ça, on ne vous fera plus de compliments !', 'ep': 0, 'g': 303, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12811] = {'n': 'Trool de Bouclier', 'nn': 'TROOL DE BOUCLIER', 't': 82, 'd': 'Ce bouclier vous rappellera vos longues soirées de torture dans les salles obscures de sinistres donjons. À ne jamais laisser entre les mains de vos enfants. Sauf si vous souhaitez leur apprendre que, dans la vie, le danger est partout...', 'ep': 0, 'g': 124, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12812] = {'n': 'Bouclipocrate', 'nn': 'BOUCLIPOCRATE', 't': 82, 'd': 'Il a fait le serment de vous protéger ! (Jusqu\'au 1er février inclus, 23 h 59)', 'ep': 0, 'g': 125, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12814] = {'n': 'Feu Intérieur', 'nn': 'FEU INTERIEUR', 't': 17, 'd': 'Votre énergie intérieure est précieuse. Une fois maîtrisée, elle vous permet d\'accomplir de grandes choses. Mais laissez-la déborder et elle finira par vous consumer tout entier(e). Cette cape, à l\'instar de la colère du Dark Vlad, peut-être dévastatrice. Apprenez à la dominer, sans quoi elle vous poussera à commettre le pire...', 'ep': 0, 'g': 198, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12815] = {'n': 'Esprit Pétulant', 'nn': 'ESPRIT PETULANT', 't': 16, 'd': 'Il faut vraiment être une tête brûlée pour prendre le risque d\'enfiler cette coiffe. Cela dit, le risque vaut la peine d\'être pris... On dit qu\'une fois posée sur votre tête, la coiffe Esprit Pétulant fait naître en vous une rage telle qu\'elle vous rend capable de déplacer des montagnes. Non, mais... on parle de VRAIMENT déplacer des montagnes. Pour les mettre où ? Oh, débrouillez-vous !', 'ep': 0, 'g': 304, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12816] = {'n': 'Broche du Dark Vlad', 'nn': 'BROCHE DU DARK VLAD', 't': 82, 'd': 'Ce bouclier reflète parfaitement l\'état d\'esprit du Dark Vlad : incisif et sanguinaire. Il vous permettra de protéger vos arrières tout en rentrant dans le lard de vos adversaires. Très pratique aussi pour se gratter l\'oreille, à condition d\'y aller en douceur.', 'ep': 0, 'g': 126, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12817] = {'n': 'Karne', 'nn': 'KARNE', 't': 18, 'd': 'Au début, vous le trouverez terrifiant. Vous sursauterez chaque fois que vous le verrez apparaître. Sa présence à vos côtés vous donnera probablement des frissons et peut-être même des nausées. Laissez faire le temps... D\'ici peu, vous ne pourrez plus vous passer de lui. Il se peut même que vous lui fassiez des gros poutous d\'amour sur son infâme front ou que vous lui chatouillez ses immondes ailes. Et tout ça, en prenant du plaisir ! On finit par s\'habituer à tout, même au pire...', 'ep': 0, 'g': 78, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[12818] = {'n': 'Main de Cire', 'nn': 'MAIN DE CIRE', 't': 18, 'd': 'Sensible et dévoué, ce familier n\'hésitera pas à vous donner un coup de pouce dans les moments difficiles. En revanche, son caractère effronté risque de vous donner du fil à retordre...  Si vous voulez qu\'il vous obéisse au doigt et à l\'œil, il faudra faire preuve de fermeté et avoir de la poigne, autrement c\'est vous qui finirez par lui manger dans la main !', 'ep': 0, 'g': 79, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[12819] = {'n': 'Hormone de Karne', 'nn': 'HORMONE DE KARNE', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 0, 'g': 277, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[12820] = {'n': 'Hormone de Main de Cire', 'nn': 'HORMONE DE MAIN DE CIRE', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 0, 'g': 278, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[12821] = {'n': 'Fantôme de Main de Cire', 'nn': 'FANTOME DE MAIN DE CIRE', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 0, 'g': 80, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
I.u[12822] = {'n': 'Potion d\'Amélioration de Main de Cire', 'nn': 'POTION D\'AMELIORATION DE MAIN DE CIRE', 't': 116, 'd': 'En utilisant cette puissante potion, vous augmenterez les capacités de votre familier de façon définitive. Attention, une seule dose sera prise en compte par votre familier, plusieurs tentatives provoqueront des résultats décevants.', 'ep': 0, 'g': 78, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=12818', 'u': true, 'p': 10};
I.u[12823] = {'n': 'Certificat de mise en chanil : Main de Cire', 'nn': 'CERTIFICAT DE MISE EN CHANIL : MAIN DE CIRE', 't': 77, 'd': 'Ce certificat décrit les caractéristiques du familier que vous avez placé au Chanil.', 'ep': 0, 'g': 91, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 100};
