I.u[12827] = {'n': 'Karnage', 'nn': 'KARNAGE', 't': 97, 'd': 'Ce certificat vous permet d\'aller reprendre votre monture dans une étable. \nAttention, ce certificat n\'est valide que 20 jours, une fois ce délai dépassé, votre monture sera relâchée dans la nature et votre certificat ne sera plus valide, vous ne pourrez plus récupérer votre monture. Pensez à laisser votre monture dans une étable si vous devez vous absenter longtemps.', 'ep': 0, 'g': 97, 'l': 60, 'wd': false, 'fm': true, 'w': 1, 'c': 'PL>59', 'p': 1};
I.u[12828] = {'n': 'Cadeau Karnage', 'nn': 'CADEAU KARNAGE', 't': 89, 'd': 'Le légendaire Karnage est désormais entre vos mains, après votre long périple c\'est mérité !', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[12829] = {'n': 'Tempotion d\'Expérience - 50', 'nn': 'TEMPOTION D\'EXPERIENCE - 50', 't': 12, 'd': 'Fabriquée à partir de tempotons, cette potion vous donnera beaucoup d\'expérience.', 'ep': 1, 'g': 43, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'c': 'PL<200', 'u': true, 'p': 1};
I.u[12830] = {'n': 'Tempotion d\'Expérience - 100', 'nn': 'TEMPOTION D\'EXPERIENCE - 100', 't': 12, 'd': 'Fabriquée à partir de tempotons, cette potion vous donnera beaucoup d\'expérience.', 'ep': 1, 'g': 43, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'c': 'PL<200', 'u': true, 'p': 1};
