I.u[12832] = {'n': 'Tempotion d\'Expérience - 200', 'nn': 'TEMPOTION D\'EXPERIENCE - 200', 't': 12, 'd': 'Fabriquée à partir de tempotons, cette potion vous donnera beaucoup d\'expérience.', 'ep': 1, 'g': 43, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'c': 'PL<200', 'u': true, 'p': 1};
I.u[12833] = {'n': 'Casque Blanc aux cornes Noires', 'nn': 'CASQUE BLANC AUX CORNES NOIRES', 't': 16, 'd': 'L\'armurier qui a confectionné ce casque devait vouer une admiration  sans limites aux dragons. Ce ne serait pas surprenant qu\'il se soit fait dévorer par l\'un d\'eux à force de les cotoyer.', 'ep': 0, 'g': 305, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12834] = {'n': 'Manteau Baïka', 'nn': 'MANTEAU BAIKA', 't': 17, 'd': 'Ce manteau vous rappelle à quel point vous pouvez être stylé, maléfique, mais avant tout plus fort que les autres... A quand remonte votre dernière victoire déjà ?', 'ep': 0, 'g': 199, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12835] = {'n': 'Lame d\'Eykards', 'nn': 'LAME D\'EYKARDS', 't': 82, 'd': 'Une vieille légende raconte qu\'Eykards était le roi d\'une civilisation oubliée. Les plus religieux d\'entre eux étaient persuadés qu\'en projetant beaucoup de croyance sur quelque chose, il était possible d\'influencer le destin en leur faveur. Si vous voulez mon avis, c\'est une juste un effet placebo.', 'ep': 0, 'g': 127, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12836] = {'n': 'Heaume du Bel Huert', 'nn': 'HEAUME DU BEL HUERT', 't': 16, 'd': 'Ce heaume est d\'une facture impréssionante, en plus de vous protéger correctement, sa luisance au soleil permet d\'éblouir les adversaires.', 'ep': 0, 'g': 306, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12837] = {'n': 'Cape voilée du Bel Huert', 'nn': 'CAPE VOILEE DU BEL HUERT', 't': 17, 'd': 'Inspirée des toiles portées par les empereurs les plus prestigieux, cette cape augmente signifiativement votre statut social auprès des autres. Après... il faut faire attention à ne pas se prendre les pieds dedans, au risque de redescendre très vite, et pas que figurativement.', 'ep': 0, 'g': 202, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12838] = {'n': 'Scutum du Bel Huert', 'nn': 'SCUTUM DU BEL HUERT', 't': 82, 'd': 'Ce grand bouclier sert à parer des attaques sans se blesser, à distribuer des coups de bouclier, à être utilisé en tant que table de pique-nique, à vous protéger de la pluie. Dans cet ordre précis.', 'ep': 0, 'g': 128, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12839] = {'n': 'Gemme Spirituelle Emballée', 'nn': 'GEMME SPIRITUELLE EMBALLEE', 't': 89, 'd': 'Gagnée en récompense de vos victoires dans le Gladiatrool, ce cadeau renferme une Gemme Spirituelle. A conserver à l\'abri de la lumière dans un endroit sec. Secouer avant usage.', 'ep': 0, 'g': 49, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'u': true, 'p': 1};
I.u[12840] = {'n': 'Bourse de jetons de la foire du Trool', 'nn': 'BOURSE DE JETONS DE LA FOIRE DU TROOL', 't': 100, 'd': 'Cette bourse contient une petite quantité de jetons de la foire du Trool.', 'ep': 1, 'g': 59, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 0};
I.u[12841] = {'n': 'Potion de la Foire du Trool', 'nn': 'POTION DE LA FOIRE DU TROOL', 't': 12, 'd': 'Cette potion sent la fête, l\'alcool et la transpiration (surtout ça en fait). Elle permet de revenir rapidement à la Foire du Trool.', 'ep': 1, 'g': 194, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[12842] = {'n': 'Passe de vieille Pie', 'nn': 'PASSE DE VIEILLE PIE', 't': 15, 'd': 'Ce passe, gracieusement distribué par une senior dénommée Pie, permet de prouver votre statut de personne très importante. Il vous permet de profiter de certains services auprès des habitants ou de passer devant tout le monde dans une file d\'attente ... et c\'est à peu près tout.', 'ep': 1, 'g': 783, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'c': 'Qo=3759', 'u': true, 'p': 2};
I.u[12843] = {'n': 'Pain Fini', 'nn': 'PAIN FINI', 't': 33, 'd': 'Ce pain est un paradoxe : il n\'est pas fini, mais dès qu\'on le fini il revient dans votre inventaire... du coup il est infini ou pas fini ?', 'ep': 1, 'g': 72, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO=12842', 'u': true, 'ut': true, 'p': 1};
I.u[12844] = {'n': 'Coiffe Belliciste', 'nn': 'COIFFE BELLICISTE', 't': 113, 'd': 'Aussitôt posée sur votre crâne, cette coiffe s\'imprègnera des pensées morbides engendrées par votre tempérament querelleur. N\'hésitez pas à lui offrir une petite séance de psychanalyse de temps à autre.', 'ep': 1, 'g': 308, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1000};
I.u[12845] = {'n': 'Cape Belliciste', 'nn': 'CAPE BELLICISTE', 't': 113, 'd': 'Légère, cette cape le sera beaucoup moins une fois gorgée du sang de vos ennemis.', 'ep': 1, 'g': 203, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'p': 1000};
I.u[12846] = {'n': 'Bouclier Belliciste', 'nn': 'BOUCLIER BELLICISTE', 't': 82, 'd': 'Ce bouclier vous protègera de bien des choses, mais certainement pas de votre propre fureur belliqueuse !', 'ep': 0, 'g': 130, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'ce': true, 'p': 1};
I.u[12847] = {'n': 'Saponnet de Nowel 652', 'nn': 'SAPONNET DE NOWEL 652', 't': 16, 'd': 'Quand vous portez ce bonnet, on ne peut pas vraiment dire que ce qu\'il y a sous ce sapin là soit un cadeau.', 'ep': 3, 'g': 289, 'l': 1, 'wd': true, 'fm': false, 'w': 10, 'ce': true, 'p': 100};
I.u[12848] = {'n': 'Saponnet de Nowel 653', 'nn': 'SAPONNET DE NOWEL 653', 't': 16, 'd': 'Quand vous portez ce bonnet, on ne peut pas vraiment dire que ce qu\'il y a sous ce sapin là soit un cadeau.', 'ep': 3, 'g': 289, 'l': 1, 'wd': true, 'fm': false, 'w': 10, 'ce': true, 'p': 100};
I.u[12849] = {'n': 'Saponnet de Nowel 654', 'nn': 'SAPONNET DE NOWEL 654', 't': 16, 'd': 'Quand vous portez ce bonnet, on ne peut pas vraiment dire que ce qu\'il y a sous ce sapin là soit un cadeau.', 'ep': 3, 'g': 289, 'l': 1, 'wd': true, 'fm': false, 'w': 10, 'ce': true, 'p': 100};
I.u[12850] = {'n': 'Coiffe Olarj', 'nn': 'COIFFE OLARJ', 't': 16, 'd': 'L\'avantage de cette coiffe, c\'est que si vous vous noyez, on vous repèrera au loin. Bon, il sera sans doute déjà trop tard, mais ça...', 'ep': 0, 'g': 309, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12851] = {'n': 'Cape Olarj', 'nn': 'CAPE OLARJ', 't': 17, 'd': 'C\'est ça qu\'on appelle un « méli-mélo de la mer sur son lit de cresson », non ?', 'ep': 0, 'g': 204, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12852] = {'n': 'Bouclier Olarj', 'nn': 'BOUCLIER OLARJ', 't': 82, 'd': 'Ce bouclier est insubmersible. Vous n\'aurez désormais plus peur de vous jeter à l\'eau, même dans les situations les plus périlleuses.', 'ep': 0, 'g': 131, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12853] = {'n': 'L\'Épouvanpaille', 'nn': 'L\'EPOUVANPAILLE', 't': 16, 'd': 'Vous vous souvenez de l\'époque où l\'on savait profiter des petits plaisirs de la vie et se contenter de peu ? Quand une orange et un bâton suffisaient à nous rendre heureux ? Une époque marquée par la pauvreté où les Douziens gardaient le sourire malgré un quotidien de privation... En ces temps, l\'un d\'eux eut l\'idée lumineuse de fabriquer un chapeau entièrement fait de paille. Et devinez quoi ? Il se fit un maximum de blé. Alors, bon... Les p\'tits plaisirs de la vie, hein...', 'ep': 0, 'g': 310, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12854] = {'n': 'Capaille', 'nn': 'CAPAILLE', 't': 17, 'd': 'Portée par les plus grands agriculteurs du Monde des Douze, à commencer par le troubadour Danioule Bat l\'Avoine, cette cape est devenue une véritable pièce iconique dans le milieu de la mode paysanne. Une notoriété qui a permis à son créateur de ne plus jamais se retrouver sur la paille.', 'ep': 0, 'g': 205, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12855] = {'n': 'Bouclier La Moyette', 'nn': 'BOUCLIER LA MOYETTE', 't': 82, 'd': 'Rien de tel qu\'une botte de paille bien tassée pour mettre K. O. son adversaire. Ça pique, ça gratte, et avec un peu de bol il reste un ou deux rats des champs à l\'intérieur, prêts à sauter au cou du premier qui viendra l\'en déloger.', 'ep': 0, 'g': 132, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12856] = {'n': 'Coiffe Ocharbon', 'nn': 'COIFFE OCHARBON', 't': 16, 'd': 'Au fond du trou ? Cette coiffe est la lueur d\'espoir qu\'il vous fallait, celle qui vous fera voir le bout du tunnel.', 'ep': 0, 'g': 311, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12857] = {'n': 'Cape Ocharbon', 'nn': 'CAPE OCHARBON', 't': 17, 'd': 'Inutile de vous creuser la tête plus longtemps, cette cape fera largement l\'affaire quand vous enterrerez vos ennemis six pieds sous terre.', 'ep': 0, 'g': 206, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12858] = {'n': 'Bouclier Ocharbon', 'nn': 'BOUCLIER OCHARBON', 't': 82, 'd': 'Ce bouclier est l\'accessoire parfait quand on tombe sur une tête de pioche.', 'ep': 0, 'g': 133, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12859] = {'n': 'Hennin du Savoir', 'nn': 'HENNIN DU SAVOIR', 't': 16, 'd': 'La forme de ce chapeau n\'est pas un hasard. On l\'a voulu pointu pour connecter le cerveau de son porteur aux esprits divins dont le savoir est bien souvent supérieur à celui des Douziens. De cette façon, les alchimistes et autres adeptes des sciences occultes espèrent pouvoir gagner en sagesse en aspirant directement les connaissances des mages et des dieux. Malin ! Ou complètement absurde et illusoire, allez savoir...', 'ep': 0, 'g': 312, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12860] = {'n': 'Besace du Savoir', 'nn': 'BESACE DU SAVOIR', 't': 17, 'd': 'Cet accessoire vous permettra d\'emporter partout avec vous les ustensiles nécessaires pour élaborer divers potions et élixirs, mais aussi confitures, cakes, tourtes et autres préparations qui nécessitent l\'usage de spatule ainsi que quelques connaissances en chimie.', 'ep': 0, 'g': 207, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12861] = {'n': 'Gardien du Savoir', 'nn': 'GARDIEN DU SAVOIR', 't': 82, 'd': 'Quand ils n\'ont pas la tête dans leurs éprouvettes, les alchimistes l\'ont dans leur grimoire. Apprendre, se perfectionner, sans cesse, encore et encore... Il ne faut pas se leurrer, ces chercheurs illuminés ont davantage leur place dans un laboratoire que sur le champ de bataille. Ce bouclier leur permet de faire d\'une pierre philosophale deux coups : continuer à s\'instruire tout en se protégeant des attaques ennemies. Il fallait y penser !', 'ep': 0, 'g': 134, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12862] = {'n': 'Barbûcheron', 'nn': 'BARBUCHERON', 't': 16, 'd': 'Luttons contre les idées reçues : le bûcheron est un homme de cœur. Il ne se contente pas de couper des arbres à grands coups de hache à longueur de journée en poussant des cris virils et rauques. Avant d\'asséner le coup fatal dans le tronc préalablement marqué d\'une croix rouge, il l\'enlace de ses gros bras musclés pour lui offrir un ultime câlin. Notez qu\'il n\'accorde cette faveur à aucune autre de ses victimes.', 'ep': 0, 'g': 313, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12863] = {'n': 'Capkoup', 'nn': 'CAPKOUP', 't': 17, 'd': 'Cette cape et sa hache intégrée est l\'outil multifonction par excellence, indispensable à tous ceux qui s\'aventurent dans la forêt au péril de leur vie. Elle vous sortira de bien des situations délicates. Dégager un chemin envahi de ronces, affûter une lame, couper une bonne tranche de saucisson de porkass ou encore un ongle d\'orteil un peu trop long : les possibilités sont infinies. On raconte même que certains s\'en servent pour couper du bois ! Époustouflant...', 'ep': 0, 'g': 208, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12864] = {'n': 'Bouclier Charde', 'nn': 'BOUCLIER CHARDE', 't': 82, 'd': 'Deux ou trois vieux morceaux de bois bourrés d\'échardes, quelques clous rouillés, un bon marteau : voilà sans doute le bouclier le plus simple à réaliser. Et pourtant tout aussi efficace que d\'autres modèles plus modernes ! À ne manipuler qu\'après avoir fait tous ses vaccins.', 'ep': 0, 'g': 135, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12865] = {'n': 'Coiffe du Braconnier', 'nn': 'COIFFE DU BRACONNIER', 't': 16, 'd': 'Une coiffe parfaite pour les jours où votre humeur est entre chienchien et mulou.', 'ep': 0, 'g': 314, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12866] = {'n': 'Cape du Braconnier ', 'nn': 'CAPE DU BRACONNIER ', 't': 17, 'd': 'Oui, cette cape sent la bête faisandée. Vous vous attendiez à quoi ?', 'ep': 0, 'g': 209, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12867] = {'n': 'Bouclier du Braconnier', 'nn': 'BOUCLIER DU BRACONNIER', 't': 82, 'd': 'Un bouclier qui rappellera à ceux qui vous cherchent des poux qu\'ils finiront forcément par tomber sur un os.', 'ep': 0, 'g': 136, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12868] = {'n': 'Béret de l\'Homme Mystère', 'nn': 'BERET DE L\'HOMME MYSTERE', 't': 16, 'd': 'En croisant l\'Homme Mystère, tout le monde se demande pourquoi il se promène toujours avec une cuillère sur lui. Ce secret n\'a jamais été percé, mais chacun y va de sa théorie. Un porte-bonheur ? Un souvenir ? Un objet permettant de lui rappeler qu\'il n\'est pas dans un rêve ? Pour la majorité cependant, elle représente la touche finale de la personnalité intrigante de cet homme hors du commun.', 'ep': 0, 'g': 315, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12869] = {'n': 'Manteau de l\'Homme Mystère', 'nn': 'MANTEAU DE L\'HOMME MYSTERE', 't': 17, 'd': 'La modestie de l\'Homme Mystère a toujours tranché avec son élégance. Dans un monde où tout se ressemble, il sait rester fidèle à lui-même, et impose son style partout où il passe. Si vous le croisez un jour dans le monde des Douze ou bien en Externam, vous ne pourrez que constater la subtilité de cet homme. La classe, ça ne s\'achète pas.', 'ep': 0, 'g': 210, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12870] = {'n': 'Gousset de l\'Homme Mystère', 'nn': 'GOUSSET DE L\'HOMME MYSTERE', 't': 82, 'd': 'On dit que l\'Homme Mystère et son acolyte chevelu passent leur vie à tester la solidité de chaque objet qu\'on leur donne. Cependant, ils ne sont jamais en retard lorsqu\'il s\'agit de prendre une pause afin de se changer les idées et se raconter des anecdotes. C\'est probablement grâce à cet énorme gousset qui indique toujours la bonne heure. Après tout, un gentleman se distingue souvent par sa ponctualité.', 'ep': 0, 'g': 137, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12871] = {'n': 'Coiffe Grand Bleu', 'nn': 'COIFFE GRAND BLEU', 't': 16, 'd': 'Totalement hermétique aux odeurs, cette coiffe préservera vos cheveux des fragrances tenaces de la mer.', 'ep': 0, 'g': 316, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12872] = {'n': 'Bouclier Grand Bleu', 'nn': 'BOUCLIER GRAND BLEU', 't': 82, 'd': 'Ce bouclier énervera autant vos adversaires que le fameux adage : « Y\'a pas d\'arêtes dans le bifteck, y\'en a dans le pichon ».', 'ep': 0, 'g': 138, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12873] = {'n': 'Cape Patrokuit', 'nn': 'CAPE PATROKUIT', 't': 17, 'd': 'Grâce à cette cape, vous pourrez rouler vos ennemis dans la farine sans risquer de vous salir.', 'ep': 0, 'g': 212, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12874] = {'n': 'Coiffe Patrokuit', 'nn': 'COIFFE PATROKUIT', 't': 16, 'd': 'Cette imposante toque vous donne du crédit. Elle vous permettra de mener vos troupes à la baguette !', 'ep': 0, 'g': 317, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12875] = {'n': 'Bouclier Patrokuit', 'nn': 'BOUCLIER PATROKUIT', 't': 82, 'd': 'Ne pas l\'emporter avec soi au combat, c\'est prendre le risque de se mettre dans un sacré pétrin !', 'ep': 0, 'g': 139, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12876] = {'n': 'Cape Carat', 'nn': 'CAPE CARAT', 't': 17, 'd': 'Cette cape a été conçue directement dans de l\'ambre appartenant au Chêne Mou. L\'insecte qui y est resté emprisonné lui confère une petite touche d\'authenticité non sans charme.', 'ep': 0, 'g': 213, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12877] = {'n': 'Coiffe Carat', 'nn': 'COIFFE CARAT', 't': 16, 'd': 'Cette coiffe est lourde, certes, mais elle protègera ce que vous avez de plus précieux. Non... Votre cerveau, pas vos cheveux...', 'ep': 0, 'g': 318, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12878] = {'n': 'Bouclier Carat', 'nn': 'BOUCLIER CARAT', 't': 82, 'd': 'Utile face aux aventuriers malveillants aux propos lapidaires, ce bouclier le sera également pour protéger vos bijoux de famille.', 'ep': 0, 'g': 140, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12879] = {'n': 'Coiffe Tanneur', 'nn': 'COIFFE TANNEUR', 't': 16, 'd': 'Alors ? Qui a dit que les cordonniers étaient les plus mal chaussés ? Ah !', 'ep': 0, 'g': 319, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12880] = {'n': 'Cape Tanneur', 'nn': 'CAPE TANNEUR', 't': 17, 'd': 'Une cape réservée aux aventuriers qui ont le cuir épais.', 'ep': 0, 'g': 214, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12881] = {'n': 'Bouclier Tanneur', 'nn': 'BOUCLIER TANNEUR', 't': 82, 'd': 'Lourd et robuste, ce bouclier est une réponse efficace à ceux qui viendraient vous tanner le cuir.', 'ep': 0, 'g': 141, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12882] = {'n': 'Cape Grand Bleu', 'nn': 'CAPE GRAND BLEU', 't': 17, 'd': 'À la manière d\'une voile, cette cape vous aidera à garder le cap lorsque vous prendra l\'envie de partir au large.', 'ep': 0, 'g': 211, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12935] = {'n': 'Bouclier vestige de Parchomancia', 'nn': 'BOUCLIER VESTIGE DE PARCHOMANCIA', 't': 113, 'd': 'Ces objets semblent venir d\'une autre époque... souvenirs égarés et flous d\'un monde parallèle où tout semblait possible. Gardez la préciseusement en mémoire de vos aventures et gloires sur cet autre monde. Et si... ?', 'ep': 0, 'g': 148, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'p': 1};
I.u[12936] = {'n': 'Cape vestige de Parchomancia', 'nn': 'CAPE VESTIGE DE PARCHOMANCIA', 't': 113, 'd': 'Ces objets semblent venir d\'une autre époque... souvenirs égarés et flous d\'un monde parallèle où tout semblait possible. Gardez la préciseusement en mémoire de vos aventures et gloires sur cet autre monde. Et si... ?', 'ep': 1, 'g': 221, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1000};
I.u[12937] = {'n': 'Coiffe vestige de Parchomancia', 'nn': 'COIFFE VESTIGE DE PARCHOMANCIA', 't': 113, 'd': 'Ces objets semblent venir d\'une autre époque... souvenirs égarés et flous d\'un monde parallèle où tout semblait possible. Gardez la préciseusement en mémoire de vos aventures et gloires sur cet autre monde. Et si... ?', 'ep': 1, 'g': 327, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1000};
I.u[12939] = {'n': 'Heaume galvanisé', 'nn': 'HEAUME GALVANISE', 't': 16, 'd': 'Sous ce heaume imposant se cachent peut-être les traits délicats d\'un visage que les flammes ont épargnés. Mais on ne parierait pas trop là-dessus.', 'ep': 0, 'g': 321, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12940] = {'n': 'Cape galvanisée', 'nn': 'CAPE GALVANISEE', 't': 17, 'd': 'Souple comme l\'étoffe et solide comme l\'acier, cette cape née dans les flammes n\'habille que les forgerons d\'une certaine trempe.', 'ep': 0, 'g': 215, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12941] = {'n': 'Pavois galvanisé', 'nn': 'PAVOIS GALVANISE', 't': 82, 'd': 'Ce bouclier est à peu près aussi élégant qu\'une feuille d\'acier martelée de coups. Cependant, il protège des attaques aussi bien qu\'une feuille d\'acier martelée de coups.', 'ep': 0, 'g': 142, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12942] = {'n': 'Masque Toutenboua', 'nn': 'MASQUE TOUTENBOUA', 't': 16, 'd': 'Le bois est une matière noble qui n\'est pas destinée à être inhalée ! Protégez-vous donc de la sciure avec ce foulard de luxe sur votre nez.', 'ep': 0, 'g': 322, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12943] = {'n': 'Cape Toutenboua', 'nn': 'CAPE TOUTENBOUA', 't': 17, 'd': 'Vos amis vous ont souvent répété qu\'il était saugrenu de vouloir fabriquer une cape en bois. Et ils avaient raison !', 'ep': 0, 'g': 216, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12944] = {'n': 'Bouclier Toutenboua', 'nn': 'BOUCLIER TOUTENBOUA', 't': 82, 'd': 'Ce bouclier en chutes de bois recyclées contient des morceaux provenant de plus de cent arbres différents. Il y a des forêts qui seraient jalouses de vous !', 'ep': 0, 'g': 143, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12945] = {'n': 'Coiffe à quatre épingles', 'nn': 'COIFFE A QUATRE EPINGLES', 't': 16, 'd': 'Ce chapeau cache en son sein tant d\'instruments de couture que vous aurez toujours de quoi rapiécer votre panoplie préférée en cas d\'accroc.', 'ep': 0, 'g': 323, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12946] = {'n': 'Cape à quatre épingles', 'nn': 'CAPE A QUATRE EPINGLES', 't': 17, 'd': 'Avec son intérieur doublé de la soie la plus douce, cette cape ne sacrifie pas une once de confort au nom de l\'esthétique. C\'est bien simple : vous avez envie de vous enrouler dedans !', 'ep': 0, 'g': 217, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12947] = {'n': 'Bouclier à quatre épingles', 'nn': 'BOUCLIER A QUATRE EPINGLES', 't': 82, 'd': 'Il est malheureux que ce bouclier ne puisse servir que pour une seule bataille : la moindre entaille vient ruiner son esthétisme raffiné, et il vous faut alors le remplacer...', 'ep': 0, 'g': 144, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12948] = {'n': 'Lunettes de Brikébrok', 'nn': 'LUNETTES DE BRIKEBROK', 't': 16, 'd': 'Ces lunettes sauront protéger vos yeux fragiles des éclairs de génie qui fusent régulièrement dans votre atelier.', 'ep': 0, 'g': 324, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12949] = {'n': 'Cape de Brikébrok', 'nn': 'CAPE DE BRIKEBROK', 't': 17, 'd': 'Voilà un jeu parfait pour jeunes enfants et Iops adultes : essayez de deviner tous les objets disparates qui composent cette cape. Des heures d\'amusement en perspective !', 'ep': 0, 'g': 218, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12950] = {'n': 'Bouclier de Brikébrok', 'nn': 'BOUCLIER DE BRIKEBROK', 't': 82, 'd': 'Cet objet personnalisé est à la fois un bouclier, un baromètre, un niveau à bulle et une cachette secrète pour votre goûter. Tout à portée de main, en cas de besoin !', 'ep': 0, 'g': 145, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12951] = {'n': 'Chapeau R\'Unique', 'nn': 'CHAPEAU R\'UNIQUE', 't': 16, 'd': 'À quoi bon être forgemage si l\'on n\'est pas reconnu immédiatement comme tel partout où l\'on se rend ? Au moins, ce chapeau magique ne laissera plus aucun doute sur la question !', 'ep': 0, 'g': 325, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12952] = {'n': 'Cape R\'Unique', 'nn': 'CAPE R\'UNIQUE', 't': 17, 'd': 'Chaque milikamètre d\'étoffe de cette cape luxueuse est recouvert de minuscules formules magiques. Tellement petites, hélas, qu\'elles en sont invisibles à l\'œil nu. Dommage.', 'ep': 0, 'g': 219, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12953] = {'n': 'Bouclier R\'Unique', 'nn': 'BOUCLIER R\'UNIQUE', 't': 82, 'd': 'Cette rune taille XXXXL, utilisée comme bouclier, vous rappellera à chaque instant de bien lire les annonces de vente par correspondance jusqu\'au bout...', 'ep': 0, 'g': 146, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12954] = {'n': 'Coiffe Roufoux', 'nn': 'COIFFE ROUFOUX', 't': 16, 'd': 'Aucun Roufoux n\'a été maltraité pour confectionner cette coiffe. C\'est du moins ce qu\'a assuré l\'artisan à Mogueta lorsqu\'elle lui a confié un Roufoux de son élevage en échange de quelques pelotes de laine afin de confectionner ses peluches. Toutefois, à la subtile odeur de sang qui s\'en dégage, quelques doutes sont permis...', 'ep': 0, 'g': 320, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12955] = {'n': 'Casque du Touitcheur', 'nn': 'CASQUE DU TOUITCHEUR', 't': 16, 'd': 'Votre dévotion vous a permis de mettre la main sur ce casque. Il vous protègera les oreilles, mais ne le portez pas sur votre Vrombilette car il n\'est pas homologué.', 'ep': 0, 'g': 326, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12956] = {'n': 'Cape du Touitcheur', 'nn': 'CAPE DU TOUITCHEUR', 't': 17, 'd': 'Comme sortie d\'une autre époque, cette cape semble émettre une musique envoutante : Poh-Lom Pim Boum Laaaaa, Pi-Li-Li-Laaam. Les passants vous dévisagent. Pour certains, cet air semble familier, mais ils n\'arrivent pas à savoir où ils l\'ont entendu...', 'ep': 0, 'g': 220, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12957] = {'n': 'Bouclier du Touitcheur', 'nn': 'BOUCLIER DU TOUITCHEUR', 't': 82, 'd': 'On dit que les miroirs sont des reflets vers un autre monde. Ce bouclier semble en être un et si vous le brisez, vous risquez sept ans de malheur. La personne qui l\'a confectionné prétendait qu\'il était une version améliorée d\'un ancien bouclier dont la rareté n\'égalait que la laideur.', 'ep': 0, 'g': 147, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12958] = {'n': 'Chapotordu', 'nn': 'CHAPOTORDU', 't': 16, 'd': 'Ce vieux chapeau usé de parchomancien semble avoir été porté par de nombreuses personnes avant vous. Il sent la poussière et le parchemin trop vieilli. Inutile de le poser sur une tête pour deviner le destin d\'une personne, ça ne fonctionnera pas.', 'ep': 0, 'g': 328, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12959] = {'n': 'Manteau de parchomancien', 'nn': 'MANTEAU DE PARCHOMANCIEN', 't': 17, 'd': 'Cette splendide cape de parchomancien peut donner l\'apparence d\'un simple disciple des arcanes. Mais les apparences peuvent être trompeuses. On raconte même qu\'un magicien qui portait une cape similaire est passé du gris au blanc après une promotion au sein de son ordre.', 'ep': 0, 'g': 222, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12960] = {'n': 'Bouclier runique', 'nn': 'BOUCLIER RUNIQUE', 't': 82, 'd': 'Pour de féroces guerriers, un bouclier est un atout indispensable au combat pour se protéger. Pour un parchomancien, une antisèche est parfois nécessaire pour ne pas oublier les incantations les plus loufoques.', 'ep': 0, 'g': 149, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12961] = {'n': 'Casque de Combattant', 'nn': 'CASQUE DE COMBATTANT', 't': 16, 'd': 'Contre vents et marais, ce couvre-chef protègera votre caboche des vilains coups.', 'ep': 0, 'g': 307, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[12962] = {'n': 'Cape de Combattant', 'nn': 'CAPE DE COMBATTANT', 't': 17, 'd': 'À défaut de parer les coups d\'estoc, cette cape vous tiendra chaud en toutes circonstances. Idéale pour les pays enneigés !', 'ep': 0, 'g': 201, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[12963] = {'n': 'Bouclier de Combattant', 'nn': 'BOUCLIER DE COMBATTANT', 't': 82, 'd': '' + '"' + 'La meilleure défense, c\'est l\'attaque.' + '"' + ' Celui qui a dit ça n\'avait probablement jamais vu ce bouclier. En effet, sa solidité apaisera votre esprit lors de vos aventures.', 'ep': 0, 'g': 129, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[12964] = {'n': 'Cadeau Coloré - Houde', 'nn': 'CADEAU COLORE - HOUDE', 't': 89, 'd': 'Ce cadeau comprend une coiffe Polykrome et un Mimibiote. Attention car l\'encre sur le paquet peut déteindre... ça vous apprendra à fourrer vos mains partout.', 'ep': 1, 'g': 43, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'u': true, 'p': 1};
I.u[12965] = {'n': 'Cadeau Coloré - Dora', 'nn': 'CADEAU COLORE - DORA', 't': 89, 'd': 'Ce cadeau comprend une coiffe Polykrome et un Mimibiote. Attention car l\'encre sur le paquet peut déteindre... ça vous apprendra à fourrer vos mains partout.', 'ep': 1, 'g': 43, 'l': 1, 'wd': false, 'fm': true, 'w': 10, 'u': true, 'p': 1};
I.u[13015] = {'n': 'Coiffasalar', 'nn': 'COIFFASALAR', 't': 16, 'd': 'Cette coiffe vous donne un air assez peu engageant. À porter les jours où vous n\'avez vraiment pas envie de faire la queue à la boulangerie.', 'ep': 0, 'g': 330, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13016] = {'n': 'Capasalar', 'nn': 'CAPASALAR', 't': 17, 'd': 'Une cape noire qui se marie avec tout. Surtout avec le noir, tant qu\'à faire.', 'ep': 0, 'g': 223, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13017] = {'n': 'Bouclasalar', 'nn': 'BOUCLASALAR', 't': 82, 'd': 'Inspiré du Dofus Ebène, ce bouclier nécessite un entretien régulier à base de cire d\'oreille de bwork, à appliquer avec un pinceau à poils doux. Oui baaah, le bois ça vit, que voulez-vous ?!', 'ep': 0, 'g': 150, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13018] = {'n': 'Salar', 'nn': 'SALAR', 't': 18, 'd': 'Livré avec sa pancarte « Attention, familier méchant ».', 'ep': 0, 'g': 81, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13019] = {'n': 'Coiffondakal', 'nn': 'COIFFONDAKAL', 't': 16, 'd': 'Cette coiffe vous rendra aussi sage que le dragon Dardondakal. On a envie de dire : c\'est pas trop tôt !', 'ep': 0, 'g': 331, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13020] = {'n': 'Capondakal', 'nn': 'CAPONDAKAL', 't': 17, 'd': 'Cette cape est très salissante. Pensez donc bien à la retirer avant de manger des plats en sauce.', 'ep': 0, 'g': 224, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13021] = {'n': 'Bouclondakal', 'nn': 'BOUCLONDAKAL', 't': 82, 'd': 'Parfaite réplique du Dofus Ivoire, ce bouclier assurera votre défense (ivoire, défense... vous l\'avez ?).', 'ep': 0, 'g': 151, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13022] = {'n': 'Dakal', 'nn': 'DAKAL', 't': 18, 'd': 'Ce familier passe son temps à faire la morale aux autres, ce qui aura l\'avantage de faire fuir vos ennemis. Et l\'inconvénient de vous faire passer l\'envie de vous gaver de rabmaracs...', 'ep': 0, 'g': 82, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13023] = {'n': 'Coifferafal', 'nn': 'COIFFERAFAL', 't': 16, 'd': 'Soyez prévenu(e) : cette coiffe risque de transformer chacune de vos prises de parole en prise de bec.', 'ep': 0, 'g': 332, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13024] = {'n': 'Caperafal', 'nn': 'CAPERAFAL', 't': 17, 'd': 'Ah ! Il vous manquait justement une cape pour le concours annuel de cris de mouette !', 'ep': 0, 'g': 225, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13025] = {'n': 'Bouclerafal', 'nn': 'BOUCLERAFAL', 't': 82, 'd': 'Réplique exacte du Dofus Émeraude, ce bouclier est un véritable bijou d\'orfèvrerie.', 'ep': 0, 'g': 152, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13026] = {'n': 'Rafal', 'nn': 'RAFAL', 't': 18, 'd': 'Ce familier passe son temps à faire des blagues de prouts. Autant vous prévenir, avec lui, ça ne vole pas haut..', 'ep': 0, 'g': 83, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13027] = {'n': 'Coiffabrial', 'nn': 'COIFFABRIAL', 't': 16, 'd': 'Alors ? Ça fait quoi d\'avoir la tête du chum de Dathura ?', 'ep': 0, 'g': 333, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13028] = {'n': 'Capabrial', 'nn': 'CAPABRIAL', 't': 17, 'd': 'Il vous faut cette cape inspirée du dragon de l\'eau, goutte que goutte !', 'ep': 0, 'g': 226, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13029] = {'n': 'Bouclabrial', 'nn': 'BOUCLABRIAL', 't': 82, 'd': 'Grâce à ce bouclier, chaque tentative d\'attaque de vos adversaires se soldera par un coup d\'épée dans l\'eau.', 'ep': 0, 'g': 153, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13030] = {'n': 'Brial', 'nn': 'BRIAL', 't': 18, 'd': 'Ce familier en apparence calme et pacifiste est la preuve, une fois encore, qu\'il faut se méfier de l\'eau qui dort...', 'ep': 0, 'g': 84, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13031] = {'n': 'Coiffakourial', 'nn': 'COIFFAKOURIAL', 't': 16, 'd': 'Si, une fois cette coiffe sur votre crâne, vous prend l\'envie de vous construire un nid au sommet de l\'Arbre Hakam, ne paniquez pas : c\'est tout à fait normal. C\'est une idée stupide, mais c\'est normal.', 'ep': 0, 'g': 334, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13032] = {'n': 'Capakourial', 'nn': 'CAPAKOURIAL', 't': 17, 'd': 'Munie d\'ailes suffisamment grandes pour vous donner de la prestance, mais trop petites pour vous permettre de voler, cette cape vous permettra de garder les pieds sur terre. Malin.', 'ep': 0, 'g': 227, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13033] = {'n': 'Bouclakourial', 'nn': 'BOUCLAKOURIAL', 't': 82, 'd': 'Lumineux, ce bouclier inspiré du Dofus Ocre capte les rayons du soleil pour offrir un teint éclatant à son propriétaire.', 'ep': 0, 'g': 154, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13034] = {'n': 'Kurial', 'nn': 'KURIAL', 't': 18, 'd': 'Ce familier passe son temps à gratter la terre à la recherche de précieux trésors. Pour l\'instant, il n\'a trouvé qu\'un demi-gland et un rat mort. Bon... Affaire à suivre.', 'ep': 0, 'g': 85, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13035] = {'n': 'Coiffemikhal', 'nn': 'COIFFEMIKHAL', 't': 16, 'd': 'Cette coiffe vous donnera un regard perçant. Vos ennemis pourront y lire votre témérité. Ainsi que l\'heure de leur mort. 14 h 23 (à deux ou trois minutes près, évidemment).', 'ep': 0, 'g': 335, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13036] = {'n': 'Capemikhal', 'nn': 'CAPEMIKHAL', 't': 17, 'd': 'Cette cape flamboyante flamboie. Non, c\'est tout, vous pouvez y aller.', 'ep': 0, 'g': 228, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13037] = {'n': 'Bouclemikhal', 'nn': 'BOUCLEMIKHAL', 't': 82, 'd': 'ATTENTION ! IL PREND FEU ! Ah non, au temps pour nous.', 'ep': 0, 'g': 155, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13038] = {'n': 'Mikhal', 'nn': 'MIKHAL', 't': 18, 'd': 'On dit que son souffle mélangé à l\'eau d\'un lac enchanté permettrait de forger la plus solide des épées.', 'ep': 0, 'g': 86, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13039] = {'n': 'La Lame', 'nn': 'LA LAME', 't': 6, 'd': 'Goultard a toujours eu bon goût. Il a par exemple eu l\'idée ingénieuse d\'attacher au bout de son épée les chaînes utilisées pour assassiner sa famille... Mignon, non ? Bien plus efficace qu\'une lame normale, cette épée vous permet de raser vos ennemis de très près. Une lame cassée pour plus de précision.', 'ep': 2, 'g': 104, 'l': 1, 'wd': true, 'fm': true, 'w': 50, 'an': 14, 'e': [15, 4, 1, 4, 40, 50, false, false], 'p': 4400};
I.u[13040] = {'n': 'Coiffe Diadévin', 'nn': 'COIFFE DIADEVIN', 't': 16, 'd': 'Ce diadème, influencé par le hasard et le Tumulte, vous permettra de jouer votre vie. Il est capable de faire de tous vos choix une réussite, mais attention... un seul mauvais coup et tout peut basculer, surtout quand on le cherche.', 'ep': 0, 'g': 329, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13041] = {'n': 'Tignasse de Goultard', 'nn': 'TIGNASSE DE GOULTARD', 't': 16, 'd': 'Vous avez toujours rêvé de ressembler au beau et valeureux Goultard ? Avec cette tignasse, l\'illusion aurait pu être parfaite si seulement votre odeur ne vous trahissait pas.', 'ep': 0, 'g': 336, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13042] = {'n': 'Cape de Goultard', 'nn': 'CAPE DE GOULTARD', 't': 17, 'd': 'Cette cape vous donnera un air assurément stylé lorsqu\'elle claquera au vent dans les déserts. La seule et unique condition pour l\'équiper est d\'être complétement torse nu en dessous, quitte à ressembler à Goultard, autant le faire jusqu\'au bout. Prévoyez juste de quoi soigner vos coups de soleil.', 'ep': 0, 'g': 229, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13043] = {'n': 'Bouclier de Goultard', 'nn': 'BOUCLIER DE GOULTARD', 't': 82, 'd': 'Ce bouclier est une relique qui enferme la splendide épée brisée de Goultard. Vous vous demandez peut-être comment ce Iop pouvait être aussi puissant malgré son arme cassée ? Vous avez raison, cette question vous causera moins de nœuds au cerveau que la suivante : Quelle puissance aurait-il atteint avec une épée intacte ?', 'ep': 0, 'g': 156, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13044] = {'n': 'Coiffe de Prestance Volatile', 'nn': 'COIFFE DE PRESTANCE VOLATILE', 't': 16, 'd': 'Cette coiffe légère et douce comme un nuage, procure un charisme presque éthéré à son porteur.', 'ep': 0, 'g': 342, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13045] = {'n': 'Cape de Prestance Volatile', 'nn': 'CAPE DE PRESTANCE VOLATILE', 't': 17, 'd': 'En adoptant cette cape, les douleurs lombaires ne seront plus qu\'un lointain mauvais souvenir. Vous pourrez vous mouvoir avec légèreté sans avoir l\'impression de porter le poids du monde des Douze sur les épaules.', 'ep': 0, 'g': 235, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13046] = {'n': 'Bouclier de Prestance Volatile', 'nn': 'BOUCLIER DE PRESTANCE VOLATILE', 't': 82, 'd': 'Selon la rumeur, les volutes qui s\'échappent de ce bouclier rendent vos mouvements flous aux yeux de votre adversaire.', 'ep': 0, 'g': 162, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13047] = {'n': 'Croum Volatile', 'nn': 'CROUM VOLATILE', 't': 18, 'd': 'L\'armure de ce familier est conçue dans un métal innovant aussi léger qu\'un pet de bouftou. Rassurez-vous, il n\'en a pas l\'odeur. Ce familier dévoreur d\'âme ne se nourrit que de créatures des Plaines Herbeuses.', 'ep': 36, 'g': 87, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[13048] = {'n': 'Hormone de Croum Volatile', 'nn': 'HORMONE DE CROUM VOLATILE', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 36, 'g': 279, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[13049] = {'n': 'Coiffe de Prestance Aqueuse', 'nn': 'COIFFE DE PRESTANCE AQUEUSE', 't': 16, 'd': 'Cette coiffe rappellera sans aucun problème à vos adversaires qu\'il faut se méfier de l\'eau qui dort.', 'ep': 0, 'g': 343, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13050] = {'n': 'Cape de Prestance Aqueuse', 'nn': 'CAPE DE PRESTANCE AQUEUSE', 't': 17, 'd': 'Porter cette cape, c\'est un peu comme avoir toujours avec soi une petite outre remplie d\'eau. Même perdu dans le désert de Saharach, grâce à elle vous ne connaitrez plus jamais la soif.', 'ep': 0, 'g': 236, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13051] = {'n': 'Bouclier de Prestance Aqueuse', 'nn': 'BOUCLIER DE PRESTANCE AQUEUSE', 't': 82, 'd': 'Dégoulinerez-vous de sueur en portant ce bouclier ou bien de plaisir en bloquant les attaques de vos adversaires ?', 'ep': 0, 'g': 163, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13052] = {'n': 'Croum Aqueux', 'nn': 'CROUM AQUEUX', 't': 18, 'd': 'Ce petit familier est une véritable bouée de secours les jours où tout part à vau-l\'eau ! Ce familier dévoreur d\'âme ne se nourrit que de créatures des Plaines Herbeuses.', 'ep': 36, 'g': 88, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[13053] = {'n': 'Hormone de Croum Aqueux', 'nn': 'HORMONE DE CROUM AQUEUX', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 36, 'g': 280, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[13054] = {'n': 'Coiffe de Prestance Ignée', 'nn': 'COIFFE DE PRESTANCE IGNEE', 't': 16, 'd': 'En portant cette coiffe, vous rayonnez sur le monde des Douze comme un petit soleil !', 'ep': 0, 'g': 344, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13055] = {'n': 'Cape de Prestance Ignée', 'nn': 'CAPE DE PRESTANCE IGNEE', 't': 17, 'd': 'Si vous êtes du genre à porter une petite laine dès que la température extérieure se rafraîchit, optez pour cette cape. Elle vous couvrira de sa chaleur diffuse pour une sensation des plus agréables. Évidemment, évitez de la porter en période caniculaire, vous auriez seulement la sensation de cuire sur place.', 'ep': 0, 'g': 237, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13056] = {'n': 'Bouclier de Prestance Ignée', 'nn': 'BOUCLIER DE PRESTANCE IGNEE', 't': 82, 'd': 'Ce bouclier illuminera vos journées, mais pas celles de vos adversaires.', 'ep': 0, 'g': 164, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13057] = {'n': 'Croum Igné', 'nn': 'CROUM IGNE', 't': 18, 'd': 'Ce familier est pourvu d\'une armure à l\'épreuve du feu. Attention, elle brûle ! Ah oui, mais non... Enfin si. Bref, tout va bien. Pfiou, on a eu chaud ! Ce familier dévoreur d\'âme ne se nourrit que de créatures des Plaines Herbeuses.', 'ep': 36, 'g': 89, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
I.u[13058] = {'n': 'Hormone de Croum Igné', 'nn': 'HORMONE DE CROUM IGNE', 't': 48, 'd': 'Cette hormone de croissance déshydratée peut être utilisée dans la confection d\'une puissante potion pour améliorer un familier.', 'ep': 36, 'g': 281, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 10};
I.u[13059] = {'n': 'Coiffe de Prestance Végétale', 'nn': 'COIFFE DE PRESTANCE VEGETALE', 't': 16, 'd': 'Cette coiffe rappelle aux autres aventuriers que vous êtes vous aussi en perpétuelle évolution, tel un rameau de printemps.', 'ep': 0, 'g': 345, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13060] = {'n': 'Cape de Prestance Végétale', 'nn': 'CAPE DE PRESTANCE VEGETALE', 't': 17, 'd': 'En portant cette cape, il n\'est pas impossible que de charmants petits volatiles viennent se poser sur vos épaules.', 'ep': 0, 'g': 238, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13061] = {'n': 'Bouclier de Prestance Végétale', 'nn': 'BOUCLIER DE PRESTANCE VEGETALE', 't': 82, 'd': 'Ce bouclier fera pousser la flore à défaut de vous faire pousser des ailes.', 'ep': 0, 'g': 165, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13062] = {'n': 'Croum Végétal', 'nn': 'CROUM VEGETAL', 't': 18, 'd': 'Que vos adversaires n\'essaient même pas de vous coller un pin ou de vous casser les noisettes, autrement ce petit soldat pètera aussitôt les plombs ! Ce familier dévoreur d\'âme ne se nourrit que de créatures des Plaines Herbeuses.', 'ep': 36, 'g': 90, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PZ=1', 'p': 1};
