I.u[13064] = {'n': 'Coiffe Rusée', 'nn': 'COIFFE RUSEE', 't': 16, 'd': 'Cette coiffe vous donnera un air rusé. À ne pas confondre avec la Coiffé Usée qui, elle, vous donnera l\'air de rien.', 'ep': 0, 'g': 346, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13065] = {'n': 'Cape 9 Queues', 'nn': 'CAPE 9 QUEUES', 't': 17, 'd': 'Alors vous, vous ne manquez pas de panache !', 'ep': 0, 'g': 239, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13066] = {'n': 'Bouc\'lyrique', 'nn': 'BOUC\'LYRIQUE', 't': 82, 'd': 'Vos adversaires commencent à vous courir sur le pistil ? Dites-le avec des fleurs ! (Et un coup de bouclier sur la tête, accessoirement).', 'ep': 0, 'g': 166, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13067] = {'n': 'Le Famystique', 'nn': 'LE FAMYSTIQUE', 't': 18, 'd': 'Ce petit familier a quelque chose de mystique et d\'envoûtant qui ne tardera pas à déstabiliser vos adversaires.', 'ep': 36, 'g': 91, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'ce': true, 'p': 1};
I.u[13068] = {'n': 'Parchouette', 'nn': 'PARCHOUETTE', 't': 18, 'd': 'Cette créature est extrêment mignonne, il suffit de croiser son regard pour tomber sous son charme. De plus, le parchemin qu\'elle emmène partout avec elle comporte des informations absolument essentielles pour tout aventurier qui se respecte. En somme, une créature très chouette.', 'ep': 1, 'g': 80, 'l': 1, 'wd': true, 'fm': true, 'w': 10, 'ce': true, 'c': 'PZ=1', 'p': 1};
I.u[13069] = {'n': 'Fantôme de Croum Volatile', 'nn': 'FANTOME DE CROUM VOLATILE', 't': 90, 'd': 'Ce Fantôme n\'a pas encore quitté le monde des vivants, il ne tient qu\'à vous de trouver une façon de le ressusciter, ou de l\'abandonner lâchement une bonne fois pour toutes.', 'ep': 36, 'g': 82, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'p': 1};
