I.u[13094] = {'n': 'Bouclier des âmes éclatant', 'nn': 'BOUCLIER DES AMES ECLATANT', 't': 50, 'd': 'Le dernier artéfact nécessaire à la confection de la fameuse Dofusteuse éclatante est entre vos mains. Vous sentez-vous petit face à l\'étendue de son pouvoir ?', 'ep': 0, 'g': 708, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1};
I.u[13095] = {'n': 'Dofusteuse Éclatante', 'nn': 'DOFUSTEUSE ECLATANTE', 't': 113, 'd': 'Polymorphe, dotée d\'une coupe exceptionnelle et de matériaux on ne peut plus rare, cette cape témoigne de vos efforts sans relâche et prouve une bonne fois pour toutes à vos pairs que « ce n\'est pas juste une phase ». Sa puissance sans limite se manifeste sous la forme d\'une aura lorsqu\'elle est portée. Attention cependant, car seuls les dignes oseront la vêtir sans se sentir coupables.', 'ep': 1, 'g': 241, 'l': 1, 'wd': true, 'fm': false, 'w': 10, 'c': 'PO=737&PO=694&PO=739&PO=7754&PO=7115&PO=7114', 'p': 200000};
I.u[13096] = {'n': 'Tofus', 'nn': 'TOFUS', 't': 18, 'd': 'Entre un dragon et lui, finalement, il n\'y a pas tant de différences...', 'ep': 0, 'g': 92, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13097] = {'n': 'Diadème Primordial', 'nn': 'DIADEME PRIMORDIAL', 't': 16, 'd': 'Ce diadème donnerait fière allure au plus médiocre des aventuriers. Alors, imaginez un peu l\'effet qu\'il aurait sur vous...', 'ep': 0, 'g': 348, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 0};
I.u[13098] = {'n': 'Cape Primordiale', 'nn': 'CAPE PRIMORDIALE', 't': 17, 'd': 'Une cape conçue dans un bois aussi léger qu\'une coquille d\'œuf et aussi robuste qu\'une cuirasse de dragon.', 'ep': 0, 'g': 242, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 0};
I.u[13099] = {'n': 'Bouclier Primordial', 'nn': 'BOUCLIER PRIMORDIAL', 't': 82, 'd': 'Défendez vos biens les plus précieux comme un dragon défendrait sa progéniture.', 'ep': 0, 'g': 169, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 0};
I.u[13100] = {'n': 'Orbe Fantosmyque', 'nn': 'ORBE FANTOSMYQUE', 't': 15, 'd': 'Cette boule magique ressemble à une crème glacée, mais il n\'en est rien. Manifestation physique de la malédiction d\'Halouine, elle concentre toute les caractéristiques de son hôte original, il est d\'ailleurs essentiel de la conserver au frais au risque qu\'elle s\'évapore. Bon, à bien y réfléchir ça se rapproche pas mal d\'une crème glacée...', 'ep': 0, 'g': 785, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'p': 1000};
