I.u[13112] = {'n': 'Masque de Mulou d\'Halouine', 'nn': 'MASQUE DE MULOU D\'HALOUINE', 't': 16, 'd': 'Tant qu\'il est revêtu sur une coiffe, ce masque peut magiquement attirer des citwouilles contenant des friandises, qui se ressemble s\'assemble comme on dit ! Son pouvoir d\'attraction est phénoménal mais il se désagrégera au bout de quelques combats. Attention, il ne semble pas protéger de la malédiction d\'Halouine.', 'ep': 0, 'g': 355, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1000};
I.u[13113] = {'n': 'Bouclizaap', 'nn': 'BOUCLIZAAP', 't': 82, 'd': 'Cet artefact servait à envoyer des aventuriers vers des terres inconnues. Allant de plus en plus loin à chaque exploration, ces derniers ne pouvaient s\'empêcher de penser devant le portail : « Allez, une ptite der\' ! »', 'ep': 0, 'g': 170, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'ce': true, 'p': 1};
I.u[13114] = {'n': 'Chapeau Stume', 'nn': 'CHAPEAU STUME', 't': 16, 'd': 'Vous pouvez être rassuré(e) : vos idées noires, pensées morbides et réflexions les plus difficiles à assumer seront désormais bien à l\'abri des jugements sous ce couvre-chef.', 'ep': 0, 'g': 340, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13115] = {'n': 'Cape Faucheuse', 'nn': 'CAPE FAUCHEUSE', 't': 17, 'd': 'Le message renvoyé par cette cape est assez clair : un sombre destin attend ceux qui vous approcheront d\'un peu trop près...', 'ep': 0, 'g': 233, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13116] = {'n': 'Bouclier Chovkipeu', 'nn': 'BOUCLIER CHOVKIPEU', 't': 82, 'd': 'C\'est fou ce qu\'on peut faire avec deux, trois bricoles récupérées au fond d\'une vieille grotte humide et mal fréquentée.', 'ep': 0, 'g': 160, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13117] = {'n': 'Shigekax Pastèque', 'nn': 'SHIGEKAX PASTEQUE', 't': 42, 'd': 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon à la pastèque préparé de façon traditionnelle. Wow ! Ce Shigekax est certainement le meilleur que vous ayez goûté de votre vie. (Les effets ne sont pas actifs en combat JcJ)', 'ep': 1, 'g': 43, 'l': 1, 'wd': true, 'fm': true, 'w': 1, 'c': 'PO!13119', 'u': true, 'p': 1};
I.u[13118] = {'n': 'Shigekax Matcha', 'nn': 'SHIGEKAX MATCHA', 't': 42, 'd': 'Retrouvez la saveur, et tout le charme des sucreries d\'antan avec ce bonbon préparé de façon traditionnelle. Hmm... Ce Shigekax vous paraît particulièrement fondant sous la langue. (Les effets ne sont pas actifs en combat JcJ)', 'ep': 0, 'g': 42, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'c': 'PO!13120', 'u': true, 'p': 1};
I.u[13119] = {'n': 'Shigekax Pastèque', 'nn': 'SHIGEKAX PASTEQUE', 't': 28, 'd': 'Retrouvez la saveur et tout le charme des sucreries d\'antan... avec ce bonbon à la pastèque préparé de façon traditionnelle. Wow ! Ce Shigekax est certainement le meilleur que vous ayez goûté de votre vie. (Les effets ne sont pas actifs en combat JcJ)', 'ep': 1, 'g': 10, 'l': 1, 'wd': true, 'fm': true, 'w': 0, 'm': true, 'p': 1};
