I.u[13121] = {'n': 'Casque du Héros Divin', 'nn': 'CASQUE DU HEROS DIVIN', 't': 16, 'd': 'Le seul inconvénient de ce casque, c\'est qu\'on finit par oublier à quel point vous êtes beau/belle comme un(e) dieu/déesse...', 'ep': 0, 'g': 338, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13122] = {'n': 'Cape du héros Divin', 'nn': 'CAPE DU HEROS DIVIN', 't': 17, 'd': 'Cette cape vous donnera l\'allure d\'un dieu. Il ne vous restera plus qu\'à réunir une horde de fidèles et à trouver le secret de l\'immortalité pour en devenir réellement un !', 'ep': 0, 'g': 231, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13123] = {'n': 'Bouclier du Héros Divin', 'nn': 'BOUCLIER DU HEROS DIVIN', 't': 82, 'd': 'La prophétie raconte que ce bouclier renverra à vos adversaires leur funeste destin. Celui de ne jamais vous ressembler. Trop dur...', 'ep': 0, 'g': 158, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13124] = {'n': 'Casque du Héros Sanglant', 'nn': 'CASQUE DU HEROS SANGLANT', 't': 16, 'd': 'Lustré avec le sang de vos adversaires, ce casque brillera autant que leurs entrailles.', 'ep': 0, 'g': 339, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13125] = {'n': 'Cape du Héros Sanglant', 'nn': 'CAPE DU HEROS SANGLANT', 't': 17, 'd': 'Ah ! Bah voilà ! Vous n\'aviez justement rien à vous mettre pour vos petites sauteries sacrificielles !', 'ep': 0, 'g': 232, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13126] = {'n': 'Bouclier du Héros Sanglant', 'nn': 'BOUCLIER DU HEROS SANGLANT', 't': 82, 'd': 'Pour être à la pointe de la mode, procurez-vous ce bouclier dare-dare !', 'ep': 0, 'g': 159, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13127] = {'n': 'Potion Duty Free', 'nn': 'POTION DUTY FREE', 't': 12, 'd': 'Sur cette potion vous pouvez lire : ' + '"' + 'La ligne droite est le plus court chemin pour aller d\'un point à un autre' + '"' + '. Si vous n\'avez pas la nausée, vous pourrez l\'utiliser pour vous rendre dans la dimension éphémère.', 'ep': 1, 'g': 17, 'l': 1, 'wd': false, 'fm': true, 'w': 1, 'u': true, 'p': 1};
I.u[13128] = {'n': 'Chacha des Glaces', 'nn': 'CHACHA DES GLACES', 't': 18, 'd': 'Extirpée du permafrost dont elle était prisonnière depuis des lustres, cette petite créature, proche cousine du chacha de gouttière, n\'a besoin que d\'une chose : un foyer chaleureux où règne l\'amour et les caresses. Vous auriez ça ? ', 'ep': 0, 'g': 93, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13129] = {'n': 'Coiffallanster', 'nn': 'COIFFALLANSTER', 't': 16, 'd': 'Ce diadème aux couleurs du héros d\'Astrub Fallanster, en plus de sa noble apparence, serait un bon remède contre la gueule de bois.', 'ep': 0, 'g': 356, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13130] = {'n': 'Capallanster', 'nn': 'CAPALLANSTER', 't': 17, 'd': 'Tout Féca digne de ce nom ne sort jamais sans sa cape et son bâton. Il ne pouvait en être autrement pour Fallanster, éminent représentant de cette classe.', 'ep': 0, 'g': 243, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13131] = {'n': 'Fécu', 'nn': 'FECU', 't': 82, 'd': 'L\'écu du Féca !', 'ep': 0, 'g': 171, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13132] = {'n': 'Boufster', 'nn': 'BOUFSTER', 't': 18, 'd': 'On dit que le meilleur ami du berger féca n\'est autre que le bouftou. Boufster va encore plus loin : il se prend carrément pour Fallanster !', 'ep': 0, 'g': 94, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13133] = {'n': 'Bouclier d\'orichor', 'nn': 'BOUCLIER D\'ORICHOR', 't': 82, 'd': 'Cette belle rondache éblouira vos ennemis et leur laissera penser qu\'en plus de remporter vos combats, vous gagnez bien votre vie.', 'ep': 0, 'g': 172, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13134] = {'n': 'Bouclier trophée du Crocabulia', 'nn': 'BOUCLIER TROPHEE DU CROCABULIA', 't': 82, 'd': 'Brandissez-le haut et fort, car même après votre mort, c\'est le seul souvenir qui témoignera de tous vos efforts.', 'ep': 0, 'g': 173, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13135] = {'n': 'Casque Pikaglass', 'nn': 'CASQUE PIKAGLASS', 't': 16, 'd': 'Avec ses pics taillés dans un bloc de glace vieux de plusieurs millénaires, ce casque est une véritable pièce historique qui fera fondre les scientifiques et biologistes. À manipuler avec précaution. ', 'ep': 0, 'g': 357, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13136] = {'n': 'Cape Pikaglass', 'nn': 'CAPE PIKAGLASS', 't': 17, 'd': 'Pour conserver l\'éclat de ses couleurs et son tombé délicat, cette cape doit impérativement être lavée à froid. ', 'ep': 0, 'g': 244, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13137] = {'n': 'Bouclier Pikaglass', 'nn': 'BOUCLIER PIKAGLASS', 't': 82, 'd': 'Ce bouclier était autrefois une pièce maîtresse de la sorbetière géante appartenant à Walla Wonki. Vous pourrez probablement y gratter quelques restes de sa spécialité : la glace au Dofus Cacao. ', 'ep': 0, 'g': 174, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13138] = {'n': 'Cape d\'orichor', 'nn': 'CAPE D\'ORICHOR', 't': 17, 'd': 'Fabriquée dans une matière des plus nobles, cette cape sera la parfaite illustration de votre gloire. Sauf si vous la salopez ! ', 'ep': 0, 'g': 245, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13139] = {'n': 'Coiffe d\'orichor', 'nn': 'COIFFE D\'ORICHOR', 't': 16, 'd': 'L\'orichor est une ressource très prisée, sans doute parce qu\'elle rappelle la grandeur du soleil. Attention quand même à ne pas choper le melon...', 'ep': 0, 'g': 358, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13140] = {'n': 'Bouclier du Dragonnet doré', 'nn': 'BOUCLIER DU DRAGONNET DORE', 't': 82, 'd': 'Votre défense : provoquer la défiance ! Quand vos adversaires croiseront le regard froid du Dragonnet doré estampillé sur votre bouclier, ils y regarderont à deux fois avant d\'engager le combat.', 'ep': 0, 'g': 175, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13141] = {'n': 'Cape du Dragonnet doré', 'nn': 'CAPE DU DRAGONNET DORE', 't': 17, 'd': 'Son tissu pourpre, ses broderies d\'or et sa forme d\'épée rappellent la part de noblesse qu\'il y a dans chaque combat. Le noir illustre quant à lui leur issue... toujours fatale. Bon, on a bien cassé l\'ambiance.', 'ep': 0, 'g': 246, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13142] = {'n': 'Coiffe du Dragonnet doré', 'nn': 'COIFFE DU DRAGONNET DORE', 't': 16, 'd': 'Au-delà de sa grande beauté, cette coiffe soulignera votre caractère bien trempé. Même ceux et celles qui ne vous connaissent pas sauront que vous n\'en faites qu\'à votre tête !', 'ep': 0, 'g': 359, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13143] = {'n': 'Dragonnet doré', 'nn': 'DRAGONNET DORE', 't': 18, 'd': 'Sous cette crinière platine brûle un tempérament de feu ! Le Dragonnet doré vous apportera ce supplément d\'âme et de confiance dont vous avez besoin au combat. Peut-être cette créature est-elle votre animal totem ?', 'ep': 0, 'g': 95, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
I.u[13144] = {'n': 'Coiffe Stromoss ', 'nn': 'COIFFE STROMOSS ', 't': 16, 'd': 'Cette coiffe ressemble à s\'y méprendre à un scalp directement arraché du crâne d\'une créature maléfique. Ah ? C\'est le cas ? Très bien... ', 'ep': 0, 'g': 360, 'l': 1, 'wd': false, 'fm': false, 'w': 20, 'ce': true, 'p': 1};
I.u[13145] = {'n': 'Cape Stromoss ', 'nn': 'CAPE STROMOSS ', 't': 17, 'd': 'On dit que, portée à l\'envers, cette cape procure le même effet qu\'une étreinte mortelle de Nécrome. Vous ne voulez vraiment pas essayer ? ', 'ep': 0, 'g': 247, 'l': 1, 'wd': false, 'fm': false, 'w': 10, 'ce': true, 'p': 1};
I.u[13146] = {'n': 'Bouclier Stromoss ', 'nn': 'BOUCLIER STROMOSS ', 't': 82, 'd': 'De son unique œil violacé, ce bouclier conçu à partir d\'une roche située au plus proche du cœur du Monde des Douze aurait tout vu de la libération des Nécromes. Son avis : vraiment pas jojo. ', 'ep': 0, 'g': 176, 'l': 1, 'wd': false, 'fm': false, 'w': 5, 'ce': true, 'p': 1};
I.u[13147] = {'n': 'Lethal Ström', 'nn': 'LETHAL STROM', 't': 18, 'd': 'Malgré sa petite taille, la morsure de cette sordide créature dégage une salive pouvant faire fondre du métal. Son apparence peu avenante vous donnait cependant un petit aperçu de son potentiel limité en tant que docile animal de compagnie.', 'ep': 0, 'g': 96, 'l': 1, 'wd': true, 'fm': false, 'w': 1, 'ce': true, 'p': 1};
